				["T1"] = {
					["TX"] = "{img:Interface\\BlackMarket\\BlackMarketSign:256:128}\n\n{col:5d4476}Pale green and more thinly than most of ther kin, Solgra stands at a shoulderweight in comparison to the average female. Where she might not be as strong as the warrior type, she has grown to use other means to prosper. Without the respect from most of the Orc kind, she has still set herself a code of Honor she wont stride from. What stands out on her most, are her bright purple eyes. Their sharp shape are a hint of her clever mind and quick wit she often likes to lash out at those around her. Oftenly, she has dark colour or even ash smeared around her eyes, mostly to hide her skin colour as she wears her veil. It is not often, especially in the big Cities that she would walk without a mask. When you do see her without any coverage, her slim neck hints of a structure she hides within her armor. Her jawline is slim, not as strong and prominant as it usually would be on her kind. All this, makes you consider wheter she is only weak, but she carries herself with a strong, confident stride. Her arms seems strong enough to fight with her weapons and her slimmer legs still give her a swift phase in battle.{/col} \n\n\n\n\n                                    {icon:INV_Leather_RaidRogue_Q_01Chest:25}{col:53996d}Attire and weaponry{/col} {icon:INV_Sword_137:25}:\n\n\n{col:5d4476}Always wearing atleast few layers of leather, she prefers to hide as much of herself as possible, exception being her arms as she feels a certain amount of pride of the strenght she has been able to build. Her armor hides various hidden pockets for small weaponry like daggers or small poison vials. The thick layers of leather hide small amounts of light plating or chain within them, only enough to protect the most crucial points oner body, but wont narrow down her movement too much. On her belt, she always carries the same twin blades. Well kept and clean, the weapons show little wear from the battles she has taken them trough.\n\n{/col}\n\n\nHave some Solgra picturs: \n\nMy own scribbles:\n\n{link*https://xewspaws.deviantart.com/art/Solgra-venturing-to-dark-edgy-places-678273285*Pictur}\n\n{link*https://xewspaws.deviantart.com/art/Solgra-677980777*Anodda pictur}\n\nActual art:\n\n{link*https://www.deviantart.com/coffeeandbiscuits/art/Solgra-Deathstride-Commission-839968176* Solgra by coffeeandbiscuits}\n\n",
