				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\n\n\n{h2:c}{icon:tradeskill_inscription_blackox:25}{col:de7b46} Ayame Cranesong{/col}{/h2}\n\n\n\n\n{p:c}{col:ffffff}- A monk, with the wisdom, stamina and endurance of the Black Ox.\n\n- A scout, though freelancing most of her time.\n\n- She spends most of her time whenever she's home in Pandaria inside the Vale to assist the order.\n\n- A mistfighter, channeling mists around her and the opponents to disorient them.{/col}{/p}\n\n\n\n{h2:c}{col:d3a943}Appearence{/col}{/h2}\n{p:c}{col:ffffff}Ayame's fur always seems ruffled up, mostly on her face and her shoulders which is for the most visible. A small piece is missing on the top of her left ear aswell. She has taken up the technique from the Ox, as to her showing endurance and unbending will during her brawls or combat. Her belly remains chubby, as is the most ideal for a pandaren woman, though her arms and legs is muscly and generously wide, which by chance would be visible through the attire, around her arms and legs.\n\nOf course, as any other out there that dwevles in combat, scars and bruises can't be ignored. Scatches here and there on her face, lines of missing fur where the scratches linger. Above her nose is a bruise, thought one would have to focus to see past her fur to spot it.{/col}{/p}",
