			["time"] = 1614987213,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}Elo'ana Ravenholm{/h1}\n{h3:c}{col:f2e599}Guardian || Martial Artist || Light Wielder{/col}{/h3}\n{h3:c}{link*https://twitter.com/EloanaRavenholm*Art here!}{/h3}\n{h3:c}{col:00ff00}[More available on request]{/col}{/h3}\n{col:ffffff}Build: 5'2\" (5'6\") In her heels. 68kg - Toned, muscular body, smooth skinand a tanned complexion.\n\nEye Colour: Blue behind the golden glow.\n\nHair Colour: Red.\n\nShoulders/Arms: Rounded shoulders, toned arms that clearly show she does some exercise. Engineered mechanical arm replaces her right arm.\n\nTorso/Stomach/Waist: Thick yet toned stomach, larger than average breasts, clear visible curve to her waist.\n\nLegs: Thick thighs and calves, clearly she does a lot of exercise and walking on a daily basis.{/col}\n\n{h3}Personality{/h3}\n{col:ffffff}In the past, Elo'ana was known for her short temper and aggressive behaviour. Though she has changed over the years, there are certain things that she clearly does not tolerate. Once you get to know her, she can be kind and fun to be around.{/col}\n\n{h3}Profession{/h3}\n{col:ffffff}Elo'ana has taken a different main path to the one she had hoped. Although she continues to study and practice the art of mistweaving, she has found enjoyment in performing for those who pay for her services. She can usually be found traveling from tavern to tavern around Azeroth, singing for the locals every other night.{/col}\n\n{h3}Hobbies{/h3}\n{col:ffffff}When Elo'ana isn't practicing, she spends most of her time exercising, trying to keep in the best possible shape she can. As she has figured out that her abilities are used best when combined with hand to hand combat, her physical strength is just as important.\n\nIf she is doing neither practice or exercise, she can be found sat on a bench or at her home reading a novel, being quite the bookworm, she can often be found sat for hours with a smile upon her face and a book in her hand.\n{/col}\n{h3}Stats{/h3}\n{col:ffffff}+5 Physical Defense\n+3 Magical Defense\n+3 Holy/Mending\n+2 Weapon Attack\n+4 Unarmed Attack\n{/col}\n{h3}Abilities{/h3}\n{col:ffffff}Lay on Hands - Restores 25HP\n\nUnarmed Strike - Punch, kick, head-butt or similar forceful blow, deals +1 extra damage.\n\nSacred Weapon - Adds +1 to attack rolls. {/col}\n ",
