						["TX"] = "Granthdaer stands a tall and wiry figure, thin but not delicate.  Well cut clothes made from thick, warm fabrics drape over his form neatly.  \n\nCrowning his head is long crimson hair, straight as a bone, and generally bound up in either an exceedingly neat pony tail or wrapped up meticulously in a turban.  \n\nHis facial features, while slightly feminine, are defined with a strong chin and cheekbones.  His eyes, deep in their sockets and shrouded in the haze of gold, gaze intensely.\n\nHis hands are soft with slender fingers.  He has shyed away from most manual labour.\n\nHis voice is soft and certainly not the deepest.  \n\nA large mass of scar tissue wraps around the right side of his torso.  Scarring to a lesser extent is found on his chest and back. He often wears a corset to help support his spine.   Due to his injuries,  he has limited mobility.  He does not run, nor can he easily bend to pick things up or bow.\n",
						["BK"] = 1,
						["IC"] = "Spell_Priest_Chakra",
					}, -- [1]
					{
						["TX"] = "Served as a ships surgeon in the alliance navy during the wars.\nDefected to the horde with the others becoming Sin'dorei.  Found purpose serving the Sunreavers in Northrend.  \n\nHelps Northrend (and later wars) veterens come to terms with their PTSD, caring greatly for their mental health.  Has  small clinic now in Silvermoon where people come for treatment.  He also practices in Hearthglen a week a month.   He has taken on a major care role with deprogramming cultists.\n\nOverall has a very well rounded and experienced medical career.\n\nHe is also rather keen to find out how people have died.  Jokingly describes it as one of his hobbies.  Archeology is a close second.  He is also a keen pianist and painter.\n\n",
						["BK"] = 1,
						["IC"] = "INV_Misc_SurgeonGlove_01",
					}, -- [2]
				},
