				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Regal Apperance",
						["TX"] = "The Elder stands with at an imposing height; his shadow often cast upon those who beckon his gaze. He often walks with a slight slouch in his posture oddly though. He maintains a robust and strapping frame, peculiar for one of the Priestly caste.\n\nHis skin is of a dark lead grey complextion with a slightly blueish tint to it. This contrasts greatly with the golden tattoes which shimmer with an alluring splendour across his darkened frame. His flesh is dotted with dark stony-scales along this shoulders, the point of his chin, and along the underneath of his brow.\n\nLong, flowing white hair hangs down from the back and sides of his head; fine and well-kempt. His tusks are fairly long, curving up at the ends. They are engraved with decorative symbols and are adorned by golden bands.\n\nHe carries himself with a certain authority and confidence befitting of his venerated position. He speaks with a refined eloquence, often times with a whimsical purr. His eyes beam an azure blue; wizened and hinting to a timeless knowledge. Though, they betray a deep weariness, perhaps even a sadness. ",
						["IC"] = "Achievement_Nazmir_Boss_Zul",
					},
					["3"] = {
						["IC"] = "INV_Helm_Mail_RaidShaman_M_01",
						["TI"] = "Mask of Terror",
						["TX"] = "A rather ornate and sinister mask is often seen upon the Death Speakers face; veiling his feature from the rest of the world. It is lined with an aged gold and hums with a malefic energy; hued in an eerie green glow.\n\nThe gaze of the mask is both oddly intoxicating and repulsive at the sametime. It is easy to become drawn into its vile gaze. It would be an ill omen to stare for too long however.\n\nThe wearer may call forth the dark powers imbued into the mask, inflicting horrific and maddening images upon any whom beckon its visage. Something evil resides in the mask, trapped and tormented; eager to inflict suffering.",
						["AC"] = true,
					},
					["2"] = {
						["IC"] = "INV_Chest_Mail_ZandalarDungeon_C_01",
						["TI"] = "Blessed Garments",
						["TX"] = "The Death Speaker boasts tremendous wealth, this is most certainly reflected in his garments. The detail upon the fabric is immaculate, the hand of a true artisan and tailor.\n\nA plethora of rich and dark colours line the garments, ranging from the dark indigo and brick red in his kilt to the golden linings woven throughout. His garments are lined over with stone plates carved with decorative symbols; they are also lined with aged gold.\n\nHis kilt is pierced through with decorative tusks that line down to the bottom. Emerald green jewels are also embedded into his kilt, humming with an enchanting power.\n\nPowerful enchantments have been infused into his very garments. A Zandalaris worth is seen in what he wears; this only furthers to soldifiy his power and authority. They are not simply for show however, boasting incredible protective and impowering enchantments",
						["AC"] = true,
					},
					["5"] = {
						["IC"] = "inv_jewelry_necklace_120",
						["TI"] = "Emerald Medallion",
						["TX"] = "The Death Speaker is never seen without this illustrious jewel, a pristine emerald embedded into a golden necklace. It shines with a loving splendour, its wearer keeping it close.\n\nIt hums with a natural power, one of life and rebirth; a fitting irony considering the wearer. It bolsters the regenerative properties of the wearer tenfold.\n\nIt is fitted with an inscription: \"In life and death, in beginnings and endings; our love is eternal.\" Whomever gifted this to the Death Speaker, he certainly cherishes it as dearly as the sentiment.",
						["AC"] = true,
					},
					["4"] = {
						["IC"] = "INV_Stave_2h_ThunderIsleRaid_D_03",
						["TI"] = "Spire of Death",
						["TX"] = "The Death Speaker is often seen carrying this large and ornate greatstaff. A brief inspection reveals many a ritualistic carving along the shaft; it looks rather heavy. The shaft is wrapped in an emerald silk for comfort.\n\nThe greatstaff has a varying degree of sharp prongs along the base with two curved blades on either side of the head. The end of the staff is curved and sharp like a Zandali spearhead.\n\nThe head of the staff is fashioned after the visage of death; a Zandali skull emblazoned in gold. The head acts like a casque, eerie energy seen glowing with a spectral light; creeping at the opening.\n\nOnly when called upon does the visage open up, unveiling a horrific melody of wails and scremas; the echoes of the departed. The melody is as ear-piercing as a banshees wail, powerful enough to sunder the earth and grating the victims mind and body with its malignant screeching.",
						["AC"] = true,
					},
				},
				["v"] = 99,
			},
		},
