						["TX"] = "Kaeimar holds himself with a stoic pride, his features set like marble, hard and cold. He walks with purpose, keen golden eyes roving to and fro. A rather tall elf, he is particularly heavy-set, at least compared to the exceptionally lithe Sin'dorei. That said, he certaintly lacks the bulk that can be exhibited by most humans. His face is angled and sharp, often coupled with a disapproving expression which he wears all too comfortably. He utilises a deep, yet well spoken voice.\n\nHe carries with him a set of armour  like a tortoise carries its shell, barely ever seen parted from it. At his waist is a well-worn scabbard, an elven long-sword resting within. Typically, a kite shield stamped with the Blood Knight crest is slung across his back, and he flies the same colours proudly on his chest. He possesses a well-made, albeit weather-worn travelling cloak, often affixed to his back as if prepared for a long journey.",
