			["about"] = {
				["T1"] = {
					["TX"] = "{p:c}{link*https://cdn.discordapp.com/attachments/233892971269849089/593226583746150452/Fae_-_Lynnariel_Nightsong_-_Waist_up_FullColour_Transparent.png*Artwork by Zyvian!}{/p}\n{p:c}{link*https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/68120656-6666-4b6e-96a9-439722a25571/dcsgtw4-0c943ab8-8b7c-403d-887a-f2c46c3ab145.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJzdWIiOiJ1cm46YXBwOiIsImlzcyI6InVybjphcHA6Iiwib2JqIjpbW3sicGF0aCI6IlwvZlwvNjgxMjA2NTYtNjY2Ni00YjZlLTk2YTktNDM5NzIyYTI1NTcxXC9kY3NndHc0LTBjOTQzYWI4LThiN2MtNDAzZC04ODdhLWYyYzQ2YzNhYjE0NS5qcGcifV1dLCJhdWQiOlsidXJuOnNlcnZpY2U6ZmlsZS5kb3dubG9hZCJdfQ.yJU2RCKVkG_dnJfvOWP-7Dw9ISpLMmAJdTUOSmFsFbU*Artwork by ArtBunny!}{/p}\n\n{col:108030}    \nLikely found lounging with some sort of bottle in hand, Lynn wouldn't be particularly distinguishable in amongst the general hustle and bustle of the Bay. Standing at an average height, clad in formfitting - if somewhat impractical - leathers, the woman's single most noticeable feature would perhaps be her mass of ginger tresses. Often left loose to its own accord, it's clear that aside from the occasional wash, not much effort goes into maintaining the length or style of her hair. The same principle applies to most other aspects of her appearance, including makeup; in which case none is worn. Upon closer inspection, a constant affinity for the sunny outdoors of the South has left her with a small smattering of freckles along her nose and cheeks - though hard to spot from a distance thanks to a tanned complexion.\n\nAlthough typically slouched, beneath the laidback demeanor and hunched shoulders is an Elf that's well trained and surprisingly disciplined. Having honed several skills to survive in the wilds of the Vale, Lynn's physique is an example of someone in near-peak condition.. If she laid off the alcohol. {/col}\n\n{img:Interface\\LFGFRAME\\LFGIcon-Everbloom:256:256}\n\n",
