				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Q- Detective of the Pigeons Call{/h1}\n{img:Interface\\DRESSUPFRAME\\DressingRoomPriest:512:512}\nLong ago she was born of a Highborne mother and raised with care. As time passed in her mothers Mansion in bliss, an elven man with dirty boots came to her little house and told her that her mother died.\n\n\"I am sorry\", he said in a monotonous voice and grinned, his dagger at the ready to strike the thunderstruck girl who was slowly trying to understand what happened to her beloved mother.\n\"wh... Why? Why mother? What happened!\", Q cried and rushed at the elf to get answers from him. She grabs his collar, but instead he groans and falls over before she reached him.\nQ was as surprised as the fallen elven man was, how could he fall down? And what is that? Is he... Bleeding?\n\"wh... What is happening!\"\nQ asks and looks around. She hates it. She always has to ask what is going on.... Even ask Why... She hates those questions.\nShe swallows her dire feelings and tries to help the other elven Man up, but blood streamed down his back as if he fell on something.... Sharp.\n\n\"Dont look. It's allright, I'm here to take you to safety. But sadly I cannot say that your mother survived the ordeal... Come, let me bring you to your Aunt to safety..\", a soft male voice came from behind her. It was a reassuring voice. Gentle and clearly caring. His blueish white hair was very standing out.\n\"wh... No. I won't ask.\", Q was sick or always asking why and who. She wanted answers! So she steeled her heart and went with the man, who introduced himself as Santhem Eversong.\n\nLuckily Santhem was truly sent by her aunt to retrieve her.\nHe was the most loyal and caring male elf she ever met.\nAnd he was Lowborne! Even more he was a juggler and acrobat! Q's eyes light up remembering those amazing feats the Silvermoon acrobats could pull off, but they were always scorned since they cannot use the Arcarne.\nBut Q loved to watch his tricks. She loved to be in the care of her aunt. The only thing that stung was that  she never was allowed to attend her mother's burial.\nIn times, she trained with Santhem to hone her body for martial arts. In her free time, she tinkered with the magic artifacts and scrolls her aunt left in her Mansion when going away.\n\nShe was obsessed to never have to ask why or who again.\nShe wanted to know who was in front of her instantly. She wanted to know why someone died or went missing. She went ahead took a book about \"Detective Q the Gadget master\". It was a silly story of a Detective who solved cases with marvellous devices. Engineering... \"Machines! They won't betray me. They are loyal and if i investigate my Mother's death... i don't bring them in danger. I must learn how to make those Gadgets!\" she exclaims buried in scrolls , not knowing that Santhem always was watching her with a smile. Her never being lively again was his biggest worry... Now it seems she has set a goal.\n\"I'll go and see Silvermoon, aunt. I am sorry I leave you like that...\"\nAfter some Years, Q went to her Aunt to live on her own in Silvermoon. It was a peaceful and magical City, the Sunwell was a Marvel of the high Elves! But leaving her Aunts Mansion to become truly independant.... And fight for her own good... \n\n\n\"Don't worry my child. Your home is always here. What do you want to do? I fear if you go to Silvermoon you will suffer... They...\"\n\"even if I suffer I want to know the truth. So I will be a detective! I read your scrolls!  Santhem even teaches me stealth and steal..... I mean borrowing! I know how to make many wondurous machines mentioned in Detective Q the story!\", Q exclaims excitedly, making her aunt laugh heartily for a long time.\nAfter some silence and pondering, her aunt asked: \"What name will you have? Your own is taboo outside of my mansion\" \n\n\"Q. From my real name. And how the detective in the story was named... I'll go then. Don't send me too much help I'm adult and self dependent!\"\nQ always wondered why her aunt had a sad smile as she went.\nBut as time progressed, and Silvermoon met its fate...\nShe seemed to know why.\nAs the Sindorei formed she helped.  As the Sindorei asked why she offered a solution. As the sindorei asked who.... \nShe said: Pigeons call lead detective  Q\n",
				},
