			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "achievement_character_bloodelf_female",
						["BK"] = 11,
						["TX"] = "Standing at 5’6, this fair skinned woman has a responsible feel about her, and she has a large mole on her left hand which resembles the shape of an animal.Upon the nape of her neck sits the beginning of a tattoo shaped like a rose with a stem, around the set sits a red ribbon. The ribbon is creased like it was once tied but has since fallen out and remains on the stem of the rose by sitting delicately on the leaves.\n\nHer hair is a bright red colour that reaches the small of her back but seems to always be tied up in a long braid that sits over her shoulder. The band that holds the hair together at the end is of a gold colour and seems to be aged from the wear on it but well loved. When let down the ends look a little ragged as if it was cut with a knife by someone who had unsteady hands.\n\nHer eyes are green with a tint of blue to them, they look almost doll-like at times. The rest of her face seems to match her eyes in how it looks naive and curious and is speckled with freckles along her cheeks, nose and forehead. There is a small scar on the left side of her face along her jawline, looking like something was dragged from near her ear to her chin. The edges of the scar look like it was torn and has not formed a crisp edge.\n\nDianaria is quite lean in her body type with little to no muscle definition. There is a little definition of her waist as it comes in slightly but under her armour she seems to have no waist. On the bicep of her right arm are a few straight scars down to her elbow from arrows catching, other than that her body seems to be free of any other marks or scars.\n\nHer usual style of clothing is something she can fix easily. Her armour unless it is shiny and new has had a few places replaced here and there from the chainmail to any details. It tends to be a little loose around her chest and arms so she can move her arms around easily, a small bag sits tied around her left thigh with 1 bandage, a needle and thread and a set of gloves. A larger bag sits on her back with more supplies and a few vials of water and a painkiller elixir.\n",
