			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1}What ye see{/h1}\n\n{col:711613}De zandalari be an ancient, powerful race, no matter what de elves may say.  Dis one tho'...he be a young'un.  Bright an' smilin' usually, holdin' pride in his people as he carries de golden insignia of zandalar on his back, gold embeded into his skin.  A tense and sturdy figure, he's not the tallest or strongest of his kind, but he ain't neva' gonna let dat stop him.  A friendlier disposition den most, dere usually be a bright smile between his two curling, golden tusks that are fitted over de stubs o' recently broken ones, don't ask 'im. Wit' de war finally ova', dis one be wanderin' fo' his own enjoyment, lookin' t' you, he prolly gonna get ya in trouble!  {/col}\n\n{h1}De tings we have done neva stop haunting us{/h1}\n\n{img:Interface\\QuestionFrame\\answer-warboard-mop-IsleoftheThunderKing:512:256}\n{col:711613}     How anger drives us t' terrible things.\n\n    When da island of zandalar was shattered as zul foretold, thousands were killed, and rastakhan did nothing.  Nazwatha was sinking into da sea, becoming nothing but a desolate swamp.  Da people begged for an answer from de king, de loa, anyone, and dere was only zul.  I was young when he came, a lil lost soul, an' he used me t' coax and provoke da people to action, \"rescuing\" me and all de other homeless zandalari into a campaign to reunite our tribes.  Anger drove us to follow, drove us to zul'aman, zul' gurub, and all da way to pandaria.  I was grown by den, a proud warscout, one of da most zealous too.I believed in da zandalari, I believed in zul.  We never believed dat he would abandon us completely at de isle of thunder, all of us left lost an' alone after de champions killed de thunder king.  We saw de destruction we created, and I knew dere was only shame.  All de tribes were scattered, some even enslaved by de raging mogu, dey were relentless, furious. Most dat survived wandered their own way, stranded dere.  Lightnin' coiled and crackled at me tribe first, I watched many a nazmani dissapear foreva...bein' a warscout taught me well when t' retreat t' fight anotha day.  It still felt wrong.  Didn't work dat well though, when dose stony fingers strangled me, I rememba de days I spent there, makin' us toil as payment for failure, as if it wasn't dere king dat died too.  Was a long time before any o' us could escape, but de biggest weakness of de mogu was dere constant infightin'.  As anotha clan came t' \"claim payment for failure\", we swam, swam for all o' our lives back to de mainland.  De taste of saltwater is somethin' I neva want in ma mouth again.  But we did it, we were free. {/col}.\n\n\n\n\n\n\n\n",
