			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h2:c}Silencer?{/h2}\n\n{col:eeeeee}One of the most curious fighters that the Shadow Syndicate produced. Rather then killing spellcasters with brute force, they use their worse fear against them. Silencers are trained to curse, nullify and drain spellcasters to make them as useless as possible. Unlike a Spellbreaker, the Silencers prefer to work in the shadows and stay as far from the front lines as possible.{/col}",
						["BK"] = 1,
						["IC"] = "spell_rogue_shadow_reflection",
					}, -- [1]
					{
						["TX"] = "{col:64b5f6}{h2:c}Alrodan{/h2}{/col}\n\n{link*https://cdn.discordapp.com/attachments/703558504480505989/747056436668006490/image0.png* Alrodan's Art}\n{link*https://cdn.discordapp.com/attachments/703558504480505989/786226638777483264/Al__Cal.png* Alrodan & Calia}\n{link*https://valiantaccord.com/Alrodan* Alrodan's Card}\n\n{p}{col:f3f3f3}Having trouble recognizing sarcasm and reading emotions are the biggest flaws of him. Some might find it dumb, others show more understanding. Don't be fooled though, his understanding of things go usually much further than other's might think. As someone who spend most of life alone, he did not stay idle. Engineering, Alchemy and Cooking are some of his most talented skills and he is not shy to show that. \n\nHe loves to bring people together and make sure everyone has a great time.  He cares deeply for his friends and loved ones, Alrodan would never be the person to spot something evil within them, that also makes him rather vulnerable to betrayal.\n {/col}{/p}\nWIP, adding more along the way.\n\n\n",
						["BK"] = 10,
						["IC"] = "inv_7xp_inscription_talenttome01",
					}, -- [2]
					{
						["TX"] = "{col:ffffff}{h2:c}Medals{/h2}{/col}\n{col:ffffff}\nHaving fought many wars. Alrodan is rewarded with medals of honor. Battles from Argus to the Twilight Highlands, Alrodan has seen them and sadly, can't forget them. As someone who was not always in the front of the battlefield, he has carried out several stealth missions to secure the victory.\n\nMedal of Honor for:\nBattle at Alterac.\nBattle at the Twilight Highlands.\nBattle at Argus.\nBattle at Silithius.\nBattle at the Ogre Isles.\nBattle at the Grizzly Hills.\nBattle at Twilight's End.\nBattle at Dragonblight (Shattered Sky).\n\n{/col}",
