				["T1"] = {
					["TX"] = "{col:ff0008}\n\nface/Hair:\n\nDaniel got a normal elven face with a few scars, One on his right eye that goes down over it but havent made him blind and got a claw scar going from right cheek across his mouth and down to his left jawbone.His hair is a messed up pony tail and the colour is red and his ears are mix betwen human and elven so they are shorter\n \nEyes:\nDaniel´s eyes are a mix betwen human and elven as he got normal human eyes but are now completly white from the beatings and torture he went through\n\nBody:\n\nDaniel´s body is a mix betwen human and elven.\nhe is abit taller the a normal blood elf male and got abit more muscles and he got some old whip scars on his back from his past\n\nRunes/Tattoos:\n\n-snake tattoo is wrap around his right arm\n-horde mark is paint on his upper arm of his left arm\n-shadow runes have been carved into his body and are glowing with shadow energy (happened doing recent event)\n\nBattlecry:\n\n-Never stop the killing! NEVER!\n-Here hold this!\n-Do you like to play with FIRE?!\n-I dropped a bomb....do you have it?\n-so you are dead now....damnit\n-I´m not done killing you yet!\n-Burn burn everthing must burn!\n-You will love my new recipe!\n-Dont mind the mess!\n-You will love this....oh wait no you wont!\n-What a day!.....what a lovely day!\n\nRight Mech leg upgrade:\n-light plate armor\n-Coolant pump (blue coolant will ooze out if the leg is wounded)\n\nThe Bloody Demon´s abillites (the ship)\n\n-Cannon Barrage (10 mins cooldown/2 turn cooldown in events)\n-Azerite Cannon Barrage (30 mins cooldown/5 turns cooldown in events )\n\nDaniel´s alchmist potions\n\nHealing potion (Blood Red): its a powerfull healing potion that can be drink or pour on wounds to heal\n\nFire bomb potion (Firey Orange):its a potion that burst into flames when it hit something or someone and its hard to put out\n\nAcid bomb potion (Green): its a powerful acid that can eat through most metals but it will eat through cloth and leather and mail with easy\n\nBomb potion (Grey): its a powerfull explosive that blows up when it hits anything or anyone\n\nFire breath potion (Firey Red) when daniel drink this potion it give him the abillite to breath fire like a dragon for a second or two\n\n\n(All DH abillites are shadow like and not demon hunterish at all....Daniel´s shadow magic is still there aswell as his mutation)\n\nShadow Mutation:\n\n- Claws ( they are no longer hidden by magic and are allways out becouse of recent events)\n- Sharp and shark like teeths (can be seen every time daniel grins or talks)\n- Improved strength and agility (faster and stronger then normal)\n- \n-\n\n\n{link*https://cdn.discordapp.com/attachments/298168842688004100/800029091192504320/462px-Weapon_b_1040612500.png*This is how daniel´s claws kinda look like just without the red crystals}\n\n(more mutation might be on the way so stay tuned)\n\n\n\nShadow spells:\n\n-Shadowflame bolts\n-Shadowflame wave\n-Shadow image (aka mirror images)\n-Shadow spike (a rune will appear under the person who is target by it)\n-Shadow beam \n\nTheme song: {link*https://www.youtube.com/watch?v=u9NStVkSCuk* Theme song for daniel} ",
