			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}The Tinker-troll{/h1}\n\nLess slender than the usual jungle troll, Zunaj is a muscular troll, with the heavy build of someone used to hard physical work. He otherwise looks like you'd expect a jungle troll to look, with a hunched stance and a thick mane of hair, night blue in colour and gathered in long braids. \nHis eyes are large, and the pupils are a fiery dark orange.  \nHis tusks are smaller than average, standing out to the sides and less in the way than most of his kin. One is noticeably shorter than the other, with a point that looks filed and sharpened rather than natural. \nZunaj speaks the common and orcish tongues fluently, almost free of the troll accent, and heavily influenced by the goblin accent and slang. When speaking in his mother tongue, Zandali, he appears rusty, as if he hasn't used the language in years.\n\nIf he is seen exposed, there are a myriad of scars upon his body. Old wounds that few others than trolls would have survived, and nasty burns that his natural regeneration could never fully repair.\n\n{h2:c}The Gear{/h2}\n\nWhat really sets Zunaj apart from most of his kin is in his attire and equipment. His armour is bulky, and made of a combination of leather, chainmail and metal plates, adding even more to his bulk and weight. It's crafted in a modern, goblin fashion, and trinkets, tools and explosives can be found in tactical places all over. \nEven the armour itself seems to have a few mechanical parts, although at first glance, it's hard to tell what functions they serve. He almost always wears a pair of goggles, concealing his eyes behind thick blue lenses. If he's not seen in armour, he favours light, utilitarian clothes. \nOn his back, he tends to carry a large, heavy rifle, modified with sights, bayonet and other various equipment. It seems well cared for, oiled and cleaned at all times. Besides this, he's armed with a pair of small knives, and a couple of goblin grenades.\n\n{h2:c}The Machines{/h2} \n\nZunajs favoured vehicle is Hir'fli - \"Little bat\" in his native tongue. It's a gyrocopter of goblin design, although heavily modified to fit the much larger pilot. It's in fine shape, but a mix-match of different parts and components, clearly repaired numerous times. In fact, with the amount of repairs made, one might wonder if any of the original machine is still left. \nThe machine is armed with a few basic weapons, a gun in the front and a few bombs attached underneath. It has been painted and decorated in a more tribal fashion, with bat wings and bat-themed paint, and a set of sharp teeth surrounding the front propeller.  \n\nBeing an accomplished hoarder, Zunaj possesses an entire garage of various land-based and flying vehicles (and a small jet-propelled canoe). They all see use now and then, when a job calls for more specialized tools, but the gyrocopter is his favourite.  \n",
				},
