			["about"] = {
				["v"] = 47,
				["BK"] = 2,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://imgur.com/vuSRvnv*Comission done by Sanna-Lee Vakkala (Veritasket)}\n\n{link*https://cdn.discordapp.com/attachments/748253882194329771/754761222813122650/Mathew_Selena_father_daughter_600.jpg* Mathew and his daughter Selena - Comission done by MetalDruid Art (deviantart.com/metaldruidart)}\n\n{link*https://cdn.discordapp.com/attachments/721019105477656607/754779691381948537/test-gold-shattered.png* Medal rewarded by Shylvaindae Voidrunner at the end of the Shattered Sky Campaign}\n\n{link*https://cdn.discordapp.com/attachments/773566213602148403/774338968358617148/unknown.png*Mathew and Laroneth being cute}\n\n{link*https://cdn.discordapp.com/attachments/805172895827099689/807633930625876028/Mathew_portrait_no_rot.jpg*Mathew - Comission done by Quixe}\n\n\n{h2:c}Appearance{/h2}\nThe Forsaken man that stands before you has a slim figure. His armor fits him well, there is little scarring on his face, the horrible scar on his throat drawing attention away from the lesser ones, but you can see by his wrinkles that he has had a hard time during his life. His scar is only visible when his cowl/mask is down.\n\n{h3:c}Weapons of note{/h3}\nShadowfang. A sword made of black steel, which is concealedby the gently drifting purple Shadow energy that moves across the blade. It lashes out with small tendrils at anything that nears it. The energy parts like fog when Mathew  touches the blade, it seems to be aggresive towards all except this forsaken man.\n\nDawnhaven dagger. A gift from a future father-in-law Astran Dawnhaven. The blade itself is of fine Thalassian Steel, magnificently balanced, and the handle consists of sturdy Thalassian oak, wrapped in lynx leather. The pommel carries a finely cut ruby, with a small fire dancing inside. The sheathe is made from the same soft lynx leather. (Worn under the flap of Mathew's cloak, semi-concealed and not used often. A treasured posession, it seems)\n\n{h2:c}History{/h2}\nMathew hails from a place named Darrowshire in what is now known as the Eastern Plaguelands.\n\nHe fled Darrowshire during the attack it was under in the Third war. He lived a few years alone in the wilds, using what was taught by his parents to survive before he died to unknown causes.\n\nWhen he was risen from his eternal slumber by the Cult of the Damned to be used as their private assassin, something went wrong and he managed to retain free will. The Cult manipulated Mathew into thinking he was assassinating evil people when in reality it were people that were a possible problem for the Cult's plans.\n\nAfter serving for a few years, Mathew decided to do some research on one of his targets, a Forsaken woman that seemed too harmless to be as evil as the Cult claimed she was. Mathew didn't carry out his task when he found out who the woman really was and he quit then and there. He befriended the woman and she referred him to the Hand of Agony as a worthy cause. Mathew requested to join and since then, has gotten a lot better as a person while serving the Queen. He's been working on his trust issues and the unrest in his soul.\n\nHidden deep beneath his armour lies the Emblem of the Forsaken. Scarred deeply and cruelly into his chest where his heart lies\n\nHe has been serving with the Hand for over three years now.\n\n{h3:c}The Cult of the Damned{/h3}\nThe Cult of the Damned raised Mathew and he was their soldier and assassin for a long time.\n\nOut of a group of thirty 'recruits' that were put through training, only five survived. The trials included gruelling exercises for stealth, manipulation, forgery, skills of assassination, murder, interrogation, etc.\n\nFailure (read also: being the one who did the worst job) at any of these tasks resulted in a punishment enacted by the rest of the squad. Being ripped limb from limb with bare-hands by your friends, being buried alive for a full week, being the subject for the next day's torture lessons, lovely things like these.\n\nAround fifty confirmed kills in their name, before he learned of their trickery. 20 men, 20 women and 10 children.\n\nDuring this time, he earned the nickname \"Reaper\" due to his cruel nature and how he used fear and terror to horrify his targets before killing them in brutal fashion.\n\n{h2:c}Family{/h2}\nAlexander (Father): A hunter who gathered food enough for his own family and sold some to fellow villagers and sometimes traders. He knew how to fight and was an honorable man who loved his family very much.\n\nMelissa (Mother): A housewife who took pride in raising her children right. She was a runaway girl who had fought many battles in the army when she first set foot in Darrowshire, where she decided to settle down.\n\nFrederick (Older brother): You would think of him as a proper soldier if you'd ever seen one. Honorable, disciplined, he follows orders, but he also thinks for himself. He left a few months before the town was destroyed by the Scourge forces and might still be alive to this day.\n\nRosalind (Little sister): A late-comer child, a blessing in disguise. Mathew's favourite sibling, had a lovely bond with his younger sister, teaching her about the plants as Mathew's mother taught him, before Mathew went out into the world to discover it. Died at age 7 during the attack on Darrowshire by the Scourge.\n",
				},
			},
