				["TE"] = 1,
				["T1"] = {
					["TX"] = "The fact that he can actually speak seems like a miracle, because most about him makes this vulpera look like a bit of a savage. It's not exactly bad luck though, what he's been having so far, when even after finding himself alone, caged, poisoned or beat to near death, over and over, he's still incapable of having the needed context to actually feel really bad about basically being... well, a lost pup.\n\nNeru is a survivor that still isn't aware of it, expecting most things to go this way or the other because that's how they're meant to be, and not because he might actually be just as capable as those other people he admires. Namely... everyone.\n\nStill, hard beginnings usually make up for curious adulthoods, and even if he can't know anymore about how bad he's been having it, some memories tend to stick from mere redundancy. Is it so strange then, that deep inside all he would wish is to do to the Sethrak some of what they've been submitting him to?\n\nMaybe it's natural too, how he only seems to care about the best way in which he could spill the blood of whatever is coming to get his'. How he revels, deep inside, in being the victor of yet another deathly struggle. \n\nRed and white, blood and bone as a reminder of what he loves to hear the most, to the point of sometimes speaking it to himself: good work.",
