			["about"] = {
				["T1"] = {
					["TX"] = "A rather simple researcher who can be seen all over the place, being somewhat like the sands of Vol'dun that she came from, irritating and get everywhere. Not much of a backstory to be worth talking about, no really, this is as generic of a vixen as there can be, maybe somewhat skilled in both light and shadow magic, but there is nothing more to it. \nShe is also a huge book worm, ever thirsty for more knowledge.\n\nSkills:\n\nMagic-\nLight (above average)\nShadow (high)\nTwilight (average)\nArcane (very low)\n\nProfessionals:\nHerbalism (below average)\nAlchemy (below average)\nCooking (average)\n\nSpellbook:\n\nShadow:\nShadow Word: pain, and death\nShadow Mend\nMind Vision\nMind Control (d3 success on 3, on 1 tareget mindcontrols the caster)\nDispersion\nMind Flay\nFade\n\nLight:\nSmite\nFlash heal\nHoly Word Serenity (d3 success on 3)\nHoly Fire\n\nTwilight: (d6, on 1 suffer damage on 2 and 3 spell spell doesn't work, on 6 effect is doubled)\nTwilight Flame \nTwilight Bolt\n\nHealing spells: (If failed both caster and target suffer damage, if use on the enemy the enemy is healed and caster damaged)\nTwilight Penance \nTwilight Mend \n\nTwilight of soul: after using both a light and shadow spells if the next spell will be a Twilight spell it will be a success as if casted with 4 or 5 (Works only on offensive spells)\n\nMount and pet, Anaxiona \n\n\n\n\n\n\n\n\n\n\n\n\n",
