				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Personality",
						["IC"] = "achievement_character_bloodelf_male",
						["TX"] = "Kelsyth is usually found to be in a serious mood if approached, this is due to him being prepared to take on a job, and therefore he prefers to remain professional.  He is known for his dry, saracastic sense of humour, and will often loosen up during the later hours of the evening",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Tattoo",
						["IC"] = "artifactability_firemage_phoenixbolt",
						["TX"] = "A small, crimson phoenix, facing downwards is noticable on the right side of his neck.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "City Attire",
						["IC"] = "inv_cape_leather_revendreth_d_01",
						["TX"] = "When Kelsyth is in Cities or Outposts, he tends to wear more casual, yet practical clothing. He sports a fine, tailored overcoat, fashioned over a buttoned waistcoat. Around his waist, a leather belt containing practical items such as throwing knives and smoke bombs in the event of combat occuring unannounced. Strapped to his wrists are simple leather bracers, reinforced with steel, and shin-high brown boots with steel tips.\n\nOn his hip, an elegant sword and a pointed dagger. ",
					},
					["5"] = {
						["AC"] = false,
						["TI"] = "Armour of the Shrouded Inquisitor.",
						["IC"] = "inv_leather_raiddemonhunter_q_01buckle",
						["TX"] = "Kelsyth is unsually armoured for an individual in his profession. \nWhile it appears to maintain a somewhat, secretive appearance, the padded furs and leathers have been augmented with what seems to be metal of Demonic Origins. \nHis travelling cloak, worn and battered, sports a sinister looking hood which appears to be enchanted to further conceal his visage from onlookers. ",
					},
					["4"] = {
						["AC"] = false,
						["TI"] = "Kelsyth's attire.",
						["TX"] = "Kelsyth's apparel resembles his personality - He is well-dressed yet practical. He appears well groomed and his outfit looks like it has been mantained, bar a worn travelling cloak that has seen better days.\n\nKelsyth adores crimson shades, and will often only wear outfits with that particular colour scheme in it.  \n\nHe currently wields two cruel knives, dripping with a toxin of an unknown variety.",
						["IC"] = "inv_chest_cloth_draenorlfr_c_01",
					},
				},
				["v"] = 82,
			},
			["time"] = 1614725293,
			["zone"] = "Orgrimmar - The Barracks",
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Kelsyth is lean and well-built. His appearance is that of an Elf who has trained himself to be quick and nimble. He tends to prefer to adorn himself in lighty guarded armour, as heavier armour would be a hindrance and slow him down.\nHis Elven features are noticable, he as a small, narrow face, with high cheekbones. His hair is short and styled, and he sports a small chin strap beard that stretches around his lower jaw. His eyes are the colour of jade, indicating at Kelsyth continues to parktake in Fel magics to sustain him as apposed to the power of the rejuventated Sunwell. His ears are smaller than your average Elf, yet not too short neither. A small ruby stud is noticable in his left ear, in the shape of a drop of blood. A personal momento for Kelsyth as it mainly symbolises the fact that he is Sin'dorei. \n\n\n",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "{img:Interface\\Pictures\\artifactbook-rogue-kingslayers:512:256}\n\nCool, calm and collected. Kelsyth is a Sin'dorei who knows how to get the job done! He is an avid planner, and tends to look over a contract or assignment with an almost obsessive attention to detail. This is a result of his time among the Farstriders where methodical planning  and observational skills were common traits that were required to succeed in the field.\nHe prefers to work with individuals with calm demeaners and even cooler heads. He has little time for rash individuals, viewing emotional outbursts  as \"sloppy behaviour\" that could result in a botched contract.\n\nDespite his professionalism, Kelsyth is not above having fun or relaxing, in fact, he is known for his sharp sense of humour and dry wit - if not at times sarcastic. He enjoys strolls through the cities and a glass of whiskey at the local tavern. He is also very much fashion-conscious, preferring to dress himself smartly and practically while on or off a job.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "{h2:c}\"We find strength within the Horde\" - Lor'themar Theron{/h2}",
						["BK"] = 1,
					},
