						["TX"] = "Relatively unassuming at first but upon a quick glance:\n\nHer left ear is singed at the tip, and her right appears to have been torn or cut off somehow.\n\nA bandolier-like belt sits across her chest and shoulder, with various pockets and a sheathed dagger. Clipped to the backside of said belt is her prized lute.\n",
