				["BK"] = 1,
				["T3"] = {
					["PH"] = {
						["TX"] = "A rather ordinary looking Vulpera, outside of her light pink fur and deep pink eyes.\n\n Her fur is surprisingly well kept and clean overall, though becoming fluffier closer to her cheeks. \n\nHer fur also lacks much unique patterning, remaining primarily light pink, though the fluff of her cheeks is a stark white.\n",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Quite calm and subdued for a Vulpera overall, but with bouts of energetic excitement when certain topics of interest are discussed.\n\nIncredibly friendly and helpful, almost to a fault. Not one to blame people, she'd sooner take a hit for someone than sell out a friend.\n\nHas a sore dislike of conflict and for the longest time avoided even brandishing a weapon, although she will fight back in the absolute direst of situations.\n\nAvoids talking about her past wherever possible, occasionally embellishing details or foregoing others if she does discuss it. \nOnly those who get to know her very well can get glimpses into her past.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Born in a Vulpera burrow, she quickly fled with a caravan while still young after the Sethrak launched a raid upon the burrow.\n\nThe remainder of her youth was spent travelling with her caravan, until she joined a pirate crew in the hopes of escaping Vol'dun.\n\nOne thing led to another, and the captain lost the ship in a card game, leading Mazou to abandon ship and seek out her own path.\n\n<Want to know more? You'll have to find out IC!>",
						["BK"] = 1,
					},
