		["0801011344D5IzQ"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Looks",
						["TX"] = "\nThe priestess has a strong feminine presence with curves that most women would envy and it looks like she doesn't mind flaunting them.\n\nHer grey colourless hair is a strange sight on someone of her age but nothing else seems out of the ordinary.",
						["IC"] = "inv_misc_idol_01",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Cosmetics",
						["IC"] = "spell_shadow_soothingkiss",
						["TX"] = "\nHer make up is sparse but tasteful: shadowy eyelids encircling her amber eyes and a faint streak of dark blue across the lower lip.\n\nShe doesn't wear much in terms of accessories. Simple bracelets of fine silver rest loosely upon her wrists and ankles, quietly tinkling with every gesture and movement.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Outfit",
						["TX"] = "\nThe dark elegant dress compliments her features with a few wide risqué openings putting plenty of skin on display. The flowing skirt hugs tight about her hips but spreads wide open on either side showing off the length of her shapely legs.\n\nA silken scarf rests loosely over her shoulders when not ensnared around her smooth silvery hair.",
						["IC"] = "inv_chest_cloth_pvpmagegladiator_o_01",
					},
					["5"] = {
						["IC"] = "Rogue_ShadowFocus",
						["TI"] = "Demeanor",
						["TX"] = "\nDespite her suggestive appearance, the priestess is often seen bearing a reflective gaze as if contemplating something of great importance. \n\nEven so, the distant look in her eyes usually gives way to a soft smile whenever approached by a friendly soul.",
						["AC"] = true,
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Trinket of Power",
						["IC"] = "inv_jewelry_necklace_06",
						["TX"] = "\nThe one item that stands out is a simple but elegant silver choker of ancient troll design gently clasped around her neck. The metal band which seems plain at a glance reveal upon closer inspection ancient zandali runes and ornaments inscribed on it.\n\nThe priestess doesn't seem to part with the piece and is seen wearing it at all times.",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 2,
					["2"] = 3,
					["5"] = 3,
					["4"] = 1,
					["6"] = 0,
				},
				["v"] = 88,
			},
			["time"] = 1614643479,
			["link"] = {
				["Leiandri-ArgentDawn"] = 1,
			},
			["about"] = {
				["vote"] = {
					[3334847320] = 1,
					[1139321858] = 1,
				},
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h3}What you see{/h3}\nThe alluring curves of the priestess are not lost upon her kin. An eye-catching form is complemented by a deliberate choice of clothing and the seductive sway of her hips. Her facial features are delicate yet ensnaring with an exotic allure topped by a burst of soft silken hair of a silvery gray hue that is quite unusual for her age.\n\nDeep contemplation whirls in the reflection of the amber coloured pools of her eyes bordered and shaded with a trim of dusky shadow, yet from time to time the un-diluted spark of childish mischief crawls across her lips into a wry smile that is decorated with the tasteful touch of deep blue lipstick.\n\nA pair of petite troll tusks is framed by full and soft lips that give voice to an accent not usually shared by the Darkspear.\n\nAmidst mostly unremarkable jewelry a choker clasped around her neck is the most peculiar piece. A simple yet elegant design of matted silvery metal inscribed with ancient zandali runes and ornaments, complemented by a few dangling pieces connected with few fine silver chains. A keen arcanist would feel the presence of darker old magics bound tight within its strands, captivating the idle thoughts of those unaware and making them linger and wander about the priestess.\n\n\n{h3}What lies beneath{/h3}\nThe suggestive image of the woman is tempered with the unpredictable primal nature of her trollish heritage. The look, however doesn't translate well to her demeanor. Reserved and timid, she usually keeps to herself and often hesitates when approached by others, although an odd glance or gesture reveals a slightly more playful side.\n \n",
				},
