			["about"] = {
				["v"] = 5,
				["BK"] = 9,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-PriestShadow:256:128}{h2:c}{col:bf000f}\"What is it, that moves, unceasing, in the dark. At the black heart, spinning, whirling, dancing deeper. The nature of evil. The unspeakable riddle. A passing shadow, nothing more?\"\n\n\"How can you see, when it is black. Or can you... are your eyes even open? Who knows, and the silence is unbroken. Blindness, a graceful gift. Do you really want to see?\"\n\n\"It comes and it goes, and it holds your heart captive. Never asking permission, it grips, it keeps, traps you as it's own. A gentle caress and a sweet whisper in the dark. The most violent of noises, can you hear?\"\n\n\"Speechless words, untold lies. Answer every question. Solitude a friend, the one that never writes. A heartbeat. A mistake. Not the last, will you ever learn? Alone? In your dreams. The most beautiful of nightmares.\"\n\n\"It donates your soul to charity, was it ever even yours? Purpose taken from you, you did not need it. Meaning, torn beyond your grasp. Lovingly unmade, did you notice when it happened?\"\n\n\"Dive headfirst down in the dark, you are not lost. The bottom is down there, even when you cannot see. All the world will follow, if you only go down first. Is this what you were living for, all along?\"\n\n\"New things begin, and old ends. The endless chain, a meaningless sequence. With nothing preceding, nothing follows. Hold the chain, lose your hand. Tempting, is it not?\"\n\n\"And then it is gone, quicker, than drawn breath. Yet memories linger, exhale if you dare. Draw breath again, and invite the darkness. Or do you hold it, until night fall strangles you?\"\n{/col}{/h2}",
				},
