					["TX"] = "Tira'sa'ye is a Trolless exhibiting all the signs of youth to those that would look at her. \n\nShe seemed quite gentle and rather happy go lucky in the way she walked and talked  to most as a usually pleasant person to be around.  She often seems to smile at just about anyone who passes except the undead. \n\nShe looks as though she has passed her age of initiation within the last year giving her a fully fledged status as a woman within the Darkspear Tribe and from what can be seen this is no understatement.\n\nTira has grown in to a fairly well developed young woman with bright pink hair that most seem to think would not be natural. Those that have checked will confirm it is. She keeps her skin and light fur clean and her facial features soft on the eye. \n\nGoing further still it would seem that Tira has been blessed with by most standards a noticeable soft and curvy appearance usually showcased by how choice in attire and her lack of emabaressment in wearing more comfortable clothing. Her sarong she wears is held by a small knot on the side of her hip. The fabric from her knees down is slightly transperant showing her legs.\n\nUnlike most Trolls she never pursued a training regime or developed much muscle and maintained a clean appearence often bathing multiple times a day.\n\n{link*https://imgur.com/xBDofEi*More art by Plankton Heretic}\n\n",
