			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Go away{col:d30900}{/col}.{/h1}\n\n  For your own sake, its best that you don't expect some warm greeting from this miserable growler.  If he blurts out something rude in your face, pushes past you, or flat out ignores you...it's nothing special.  This strange, grey vulpera is surprisingly built, often leaned over a bar-counter kept to himself.\n\n  Fingers will be lost if an attempt is made to \"pet\" his visage.  \n\n  Typically wearing garb for easy maneuverability, the towering vulpera carried himself about with a palpable arrogance.  Something very dark strives him to his maintain his current stature, and any mention of the alliance will reveal that.\n\n\n\n\n{h1:c}Forbidden style.{/h1}\n\n\nThe core reason for his banishment from his martial school was his discovery that the Mogu were not completely without their own techniques.  He despised the advantage of strength so many held over him, despite how much he trained...so in the inky blackness of night atop Kun-lai summit, he delved into the scrolls and discovered the \"Mogu arts\".  They were not martial prowess when the pandaren held their uprising, he discovered the secret towards their self induced petrification, utilizing the \"flesh-shaping\" magic to forge his fists into solid stone during his attacks...though there was a deeper power.  \"Subjugation\" was a strange technique where one could sap the strength of their opponent, bringing them to their knee's or as the name suggests...\"subjugate\" them.  His indulgences in these studies were never completed, for he was discovered, cast out of the order.  Never having found the key to the strange second Mogu art, he scours pandaria for their instructive texts, that is when he's not fixated on disrupting the alliance.\n\n\n\n\n\n\n\n\n\n{h2:c}A glimpse{/h2}\n\nBurning.\n\nFires licked his fur as he awoke, a similar vulpera far smaller than him gone from his grasp.  Desperately calling out to family, his struggle out of the carcass of his caravan led him to the feet of a lumbering dwarf. \n\nClasp iron chains.\n\nWhethering his fur away, everything was gone.  Watching vol'dun melt into the ocean and night.  Voices of kin wailing under deck.\n\nPandaren.\n\nStrange creatures lift him up, a mess of mud and fur, guided onto his feet, and shown how to fight.  Inner peace?  Can't.\n\nExile.\n\nShunned by his teachers, students of his same order averting their gaze from his as he left.  I have what I need, not what I want.  Alliance blood.",
