			["about"] = {
				["T1"] = {
					["TX"] = "This is Vivian. Vivian is a farmer. Vivian can walk under water. Vivian respects.. almost everyone. Vivian isn't very talkative. Vivian is cool. Be like Vivian.\n\nHer hobbies include dancing, drumming, flying around on her overweight Wyvern and sticking random objects in her eyesockets.\n\nStuff she has on her most of the time:\n- A buzzbox with a few custom sentences built in\n- A CotW (Scroll down for more info)\n- A rolled-up map\n- A flintlocke (always loaded)\n- A sword or shovel\n- A whetstone\n- A sickle with a rope on it\n- A Tauren-made beltpouch with a notebook in it\n- Said notebook\n- A pencil behind her ear\n- Combat Medal of the Broken Isles (post humous participation-pin shaped like a little bronze lionshead broche)\n- THIS pocketwatch, designed by Acrona: argentarchives.org/node/199219\n- Mar'en's horn, toot-able\n- A medal for attending the Battle of the Barrens, 2018\n- A medal for attending the March of the Damned, 2020\n- A War of Thorns medal / bootcleaner\n- A Sun Hawks \"Silver Phoenix Banner\" medal for killing an actual frostwyrm, yay!\n\nHidden somewhere: \n- A leather sleeve with the Alliance crest on it, filled with paperwork\n\nMounts: \nDoormat the fat Wyvern\nVrr Vrr the trike\n\nOther items: Several farm tools, a Highmountain tapestry of the Skyhorn tribe, two buckets and a wheelbarrow. And this drawing: tinyurl.com/frozenfarm\n\n---- CotW (\"CotWah\") Carcanet of the Wolf. A leather chord with beads and trinkets on it that tell your story of the Frozen Paw Clan. Fellow Paws will only need a glance of your CotWah to see what you have achieved in the guild.\nBlue Bead with Paw\nSilver Bead with Paw\nTin Compass\nWooden bead with feather\nEggie bead\nRainbow Eggie Bead from Zaxzil\nTip of frostwyrm claw\nBead of the Fourth War\nA bolt from Zaxzil\nEnd of Days Campaign medal\nShattered Sky Campaign medal\nWooden Trainingbead with white fist on it\nStone Trainingbead with a white fist on it\nIron Trainingbead with a white fist on it\nWooden red-and-gold Farstridersbead, gift from Ayzannah\n(Text on it: Malanore Anar'alar (Friend of the Rangers/Traveller with the Rangers)\n\nThat's pretty much it, apart from background stuff which you don't wanna learn about OOCly.\n\n...No, really! Find out ICly, it's more fun.\n\n...Oh seriously? Fine, go here, but don't tell you I didn't warn for:\n\nS P O I L E R S\n\nargentarchives.org/node/183469\n\n\n\n-----\n\nViv's History notes\n\nTemporary names given sofar: Calla - Eyes - Fresh Face - The Kid - Rose - Shark Bob - Vivian - Gem eyes - Stones - Elise - Lak'wola - Bonefingers - Stone-eyes - Takoda (\"Friend to all\") Rowanoak - Sul'fi (Little slasher) - Mask - Amanda - Spooks - Skinny - Bones - Shark wrestler - Overhaul - Egg girl\n\nVal'kyr risen, quite recently (August 2016)\nJoined the Ravensun shortly after.\nLeft the Ravensun in september 2017\nJoined the Frozen Paw Clan at 18-9-2017\n\nBirthday: 25th of june\n\n\"Be the change you want to see.\"\n\n\"I'm not -hopeful- the world is going to get better, friend. Nor am I quietly sitting and waiting for it to happen. I'm making it better. A little bit, every day.\" - Rogmasha Thundercaller\n",
