				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Proud Zandalari:",
						["TX"] = "This troll wears his heritage with pride, a nymber of golden tattoos run accross his body, going down his arms and covering his chest and back. They take a traditional style with their lines, some depictions of Krag'wa noticable on it.\n\nHis Tusks would be etched with similar designs, each having a golden band near the base.",
						["IC"] = "ability_racial_cityofgold",
					},
					["3"] = {
						["IC"] = "inv_shield_1h_battledungeon_c_02",
						["TI"] = "Lillypad Shield:",
						["TX"] = "The shield wielded by this Zandalari would be ornately designed, the center resebling a lillypad, a green crystal at its center.\n\nThe outer edges would have ornate carvings of Zandalari design, similar to their tattoos. Along with the General lines would be depictions of Krag'wa.\n\nAlong the base would hang some carved bones, feathers and the like.",
						["AC"] = true,
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Weapons:",
						["TX"] = "This Zandalari can usually be found carrying 2 weapons, a War mace and a ritual blade.\n\nThe war mace would be sturdy and rather plain, the head spiked for extra damage, while fine leather makes up the wrap.\n\nThe blade would be  folded stormsteel, with a guilded guard and bone handle. Three small gems placed onto the top of the guard. \n\nThe blade itself would have decorative etchings carved into it from guard to tip, depicting various loa and other things.",
						["IC"] = "inv_knife_1h_zandalarquest_b_01",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Ritual / War Armor:",
						["TX"] = "The armour worn by this Zandlari would be a finely crafted mixture of chain, liight plate pieces and hide. The gauntlets, and hip guards would be typical tiki depictions common in Troll culture with some feathers coming out of them. Each being made of light but solid plate.\n\nThe kilt of the robe would be made up of two layers, the lower being hide the upper being chainmail. It would be split and front and back for easier movement.\n\nThe chest piece would be made up of three layers, the outer being a light treated plate, with chainmail underneath and the lowest layer being a padded leather to make it more comfortable to wear.\n\nThe sounderguards when worn would be large depictions of his loa, Krag'wa. Large frog heads with some bones, teeth and feathers hanging and tied to them.",
						["IC"] = "inv_helm_mail_raidshamanmythic_s_01",
					},
					["4"] = {
						["IC"] = "spell_animamaldraxxus_buff",
						["TI"] = "Shifting Aura:",
						["TX"] = "To those sensitive to sught things this Zandalari would have a somewhat shifting aura about them. \n\nA connection to the elements and the spirits evident, however something mixed around and within that seems to slither and shift.\n\nThose with the know would be able to sense the use of voodoo aroun him.",
						["AC"] = true,
					},
				},
				["v"] = 53,
			},
			["about"] = {
				["v"] = 26,
				["BK"] = 4,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-zone-BattleforAzerothZandalar:512:256}\n{h1:c}Appearance :{/h1}\nThis Zandalari stands at nine and a half feet in height, averageish for his kind. He would keep his head bald through recular shaveing, oiling and caring for the area as some would hair. His large ears jutting up above his head, the lobes each pieced with four golden hoops,a large guage at the lobe stretching it out. Each of the golden hoops would be on closer inspection etched with classic designs.\n\nHis facial deatures would have a firm and chiseled look to them, strong masculine features from a solid jaw to his large tusks. His eyes would be a blue/green colour, looking like a deep pool of water one might find in the jungles. Each of his large tusks would be ornatly etched and carved, classic Zandlari symbols running from the tip right down to his mouth. Two ornate golden rings fitted on the base near his lips.\n\nHis shoulder would be broad and well musculed, as is most of his body. A great deal of training and time being put in to keep him at peak strength. He would have ornate golden tattoos across most of his torso, going around his collar and upper back, down each arm and over his chest and lower back as well. They would extend right down over his hips and coming to an end at his ankles. They would be a classic Zandalari design, the only prominant image being that of Krag'wa.\n{img:Interface\\ARCHEOLOGY\\ArchRare-Zandalari:512:256}\n{h1:c}Loa Followed:{/h1}\nThe Loa this Zandalari has ended up following is Krag'wa the Huge, the frog loa. He is a powerful and impulsive loa found within the swamps of Nazmire, making the Frog Marsh his home.\n\n{h1}Krag'wa's Tales of the Loa:{/h1}\nAll de creatures great and small,\nHis protection will encompass all.\nIf sacrifice be ya whim,\nBest look to yaself, not one of dem.\nFor those dat seek to care for others,\nYa find ya kin, sistas and brothas.\nIf ya be de one ya love da most,\nTo him ya surely should not boast.\nWith each word, he puts much weight,\nNo wasted thought, no hurried trait.\nIf ya be selfish, come not here.\nDe selfless have no need to fear.\nOf danger he has seen no end.\nOur faith and hope his greatest friend.\nKrag'wa\nLoa\nGuardian strong.\nKrag'wa\nFather\nMay ya live forever long.\n",
				},
			},
		},
