				["Jugter-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-zone-BattleforAzerothZandalar:512:256}\n{h1:c}{col:007fff}Jug'ter{/col}{/h1}\n\n{h2}Art/ Doodles{/h2}\n{link*https://cdn.discordapp.com/attachments/586196829046046720/631919322243137547/unknown.png*Kiv'reesh & Jug'ter} - Art by Jakktari\n{link*https://cdn.discordapp.com/attachments/623327010504048690/629276212820443136/Jugter_Close_up.png*Jug'ter} - Art by Kiv'reesh\n{link*https://cdn.discordapp.com/attachments/560738980078026764/570341778625134612/Wow_2019-04-24_02-58-37.png*Jug'ter}\n{link*https://cdn.discordapp.com/attachments/623327010504048690/678919385968017418/image0.png*Kiv'reesh & Jug'ter} - Doodle by Jug'ter\n{link*https://cdn.discordapp.com/attachments/553060799892160512/675119311169257472/image0.png*Jug'ter} - Doodle by Jug'ter\n{link*https://cdn.discordapp.com/attachments/634477717659713547/678648044660457472/image0.png*Jug'ter's Gral Tattoo} - Doodle by Jug'ter\n{link*https://cdn.discordapp.com/attachments/553060799892160512/686278350364606483/image0.png*Pa'prika, Kiv'ral and Jug'ter} - Doodle by Jug'ter\n{link*https://cdn.discordapp.com/attachments/708677233727766571/746333400033394708/6931C2D7-807B-4F0F-970D-3DFBF2C89FE4_1.png*Gral's Blessing} - Doodle by Jug'ter\n{link*https://cdn.discordapp.com/attachments/708677233727766571/758854195636863026/D55517D6-C325-49A1-AA53-88C972C93F2F_10.png*Tix'azli & Jug'ter} - Doodle by Jug'ter\n{link*https://cdn.discordapp.com/attachments/586196829046046720/813067049358196796/image0.png*Tix'azli & Jug'ter} - Art by {link*https://twitter.com/xalaeth*@xalaeth}\n{link*https://www.argentarchives.org/node/231747*Argent Archive}\n\n{h2:c}{col:007fff}History{/col}{/h2}\n\n{h3:c}{icon:achievement_alliedrace_zandalaritroll:25}SINKING OF ZANDALAR{icon:achievement_alliedrace_zandalaritroll:25}{/h3}\nBorn and rased in Atal'Gral, Jug'ter was a skilled hunter as life in the Zuldazar wilds was always tough.\nLike most Jug'ter never believed Zul's prophecy of Zuldazar sinking beneath the waves, unfortunately the prophecy was half true, even though Zuldazar never sank with the cataclysm most of Zandalar did including Jug'ter's home.\n\n\"The sinking.....Prophet Zul predicted this\"\n\n{h3:c}{icon:expansionicon_mistsofpandaria:25}PANDARIA CAMPAIGN{icon:expansionicon_mistsofpandaria:25}{/h3}\nNow with reason to believe Zul's prophecy Jug'ter joined the Gold Fleet for the Pandaria Campain as part of the forces under Vilnak'dor during the Isle of Thunder.\n\n{h3:c}{icon:ability_rogue_ghostpirate:25}HEADHUNTING/ THE FLYING ROSE{icon:inv_garrison_cargoship:25}{/h3}\nJug'ter earned what coin he could Headhunting. \nHearing of a Bounty on an elvish Admiral \"Aimee Moonrise\" Jug'ter hatched a scheme, posing as a crewmate he joined as one of the crew under Captain \"Rhae\", slowly earning their trush until he could strike.\nKidnapping Aimee during a mission and leaving the crew to die he sailed to Zuldazar to claim the prize. Unfortunataly the crew of The Flying Rose are not so easily beat, attacking Jug'ter on his ship burning it down and freeing their Admiral.\n\n{h3:c}{icon:achievement_boss_zuldazar_rastakhan:25}RASTARI VANGUARD/ HAND OF ZUL{icon:achievement_nazmir_boss_zul:25}{/h3}\nReturning home to find Dazar'alor in ruin and King Rastakhan dead by alliance hands Jug'ter joined the Rastari Vanguard seeking vengance for the Zandalari joining battles in Westfall with Mogu allies and helping fellow trolls in the battle of Hinterlands where he met and assisted scouts from The Hand of Zul lead by \"Huntmaster Zek'tulo\", the offer to join The Hand was made..... but denied at first.\nReturning home to Zuldazar from the many battles the Rastari Vanguard were not welcomed as heros but disbanded a disgrace to the warriors who fought and died.\n\nTaking up Zek'tulo's offer Jug'ter would join the Hand of Zul seeing their view for a united troll empire and assisting them, together the Zulians would battle and free Stranglethorn of the lesser races and continue to Duskwood where skirmishers with constant fighting would see multiple alliance forces defeted but ultimately a stalemate.\n\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-Islands:256:128}\n\n{h2:c}{icon:inv_pet_babyshark:25}{col:00ffff}Tales of de Loa: Gral{/col}{icon:inv_shoulder_cloth_sharkjaw_b_01:25}{/h2}\n\n{p:c}{col:00ffff}Beneath de plane where Pa'ku reigns,\nGral rules de deep and dere remains.\nOceans vast, beneath de tide,\nWhere life be strange and horrors hide!\n\nGral is wisdom, Gral is power.\nGral is fierce, unworthy cower.\nTruths be found within de depths.\nLies exposed and secrets kept.\n\nHis realm be boundless! De pressure great.\nWith hunger for knowledge ya never sate.\nBlow de conch or bring fresh meat,\nYa find de loa that none can cheat.{/col}{/p}\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-Zandalari:512:256}",
				},
				["BK"] = 5,
				["MU"] = 2575924,
				["v"] = 99,
			},
