				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Spidery Affinity",
						["TX"] = "Homages to spiders are present all about her person, from the embroidery of her clothing to the decorative, many-eyed ritual mask she carries with her.\n\nThose familiar with the venerated loa spirits of the trolls may recognise that these are clear dedications to Elortha no Shadra and are similar to how a loa priest might display their faith.",
						["IC"] = "INV_SpiderMount",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Trinkets and Travel Bags",
						["IC"] = "inv_misc_necklace_feather09",
						["TX"] = "Zulzi wears two elaborately embroidered bags of soft hide and leather while travelling; one a cross-shoulder back pack and the other bound to her belt. \n\nBoth possess either earthy scents or primal auras of voodoo magic.\n\nHer belt is lined with varied juju trinkets; prayer beads, voodoo fetishes and two vials of noxious looking liquids.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Many Eyed Mask",
						["IC"] = "inv_helm_cloth_pvppriestgladiator_o_01",
						["TX"] = "Zulzi's ritual mask is shaped with coarse woven silks into the silhouette of a web, crowned with brilliant carmine feathers and has two false tusks which are pierced with a single gold ring each.\n\nWhen worn, the eight eyes come alight with an eerie green glow and dull when it finds a place to the back of her cross-strap pack when not in use.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Intricate Tatau",
						["TX"] = "In dark mahogany ink, Zulzi has various markings that are easily identifiable and unique to her.\n\nThey seem to be sigils with great significance to her faith and craft, featuring patterns common in vodoo conjure and abstract spiders. \n\nThey appear across her left eye, right shoulder, left forearm, right hip and left shin.",
						["IC"] = "ability_psychicassault",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Locomotion and Gaze",
						["TX"] = "The constricted pupils in her pale eyes give the impression that Zulzi is on high alert and lends a certain unpleasant, intrusive quality to her gaze. \n\nAware of this natural leer, she is prone to making deliberate, sustained eye contact for just a little too long.\n\nThe way she moves follows this practiced and intentional trend; her gait is an easy, fluid glide as she walks with purpose.\n",
						["IC"] = "ability_demonhunter_spectralsight",
					},
				},
				["v"] = 44,
			},
			["time"] = 1614724353,
			["link"] = {
				["Zulzi-ArgentDawn"] = 1,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "\n{h2:c}{col:169382}Zulzi of Shadowprey{/col}{/h2}{h3:c} {col:FFD883}The Whispering Witch {/col} {/h3}",
						["BK"] = 3,
						["IC"] = "INV_Trinket_Naxxramas04",
					}, -- [1]
					{
						["TX"] = "{h3} {col:169382}Description - {link*https://i.ibb.co/T052jyj/Zi-model.png*Model Edit} {/col} {/h3}\n{col:FFD883}While this Darkspear female is small and slight of frame, everything from the prideful air of a tribal queen to the grandness of her attire gives the impression that she is very much assured of her own personal power - and the way her pale eyes lock onto others both bewares and dares them to contradict her.\n\nHer visage bares an unusual blend of features; her angular, chiselled face is smattered by light freckles, retaining a look of youthfulness and her large, pale gold eyes are ringed with shadows, making her already intense stare seem intrusive.\n\nZulzi is all things that suggest her spiritual persuasions; intricate enspelled tatau markings decorate her body, obscure trinkets and items of power are bound to her belt, magnificent trims in the form of vibrant feathers frame her crown and spider motifs in veneration of her loa are present all about her. \n\nNo effort was spared to ensure her proclivity for voodoo was made abundantly clear.{/col}",
						["BK"] = 3,
						["IC"] = "inv_icon_wing01a",
					}, -- [2]
