		["0130215953xWtD9"] = {
			["character"] = {
				["v"] = 70,
				["CO"] = "-Always happy to RP.\n-New to RP? Come say hi and introduce your char :) happy to help practice conversations.\n-Running is IC.\n\nTheme song (just cus it's amazing!) : Sahalé - Djiin\n",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "Minding his own business. Relaxing with a drink",
			},
			["time"] = 1614810469,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["v"] = 53,
				["BK"] = 8,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Mud:512:128}\n{col:181510}Taajoo is a tall and lean male troll. His coarse skin, slightly cracked in places like old leather, muddy light brown and devoid of any fur, could to the knowing eye set him apart from the more common jungle trolls. \n\nHis limbs are dry, thin and wiry, with muscles and sinews standing out like ropes as if the hot sun baked him three times over, mercilessly removing all moisture and melting all fat from his body and bones, giving him a somewhat gaunt and starved appearance. \n\nHis hair, growing straight upwards, is of a darker muddy brown hue and his large tusks have taken on the colour of dull, dark and aged ivory - but show signs of having been stained dark brown once, and painstakedly sanded to remove the colouring. \n\nBright blue eyes peer at the world from under heavy brows; his gaze appears direct and unafraid. Subtle grey colours have been painted on his face in a particular pattern, which seem to serve as camouflage and also send a message to his Troll peers. \n\nHe wears some jewellery; small rings of unpolished gold of distinct Zandalari design and fashion pierced through his tusks, ears and nose. \n\nHis body  and arms are encircled by tattoos; the ink used has faded into a muddled brown-green hue, and resembles the pattern found on the skin of a snake or crocolisk.\n\nAn abundance of scars on his body, most of them old but a few of them new, could indicate he isn't a stranger to fighting. One such new scar splitting his left eyebrow is deep and appears slow to heal. {/col}\n{img:Interface\\ARCHEOLOGY\\ArchRare-TrollVoodooDoll:512:256}\n",
				},
			},
			["misc"] = {
				["ST"] = {
					["1"] = 2,
					["3"] = 2,
					["2"] = 3,
					["5"] = 0,
					["4"] = 2,
					["6"] = 0,
				},
				["PE"] = {
					["1"] = {
						["AC"] = false,
						["TI"] = "Hidden",
						["IC"] = "ability_rogue_improvedrecuperate",
						["TX"] = "Wearing a working outfit, which is worn and dirty, that covers most of his skin. The hood he wears casts a dark shadow over his face.\n\nHis garments are stained with dust, oil, rust and grease.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Scent",
						["TX"] = "He barely has a scent. The subtle pheromones he gives off are those of a healthy male, currently unaffected by any disease or ailments, which likely only other Trolls could pick up on. \n\nAny other race might simply register a faint scent of warm, dry, earthy and woodsy musk.",
						["IC"] = "ability_druid_flourish",
					},
					["2"] = {
						["AC"] = false,
						["TI"] = "Tools",
						["IC"] = "inv_misc_wrench_01",
						["TX"] = "Taajoo carries a medium-sized leather bag, badly stained with oil and grease. Some worn jumper cables and a battered wrench stick out; the bag seems to be packed with more tools and materials usually found in a goblin engineer workshop.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Knick knacks",
						["IC"] = "inv_belt_mail_raidhunter_r_01",
						["TX"] = "- Skull belt buckle. The polished remnants of a shrunken head, likely that of a Troll, sits on his belt. It's yellowed by age and weather.\n\n- Yak horn. Decorated with small jade stones in Pandarian fashion, the horn is filled with dry snuff at the wide end and the small hole at the narrow end allows him to shake out a small amount to use.\n\n- Leather medicine bag. This small pouch he wears around his neck, almost like a necklace. ",
					},
					["4"] = {
						["IC"] = "inv_weapon_halberd_ahnqiraj",
						["TI"] = "Weapons & Equipment",
						["AC"] = true,
						["TX"] = "- A large recurve Zandalari Military Warbow, made with a bamboo back and belly with a hard timber core, a sauroid leather stitched grip and fastflight string. The bow shows signs of having been modified to serve a more all-round purpose, such as hunting as well as fighting.\n\n- A leather quiver suspended from the right side of Taajoo's belt that can hold up to 20 arrows. The lower side is finished with the coarse fur of wild boars that serves for protecting the arrows. There is a wolf tail attachment for cleaning after the hunt, or fight.\n\n- A short stabbing spear with a two-foot wooden shaft and a one foot long, dagger-like and razor sharp steel blade that is double edged. The metal has been stained to a dull and dark colour, and does not reflect the light.\n\n- A tough as boots hunting knife with a polished scorpid leg handle; the blade length is approximately 9 inches, full tang and sharpened. It sits in a heavy duty, leather sheath attached to the left side his belt.\n\nHis leggings are crafted of sturdy, hard sauroid leather that has been reinforced across all the joints. All metal buckles have been intentionally darkened and dulled as to not glint in the sunlight, and the surface of the leather has been stained with different hues of green and brown.\n",
					},
