			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}\n{h1:c}{col:ff7e2a}Description{/col}{/h1}\n------------------------------------------------------------------------------------------------\nThe troll before you displays many traits of her kin, ranging from height to strength to stony patches across her skin. Her teal eyes speak of the mysterious things she has seen and learned, of the power of te Loa she might wield or not. Her tusk protude forward, thick and sharp, having some carvings in them as decoration. Her mossy green hair is decorated with golden jewelery though the largest part of it is bundled together with a ribbon of dinosaur leather.\n\nThe adult Zandalari looks to be in prime condition. Her body is well toned , covered and decorated with golden tattoos. Looking rather imposing with her broad shoulders and multitude of scars, be them from combat or from rituals. Yet this appearance seems to occasionally change every so often due to her habit of shifting forms, adding minor or more drastic changes to her normal appearance.\n\nOn her belt one can find a variety of pouches containing herbs that serve multiple purposes, though most seem to be native to the island of Zandalar. Alongside these pouches she carries around an enormous book bound together by dinoleather to give it a green-red scaled cover. Seemingly stitched together with gold thread and having an ever growing number of pages, this book contains a wide variety of information regarding wildlife. Yet despite this some of the creatures within do seem to be created from the imagination of the writer.\n{img:Interface\\ARCHEOLOGY\\Arch-Race-ZandalariBIG:256:512} ",
