					["TX"] = "The young mage is easy to miss among the people he walks around with, as hes short height makes it easier to overlook, but what he is lacking in hight, he makes up for with a charming and bubbly personality.\n\nWhen Tumis starts talking, he is hard to silence. He is determined and enthusiastic about the subjects, that matter to him or are of importance.\n\nIn addition to Tumi's height, and short snout, he is your average vulpera.\nUsually seen in simple garmets, that make it easy to see the profession he is practicing, that being a mage. \n\nDespite not being that talented in the area of frost or arcane, fire seems to bloom deeply in hes heart and if witnessed in actions, Tumi does hes best to give quite a show for those around with the explosions taking shape of anything he deems beautiful or great to look at.\n\nAs hes talents are clear, hes confident attitude may come across as arrogance at times, but deep down...He has a big heart and made of pure gold. Hes consideration is questionable at best, but rest assured, he always has the well-being of others in hes mind...Well...That and cake...He loves cake.\n\nAs a pyromancer, the hotheaded youngester has a tendency to fail to follow orders and acts on an impulse as well as do what he deems is right. \nBut hes bubbly way of speaking makes it very hard to remain depressed around him as the cheerfulness and kindess do tend to grown on a person.\n...Either as a warmth in one's chest or like a rash on the skin.\n\nTumi is always looking for a way to better himself and he's way of learning is trial and error, do first...think second. \n\nEventhough usually never seen without hes trusty attire, the pyromancer has a deep gash running through hes chest as a reminder to be more careful in the future.\nHe also seems to frowns every now and then, if looking at something for extended period of time. It becomes obvious, he cannot see that well.\nThe fur around hes eyes seem to be absent aswell.\n",
				},
