						["TX"] = "Looking towards Merenis some things would be clear, He was a very young elf most of his skin being very soft looking and smooth though it would be odd to see the scarring altering his Arm, Chest, Shoulder and Eye seeming quite rough looking for his age.\n\nHis skin would be darker than most elves having tanned brownish skin his frame being quite slim though he wouldnt look malnourished but possibly of worked his way from looking so before. some light muscle could be seen around his arms and legs.\n\nAround his head and face could be seen a deep honey blond hair kept slicked back with some kind of gel though it would look a little rough to those knowing hair it would be obvious he wasnt using a brush of any kind, His facial hair being slightly rough as well simply a small line handing from the front of his chin, the only other hair of note would be his eyebrows seeming shorter once again cut rough.\n\nThe only other thing of note would seem to be his ears would also seem shorter than most elves.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Equipment/Weapons",
						["TX"] = "Two ropes would sit around his chest crossing one another over, Along with this four daggers would sit in a custom made belt.",
						["IC"] = "inv_misc_rope_02",
					},
					["2"] = {
						["IC"] = "inv_chest_leather_30",
						["TI"] = "Armour",
						["AC"] = true,
						["TX"] = "A brand new set of armour would fit snugly around the young elf looking to be made by Sin'Dorei in design, A layer of off white leather would seem to make the most of the underlayer held together around the sides of the arms and legs with tight stitching and with leather arm bracers keeping it tight.\n\nLaying on top of this around the chest, Stomach and his thigh area would be quite layered looking leather, dark blue in colour it would seem to reinforce area's for more protection against incoming attacks to vital parts each of these having light metallic reinforcements keeping the layers held together.\n\nThe same dark blue leather made up the gloves and boots of the set once again being held together with metal reinforcements, the boots having additional hardened dark brown leather for extra protection, on each glove and boot would also be a small orange gem seeming simply decorated with a larger gem sitting in the middle of his belt.\n\nSeeming to finish up the design would be a brown cloth necking that once again would seem more decorative but give a small amount of protection around this area.",
					},
