						["TX"] = "Although the Orc is in his prime physically, his ice-blue gaze carries with it a certain degree of fatigue. This Orc has seen much in his lifetime and with all that it is hard for him to rekindle the excitement and wanderlust of youth.\n\nEven his expression share the same sentiment with his eyes. Iceblade's features are mostly neutral and reserved. However, he is still capable of showing emotion, he just chooses not to. ",
