			["about"] = {
				["T2"] = {
					{
						["TX"] = "Mar'en \"Wolfsoul\" Darkhorn, daughter to Tar'khan & Lali'a Darkhorn, sister to Fae'nai and born in the dusty mountains of Stonetalon. Mar'en has always been a considerate soul, caring for all around her and finding the good in all those she encountered.",
						["BK"] = 1,
						["IC"] = "achievement_zone_stonetalon_01",
					}, -- [1]
					{
						["TX"] = "The Darkhorn Tribe were known for their love of wolves; Mar'en was no different. She trained under her Mother, a skilled hunter and prestigious Wilderness Stalker, learning the ways of the wilds and their Canid kin. As she grew, Mar'en tamed her first wolf, cub to her Mother and Fathers companions. With the help of her childhood friend, Mo'zai; a young troll, Mar'en named her new found companion, Zal'dir. To this day, Zal'dir is a stalward protector of his master and the bond between the pair appears to be unbreakable.",
						["BK"] = 1,
						["IC"] = "inv_wolfdraenormountblacktri",
					}, -- [2]
					{
						["TX"] = "During the events of the Cataclysm, Stonetalon was upheaved along with the rest of Azeroth. These events broke her tribe and ended with the deaths of both Mar'ens parents. In an attempt to reunite her people, Mar'en worked hard to revive the Darkhorn tribe along with her lifelong mate, Ruinos Sunderhoof. The pair managed to revive the Tribe for a time, working to protect the mountains but war and stress ended with the Tribe dwindling in numbers and remains a family unit to this day.",
						["BK"] = 1,
						["IC"] = "inv_armor_tauren_d_01cape",
					}, -- [3]
					{
						["TX"] = "Now a Mother, Wilderness Stalker and Protector, Mar'en flies the skies of Kalimdor, still bound to protect her homeland and lend her aid to the Tauren people. She is also looking to grow her tribal community within her homeland and Kalimdor as a whole.",
