			["link"] = {
				["Moonsaei-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}\n\n{h1:c}{link*https://myalbum.com/album/MWkJUJRzAZJS*Moonsaei Dawnsworn}{/h1}\n\n{col:ffffff}{h3:c}Emotions are not hidden on her face for a reason, each breeze of new feelings evident on her brow and the downturn of full lips. Shadows have now melted from her gaze, only remaining in the ones her lashes cast on her cheeks, there's no longer the wild look, for now it remains tamed, and the lack of spark isn't the only sign of the frail soul.\n\nRestless curls of paling gold, and white roots,  snake around her in the form of not only her hair, but her magic, and it's a wonder the locks aren't where her power resides. She threads her way in and around with her short stature and willowy limbs with hesitation in her movements;  the free spirit confined by the rooms she dwells in. The outside is her home, with no burden or order. There is no fear shows at the unknown, but terror reigns when trapped, judging from the gentle twitching of her fingers and the knock-knee'd shaking under her gowns, cinched tightly at her slim waist, her mind unsuited for the graceful curves she posesses. \n\nEven after the Spire, she remains a restless, tormented, wild slip of a girl.  {/h3}{/col}",
