						["AC"] = false,
						["TI"] = "Armour.",
						["IC"] = "inv_misc_bag_36",
						["TX"] = "Usually, Jimbo's wears a black linen bandana that covers half his face. The goblin strapped in light leather shoulder pad armor that seems slightly too big for him. As one can see, on the waistband, he carries a few throwing knives for one of his \"emergency\" situations. The belt also has a pair of mini bags filled with different types of ingredients for his crafts. Pocket of sand, poison vials, lockpicks — these are what goblin carries from time to time.",
