			},
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "{h2:c}Physiognomy{/h2}{p}\nHe's not an athlete, but neither he has \"belly problems\". Long neck, broad back, wide shoulders, well-fed stomach, average-sized muscled hands — these are the accurate ways to describe Jimbo's body complexion. \nMindplosive has soft, large, and floppy ears, that move when he's picking up sounds or expressing emotions. Eyes coloured in amber and contain amounts of very light gold-ish gray.\nThe olive-green color of his body and lack of wrinkles straightly points that goblin is in his mid-twenties(Adult Aged). {/p}\n",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "{h2:c}\"Actin' Real Bad.\"{/h2}\n{p:c}Jimbo Mindplosive acts foolishly and takes personally every single word you'll decide to throw. He's the \"head first\" type and pumped for action, but, sadly, regrets his failures after they've happened. Emasculation attempts are always going easy on him. Wouldn't miss a chance to lie whenever he can, plots a lot of stuff, and treats people the same way they treat him. Sometimes lets his ego get the best of him. He's not the smartest kid among the others: Jimbo has no sense in engineering and alchemy at all. Catching him in a bad mood is no news at all! He's pleased to spoil someone's day, as he highers his self-esteem with such doings. Nonetheless, he's a good guy mostly and feels terrible when behaves reversal against people who don't deserve that. Being gentle where he decides to be, eager to earn extra money, even though he, often, offers quite an unprofessional job, fulfilled with different sorts of ups and downs. Step carefully, don't touch his \"soft spots\" and you'll make one hell of a friend. But still, remember: He's a goblin. And if he has a chance to improve his welfare — he never misses it.{/p}",
