			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Brok'tor is the prime example of an Orcish warrior. The brutish, near hulking strenght only rivaled by his own monstrous allies within the Tauren and Zandalari tribes.\n\nBoth arms appearing as if two severed tree trunks, fastened to the toned and bulging torso. His legs announce his arrival, stomping both feet upon the ground as he marches onwards, crushing any unfortunate pebble unfortunate enough, to be caught beneath his boots.\n\nHis olive-green skin is a near criss-cross pattern of scars, varying in size, lenght and whether they have properly healed or not.\n",
						["BK"] = 1,
					},
					["PS"] = {
						["IC"] = "ability_warrior_furiousresolve",
						["BK"] = 1,
						["TX"] = "Brok'tor is a often considered no more than fearsome brute, knowing nothing else but to hack and slash. This much is also very often true, atleast to his enemies, but when it comes to the Horde and his fellows, he can be a lot more.\n\nThere is a deep sense of pride and camaraderie between him and his fellow soldiers, treating those who share his fondness of the Horde, with great respect.",
					},
					["HI"] = {
						["IC"] = "trade_archaeology_orc_bloodtext",
						["BK"] = 1,
						["TX"] = "Born upon Azeroth and in chains, much of Brok'tor's past is a haze of slavery, constant war and the pursuit of glory.\n\nHe was raised in one of the internment camps, build to contain the remains of the Orcish threat, after the Horde's defeat in the Second War.\n\nWhen they inevitably rebelled against their Human opressors, Brok'tor found a new place in the Horde, under Thrall. Here he joined with the warriors, and fought countless times against a countless amount of foes. He learned quickly, that to live on Azeroth, his people would have to carve out their place in the land themselves.\n\nParticipation in events and war efforts:\n\n- Invasion of Outland\n\n- The Northrend War\n\n- War Effort during the Cataclysm\n\n- Landfall with Domination Offensive in Krasarang Wilds, Pandaria.\n\n- Invasion of Draenor\n\n- Third Legion Invasion\n\n- The Fourth War",
					},
				},
