					[1106733264] = 1,
				},
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}\n\n{h2:c}{link*http://i.imgur.com/704p6vq.png*Picture 1}{/h2}\n{h2:c}{link*http://i.imgur.com/dZfCNAo.png*Picture 2}{/h2}\n\n\n\n{col:8B8B8B}\nHer complexion appears youthful, as is common for her race, yet her hands look like those of an old woman -  the veins more prominent, skin wrinkled and thin, and the very tips of her fingers darkened like death already had its hooks in her. Oftentimes they are hidden by a pair of gloves, though; tucked away from sight.\n\nHer frame is that of an average sin'dorei woman. Tall, lean, imposing; not much different from the dozens of others who probably never lifted anything heavier than a hairbrush in their entire long lives, or remembered to eat often enough for that matter.\n\nHer voice is soft with a husky undertone; soothing, yet full of determination, even dominance. It's a perfect match with the solemn, serious expression that seems to be permanently stuck on her face.\n\n\nVisible items: \n\n- A gold band with a red jewel sits around her ring finger. For some reason she has a habit of covering it with her right  hand when sitting down in a park or having a conversation with strangers.\n\n- A ring with a big black rock on it on her right hand.\n\n- A small leather satchel hangs from her belt on the back side. It most likely contains reagents, coins or other similar small items - who knows, really.{/col}\n\n{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}",
