			["about"] = {
				["T1"] = {
					["TX"] = "{h1}Ooh, I wonder if this works{/h1}\n\nMaximilien likes to poke around magical things. Try different things. That is also why he is on the Horde's side now. They didn't like his experiments in Stormwind. Or anywhere else Alliance-occupied places. That and he caused a few deaths here and there. He left the Alliance on his own accord. Well... And he is wanted for murder in Stormwind and Elwynn, so... He strangled a bastard. He deserved it.\n\nMaximilien is fascinated by the void, fel, shadow and unholy magic and necromancy. The things that others, especially paladins and priests, avoid. Anything that has a possibility to empower someone or something. He has also raised his fair share of undead. Mostly just zombies. But, he is progressing.\n\nMaximilien was once wandering around Northrend. Spent time researching and hiding from Alliance forces and those who are in good terms with them. He can't tell the exact moment when he slipped into undeath, but he knows that it happened in Icecrown. He noticed that something was missing and with his menial medical knowledge he noticed it. His pulse was gone, no hunger anymore, no need to breath. He was medically dead, but still kicking. However, this excited him. Now he was able to try out his research of creating a death knight.\n\nAfter Maximilien's heart froze over, he decided to seek out the Horde and the forsaken. There he would be able to be himself. Be free.",
