			},
			["time"] = 1615496226,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "{h3:c}Head{/h3}\nthe orc's black hair is tied in a long braid falling behind his back, with sides of the head being shaved bald. His beard is long and unkempt, being slightly subdued by being tied in the middle. His facial structure is very sharp and boney.\n\nThere are many piercings on his ears, eyebrows, tusks, lips and nose, mixed between being made of bone or metal.\n\n{h3:c}Body{/h3}\nHe stands taller than the average orc, but appears less wide and muscular. His body type could be described as lean-muscular. Standing next to an average Orc he would seem stretched out, rather than monstrously big and wide. His limbs are boney and long, giving him good reach, but it could be discerned that his grip would be weaker, hence why he relies on striking with two axes rather than with a heavy two-handed weapon. \n\nHis skin is green and seems thin and streched out over his muscles with lots of veins visible, perhaps too many. It is as if his muscles and skin cannot keep up with the length of his bones, hinting at something unnatural in his growth. The skin is littered with scars all over, signs of a life of battle both in the wilds and on the fields of war.\n\n{h3:c}Armor{/h3}\nHis upper armor consists of fairly big pauldrons resting on his shoulders, giving him more wideness in his look. His hands are protected by wristguards and during battle he wears a helm adorned with ram horns. His torso is covered with metal plate, which still offers good mobility of the arms. His belt carries a knife and some accessories to the sides. Bottom half of his armor seems to be fairly light, allowing quick footwork, if less protection.",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "As a hardened warrior who grew up in orcish society, the orc is not afraid of speaking his mind openly. He is, however, always aware of what each of his words may imply. He values wisdom highly and shows himself as an orc in control of his racial primal rage, though control meaning knowing when to unleash it, not supressing it completely. Having lived a life of war and survival, he knows things from stories told and strifes experienced, not pages read.\n\nHe is proud of his heritage, being a Warsong Orc of the Horde. He has some reservations towards certain races of the Horde, but he gives everyone a chance to prove him wrong. He holds a great grudge against the Alliance and its races, believing the Horde has every right to the lands they have conquered, survival of the fittest being the main unbroken rule of his life.\n\nHis main motivation in life has been seeking to have his name remembered amongst the legends of the past, though more recently, his purpose has shifted to nurturing a new community, believing he has the fortitude and patience to lead a Clan of his own.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Interact ICly to find out!\n\n\n\n\n\n",
						["BK"] = 1,
						["IC"] = "inv_misc_book_15",
					},
				},
