						["IC"] = "inv_archaeology_orcclans_tattooknife",
						["TX"] = "Face tattoos extending down from his scalp, to and around his eyes and down his cheeks.\n\nWarsong symbol on his left shoulder, Horde symbol on his right shoulder. Symmetrical tribal tattoos across chest and back connect the two main pieces.",
					},
