				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-monk-cover:256:256}\n\n{p:c}Brief History: Kelemar Everveil was born of a human father and elven mother, but was solely raised by his mother in Quel'thalas. Shown much ridicule amongst his pompous peers for being a half-breed, Kel left the elven city as soon as he was able to and lived quite a nomadic lifestyle.\n\nHaving a slight disdain for the undead due to the sacking of Quel'thalas by the Scourge, as soon as they had returned during the war against the Lich King, Kel wished to lend a hand even though he had very little training in fighting.\n\nOnce he had made his way to work amongst the Argent Crusade, he was taught the ways of the Light to aid alongside the medics. This connection to the Light, sadly, didn't last long...an event he wishes to forget made him lose his faith in it, which struck him hard as he loved healing the injured.\n\nLater on, once the continent of Pandaria is discovered and the teachings of the Pandaren monks became more known, he jumped on the chance to teach under them to find another way he could help.\n{/p}\n",
