		["0112151349UxnyX"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Weaponry",
						["TX"] = "He caries a big hammer made of blackrock iron. Hard, sturdy and near indestructable. The red stone in the middle of the hammer's head, sometimes flashes with a firelike color. \n\nSecured to the belt on the back, is a rolled up chain of blackrock iron as well. There's nothing really special about it.",
						["IC"] = "garrison_blueweapon",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Necklace",
						["IC"] = "inv_misc_bonenecklace",
						["TX"] = "Hanging around his neck, hangs a necklace with what looks like a claw dangling at the end.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Armor",
						["TX"] = "He's wearing the armor of the Blackrock Clan most of the time, as well as carrying around a shield. \nThe shield though, is made of hardened and rustfree steel. It has spikes scattered around on the edges of the shield, to act as both weapon and protection.",
						["IC"] = "inv_plate_blackrockclan_b_01chest",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 3,
					["5"] = 0,
					["4"] = 0,
					["6"] = 1,
				},
				["v"] = 19,
			},
			["time"] = 1615060901,
			["zone"] = "Orgrimmar - The Drag",
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "He is not as muscular as the orcs fighting in close combat, but he is far from being scrawny either. \n\nHe has very few scars, but does have two scars around both of his wrists. \nHe also has what looks like a sharp edged weapon cut into his shoulder.",
						["BK"] = 7,
					},
					["PS"] = {
						["TX"] = "He can be kind to those who treats him well. Treat him with disrespect, and he shall do so to the person disrespecting him\n\nHe is loyal to those he works and fights for as well as to those he cares about.",
						["BK"] = 6,
					},
					["HI"] = {
						["TX"] = "Raised under strict circumstances by his parents to perform at his best, this was part of Drarkan's childhood till he became of age to train as a shaman. \nHe showed promising skills, but mostly at handling the element of fire, which later became laid background for the Omriggor he had to go through. \nUpon completion of the Omriggor he'd earn the name \"Firechain\". \n\nAs Drarkan got older, conflict would start to stir in Gorgrond, resulting in the ogres rebelling and assaulting the Blackrock Foundry. Shamans were called to the forges to aid with the production of weapons and armor, and this included Drarkan as well.\n\nAs the ogres would press on, the chances of the Blackrock coming out victorious would slowly diminish, but a turning point would change the whole battle. Plans uncovered to work blackrock iron was given to the forge and foundry workers, and thus helping end the war.\n\nAfter the assault was driven back, Drarkan amongst other shamans, was selected to work at the foundry in the Slagworks, where they'd be keeping The Heart of the Mountain under control.\n\nAfter the forming of The Iron Horde as well as the fall of it, Drarkan saw little action in terms of fighting. Production increased, forcing him to work longer hours. Although a tough life, Drarkan never once complained, and only till the day that the foundry was assaulted by Frostwolf Clan orcs and The heroes of Azeroth, he had not had a single day off. \n\nHe saw little reason to resist the attackers and laid down arms. He chose to rather live to see another day and was captured.\nDue to being less of a threat and not participating in the war, Drarkan was released into Draenor once again.\n\nHe wandered through Gorgrond till he heard of a settlement with Mag'har, having orcs from all the clans gathering, and he'd take the opportunity and seek it out.\n\nHe found the place and was accepted into the group, and under the leadership of Geya'rah, he found himself in a lifestyle a bit less stressing than what he was used to.\n\nThe peace this new tribe had endured was short lived, as the Lightbound draenei ended up attacking their settlement. It was there, short after the attack had started, that a green orc came, telling of a way to survive, and as he activated a device he possessed, he'd create a portal into another world.\nDrarkan was one of those to enter, and this took them to Azeroth, where a new life owuld unfold for him.\n",
						["BK"] = 5,
					},
				},
				["BK"] = 1,
				["TE"] = 3,
				["v"] = 8,
			},
