			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-ChromieScenario-Gold:256:128}\n\n{h3:c}{col:b00006}\"When the pebble hits the glass or the glass hits the pebble, the pebble ain't gonna get hurt.\"{/h3}{/col}\n\n{h3}{col:ffffff}Physical description.{/col}{/h3}\n\n{col:fffff6}Short and stocky, Ranima is a walking doorstop even when not wearing her heavy armour. Physical strength isn't the forté of the Vulpera but this one seems an exception, a muscle clad red vixen.\n\nA scar runs down just over her left eye and onto her proud snout.{/col}\n\n\n\n{h3}History in Vol'dun.{/h3}\n\n{col:00ff61}Ranima may be known for filling in whatever tasks were needed in the few Caravans she's passed through.\n\nGuarding, fetching water, hunting for food, carrying boxes, distracting exiles, and playing a flute, badly.\n\nYou name it, she's probably done it.\n\nShe never stays for long with any caravan and usually was a positive experience.{/col}",
