			["about"] = {
				["BK"] = 1,
				["T3"] = {
					["PH"] = {
						["TX"] = "{link*https://www.youtube.com/watch?v=hKfSCSgdLJA*Voice reference - Toki Wartooth}\n\nHis frame is mostly hidden by unruly red and white fur, which pokes out of his just as red leather armour. A closer look reveals the myriad of scars the fur hides.\n\nFierce looking teeth from some exotic desert beast are attached to his gloves and shoulderguards, with enough pinkie toes left over for the front of his ankle boots.",
						["BK"] = 1,
						["IC"] = "inv_misc_foxkit",
					},
					["PS"] = {
						["TX"] = "His language, regardless of dialect, is stilted. Literal. Although there's obvious thought behind it, nuance is not something to be found in this one.\n\nBlunt and brash by nature, having a fur colour like he has tends to stereotype you as impulsive through life. It hasn't helped his tendancy to rush into matters, regardless of the odds. Some would paint him as naive, others reckless. Overall he seems very, very new to the world. ",
						["BK"] = 1,
						["IC"] = "spell_misc_emotionangry",
					},
					["HI"] = {
						["TX"] = "Not that far into adulthood, Krat hasn't known much outside of Vol'dun. Most of that time was spent within the slave pens of the Sethrak. His almost constant (and always unsuccessful) one man rebellions against his captors earned him the slightly mocking  title of \"Red Son of the Sands\" for when he would be put in the fighting pits. Such fights are something he lost count of long ago, and more often than not were to the death.\n\nLearning the harsh ways of survival in already poor conditions, he was more than ready to prove himself in the \"real world\" once he was freed from captivity shortly into the Blood War. He has no immediate want of a permanant home, preferring to travel to new experiences.",
