			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2}Arnatha Grimtotem{/h2}\n\n{col:853e00}Arnatha is one of the many Grimtotems that remained loyal to the Horde after Magatha Grimtotem's betrayal. She in particular believing that starting a war against the Horde was a fools errand.\n\nEver since then, she fought against the Alliance for resources during the remaining events of the Cataclysm. After the defeat of Deathwing and the discovery Pandaria, Arnatha joined the Horde fleet to Domination Point, where she saw the madness of Garrosh Hellscream grow and then joined Baine and Vol'jin's rebellion against the 'True Horde'.\n\nAfter Garrosh's defeat, Arnatha left militart life behind until the third invasion of the Legion. She joined a warband that was tasked in assaulting Legion strongholds across the Broken Isles. During one mission, something went horribly wrong and Arnatha and two other soldiers were the only survivors. Fortunatly, the war against the Legion would soon be moved to Argus and most of the Legion forces on Azeroth were either defeated or have retreated back to Argus. Arnatha later then, reluctantly, joined the Fourth War, where she quickly grew disgusted towards Sylvanas' ways and joined Saurfang's rebellion.\n\nAfter Saurfang's death and Sylvanas' 'dethroning', Arnatha indefinitely left the Military life behind and became a full on mercenary.{/col}",
