				["PE"] = {
					["1"] = {
						["IC"] = "inv_sword_bloodelf_03",
						["TI"] = "Equipment",
						["AC"] = true,
						["TX"] = "The elf's primary weapon is an ornate elven high poundage war bow (~200lbs) which few other individuals would likely be able to pull. The bow is about an inch taller than he is.\n\nQuiver's kept on his right hip rather than the back, filled with around 20 thick-shafted arrows with differing heads. \n\nHis favoured sidearm is a fetching elven khopesh, kept in a frog on his left hip. Judging by the looks it must've cost a pretty penny.\n\nKalithion habitually carries a survival knife, it's usually tucked away in a sheathe across the back of his belt.\n\nAlso carries a spyglass, presumably for spying.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Wary of Surroundings",
						["IC"] = "ability_warrior_revenge",
						["TX"] = "Constantly familiarizing himself with his space and those sharing it, it's unlikely you pass by without catching a glance.",
					},
					["2"] = {
						["IC"] = "inv_helm_armor_bloodelf_d_01",
						["TI"] = "Armour",
						["TX"] = "He often neglects to wear a helmet, doesn't care to have his vision obscurred or hearing impaired.\n \nBelow the neck he's wearing what looks like some pretty substantial thalassian armour, padded garments for his base layer with mail and plates fitted over them - only bare skin showing is a bit of arm.\n\nThough the fabrics worn beneath do a decent job of dampening the metallic sounds emitted while moving, he'll make a bit of a racket when doing anything with urgency.",
						["AC"] = true,
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Currency",
						["TX"] = "Doesn't carry much coin, only enough to get him some foodies should he get peckish while out and about.",
						["IC"] = "inv_misc_coin_03",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Voice",
						["TX"] = "He speaks with a peculiar accent, the result of being raised working-class and in more recent years keeping the close company of more affluent, \"posh\" individuals.\n\n(Sounds a bit like a younger Pierce Brosnan, for a reference.)",
						["IC"] = "achievement_halloween_smiley_01",
					},
				},
				["v"] = 43,
			},
			["time"] = 1614803680,
			["link"] = {
				["Kalithion-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "\n\n{h2:c}{icon:inv_misc_tournaments_symbol_bloodelf:18}   Appearance    {icon:inv_misc_tournaments_symbol_bloodelf:18}{/h2}\n\n{img:Interface\\Pictures\\artifactbook-hunter-thasdorah:350:35}Kalithion stands at an average height, athletically built with muscular broad shoulders which can be attributed to his obsession with archery. His long reddish-brown hair is usually kept from infringing in his business with a high knot, ruggedly fashioned to befit his character.\n\nHis prominent fel green eyes habitually survey his surroundings, above them\ndance some particularly expressive eyebrows who can be very revelatory, often to Kal's detriment. His substantial elf ears are no different in this regard.\n\nA smattering of freckles fall across his small nose and gaunted cheeks\nwhich aren't very distinct against his pale complexion unless in certain lights. His dainty flushed lips don't part often, usually only to convey what his visage and hands can't manage. His masculine jawline is usually left sporting a bit of scruff, trimmed and shaped to not look too unkempt.\n\nThough his work can often leave him caked in all kinds of unpleasant gunk, he'll typically be eager to find a bath and have a good soak. Personal hygiene's seemingly important to him.\n\n\n",
				},
