						["TX"] = "Hanging on the side of his waist from a belt, this pouch appears to be filled with herbs and bandages.\n\nExamples of what it contains:\n\n-Bandage rolls.\n-Small vial of aloe thistle salve\n-Earthroot\n-Peacebloom",
