			},
			["about"] = {
				["v"] = 16,
				["BK"] = 5,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-monk-cover:256:256}\n\n\n\n{h1:c}{col:73ff78}Lekai{/col}{/h1}\n\n\n\n{h3:c}{col:73ff78}Lekai is a young Vulpera who stands at around 125 Cm, making him him around average height for his kin.\n\nHis eyes are slightly upturned and has a greenish-yellow colour to them. Or to be more precise, dark chartreuse. Beneath them, dark markings can be seen, making his eyes stick out a little bit more. His snout is fairly long and thin, concealing rows of sharp teeth. On top of his head, two gigantic ears can be seen. On the tips, tufts of dark fur can be seen.\n\nHis fur comes in a mixture of multiple colours; orange, white, brown and black. The outer side of his arms, legs, ears and his entire backside is orange whilst the inner sides and the tip of his tail are white. As well, he has a white crest upon his chest, flowing down to his abdomen. His paws and front arms on the other hand are dark brown. And all over his body, black spots can be seen splattered on the fur, giving him a rather distinct pattern.\n\nBodyshape wise, Lekai appears to be rather lean and athletic, having defined muscles on his arms, upper torso and legs.\n\nThe claws on his paws are fairly long and worn from too much use. Yet, they still seem to be rather sharp nontheless.{/col}{/h3}\n\n\n",
				},
			},
