					["1"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["TX"] = "She stands slightly shorter than the average sin'dorei. Her form flows in a noticeable hourglass shape.\n\nHer skin is a soft fair shade, keeping in contrast with her raven-black hair that falls down wavy and slightly curly to the small of her back. \n\nHer eyes have recently turned to a golden colour, surrounded by long black eyelashes.\n",
