					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Perfume",
						["TX"] = "When standing close to Sylvia a soft and delicate smell of wildflowers appears to scent the air around her and on her.\n",
						["IC"] = "inv_misc_trailofflowers",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Unusual speech pattern",
						["TX"] = "Sylvia appears to have a \"different\" speech pattern than most people around her.\n\nShe tends to hold long pauses inbetween her sentences aswell as she drags out words at times, often at the end or the middle of a sentence.\n",
						["IC"] = "inv_misc_herb_starflower",
