					["4"] = {
						["AC"] = true,
						["TI"] = "Jewelry",
						["TX"] = "A glittering silver chain necklace hangs around her neck, a deep red teardrop gem beset in a pendan\n\nAround her left wrist hangs a golden bracelet with crystal stone.\n\nAround her right wrist is a silver bracelet with a small charm with an inscription.\n\nWearing a silver ring shaped like branches as a necklace usually hidden under her shirt.\n",
						["IC"] = "inv_jewelry_necklace_07",
					},
				},
				["v"] = 31,
			},
			["link"] = {
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h2:c}Physical Description{/h2}\nSylvia stands slightly shorter than the average sin’dorei. It however has always seemed to help her when it comes to her scouting job.\nHer figure has recently taken on a noticeable hourglass shape, as she has cut slightly down on her training and enjoying life more. \n\nHer face seems to always be decorated with a slight hint of makeup. She wears mascara to give her eyelashes a long and voluminous appearance and a winged eyeliner.  \n\nShe appears to be rather pale compared to many people around her, it does not seem to bother her as she however dresses up in colorful attires to make up for the lack of colour on her frame. \nIt gives a good contrast to her quite dark raven-black hair, that has a slight wave and curls to it when it is flowing free, reaching down to the small of her back. \n\nFor those who have met Sylvia for the past months would have noticed that her eyes have recently turned into golden colour.\n",
						["BK"] = 1,
						["IC"] = "inv_misc_herb_starflower",
					}, -- [1]
					{
						["TX"] = "{h2:c}Personality{/h2}\nSylvia seems to be a constant bubble of happiness. She is often seen wandering around, or even more so, running around without shoes, adorned in a flower crown and very often handing out sweets and cookies to people she meets. It appears like she does not have a single worry in her life. ",
						["BK"] = 1,
						["IC"] = "inv_misc_food_148_cupcake",
					}, -- [2]
