			["about"] = {
				["T1"] = {
					["TX"] = "Buffeting breath and concussive stomps betray the behomothic presence of a tauren warrior long before he is seen. Truly gargantuan, Argyro Silverhoof casts a long and terrible shadow over most that look upon him. From the mountainous summit of his hump to his anvil-sized hooves, Argyro's dimensions are vast,\n\nThe tauren has brawn enough to bear the burdens placed upon draught animals without a gasp for breath or any visible effort, with the span of his back swollen with thew and his chest deep and solid. His arms, swooping low with each ponderous step, are packed with eyewatering musculature, raw, savage power festooned by a thick layer of dull, argent fur. His hands are padded similarly, rough as sandpaper and big enough to crush the skulls of smaller races like walnuts.\n\nHe is outrageously clumsy, perhaps hinting at a lack of coordination or more likely a complete disregard for whatever -- or whoever -- might stand before him. The slow and blunderous gait causes the compact fat of his well-fed belly to wobble.\n\nFacially, the tauren is utterly hideous. A once noble and intelligent bovine profile has since been beaten into a ruined and tortured shape. Argyro's snout, black and glistening with moisture, is crooked from repeated breakages, and his heavy, pelted jowels are lined with shallow scars and the pits of cruel arrowheads. Eyes like two small silver coins, pale and stark, twinkle with a dark and animal cleverness. From out a mouth slathered with idiots drool potrude pestle-sized teeth stained yellow, and when the tauren pulls back the thin black line of his lips to smile, he reveals a horrific beartrap of large snapping molars, incisors and canines. His poisonously bad tempered glare affords him few friends. \n\nTo the side of the tauren's shelf-like brow are adorned his long and sturdy horns. They protrude, becoming angled, designed to shovel aside Argyro's foes with murderous headbutts. \n\nGenerally he eschews heavy metal armour entirely, finding it difficult to find armourers that cater to his taurahic frame. Instead he allows the sun to beat down on his fur, giving it a close and cloying earthy aroma. Argyro goes to war with a bag of feathered hunting javelins, but his main arm is the traditional shu'halo halberd that can sweep a section of human fighters in a single arc.",
				},
