			["about"] = {
				["v"] = 7,
				["BK"] = 11,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}\n\n\nA rather tall Sin'dorei who stands above most other elves, having to look down to speak to them and in the case of children he may occasionally crouch or kneel down.\n\nThroughout his life, Lorsterian has been described as an attractive male (even for Sin'dorei standards). His facial features are statuesque and well defined, his cheekbones slightly raised and his jaw chiselled. His skin is smooth and of a lighter shade.\n\nHe is fortunate enough to have a full set of evening black hair which he keeps mostly in a foxtail style with a few loose strands resting upon his shoulders, should his hair be untied it would fall down to just below the middle of his back. Upon his chin he sports a black goatee which only adds to his devilish charm.\n\nHis now Golden eyes, thanks to the revitalisation of the Sunwell, are slightly angular and have a calm aura about them.\n\nHis tall frame is complimented with a toned form, broad shouldered and with a defined set of muscles that did not come across as too bulky. This elf was clearly a strong and fit individual, but also did not seem to spend all his life pumping iron.\n\nWhen it comes to scars the elf was grateful to not have any marring his pristine face, however rippling across his back are a large set of ugly and crudely healed scars, the result of an attack by a lynx when he was but a child. Lorsterian has had a phobia of lynxes since that day.\n\nHis voice is that of a smooth baritone and carried with it the aristocratic emphasis and pronunciation of nobility.\n\nWhen it came to artistic flair the elf had a few personal tattoos upon his build, the first being a tribal ink that danced across his chest, the inks a mix of black of blood red. The second of the trio would be a line of Thalassian text wrapped around his right arm that read \"By Blood and Spirit we are bound.\" The final would be that of the Blood-Knight emblem work proudly upon his left shoulder.\n\nLorsterian was not one to wear too much jewelery, the only items being a family heirloom worn upon his neck and two rings, one gold and one silver, that identified his status as a married elf.\n",
				},
			},
