			["about"] = {
				["v"] = 73,
				["BK"] = 19,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n{p:c}{icon:sha_inv_elemental_primal_shadow_nightborne:25}«Our heart is mana»{icon:sha_inv_elemental_primal_shadow_nightborne:25}{/p}\n\n{p:c}{icon:achievement_thenighthold_highbotanisttelam:25} REMETHION{icon:achievement_thenighthold_highbotanisttelam:25}{/p}\nRemethion is tall, thin, and very old. The elf carries himself with an ethereal, majestic grace. He always walks in an impeccable manner, keeping his back upright and an impassive, yet determined face. While his demeanor is composed, his white eyes carry a faint shade of mischief and self-indulgence. Remethion’s face is emaciated, wrinkled, and with two dark circles surrounding his shimmering eyes. In spite of his old age, Remethion’s physique is in full health and well-trained, shaped by a life spent in the Duskwatch.\n\n___________________________________________________________________________\n\nRemethion’s magical aura is so potent that it is almost tangible even to those unacquainted with arcane magic. The old elf has been a conduit of raw arcane power for so long, that his very nature has merged with the arcane. When fully unleashed, his magical aura feels like a storm of burning heat radiating from a core of cold fury.\n\n___________________________________________________________________________\n\n{p:c}{icon:achievement_thenighthold_highbotanisttelam:25} EQUIPMENT{icon:achievement_thenighthold_highbotanisttelam:25}{/p}\n\nThe noble wears only the finest raiments Suramar has to offer, expensive and enchanted with a myriad of arcane spells, to the point that is hard to distinguish which are useful and which ones are just for show. He’s usually found wearing shades of purple, red or blue. \n\nRemethion's main weapon is the Arcan'dris, a stave with a huge leystone atop of the shaft.\n\n___________________________________________________________________________\n\n{p:c}{icon:achievement_thenighthold_spellbladealuriel:25}WHO ARE THE LASTARIL?{icon:achievement_thenighthold_starauguretraeus:25}{/p}\n\n«A learned society is closer to the truth and to the realm of order. And once we have attained knowledge, we’ll wield enough power to give birth to a new great civilization, whose power will know no bonds, no limitations.»  \n{p:r}-Lady Elindre Lastaril{/p}\n\nTHE ORIGINS\nA family of renown arcanists, the first records of the Lastaril mention them as members of a highborne sect who excelled at acquiring ancient relics and artifacts, Elisande's very elite.\n\n___________________________________________________________________________\n\nSYMBOL\nTheir symbol is Xarok, a mythical spellwing who saved and defended Lady Elindre Lastaril from a group of zandalari long ago. It is considered a symbol of good omen among other shal'dorei. Associated with mystical properties, the creature stands a bridge between this world and the magical one, and is viewed as a testament of the arcane prowess of the Lastaril.\n\n___________________________________________________________________________\n\n\nTHE SUNDERING\nDuring the War of the Ancients, Astralis Lastaril and Elindre Lastaril succumbed while fighting the Burning Legion. Elindre sacrificed her life to teleport her sons in Suramar, where they would have the difficult task of rebuilding what was lost.\n\n___________________________________________________________________________\n\nSURAMAR\nAnd rebuild they did. Aesther became the head of the house while Remethion joined the Duskwatch, interested more in duty than political influence and intrigue. Over time, their devotion to Suramar would pay well, with Remethion becoming one of the finest warpmancers in the city, and Aesther serving her Grand Magistrix as Arcanist of the city.\n\n___________________________________________________________________________\n\nINSURRECTION\nDuring the civil war of Suramar, the House has lost much of his ancient prestige, and its very fortune was destroyed. Lord Aesther himself has been murdered by demons. Rumor has it, Remethion was responsible for his brother's demise.\n\n\n\n\n\n",
				},
