						["TX"] = "A strange looking glaive is slung across the orcs shoulder with finely honed blades on either side, that seem to glow faintly in a light crimson colour.\nA finely made belt is slung about his waist with a hunting knife slung into the front and a set of bola at one side.\nA minature crossbow and bolts can be seen in a small pack, along side some bolts, regents and rifle ammunition.",
