					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Armour",
						["TX"] = "The orc wears armour , which seems to be partialy fashioned from the fur and bones of slain beasts, along with finely crafted, metalic gauntlets, boots and pauldrons.\n",
