			["time"] = 1614811428,
			["link"] = {
				["Lugark-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}History{/h1}\n\nBorn in Mag'har village, shortly before the events of the second war Khagra would grow up in the recently torn appart world of Outland. Being one of the last uncorrupted members of the orignal Bleeding Hollow clan, he clung closely to the anchient practices of his people, learning the blood rituals of his people, though he found his true passion in hunting the deadly creatures and demons that roamed the broken world.\n\nIn his teenage years he would follow a young orc named Hellscream to the world of Azeroth. In this new world he would assist the Horde, focusing his attention on fighting the Searing Blade and other Demonic cults in the new world. The young orcs hatered for both Demonic influence was already clear at this time, however another mortal enemy would be identified before long.\nDuring the Northrend campaign, Khagra would accompany Hellscream, fighting as part of a gurilla strike force on the frozen continent, doing battle against the Scourge and the Allience. In this time he lost many comrades on the battlefield, causing a bitter hatered to form against the Allience in particular.\n\nUppon the end of the Northrend campaign, Khagra's war would not be close to over. He would continue to fight at the spearhead of Horde opperations throughout the Catacysm and the Invasion of Pandaria.\n\nIt was some time during the conflict of Pandaria that Khagra became more than just an average orc, recieving mild alchemical enhancements, using ancient blood rituals from the Bleeding Hollow, giving him enhanced sences and a slight enhancement in healing factor. These enhancements would cause him to become known as the \"Blood Hunter\". These abillities would be useful when he stood with the Kor'kron to face down the Horde traitors and defend his Warcheif. In a skrimish he was severely wounded and knocked unconcious, which would put him out of action till the end of the seige. \n\nHe would mange to free himself shortly after and join up a Kor'kron remnant, attempting to reunite with their Warcheif on alternate Draenor. However after traveling to Draenor he would become distracted by personal interests, joining up with his people in the Bleeding Hollow, learning more of his people as fighting to defend them.\n\nHowever he lost faith in them after Kilrogg consumed the demon blood again, changing sides and rejoining the Horde to bring down the new Fel Horde. He would then return to Azeroth to fight the Legion and later the Allience during the Fourth War.\n\n\n\n\n\n\n\n",
				},
