			["about"] = {
				["BK"] = 3,
				["T3"] = {
					["PH"] = {
						["TX"] = "Even at a brief first glance, it's apparent Sylnoora is quite different than many blood elves. A tiny elf with an usual look to her - with shorter ears than usual, what could be the reason?\n\nHer delicate figure against the Silvermoon sun appears as as a slightly tan, glimmering golden color. If you were lucky enough to meet her gaze, her almond emerald green eyes resembling a fel crystal would capture your attention immediately. However, that is almost too rare of an occurence, as she is usually seen looking down, fidgeting and avoiding any eye contact at all costs. \n\nHer heart-shaped face with rosy, freckled cheeks always presented an amiable and innocent look - despite her unusual shyness. Fiery red hair flowed gently with loose curls to her mid-back, more often than not wore in a single braid. \n\nUsually seen wearing a big green crystal pendant adorned by fine gold filigree, and matching emerald green earrings. \n\nLike many of her unfortunate race, she can be seen wearing slightly faded scars that is usually hidden away under her clothing.",
						["BK"] = 1,
						["IC"] = "achievement_character_bloodelf_female",
					},
					["PS"] = {
						["TX"] = "Half filled with friendliness and half painfully shy - Slynoora crave solitude yet also craves people. Her clashing personality can sometimes come across as obnoxious - too eager, almost childlike. Other times, however, she can be seen holding herself with reserve.\n\n",
						["BK"] = 1,
						["IC"] = "ability_mage_invisibility",
					},
					["HI"] = {
						["TX"] = "First daughter of a respected war mage, Sylnoora has always been brought up around magic - showing affinity for arcane before she was considered just a mere child. Younger sibling of two rangers, and older sister of three other siblings, she grew up as the middle child in a relatably big, boring family - until the Third War. After losing her father and older brothers at the hands of scourge, like many other of her race, Sylnoora relocated from one place to another in the surrounding forest of Silvermoon, until she started working as an apprentice to the Instructor Quithas in the city. \n\nAt the moment, Sylnoora is furthering her research into Divination, Illusion and Enchantment with the Kirin Tor while assisting studies in Abjuration and Evocation.",
						["BK"] = 1,
						["IC"] = "inv_inscription_80_warscroll_intellect",
					},
