					["TX"] = "Born in Alterac Mountains, the Winterax Tribe was all he knew and all he had. Ten years ago, Tiekke was expelled by his former tribe and seeks a new place within the Horde.\n\nTiekke's main Loa is Quetz'lun, the slain wind serpent Loa of vengeance. Which he wholeheartedly worships, believing one day she shall return from the Other Side and strike down all of her enemies. Definitely a cannibal.\n\nExpelled at the very young age (17) for not being a warrior type of personality, he rather found an interest in the heavenly objects and prophecies. Some of these so called visions happened to be completely incorrect, some of them were indeed correct. The Winterax tribe, however, cannot afford to waste their time on dreams of some weak troll individual.\n\nIronically, in order to survive outside the Winterax tribe, Tiekke had to become a mercenary.\n\nFighting for the Horde doesn't mean to fully embrace it. He hates most of the Orcs, the Undead and even the other Troll tribes being considered as weak by the Winterax. Unfortunatelly, your roots always show off.\n\nAs a shapeshifter, he focuses on the Voodoo and astral magic. His keen interest is the celestial bodies and their movement in the sky. He knows the nature and its cycle well, but he is not a peaceful druid like other followers of this path.\n\nHe finds an interest in Troll males, but always keeps his distance and reacts with strong distrust.",
