			["about"] = {
				["BK"] = 1,
				["T3"] = {
					["PH"] = {
						["TX"] = "A figure wreathed in a frigid mist, threatening to darken the flames that draw near and freeze the very ground beneath her feet. Even the waters do not give way for her to sink in demise.\n\nTiabel is pallid in skin tone with undeath not being most kind to her form. Her eyes locked in a forboding cold stare and completely unable to express facially as her face is utterly paralysed.\n\nThe armour she wears teeters on the balance between grim and elegant. Silver and bone adorns this Saronite armour, a mix of Scourge and Sin'dorei elements. More noticably, she wears the tabard of the Ebon Hold.\n\nTiabel's weapons as a choice is a pair of runed long swords, riddled with runes that emanate an unearthly cold that threatens to do the same as her mere presence.\n\nBeing near Tiabel is akin to being in the peaks of a mountain, being more noticable the closer one gets.",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Tiabel as an individual is unnervingly distant to the living, similarly she has the personality of a rock- only feeling anger or hate. She only ever approaching someone for query and can be straight to the point with her intent. Additionally she will occasionally refer herself as \"this vessel\".\n\nShe is unrelentingly loyal to the Ebon Hold, and equally so to those who would have her in their colours.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Tiabels history is lost to time, asking will not yield results. But those willing to look into the soul bound to her undead form may find something.\n\nNeph'owyn: (To) stand forever.",
						["BK"] = 1,
					},
				},
