					["PS"] = {
						["TX"] = "Lax and relaxed, one who just wants to enjoy life and spread good times to all who need them. Often easily swayed from serious talks or hard situations, she tries to help people through the miracle of good vibes and great drinks.\n\nStill a Goblin at heart, she does get a laugh out of explosions and, while not a greedy one for gold, she hates getting a raw deal from merchants, opting any method to get them to give fair prices.",
						["BK"] = 2,
					},
					["HI"] = {
						["TX"] = "Born in Orgrimmar as a lone child of the Bottlerocket family, daughter of the workaholic toy-seller in Orgrimmar. Learned her warlock arts being friends with a childhood Orc friend name Arnak in The Drag. Has since gone on to move out and live in her own place in Ratchet.\n\nSince then she's mostly been living life to the fullest, and plans to continue to do so. Her aspirations are minimal, otherwise.",
