						["TX"] = "Minph has spent her entire life studying the dangerous arts of the arcane. Hard work and raw affinity has resulted in a skillful mage with a potent magical aura around her. Her form shimmering strangely on rare occasions. \nNow left to her own machinations, what will she do with such power?",
						["IC"] = "Spell_Arcane_Arcane04",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Equipment",
						["TX"] = "Staff:\nDesigned by herself, Minph's new mage staff brims with power! Charged runestones hovering at each end, supported by light, finely crafted steel with a high affinity for magic! She keeps it on her usually, hidden away by illusions.\n\nTome of magic:\nMinph always has a huge book with her. It appears enchanted and brimming with magic! She's often found reading in it and it is always kept close by.\n\nBelt and pouches:\nOften strapped along her travelling gear is a belt with many pouches and flasks! The majority of which are enchanted or magical in some other way.\n\nMagical backpack:\nMinph's magical backpack appears light and expensive, definitely just as magical as all her other stuff. Is it bigger on the inside?",
						["IC"] = "inv_misc_treasurechest04b",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Makeup",
						["TX"] = "Minph is always keeping her face fresh, clean and pretty! Subtle yet elegant makeup paired with lipstick and eyeliner ensures she's always presentable!",
						["IC"] = "achievement_FemaleGoblinhead",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Expensive looks",
						["IC"] = "racial_dwarf_findtreasure",
						["TX"] = "Minph seems to be donning both expensive clothing,  rings and piercings made of gold and gem studded. She's certainly not lacking in coin!",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "A Portalmaker",
						["TX"] = "In a recent elaborate coup for the power over her Goblin mage-family, Minph has effectively seized control of everything regarding the Portalmakers. Acting as the new head she has already been cleaning up in her family's shady past!",
						["IC"] = "spell_arcane_portaldalarancrater",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 1,
					["5"] = 0,
					["4"] = 1,
					["6"] = 0,
				},
				["v"] = 55,
			},
			["time"] = 1615504234,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["v"] = 70,
				["BK"] = 11,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\n\n{h3:c}{col:e60005}A Goblin woman with average height but a softer build. She sports this softer figure probably as a side-effect of her addiction to sweets and good food! Causing a small wobble with each step she takes! Her face is clean, with makeup and a few freckles. Several golden, gem-encrusted piercings in both her ears and nose. Curly, soft, purple hair sprouts from her head, reaching her shoulders but usually kept up in tails or a bun. \nInquisitive and curious she seems to always be on a mission, a quest to learn something new or plotting a scheme! And with her arcane powers she hasn't met any big obstacles yet. Perhaps that is to change?{/col}{/h3}\n{img:Interface\\ARCHEOLOGY\\ArchRare-TheInnKeepersDaughter:512:256}\n{h3:c}{col:e280ff}After extensive and methodical planning, Minph managed to pull off a crazy coup on her family's ruling Elders. Removing them from their positions of power and placing herself in their stead. It was not without its complications, but Minph has emerged stronger than before now looking to clean up the dark shadow cast by her family while also looking to the future from a new perspective. Where will she go from here?{/col}{/h3}\n{img:Interface\\Pictures\\artifactbook-mage-cover:256:256}",
				},
			},
