				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}History{/h1}\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-38:64:64}\n{icon:spell_nature_agitatingtotem:25}Born of the (now almost extinct) spiritual leaders of the Skychaser Tribe\nHe did not suffer the same fate as his elders, due to living away from Thunderbluff as a mad hermit{icon:spell_nature_agitatingtotem:25}\n\n{icon:ability_mage_massinvisibility:25}Spent most of his life being a hermit, communing with spirits and often times crossing over to the spirit realm. And hunting and taking care of himself the way a hunter gatherer hermit would, Living in tents and shelters etc. Living off the land the right way (in his eyes)...{icon:ability_mage_massinvisibility:25}\n\n\n{icon:spell_hunter_aspectofthehawk:25}Tauwodi meaning hawk (Tawodi in native american Cherokee), was given this name at birth, due to the village he was born in, who all had a vision of a hawk around the time of his birth (perhaps early symptoms of his later shamanic calling{icon:spell_hunter_aspectoftheironhawk:25}\n\n\n{icon:inv_misc_pelt_09:25}This Shu'halo (Tauren in Taurahe) used to have a majestic golden bright fur.\nHowever in a trip to the spirit realm, something went wrong and he didn't come back for what seemed to be an eternity. \nBy the time he re-entered the material realm it was to his shock, that no time had passed at all..\nThis ordeal had taken such a strong toll on the connection between his body and soul being separated for so long (Also might have just been due to severe traumatization). Due to this, this Shu'halo now has an unnaturally pale (white) fur{icon:inv_misc_pelt_10:25}\n\n{icon:vas_guildfactionchange:25}Born into the horde, he has now left it and sees him self as a (Faction) neutral spirit guide{icon:vas_guildfactionchange:25}\n\n```````````````````````````````````````````````````````````````````{col:ff0028}\n````````````````````````````````````````````````````````````````````{/col}\n\n{h1:c}Characteristics{/h1}{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-35:64:64}\n\n{icon:achievement_character_tauren_male:25}He's anywhere from a true neutral, to a chaotic good, edging more to the true neutral focusing more on wisdom instead of \"petty squables\"\n\nHis hermit lifestyle allowed him to develop a dual sided attitude from the spirits he communed with so much.\n\n1 A more introverted, dutiful, responsible and wise attitude, with a healthy detachment from the ones he helps in a more serious manner like most other spiritwalkers.\n\n2 Of a more extroverted, manic, loose and outgoing attitiude, who has learned to take life not too seriously all the time from the spirits.\n\nKeep in mind however that one can never be certain what spirit or energy urges him to act at any time, in any way{icon:achievement_character_tauren_male:25}\n\n\n\n````````````````````````````````````````````````````````````````````{col:000dff}\n````````````````````````````````````````````````````````````````````{/col}\n\n{h1:c}Spiritual Characteristics{/h1}\n{img:Interface\\Pictures\\artifactbook-shaman-cover:256:256}\nThis Shu'halo  embraces and walks in the footsteps of the spiritwalkers of old and thus is in close connection with the ancestors\n\nDespite this, he isn't known to use ONLY the traditional way.... \n\n\n{h3}A combined path{/h3}\n{icon:ability_ardenweald_priest:25}He's started looking into the abilities of the mistweaving monk. Manipulating and using the power of spirit himself directly instead of asking for other spirits to do it for him.\n\nTauwodi is starting to incorporate the things he has learned over the years from his own way, now with the teachings of the inner chi.\n\nEver Expanding, he's starting to look into the miraculous powers of the light as well. More specifically the sun-seers \"{col:8002ff}***{/col}\"{icon:ability_ardenweald_priest:25}\n\n\n`````````````````````````````````````````````````````````````````````\n\n\n{icon:spell_shaman_astralshift:25}Spiritwalkers are believed to be the ill omen of a coming age\nDespite this spiritwalkers are held in near reverence by their people\n\nLike most spiritwalkers he is a loner set apart from his others. He knows his friend not only as his friend, but as the child of a slain warrior spirit, as the grandchild of an elderly spirit, as the parent or sibling of a mournful child spirit. This makes any personal relationships complicated and very difficult.\n\nProviding guidance and spiritual sanctuary to their community in times of the greatest peril and uncertainty is the spirit walker's sacred calling. These transcendent shamans channel the collective life's experiences of all the generations that preceded their own through their mortal frames, calling upon this sacred communal soul to attain profound wisdom and insights. \n\nHe doesn't however only embrace his ancestors, he channels all that come to him and believes that all spirits, elements and forces are all part of the cosmic whole and balance. \n\n\nThe spirit walker lives only partially in the mortal world. His mind roams freely, and countless personalities enter his memories and his thoughts\nBecause of this he will not always be found acting the part of wise mystic but sometimes more of a madman contributing to him being more of an outsider amongst his kind\n\nWhen speaking to a spirit walker one can never be truly certain that only the spirit walker responds, for they speak with the voices of the spirits..\nNor what spirit rouses him to action.\n\nDue to this, he can sometimes be found in spiritual states questionable and undesireable to others. This end ups in him keeping interesting company at times\n\n\nThe spiritwalker walks through all times and the spirit realm knows no time\n \nHe can be often found walking in a more ethereal form not wishing to become too attached to the material realm or the ones in it\n\n\nBeing a mortal spiritual guide to this realm, it is most likely this Mystic will continue to do what he does in this life as well in the next one...\n\nIn the end he truly is most blessed and most cursed by the spirits. {icon:spell_shaman_astralshift:25}\n\n\n````````````````````````````````````````````````````````````````````{col:00ff22}\n````````````````````````````````````````````````````````````````````{/col}\n{h1:c}Desires and opinions{/h1}\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-93:64:64}\n{icon:artifactability_balancedruid_newmoon:25}He has no desire of solving the petty squables of most mortals and sees it as the usual chaos that eventually results in balance (in the end){icon:artifactability_balancedruid_fullmoon:25}\n\n{icon:inv_hordewareffort:25}He doesn't care about the struggles between the alliance and the horde has no real place on their battlefields. He wishes to uphold the original reason why Thrall created this horde: To create harmony and peace between the horde and the denizens of Azeroth. \n\nHe however often enough sees that the fellow members of the horde are lacking in the possession of this virtue and desire\n\nThus he deems that most of the horde (and the alliance) are failures, who give in to the blind bloodlust and the us versus them mentality that only creates more unbalance and go against the very thing the horde's supposed to stand for.{icon:ui_allianceicon-round:25}\n\n\n\n``````````````````````````````````````````````````````````````````{col:ba00ff}\n````````````````````````````````````````````````````````````````````{/col}\n{h1:c}Lore on spiritwalkers and partial inspiration to the texts above{/h1}\n{img:Interface\\ARCHEOLOGY\\ArchRare-AncientShamanHeaddress:512:256}\n{link*https://wow.gamepedia.com/Spiritwalker*I put a link instead, due to profile file getting too big}\n\n``````````````````````````````````````````````````````````````````\n**********************************************************\n\n{h1:c}Themes{/h1}\n{img:Interface\\ARCHEOLOGY\\ArchRare-TrollDrum:512:256}\n\n{icon:spell_shaman_astralshift:25}{link*https://www.youtube.com/watch?v=d-r_xA7FPCQ&ab_channel=P%C3%A1ssaroTrov%C3%A3o-SonsAncestrais*Spiritwalker theme  (Native american flute music + Tibetan)}\n\n{icon:inv_armor_tauren_d_01helm:25}{link*https://www.youtube.com/watch?v=XHdOSMpZ1_w&ab_channel=SaturaStramoine*Tauren theme  (Pure Native american flute}\n\n{icon:ability_monk_counteractmagic:25}{link*https://www.youtube.com/watch?v=rP9uuuhEx5M&ab_channel=FOND%2FSOUNDi*A combined path theme  (Traditional Japanese + Native american }\n\n{icon:ability_paladin_beaconsoflight:25}{link*https://www.youtube.com/watch?v=xBLWetfj8E0&ab_channel=WuWei*Ecstatic heart theme  (Native american + Tibetan}\n\n(Most of this music starts off pretty slow and relaxing and starts picking up more later)\n\n\n\n\n\n",
