			["link"] = {
				["Damnedlion-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "\n{h1}The Jewels of Edlion{/h1}\n\n10,000 years ago, the first night of the seige of  Zin-Azshari was attacked, an astromancer{col:341bff} Nallath Endalah'Nore{/col} witnessed three stars flicker as if to die. As he and his colleages peered up, they saw one star, yellow like our own fade and die, consumed by the void. The second, an energertic white star burst into green fel flame, the third was a red giant, dying of ripe old age exploding into a supernova and collapsing dormant.  He recorded the light of these stars in 3 jewels and fled the beseiged city. \n\n{h2}Coming to SIlvermoon{/h2} \nNallath and his family joined{col:2022ff} Dath'Remar{/col} and the Highborne to sail to Tirisfal and Quel'Thalas where he took up the profession of gemologist using leylines to grow \"natural crystals\" as opposed to cutting them. After a series of lucky commissions, he was comissioned to create some of the crystals that you still see in Silvermoon today. Despite the wealth and lands and wives, his prized posessions were the three jewels where the light of the three suns resided until recently.\n\n{h2}The Decline of House Endalah'nore{/h2}\nNallath had three older children who, being spoiled and entitled, bought themselves their own houses and promptly began to bankrupt their father while (insult to injury)  changing their names and breaking the large house wealthy into three separate considerablyless wealthy houses:\n\nEth'lore, \nMath'lanore\nEdlion\n\n{col:221dff}Marithol{/col} the grand daughter of Nallath and matriarch of House Ed'lion was the closest to her grandfather and gave back part of her dowry to her now penurious papa. After a disasterous experience in Dalaran, she came back truly humbled and moved into the countryside. When Nallath began to fade away she took care of him to his last.\n \n\n{h2}The Scourge of Silvermoon{/h2}\n\nThe entire houses of Eth'lore and Meth'lanore and most of Edlion were eradicated during the scourge of Silvermoon. 248 petty nobles, rangers and mages in those houses were killed by Arthas and his liches. The only survivor of a once historic house was a 30 year old elf, a baby really by elf reckoning.\n\nDath'aman is now the last scion of the house Edlion  that was completely whiped out during the scourge of Silvermoon. When that dread day came, Dath was many leagues away learning to be a courier in Stormwind. \n\nWhile he has no house to represent, he is of noble birth and carrys himself with poise and grace as one of high standing. He has inherited a condominium in Silvermoon as well as a collection of gems and naturally grown (not cut crystals). \n\n{h2}A Checkered Past{/h2}\nDath has had dark past dealing with warlocks and demons of which he is ashamed but after 5 years of being a squire for the Argent Crusade, he beleives that he has atoned for his mistakes. \n\nDath served on the front line during the invasion of Suramar by the combined elven forces but was greivously wounded during the Assault on Nighthold and was not involved in the defeat of the Legion or the fourth war, so called the Battle for Azeroth.\n\nDath is a follower of the church of the light and has never partaken in fel magic. \n",
