			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Description:\nTall, strong and imposing. He has grown both stronger and wiser with the years.\nThe tips of his tusks appear to have been coated with, now dry, blood.\n\nHe's earned a great deal of scars, proof of his appetite for battle. He may be past his prime youth, but there is no mistake that he is strong, brave, honourable and terribly stubborn. \n\nHe walks with a heavy but proud stride, displaying a fierce presence that commands respect and will simply shoulder away anyone unfortunate enough to get in his way.\n\nCurrently wearing a heavy type of Horde-style armor, a well worn and used set but one that inspires both fear and respect. \n\nHe is tatooed with the symbol of the Warsong clan to clearly mark his roots, seen on his left shoulder if not covered. \n\nHis table manners are also awfully terrible..\n\n------------------------------------------------------------------------------------------------\n\nHistory: \nThe son of Kulrakh Bloodfang ,born and raised in the Warsong clan, Durgrol only had a short childhood among his clan before contracting the Red Pox. \n\nAs a result he was placed among the quarantined in Garadar. His father told him this was his test of worthiness, he would either fight through the sickness and emerge alive, strong and a member of the Warsong, or he would die, weak and forgotten.\n\nSuffice to say, this painful struggle came to build a massive wall of stubbornness with the young orc, drawing inspiration on the tales of how his fellow clan folk would spit and roar in the face of death in defiance.\n\nDurgrol did survive and crushed the sickness within himself but by that time, the Warsong clan had already passed into Azeroth and he was left with only a few of his fellow clansmen on the broken world of Outland.\n\nNot willing to give up or let himself die as the world itself once had, Durgrol joined those strong enough to fight in the defence of Garadar, using the Warsongs legendary hit-and-run tactics to push back eventual attacks from the various ogre tribes and broken draenei.\n\nWith the coming of the Dark Portal’s reopening and the reunion for the Mag’har with their green-skinned kin, Durgrol came to Orgrimmar and was amazed of how the Horde had not only survived but grown into a great force.\nDurgrol would follow the events of the Horde as the time passed and he noticed, with joy, how Garrosh Hellscream rose to power.\n\nHowever, Hellscream's true colours and nature, did much to put a huge dent in both Durgrol's pride as well as trust. \n\nThese events has left him somewhat bitter, yet he now fights with determination to preserve what remains of the Horde’s glory and honour as well as also for the preservation of a place to call home.\n\nHe is the current patriarch of the Bloodfang line, until his own son, Dragul, or daughter, Shagara, surpass him as leader of his bloodline.\n",
				},
