			["about"] = {
				["v"] = 22,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:00f8ff}BACKGROUND:{/col}\nAt an undisclosed time, somewhere prior to the Orcish invasion of Azeroth in the northern regions of the Eastern Kingdoms, an unnamed band of mercenaries were scraping by. A beautiful elven woman who had run afoul of the law, had been running with this band for a couple of years. \n\nA young man from the kingdom of Stromgarde had also found himself on the run and fallen in with the crew. Though their stories were similar, it took the man many years before eventually convincing his beloved Alreana that they were meant to be. From this union a young boy was born.\n____________________________________________________________________\n\n{col:00fbff}DESCRIPTION:{/col}\n\nAllarin Evenheart stands at a height of 6'5 feet. His physique is lean muscled and well defined, courtesy of a rough life. His hair, when grown out, is more coarse than one would expect, and often styled in one of several different ways. \n\nHis eyes glow vibrantly yellow, so much so that it can at times be difficult to see his pupils. His right eye has lost its shine.\n\nHis mixed heritage unfortunately counter-acts the so often praised elven beauty of his mothers side, leaving him with marked cheekbones, a strong jaw and slightly too plump nose and lips, the latter of which he sometimes tries to conceal by growing his beard out. Not that it does anything to hide what he is, as anyone with half a brain can tell that his ears are far too short for a full-blood Quel/Sin'dorei.\n\n------------------------------------------------------------------------------------------------\n{col:27ff57}GUILD EVENT INFO:{/col}\n\nROLE: Healer - /roll 1-6 if attempting to heal someone. Roll 1-4 if doing damage.\n\nHP: 16/16\n\nPERK (Active): Power Word Shield - Protect an Ally from 4 or less Damage this turn /// Exhaustion: 2 rounds\n\n\n\n\n",
