					},
					["HI"] = {
						["TX"] = "Born in Fairbreeze to a Mother and Father and a Brother ( Vitos Amberlight. )\nCam used to aid in his fathers herbalism buisness that supplied the apocatherys of Silvermoon. This is where he got his initial love of plants and their uses from.\nFrom a young age he had a knack with animals, mostly of horse variety, making friends with the occaisonal alliance messangers mule. \nDuring his teenage years he took up archery and became quite good at it. never top of the class but good enough to win a fight.\nthroughout his years Cam has befriended Druids and other hunters like himself, who have a passion for nature. \nDuring his expiditions he has also tamed a small amount of creatures which he dotes after.\nIn the present, he assists where he can in mercenary missions where he puts his gift of herbalism and his gunnery skills to use.",
