				["T2"] = {
					{
						["TX"] = "{p:c}{icon:trade_archaeology_delicatemusicbox:25} -||||Audio||||- {icon:trade_archaeology_delicatemusicbox:25}{/p}\n\n{p:c}Voice: {link*https://www.youtube.com/watch?v=y0ygaGGe0Jw*Rocket Raccoon}\n\nTheme: WIP{/p}\n\n\n",
						["BK"] = 1,
						["IC"] = "trade_archaeology_delicatemusicbox",
					}, -- [1]
					{
						["TX"] = "{p:c}{icon:inv_misc_hearthstonecard_legendary:25} -||||Character Art||||- {icon:inv_misc_hearthstonecard_legendary:25}{/p}\n\n{p:c}{link*https://i.imgur.com/VjuZ0VJ.png*Zax} by {link*https://www.deviantart.com/wow-baby/gallery/*wow-baby}{/p}\n{p:c}{link*http://www.argentarchives.org/files/imagecache/gallery_main/gallery_image/Screenshot 2020-04-17 at 15.17.46.png*Zax and Dex!} by me{/p}\n{p:c}{link*https://cdn.discordapp.com/attachments/703558504480505989/753395686967345234/zaxartyparty.png*Captain Zax Price} by me{/p}\n",
						["BK"] = 1,
						["IC"] = "inv_misc_hearthstonecard_legendary",
					}, -- [2]
					{
						["TX"] = "{p:c} {icon:inv_frostwolfpup:25} -||||Carcanet of the Wolf||||- {icon:inv_frostwolfpup:25}{/p}\n\nThis is worn around Zax's neck as a necklace. It shows his affiliation with The Frozen Paw Clan. It also shows his achievements in the form of small beads threaded onto a leather cord.\n\nBeads:\n- A blue bead with a white paw on it.\n- A silver bead with a white paw on it. (Overseer)\n- A small Silver Axe. (Warrior)\n- {link*https://cdn.discordapp.com/attachments/344066312705671168/631258461358915605/CotWah_United_We_Stood.png*Bead of the Forth War}\n- White Eggie bead (3 Vivian Farm Points.)\n- Brown Eggie bead (6 Vivian Farm Points.)\n- A wooden bead with a white fist on it. (3 Training Points)",
						["BK"] = 1,
						["IC"] = "inv_frostwolfpup",
					}, -- [3]
					{
						["TX"] = "{p:c}{icon:Spell_Misc_EmotionHappy:25} -||||Personality||||- {icon:Spell_Misc_EmotionHappy:25}{/p}\n\n{p:c}Personality Inspiration: A mixture of {link*https://i2.wp.com/kakuchopurei.com/wp-content/uploads/2019/07/borderlands_tinytinathenandnow.jpg?fit=1280%2C720&ssl=1*Tiny Tina} and {link*https://www.usajacket.com/wp-content/uploads/2019/04/Guardians-Of-The-Galaxy-Vol-2-Rocket-Raccoon-Vest.jpg*Rocket Raccoon}\n\nZaxzil is a bit over the top and a bit forward, a typical Goblin some might say. However along with his over the top attitude he can be quite the loving person in his own silly and stupid way. \n\nHe is extremely loyal to his friends and loves all of them. Even considering a select few as his real family, be they Goblin or other. He cares for all of them, even stepping out of his way to make them happy.\nZaxzil enjoys people who can take a joke and have fun and not get offended. He would often make a joke about his own appearance and life just for the sake of making people laugh. \n\nAlthough Zax can come off as an oblivious goof ball he is actually quite smart. Knowing his way around most, if not all machines and equipment. He is known for making things that even he can't explain afterwards.\nEven though Zax enjoys making things, another of his passions is blowing things up, whether that be buildings, people and so on. He knows his way around any sort of explosive from a grenade to a rocket and if someone were to mention the word explosion or bomb. It would send him off his rocker and he would probably try to blow something up.\n\nBeside his goofy and comedic nature he can also be quite serious when the time permits, however a joke may pop out every now and then.\nZaxzil isn't afraid to speak his mind, if he doesn't like something or someone he will say. For he might as well say it now to save the pleasantries for the next time. However his mind might be swayed overtime, just like any other person.\n\nAlthough Zax is an all around lighthearted and humorous person, he has his moments of dark thoughts and loneliness, however he usually buries these feelings as he would rather people not see him this way. Zax only opens up to people that are close to him and have earned his trust, such as the people he calls family. \n{/p}\n",
						["BK"] = 1,
						["IC"] = "spell_misc_emotionhappy",
					}, -- [4]
					{
						["TX"] = "{p:c}{icon:INV_Misc_Bomb_04:25} -||||Appearance||||- {icon:INV_Misc_Bomb_04:25}{/p}\nHe green\n\nWIP",
						["BK"] = 1,
						["IC"] = "achievement_goblinhead",
					}, -- [5]
					{
						["TX"] = "{p:c}{icon:inv_leather_raidroguemythic_s_01_belt:25} -||||Utility Belt Items||||- {icon:inv_leather_raidroguemythic_s_01_belt:25}{/p}\n\n-Tools-----------------------------------\n\n-Buzzbox: This is a small radio that Zax can use to send messages or receive them, given he is on the same frequency as the other person.\n\nExplosives: The only explosives Zax keeps attached to his belt would be small explosives such as Grenades. \n-The contents of these grenades could range from: Regular, Shrapnel, Sticky, Incendiary, Shock, Azerite Infused. \n\nThe three basic tools that can be found on his belt can vary, however they usually consist of:\n-Interchangeable Screwdriver\n-Adjustable Wrench\n-Extendable Blow Torch\n\nNote: See the weapon glance for details on the pistols.\n\n-Pouch Contents--------------------------\n\nThe weapon he carries determines the ammo he has on his person. \nAmmo Types:\n -Rifle Bullets: Regular, High Powered, Shock, Azerite Infused.\n -Small Propelled Grenades: Regular, Shock, Azerite Infused.\n -Rockets: Regular, Azerite Infused.\n -Pistol Bullets: Regular, Azerite Infused.\n\n-Cigars: \nThese usually consist of any brand he can get his hands on. Whether by legal purchase or by other means.\n\n-Money Pouch: \nAs suspected this is one of the most secure pouches upon his person. His skills have allowed him to create such a secure money pouch it is as if he was carrying around his own little safe.",
						["BK"] = 1,
						["IC"] = "inv_leather_raidroguemythic_s_01_belt",
					}, -- [6]
					{
						["TX"] = "{p:c}{icon:inv_misc_coinbag02:25} -||||Backpack Items||||- {icon:inv_misc_coinbag02:25} {/p}\n\nShould someone look into this backpack, it would all just seem a big mess with no order at all. They would be wrong.\nThe contents of Zaxzil’s backpack can vary depending on the mission type. However his backpack usually contains:\n\n-Backpack Main Storage------------------------------\n\n-The rest of his tools and equipment used for tinkering, they line the inner walls of the backpack in their own personal spots. Along with boxes of nails, screws, bolts etc. Accompanied by some scrap for repairs while out on the field.\n\n- Any leftover space would most likely be filled to the brim with his many explosives and other devices. Larger and more deadly than the ones he keeps attached to his belt.\n\n-Backpack Pouch Contents-----------------\n\n- Zaxzil has personally made sure there is a special pouch for any of his most precious snacks, ranging from: sweets, crisps, biscuits and the occasional fizzy drink.\n\n- There is also a handy notebook and goblin pen stashed away in its own little pouch for those sudden ideas that might pop into his head.\n\nWIP",
						["BK"] = 1,
						["IC"] = "inv_misc_coinbag02",
