				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Rain:512:128}\n(Very rough work in progress -- most likely will have typo's somewhere but will edit)\n\n{icon:inv_ferret_light:25}{icon:inv_first_aid_70_medicalkit:25}\n\n{h1}{col:008c7f}~Contents~{/h1}{/col}\n{h1}{col:006b61}-------------------{/h1}{/col}\n\n{col:006b61}{icon:achievement_bg_dg_master_of_the_deepwind_gorge:25}About - Quick overview of Romura's personality. {col:494949}(Current Work in Progress){/col}\n\n{icon:inv_inscription_scroll:25}History - Complete history of Romura and how she came to be the person she is today. {col:494949}(Current Work in Progress){/col}\n\n{col:006b61}{icon:achievement_guildperk_everybodysfriend:25}Personality Traits - Good, Bad, Hobbies etc.{col:494949}(Current Work in Progress){/col}\n\n{icon:ui_chat:25}Plot Devices - Ideas for Walk-ups!{col:494949}(Current Work in Progress){/col}\n\n{icon:spell_rogue_deathfromabove:25}{icon:rogue_shadowfocus:25}\n{col:006b61}Additional information - Misc info about her character\n\n{icon:vas_guildnamechange:25}OOC Info.{/col}\n\n{icon:inv_ferret_light:25}{icon:inv_first_aid_70_medicalkit:25}\n\n\n________________________________________________________________________\n{img:Interface\\ARCHEOLOGY\\ArchRare-ScimitaroftheSirocco:512:256}\n{h3:c}{col:641f00}~They say 'Freak'~{/h3}{/col}\n{h3:c}{col:641f00}~When you're singled out~{/h3}{/col}\n{h3:c}{col:641f00}~The red~{/h3}{/col}\n{h3:c}{col:641f00}~Well, it filters through~{/h3}{/col}\n{h3:c}{col:641f00}~So lay down~{/h3}{/col}\n{h3:c}{col:641f00}~The threat is real~{/h3}{/col}\n{h3:c}{col:641f00}~When his sight~{/h3}{/col}\n{h3:c}{col:641f00}~Goes red again~{/h3}{/col}\n                                                           \n________________________________________________________________________\n\n{img:Interface\\Pictures\\artifactbook-shaman-cover:256:256}\n{h1:c}About{/h1}\n{h3:c}{col:00ff00}{/h3}{/col}\n\n{col:c31d38}{/col}\n________________________________________________________________________\n\n{img:Interface\\QuestionFrame\\answer-warboard-bc-IsleofQuelDanas:512:256}\n{h1:c}History{/h1}\n{p:c}{col:ff0000}(Spoilers){/col}{/p}\n\n{h2:c}{col:515151}{/col}{/h2}\n\n{col:ffffff}{/col}\n________________________________________________________________________\n{img:Interface\\LFGFRAME\\LFGIcon-BlackrookHoldArena:256:256}\n{h2:c}Personality Traits{/h2}\n\n{icon:ability_paladin_holyavenger:25}{col:ffffff}Good:\n\n-\n-\n-\n\n{icon:ability_warlock_demonicpower:25}Bad:\n\n-\n-\n-\n\n{col:ffffff}\n{icon:thumbsup:25}Likes:\n\n-\n-\n-\n\n{icon:thumbsdown:25}Dislikes:\n\n-\n-\n-\n\n\n{icon:inv_misc_book_10:25}Hobbies:\n\n-\n-\n-\n\n{icon:spell_magic_polymorphrabbit:25}Quirks:\n\n- \n-\n-\n\n{icon:spell_holy_silence:25}Secrets:\n\n-???\n-???\n-???\n\n{col:b30076}(She may reveal her secrets as you get to know her){/col}\n\n||Appearance||\n\nShe is presented as you see her in game, she has no set attire.\n\n||Character Art||\n\n\n||Language||\n\nOrcish -- Well-spoken\nThalassian -- Native language\n\n\n||Gait||\n\nLaid back but maintains a sense of elegance.\n\n||Manner of Speaking||\n\nSoft spoken, usually sounds calm and talks properly.{/col}\n\n________________________________________________________________________\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-TrollVoodooDoll:512:256}{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n{h1:c}{col:4c83e5}Plot Devices{/col}{/h1}\n{p:c}(For Walk-Ups){/p}\n\n\n{col:ff7f00}- \n-\n-{/col}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n{col:ffff00}(Shoot me a /W to discuss any other plot devices if you would like to RP; am very approachable!){/col}\n___________________________________________________________________________\n{img:Interface\\QuestionFrame\\answer-MonkWindwalker:256:128}\n{h2:c}Additional Information{/h2}\n\n{col:ffffff}- \n-\n-\n{/col}\n\n{col:ff00ff}Voice Ref: Blake Belladonna (Rwby -- Arryn Zech){/col}\n\n___________________________________________________________________________\n\nOOC Info:\n\n- I've been roleplaying in general for 6 years now (I'm a writer), so if you're interested in roleplaying outside of WoW I'll happily give my Discord \n- I'm open-minded, but I will NOT ERP. Character romances are acceptable though.\n- I am quite the serious RPer and prefer my character to be of the 'unusual' kind\n- Running/stealth/etc will always be IC unless stated otherwise.\n\n\n\n\n",
