						["AC"] = true,
						["TI"] = "Smartly Clad Street Rat?",
						["TX"] = "Despite looking hungry most of the time, and her lack of coin, she is dressed quite smartly.\n\nThat being said, her clothes are very few. She'll often wear the same kind of armour (when brawling) and same ordinary clothes when people see her around. It's a rarity that she has anything nice or new to wear -- her clothes are often second hand and look very worn down with scuffs and the occasional tear.\n\nHer clothes tend to smell like the salty ocean, since she cannot afford to properly wash them.",
						["IC"] = "achievement_rat",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Rusted Weaponry",
						["TX"] = "She'll often fight with her fists, her sword on her back shows a lot of wear and tear -- the blade appears quite blunt in appearance, with rust eating away on both its tip and near the hilt. She cannot afford to buy herself stronger means of protection.",
						["IC"] = "trade_archaeology_rustedsteakknife",
