						["TI"] = "Unusual Aura?",
						["IC"] = "spell_shadow_auraofdarkness",
						["TX"] = "There is an unusual aura surrounding her body; one may not be able to detect exactly what it is.\n\nThere is an attempt to conceal it, but whatever the aura is it's powerful enough to subtly seep through such a concealment. ",
