						["TX"] = "Wears a somewhat new looking cross body rucksack. Her polearm is tied to it when not in use.\nContains an old blanket, small frying pan, cooking knife, basic condiments, sharpening stones, flint stones, a bottle of Pandaren plum wine and rations, usually in the form of red bean buns",
