					["PH"] = {
						["IC"] = "achievement_character_pandaren_female",
						["BK"] = 2,
						["TX"] = "Most obvious thing about Jue-Xi is her height. She is considerably shorter than average. Her body is covered in short dense fur apart from her cheeks, elbows, shoulders and the tips of her ears which have longer fur. \n\nLong hair is always kept in a high ponytail or in an updo to keep it out of the way, with some strands of hair framing her face. Eyes are a dark greenish blue colour with dark brown almost black markings surrounding the eyes. Her fur has a very warm undertone, looking almost golen in certain light.\nA prominent snaggletooth on the left side of the mouth.  \n{link*https://cdn.discordapp.com/attachments/597872461564084237/786843468018352128/Jue-Xi_finished.png*Art by me}\n",
					},
					["PS"] = {
						["IC"] = "pandarenracial_innerpeace",
						["BK"] = 4,
						["TX"] = "Two left feet but trains hard to become better. Likes to wonder around and she always end up in trouble, whether intentional or not, Riu, her tiger companion, is the one who usually takes her out of those sticky situations \nWhen not adventuring to a far corner of the map she spends her days camping, fishing and hunting food wherever she finds a good place to make camp for the night.",
