						["IC"] = "inv_misc_book_02",
						["BK"] = 3,
						["TX"] = "Born a runt, many, including her own family did not believe she'd survive more than a couple of weeks, but despite everything, she lived. As a young cub, she was not allowed to go outside, her parents feared she'd injure herself due to her frail constitution.\nWhen she turned 6, she was allowed outside the house to roam around on her parent's farm under her older sister supervision. Nevertheless, she climbed the peach tree that she always watched from her window, fell from it and broke her left arm in three places.\nAt 10 she was sent to the Shang Xi's Academy on the recommendation of her sister, who, by that time she achieved the rank of master. Jue did not enjoy her time there, being nearly twice as small as the other students of her age she was always made fun of by her peers and had a hard time keeping up with class exercises. One day, however, one of the peers and their friends who always seemed to pick on her the most took it too far, telling her that she's too weak achieve anything and she will disgrace her family's name. At that moment something in Jue snapped, attacking the bullies. Before the instructors could break off the fight, she bit off a chunk of a bully's ear and punched two others so hard they lost multiple teeth. The instructors at the academy deemed her too undisciplined and violent, expelling her.\nNot long after that incident, during a summer night, the family was awakened to loud thuds that originated from one of their storage sheds. Her father and older sister rushed down, Jue following them too, not wanting to be left out. Both her father and sister barged into the shed thinking that feral vermlings have broken into their food stores, only to find a small tiger cub. \nDespite her parents' wishes she wanted to keep the cub. Only after her sister stepped in, once more, and argued that a well-trained tiger could help with the vermling problem, and Jue would have a friend. After many hours of begging and almost crying her parents relented, letting Jue keep the cub, naming him Riu.\nFrom that night on she'd spend her time playing with the tiger and wandering around the Isle. As the tiger grew, they started to hunt down the vermlings that tormented her parents' and neighbours' farms, over time managing to rid of most of the population in the South of the Isle.\nHer explorations around the turtle became bolder, venturing to the highest peaks, and many times getting lost or stuck, needing help to bet back and almost falling off Shen-zin Su once, \n",
					},
