		["0828203156pSpCg"] = {
			["character"] = {
				["CU"] = "- Mood: Looks worse for wear\n- On duty\n- Tabard is torn and bloody\n",
				["CO"] = "- IC ≠ OOC\n- HP 0/5\n- /W if I miss something \n- Glances updated! \n- Voice Ref: Female British Inquisitor (Dragon Age)\n- Will fight anyone",
