			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Azrise Dawncrown{/h1}\n{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}\n{h2:c}Appearance{/h2}\n{p:c}Azrise often looks impeccable. Her hair is neatly cut into bangs. Her makeup practically perfect at all times. It is quite obvious she takes great pride in her appearance and will often get upset if something messes with it. There is a light scar across her lip but apart form that she is pretty much unblemished. She is often seen in deep red lipstick and accompanying eyeshadow.{/p}\n{h2:c}Apparel{/h2}\n{p:c}Azrise tends to wear her plate armour accompanied by her Blood Knight tabard. She tries to stick to wearing gold and reds but if a dress takes her fancy she will often ditch the rule pretty quickly. As with her appearnce her clothes are always perfect. Repairs are barely noticeable and she will quickly replace pieces if they get damaged. {/p}\n{h2:c}Weapons{/h2}\n{p:c}Strapped to Azrise's side is her sword, Absolution. A beautifully crafted sword with an intricate pattern inscribed onto the blade. A show of both wealth and status. Along with her sword she has her shield. This has seen many a conflict with her but even so it looks well looked after and well maintained.{/p}\n{h2:c}Demeanour{/h2}\n{p:c}Her personality is different to what might be associcated with a Holy Paladin. She is snarky and confrontational. She isn't afraid to speak her mind and will call people out if she thinks they are wrong whether they are or not. Even with all this she is an acomplished healer and wears this like a badge of honour. She can't imagine doing anything else.{/p}\n",
