					["TX"] = "{h2:c}{icon:inv_7xp_inscription_talenttome01:25} {col:ff7f00}Anearia Glim{/col}{col:d26900}mershade{/col} {icon:inv_7xp_inscription_talenttome01:25}{/h2} \n\n{h3}{icon:achievement_character_bloodelf_female:25} {col:f2e599}Appearance{/col}\n{/h3}\n\n{col:ba7100}Appearing as quite the young Elf. Anaeria stands taller than most other Sin’dorei, her body seems more defined than the common priest; suggesting she trains in body as well spirit. Her skin, fair tanned, is almost silk and matching to touch with a flawless complexion. Her face fits an almost stunning soft structure with angled features, her face being framed in an oval shape. \n\nHer hair, light platinum blonde with the appearance to sometimes altar pale white in some lightning, is long, reaching down to her tush. Is kept tied up in an elegant braid, neatly framing the tip of head. A single golden winged brooch is snug into her braids, revealing a ruby gem eye detailing the image of a phoenix.\n\nAn inscribed golden rune is written at the top of her left cheekbone, over the bridge of her nose and to the top of her right cheekbone. The inscribed rune is framed on the bridge of her nose with golden lines, starting in line with her eyes and ending just below the rune. \n\nContrasting her youthful appearance, her expression usually rests with a warmth, mature embrace. Welcoming those near. Her golden hues beam ever bright with her connection to the sunwell, delighted composure only matching the light of her own eyes. {/col}\n\n{link*https://cdn.discordapp.com/attachments/485086703648768000/716645783407165531/Knae_Belf_priest.png*Lovely Art by ForgedFromVHS}\n{link*https://pbs.twimg.com/media/EeSP2IUWAAMOwZP?format=jpg&name=900x900*Great art by @Eliz0r }\n{link*https://twitter.com/AURIGAE8/status/1315780974341431297/photo/1*Gift from a friend, by @AURIGAE8 <3}\n{link*https://pbs.twimg.com/media/Ek97RUnWMAAg6LA?format=jpg&name=4096x4096*Hallow's End outfit!! by @topikoji}\n{link*https://cdn.discordapp.com/attachments/759672048372678676/787768211612499998/GIObueC4.jpg_medium.jpg* Cute gift from friend!}\n{link*https://pbs.twimg.com/media/Er8YlhYXYAMAUOs?format=jpg&name=4096x4096*Absolutely gorgeous art from Makkochi @_glittergoth\n}\n\n",
