				["T2"] = {
					{
						["TX"] = "{h3}{col:60adff}ARTWORKS\n••••••••{/col}{/h3}\n{col:60adff}• Artworks are WIP. I am working on them.\n• Interact with this character to know more about them.{/col}\n",
