						["TX"] = "{h3}{col:60adff}LIKES AND DISLIKES\n••••••••••••••{/col}{/h3}\n{col:ffffff}+ Loves to cuddle\n+ Different types of fish (raw)\n+ Getting compliments\n+ Cold weathers\n+ Collecting plushies\n+ Attention\n+ Spending time with Galvaen{/col}\n\n{col:60adff}•••••••••••••••••{/col}\n\n{col:ffffff}- Getting treated badly\n- Feeling worthless\n- Lack of attention\n- Hates being touched by strangers\n- Others getting close to Galvaen\n- Being lied to\n- Not getting what he wants {/col}\n",
