						["TX"] = "{h3}{col:60adff}SKILLS AND FLAWS\n•••••••••••••{/col}{/h3}\n{col:ffffff}+ Good with swords\n+ Manipulating\n+ Victim playing \n+ Acting\n+ Loyal to those he trusts\n+ Cold resistant\n+ Notices others {/col}\n\n{col:60adff}•••••••••••••••••{/col}\n\n{col:ffffff}- Sensitive personality\n- Gets anxious under pressure\n- Gets easily confused\n- Weak against users of the Light\n- Vulnerable due to traumatic background{/col}",
