					{
						["TX"] = "{h3}{col:60adff}FEARS\n•••••{/col}{/h3}\n{col:ffffff}• Priests and paladins\n• Rejection\n• Loneliness\n• Getting hurt\n• Failures\n• Betrayal (getting betrayed / lied on)\n• Being yelled at\n• Strangers\n• Has a fear of being laughed at or humiliated {/col}",
