				["T3"] = {
					["PH"] = {
						["TX"] = "Canys is a tall elven woman with black shoulder length hair and tanned skin.\nThe woman has a typical elven figure.\n(Ingame Model, basically)\nAverage sized chest and a well shaped rear.\nClearly a spellcaster, not very physically trained.\n\nHer eyes glow strong with corrupt flame, a piercing and almost compelling gaze.\nWhen she speaks, she seems eerily calm and collected, her voice has a low pitch to it but not to the point of being unusual.",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "This woman fits the description of a suspected criminal, a murderer and kidnapper.\nShe hasn't been caught red-handed yet, but there are rumours.\nSome describe her as insane, talking to herself.\nGuards and the law are instructed to keep an eye on her. \n(Silvermoon City specific)\n\nViolent and underhanded character.\nI give hints so players can avoid uncomfortable themes.\nI accept consequences if caught red-handed.\n\nShe does not see the appeal in one night stands or relationships at all.\nPerhaps she has not found the right person yet.\nOr perhaps something in her brain is missing.\nIt would take a miracle to turn her into a good person.\nRecently, she has been making 'friends' and trying to control her sadistic urges.\nFor now it is a mask she's wearing but the lines between the act and her feelings are blurring.\n",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Canys Doomweaver the Troublemaker.\n\nSuspected to be involved in arson, abduction, torture and murder.\nAlso was connected to the Old God cults, but with N'zoth's demise, that ended.\n\n\nHas been living in Booty Bay for a while now to lay low.\nThere, she seeks entertainment of the sort that won't get her into too much trouble.\nShe has also been holding back on her sadistic tendencies.\nThis seems to help her impression greatly as, to her great surprise, several people found her likeable.\nAt present she is doubting herself and wondering if she is truly capable of 'likeable' things.\n\n",
