			["character"] = {
				["CU"] = "-Admiring a bronze flask of Mountaineers ale, While writing in a tattered book.\n- Brusied but Healthy.\n\n",
				["CO"] = "- Looking for friendly rp guild.\n- Friendly yet a little shy.\n- Whisper me if i dont reply.\n- New to rp ",
