			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Belolonis Velnia Mournguard was born in silvermoon city there she heard of heroic stories told by her grandfather about  House Mournguard long lineage of hero's in the Royal Guard which is now known as The Blood Knights led by Martriarch Liadrin, who Belolonis admires.Belolonis's joined the Blood knights after the events in the Outlands out of anger, during her training for the Bloodknights Belolonis experianced alot of pain trying to invoke her powers and before that struggled with her faith in the light as she thought along with many other Sin'dorei that the light had abandoned them but her faith was restored over sometime, an now her faith in the light is stronger than ever before.\n\nOn a expadition to Northend Belolonis experianced snow for the very first time she had become uset to Slivermoons everlasting autumn, so the cold flakes of ice were a shock to her but yet she found the moment magical as did the other Blood Knights with her. From that moment onwards Belolonis adores Northrends climate she could spend her days admiring a snowy moutainess landscape sipping on her favourite beverage dwaren ale even though it is work finding it, normally she buys it from some very \"interesting\" individuals which has acquired her some very odd friends.\n{img:Interface\\QuestionFrame\\answer-warboard-wotlk-Icecrown:512:256}\nHouse Mournguard is very large, firstly you would have Belolonis the first born of Krearrin Morningguard and Bellen Morningguard,then you would of have Belolonis brothers Vor'lon, Kraeleron, Velendan and Alestus being the youngest. All of the brothers have followed in the Belolonis's footsteps joining the Blood knights and invoking the light, making there grandfather Mathalen very proud that his grandchildren have carried on the families lineage. In his final few years he can lay comfortably knowing house Mournguard has a bright future. \n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-SilvershardMines:256:128}\nBlacksmithing has always been a passion of Belolonis, she discorved this passion while admireing a ore as she bargained with a travelling trader she wasnt sure what kind of ore it was back then and now still isnt sure as she hasnt come across such a ore like the one she saw but still she remembers its distinct colour of blue in its core,the only similar ore she has found is true ore.\n\nBelolonis is also a great fan of cooking, she enjoys a strong alcoholic beverage just like anyone else but she never properly acquired the taste of wines she can stand such a taste at family balls but she would never pass a chance to pour the wine into a potted plant. Some of her Favourites include Mountaineers Ale,  Booty Bay rum, Apple Bloom cider, Moonshine. She also enjoys Zanadalri Food like Mon'Dazi and Honey pot pie. Other than that she can be found in you local tavern attacking lobster stew and some grilled squid. \n\nHer daily routine normally starts and finishes at a tavern but inbetween that she is either sampling ore or out adventuring with a racist elf Astalleron, after that she heads to the broken tusk in orgrimmar to drink, eat and reflect on the day.  \n         \n\n\nshe has also become close to the tauren and is learning about there culture. Tauren have always been adored by belolonis she admires their way of thinking and there love for the earth mother. As for other races she can first seem unintreseted in chit chat because her rather be eating but she is open to talk to others, other than the subject of war.\n",
