			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "achievement_character_bloodelf_female",
						["BK"] = 1,
						["TX"] = "Tyely is a short, lean and athletic woman, with medium-length pale blonde hair, tan skin and orange eyes. Her dainty cheeks are freckled, and so are her shoulders. Black elaborate tattoos spread across her upperarms and chest, depicting cloud serpents twisting on her ribcage. These can be covered up with clothing, depending on the situation. She also has a large scar on her right rib from a nasty taming accident when she was younger. \n\nTy is usually in muddy, rugged riding and taming clothes for her work with the cloud serpents, or in more elaborate armour. A bow, belovedly named \"Nor'danas\" is with her most of the time, with a long piece of cloth tightly tied to the top of the bow, usually brushing against her shoulder akin to a comforting hand.\n\nTypically, there's a scratch, bruise or bite from one of her beasts on her arms or face. These don't seem to bother her, if anything, she looks upon them with pride or with humour, at how they may of occured.\n\n{link*https://t.co/wIdUxTrJDm?amp=1*Training Session}\nRender done by the amazing Cazadora on Twitter.\n",
					},
					["PS"] = {
						["IC"] = "inv_misc_gem_azuredraenite_03",
						["BK"] = 1,
						["TX"] = "Stubborn, headstrong and fiery, Tyely is a determined soul seeking to prove her worth. However, she has an emotional side that can best her at times and cloud her judgements. She can also be described to be impatient, and more drawn to action then holding back. Many describe her as wild and adventurous, but if you asked her, she'd just tell you she's having fun.",
					},
					["HI"] = {
						["IC"] = "inv_pandarenserpentgodmount_black",
						["BK"] = 1,
						["TX"] = "Tyely grew up alongside her father, Nor'danas Emberstalker, and his closest friends, who were all revered beastmasters. Her father specialised in taming reptiles, and they travelled endlessly for various jobs. Tyely dismissed a lot of her father's teachings when she was younger, and had no clear view of what she wanted to do. However, her father recently passed, leaving behind chasms of unknowns and unanswered questions. Thrusted into beast mastery, she has stumbled to follow her father's footsteps.\n\nThe hunt to fulfill her father's legacy has landed her in Pandaria, where she has started to master the art of taming cloud serpents. Tyely also flies and races them, but is focusing on becoming an adept fighter alongside the lethal but majestic creatures. Despite much self-doubt and questioning, she feels most at home amongst the clouds, and has fallen in love with the serpents she works alongside. Perhaps, it's her calling.",
					},
