			["time"] = 1615066757,
			["zone"] = "Booty Bay - The Salty Sailor Tavern",
			["about"] = {
				["T1"] = {
					["TX"] = "Vol as his friends know him is a humble summoner, usually friendly and aproachable, famous for being a charmer but  well mannered when not drunk and will help those in need if posible.\n{icon:ability_racial_childofthesea:25}\nHis childhood was not the best not having his biological parents around as they mysteriously disappear when he was only a baby, he was found and raised by a family of orcs in Orgrimmar that helped him develop a love for the horde and colaboration between races as something necessary for survival, he does not feel superior to other races and treats them with respect.\n{icon:ability_monk_counteractmagic:25}\nHe found magic fascinating from a young age and started to mess around with demons by accident, that moment when he first summoned an imp changed his whole life, that imp would have killed him if one of the troll warlocks hadn,t shown up just in time to subjugate it, he knew then that he wanted to be able to do just that, control demons.\n{icon:spell_shadow_demoniccirclesummon:25}\nAs time went on he lost interest in the art of summoning demons and he focused his efforts in summoning others instead, becoming a bodyguard to those in need and a useful tool for others looking to reach places that without his help would be imposible.\n{icon:inv_staff_2h_artifactheartofkure_d_06:25}\nHe recently found someone he really cares for and even tho their time together has been sort, for them it was love at first sight, they care deeply for each other and even tho they  are unable to see each other due to unavoidable circumstances, they write letters whenever they have the chance  reminding them of their sweet moments togueter.\n{icon:spell_chargepositive:25}\nVol has been trying to not think as much about that person that was once so important for him and move on, in Booty Bay he has found new people that have helped him go through this difficult moment in his life. He is now beginning to understand the true meaning of friendship and to differentiate between attraction and love.\n{icon:achievement_zone_silithus_01:25}\nHe said goodbye to his friends in Silvermoon, specially Lightspear, who has always helped him there, she was his support for a long while and now they had to part ways, he promised to visit from time to time tho; Now he has moved to Booty Bay where he somehow feels more at home than the big city, who would have guessed that the blood elf would end up in such a place?\n{icon:ui_sigil_necrolord:25}\nAfter the events that transpired in the maw, where he ventured with his horde allies to stop Sylvanas, he found a new home alongside the Necrolords, the group he choose to become a part of, for they saw in him an unbreakable passion to defend what is dearest to him and even more important, his combat prowess, now able to fully control demons at will and make them powerful allies to the Necrolords cause and a fearsome foe for those who dare oppose them.\n",
