					["TX"] = "Description\n\nA towering and heavily armored individual taller then most males  of her kind.\n\nHer lower jaw replaced by a metalic jaw linned with jagged metalic blades to resemble / replace the teeth that whould be there.\n\ntwo larger tusk like fangs pertrude from the metal jaw one either side in an orcish fasion.\n\nHer right eye is completely blind surounded by what apears to be a few month old burn scar, that side of her face primarily covered by her overgrown over hanging red mane.\n\nHer left eye is a fierd dark red almost glaring out from her black scarred and ragged fur.\n\nOver her left eye is a scar that looks like three claw marks runing   right to left downwards and the on down her cheek.\n\nThe teeth and fangs in her upper jaw have also been replaced by metalic fang like blades.\n\nHer tail is long enough to wrap round her body atleast twice and is kept wrapped round her in the apearence of a shourter tail unless she is in battle or making use of it.\n\nHer tail is  much like a monkeys tail as in the way it can be manipulated to grab hold of or pull things.\n\nHer long overgrown ragged mane hangs across the right hand side of her face and all the way down her back.\n\nHer horns have been snapped off most of the way down forcing them to be replaced with metalic caps to simulate horns.",
