					["5"] = {
						["AC"] = true,
						["TI"] = "Gear",
						["TX"] = "Weapons :\n- 1 Mace\n- 1 Axe\n- 2 Daggers\n- 1 Shortsword\n\nPouches :\n- 3 Healing potions\n- 3 Antidotes\n- 3 Mutagen\n",
