			["time"] = 1615504067,
			["link"] = {
				["Raynardo-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://cdn.discordapp.com/attachments/601256416967393281/761951249519738911/unknown.png*\"If it's sunken it's yours!\" By : Kam-Fox}\n\n{h3:c}Description{/h3}\n\nAround his mid-twenties, the White furred Vulpera with Hyena like Black spots across his fur stood with a noticeable extra bit of height compared to his kin. His vivid and sometimes almost skittish Grey-eyes displayed a sharp contrast with his placid face. A distinct feature of his being his mangled left ear, the cut was too uniform to be an accident, its twin however was intact. His build could easily be described as an inverted triangle, the width of his shoulders combined with his fit physique made his body look wiry. His array of clothing varied, however the constant factor was their tendency to allow for maximum use of his agility even thouh his style of choice made him appear to be among the Roguish type.\n\n\n{h3:c}Background{/h3}\n\nAnother fine Specimen among the 'quitters', he abandoned the dunes he hardly called home for better horizons. Embracing the life of a sailor allowed him to experience adventures... Not all good or bad but he found it better than Scavenging for survival. Thanks to that, he acquiered new skills, refined the old ones and taking on further challenges on his own now. Today he's a proud owner of his own Sailboat, Carmela's Spite.\n\n\n{h3:c}Of Interest{/h3}\n\n{p:c}{col:ff0e00}A Wanted poster is put across the major cities of the Alliance with a harbor. No image or sketch on the poster{/col}{/p}\n\nName : N/A\nAge : N/A\nGender : N/A\nWanted : Dead or Alive\nRace : Vulpera\nAround 1 meters (3.3FT) and 1.10 meters (3.5Ft) White furred Vulpera on a one-man Sailboat, wanted for stolen valor and stealing from official sunken ship. Operates in Kul Tiran and Zandalari waters, discovered in Freehold selling salvaged goods belonging to the Alliance and selling to the Black Market. Beware of his slippery tendencies.\nLast seen : Freehold\nReward : 1000 Gold\n\n\n{p:c}{col:ff0200}((Information here is purely up to those who might have been involved or related to these events. See these as opportunuties for RP, whether it be for friendly encounter or more likely unfriendly ones :D.)){/col}{/p}\n\n{p:r}{col:00fff7}- Former Pirate of the Bilge Rats. Minor Mixologist among the crew but notably known for his obsession with hygiene. Participated in raiding, looting, pillaging, hostage taking, ransom... In short, the Pirate life.\n\n- Joined the Blacksail Crew a year before the Burning Legion's third invasion as an underwater scavenger. Assisted the Uncrowned's efforts and the Armies of Legionfall in exchange for a pardon.\n\n- Engaged in more 'salvaging' during the Fourth war by taking from sunken ship.{/col}{/p}\n",
				},
