					["PS"] = {
						["TX"] = "Luci is quite calm, but his patience can run short in certain situations. He usually dont like arguments and would do anything to end them, even if he's wrong or not, unless they are of importance. Rarely he shows joy or sadness. He's always with a bored expression, un-interested in whatever is around him.",
