						["IC"] = "achievement_profession_fishing_oldmanbarlowned",
					},
					["HI"] = {
						["TX"] = "Usually most vulpera are from the desert. Not in Luci's case, he was born and raised in the swamps of Nazmir. His home and parents were lost to the blood trolls and wild life in Nazmir. In all that chaos he did not find his brother's corpse which led to Luci having hope for his brother being alive. Times got harder, so later in his life he attempted to seek help, all of that searching led him to different kinds of races, he met with tortollan from which he has learned his inscripton skills, tho he has developed them into his own style. He has been told by the tortollans that he has people of his kin in the desert, with any hope he went to the deserts of Vol' Dun. Eventually he got there in the middle of a sethrak attack on a certain camp. Luci saw that his kin was being attacked in this place and without hesitation he rushed to help. Although not many survived, he managed to help one vulpera out the chaos. That vulpera told Luci they had a hideout, to which Luci was taken. Later on as the vulpera joined the horde Luci decided to follow his people to the city of Orgrimmar.",
