			},
			["character"] = {
				["v"] = 83,
				["CO"] = "Dino does not stand for dinosaur. It's KIL not KILL!\nF, H and A died... Replying takes a while\nTheme: Dagothwave\n\nVoice- Kimbul's aspect from Battle for Dazar'alor\n\n\n\n\n\n",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "Hating all undead.\n\n\n\n",
			},
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["v"] = 30,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Personality{/h1}\n{h1:c}{icon:inv_tourofdutyzuldazar:25}{/h1}\n{col:e3b0ff}As a shadow hunter, Dinokil spent most of his life talking with spirits and Loa, that's why his way of comunicating with normal people might seem weird, or even wrong. His sense of humour is bad and he doesn't know what small talk means. His words or actions sometimes suggest that he is pure evil and sometimes the exact opposite. He thinks of himself that he is above other trolls because of his role as a shadow hunter.\n \n{h1:c}Armour{/h1}\n{h1:c}{icon:inv_helm_mail_raidshamanmythic_s_01:25}{/h1}\n{col:6cfdff}Rush'kah mask made out of wood, painted in gold to better fit his zandalari heritage. Some call it a helmet or headress, because of the more practical build of this mask, fitting better for a soldier.{/col}\n\n{h1:c}{icon:inv_shoulder_mail_legionraid_d_01:25}{icon:inv_chest_mail_raidhuntermythic_r_01:25}{icon:spell_nature_bloodlust:25}{/h1}\n{col:6cfdff}Bulky shoulderguard made out of gold on his right side, with a skull of a ravasaur attached ontop of it, symbolising that he is -not- a memeber of \"The Pack\". On his left shoulder, rests a small wooden shield, honouring his membership in the Painted Shields. Short pads of leather, painted in gold wrapped around his arms. Under his tabard, a tunic made out of dinosaur's skin with a jaw of a shark attached to it.{/col}\n\n{h1:c}{icon:inv_glove_mail_raidshaman_l_01:25}{/h1}\n{col:6cfdff}Two light gloves made out of Sethrak leather, pained in red somewhat protecting his hands and wrists, but most importantly, looking very fashionable. Pouches and bags on his belt that only the shadow hunter knows what's inside them. Hook attached to Dinokil's right side, helping him with carrying any special offerings.{/col}\n\n{h1:c}{icon:ivn_pant_armor_zandalaritroll_d_01:25}{icon:inv_boots_mail_01:25}{/h1}\n{col:6cfdff}With his top body parts, mostly on right side good covered, Dinokil uses typical cloth pants and boots made from Sethrak leather, stylised in zandalari style to let him move and run freely.\n\n{h1:c}Weapons{/h1}\n{h1:c}{icon:inv_axe_2h_zandalarquest_b_01:25}{/h1}\n{col:6cfdff}Hexbreaker, legendary axe made for Warbringer Ar'khala out of gold and as it's hilt, stories tell that it is made out of Kimbul's fang itself! Decorated with carvings simbolizing Eraka No Kimbul. Enchanted by the priesthood, the axe completly intercepts any kinds of magic, other then the Loa based around it's wielder. Troll who holds the hexbreaker is unable to cast his voodoo, but can easly overcome other spellcasters, as the axe can easly block most magics and even cut pyroblast in half.\n\n{h1:c}{icon:inv_bow_1h_zandalari_c_01:25}{icon:ability_hunter_chimerashot2:25}{/h1}\n{col:6cfdff}Traditional paku'ra bow, painted in red to better fit his overall presentation and a quilver full of wooden arrows with carved chants to Zanza on each one of them, allowing the shadow hunter to cast Arcane Shots from his bow.{/col}\n\n{h1:c}Loa blessings{/h1}\n{h1:c}{icon:inv_giantsnake_brown:25}{/h1}\n{col:ceff28}One of the \"evil\" Loa that Dinokil serves is Dambala, the Loa of treachery. Dambala bestows Dinokil the ability to change his shape into a cobra of different sizes. He could choose to either become a small adder that can slip through tight surfaces, or a cobra bigger than average raptor.\nAs powerful as this ability seems, the shadow hunter uses it -very- rarely, because the shapeshift brings incredible pain to his body, forcing his bones to break and bend his flesh to scales.\n\n{h1:c}{icon:ability_racial_embraceoftheloa_kimibul:25}{/h1}\n{col:ff8900}Closest Loa to Dinokil is Eraka no Kimbul. His family have been serving the King of Cats for generations, even when the Loa had to protect his honor and didn't accept any new followers. Shadow Hunter can call upon his skills and hold fast reflexes and running speed, his limbs feeling lightweight and swift, while the mind has an aura of clear thought. Kimbul can also grant Dinokil the \"Predator's awareness\", allowing the shadow hunter to sense heat and -see- while he is temporarily blinded.\n\n{h1:c}{icon:ability_racial_embraceoftheloa_kragwa:25}{/h1}\n{col:abff95}The huge protector lands Dinokil a portion of his powers, as he trusts the shadow hunter cares more about the others, than himself. Dinokil is not the greatest healer, he prefers to act and use his powers to protect others from getting hurt, not to heal their wounds, but that doesn't mean that he can't heal. Shadow hunter can channel the Huge One through his rush'kah mask and let Krag'wa work through him to save lifes. Krag'wa can also temporarily increase Dinokil's body weight by up to two hundred pounds. His body's apperance remaining the same (just glowing in eerie green), but allowing him for one hefty punch.\n\n{h1:c}{icon:ability_racial_embraceoftheloa_bwonsomdi:25}{/h1}\n{col:a6a6a6}All though Dinokil never liked Bwonsamdi, for he is the Loa who took his closest friend from him, he respects the Loa of Kings and continues to send souls to him for his favour. Shadow hunter can channel Bwonsamdi through his rush'kah mask and use \"Smite undead\" ability. Evoking this spell allowes Dinokil to have a searing touch that can burn and blister the skin of an undead like a hand coated in fiery acid.\n\n{h1:c}{icon:ability_racial_embraceoftheloa_akuna:25}{/h1}\n{col:69eeff}The thunder lizard can invoke himself through Dinokil's mask and channel his wrath in the from of lightning. This spell should not be used often, as it can hurt not only the target, but  the shadow hunter too. On top of that, once a month Dinokil can perform a ritual in which he can erase one's memory, but the target must agree to it, for the spell to work. It can't erase someone's memory fully, but can help forget about a certain hard thing, like death of a friend or lover.\n\n{h1:c}{icon:ability_hunter_pet_dragonhawk:25}{/h1}\n{col:ff7b66}It is thanks to the great dragonhawk, that Dinokil can become barly visable. When the shadow hunter is in need, he can invoke Jan'alai's boon and grant himself a turbulent stealth that cannot be seen or heard by enemies. On top of that, Dinokil is able to create a spark of fire between his fingers, fairly useless in fights, but he can use it to light a bonfire, set his arrow on fire or seal a nasty wound if he couldn't heal it.\n\n\n\n",
				},
			},
		},
