			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "Suramar? Home of the elder elves, the Grand Magistrix, the Font of Night and all that was well. Until the Fel came knocking. Until outsiders brought ruin to my home. Until they- until I was ousted from the life I knew, to pledge myself to this.. this Horde of yours.\n\nDon't look so sad, it's better now. Bumpy introductions aside, the repositories of knowledge your more literate kin tend to is magnificent indeed.",
						["BK"] = 1,
						["IC"] = "achievements_zone_suramar",
					}, -- [1]
					{
						["TX"] = "Ah, yes. The Horde. A warmongering and genocidal bunch at first glance. But there is something- honest about this confederation of disparate tribes, nations, people. I have seen the ingenuity, craftsmanship, statecraft and martial prowess of this Horde, and I have grown fond of it.\n\nBesides, you're all terribly fascinating for one who up until recently spent his entire life under a dome.",
						["BK"] = 1,
						["IC"] = "inv_cape_hordetoy_a_01",
					}, -- [2]
					{
						["TX"] = "-let's not speak of that, for now. Instead, the marvels of the great ever after. Of the Fey, no less!\n\nMuch like the great Horde, first impressions can be deceiving. To an assuming eye, naught but a bunch of tree tenders, but they know much of the process of rebirth, but of the process of dessication as well. This group, led by their most illustrious Queen, seem to truly realise the duty laid out before them. From the loftiest Treekin to the humblest Gorm, they all see that death is part of the way forward. That destruction and decay pave the way for greater things to come. They understand. They- they all understand their purpose.",
