					["TX"] = "{h1:c}{col:ffd300}Origins{/col}{/h1}\n\nW I P\n\n{h1:c}{col:ffd300}The Light Watch Order{/col}{/h1}\n\n{h2:c}After a long part of his life travelling, he decided to finally settle somewhere to continue his studies on philosophy and magic. The Light Watch order proved adequate, as he was seeking to delve into the nature of the Light and its usages, always as an act of service and usefulness.\nHe is now a Watcher in the Faith and Philosophy branch, and spends most of his days studying the locals and their lives, pondering on a plethora of matters, and training himself as a priest in  all aspects, abandoning his aspiration to become a \"real\" paladin, but without abandoning his knowledge on melee combat.{/h2}\n\n\n\nCharacter theme: Love Theme, Andrea Morricone",
