				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Very Old (for an Vulpera)",
						["TX"] = "As soon as you see Onkuro it is obvious that he is a very old. His bones are crackling, his moves are slow.",
						["IC"] = "ability_deathknight_reanimation",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Blind staff",
						["IC"] = "inv_relics_6orunestone_orcspeakingstaff",
						["TX"] = "-He uses his staff to avoid running into people...and walls...because both hurts\n-The Head of the Staff is decorated with a Sethrak skull and some of their bones.\n-Some one who nows about the dark arts may feels a tint of fel in the staff.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Blind",
						["TX"] = "His Eyes are empty and he is completely blind. When you talk to him he trys to lock somewhat at your direction.",
						["IC"] = "spell_shadow_evileye",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "New to the language of the Orcs",
						["IC"] = "ui_horde_honorboundmedal",
						["TX"] = "You cant show an old dog new tricks. So it was very difficult for Onkuru to learn this new language and you can still hear that.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Full belt",
						["IC"] = "inv_firstaid_healingsalve",
						["TX"] = "On his belt you can see many Potions and pouches.",
