				["v"] = 27,
			},
			["time"] = 1615493260,
			["link"] = {
				["Onkuru-ArgentDawn"] = 1,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1}The Short Version{/h1}\n-He is Very Old and Blind\n-He lost everything and everyone he knew in the slave pits of the Sethrak\n-He was to become a warlock trained by an exiled Troll but chose differently\n-He became (by circumstances) a medic for the proud Warriors of the Horde when the foul Alliance attacked the Shores of Voldun\n\n\nI know the other stuff is far to much to read but i needed it to get some ideas of Kuru",
						["BK"] = 1,
						["IC"] = "achievement_bg_tophealer_soa",
					}, -- [1]
					{
						["TX"] = "{h1}Years in the destert{/h1}\nWell friend, the desert wasn´t kind to me. Even though i miss the dunes of all the places i once called home, it pains me to remember them.\nI lost all those who traveled with me, al those i loved, to the bane that haunted the Sands of Vol´Dun for so long. \nLong ago when life was good to me, i had a family, a caravan who traveled through the Dunes. A woman i loved and people i called friends. Then, a story as old as the desert itself unfolded. The Sethrak attacked us, wanted us as slaves. It didn´t take long and we were chained. I dont now how much time we´ve been there, but one day a Champion of the Horde and a girl called Nisha attacked the slave camp and gave us weapons to fight back. Many of us where still weakened from days without food and hours without water chained up in the desert sun. We did our best but couldn´t make it out wihtout losses. Rima, the one i loved, fell that day. I remember holding her...i couldn´t do anything while i saw the life leaving her eyes..\nAfter that i was alone. Just three of our Caravan had survided. My two friends chose to find a new one, while couldn´t. I wished them the best of luck and never saw them again. The thaugh of them finding a new home gives me hope, while the possibility of the desert devaurering them haunts me at night.",
						["BK"] = 17,
						["IC"] = "achievement_dungeon_templeofsethraliss",
					}, -- [2]
					{
						["TX"] = "{h1}Times of witchcraft{/h1}\nAfter that i was alone for a very long time. Traveling through the sands without a goal without a purpuse. I didn´t now what i was locking for but in the end i found a troll. An Exile from the Empire behind the southern mountains. He was dying of thirst, drying in the desert sun like we did as slaves. I helped him, dragged him into a cold cave and gave him some of the water from an oasis near by. After a couple of days he was healed and even thou i hessitated we travelled together. He was locking for something in our desert. We visited ruins and he gathered some strange artifacts. Some of them i heard whispering in a strange tounge, even today i dont know what they said,but only today i know that this was probably a good thing. He started to tell me some things about those artifacts, about how there are things in this world that can scatter the veil between life and death. Still haunted by Rimas lifeless eyes i listened. So we gethered more and more of those things and he taught me more and more secrets about powers that some would consider as witchcraft. The day came when we had gathered enough and only one thing was still missing for our rituals. Life. Only with life you can controll death, at least thats what he taught me. As ashamed as i am to say that, but we gathered life. I was blinded, maybe by the artifacts, maybe just by the possibility to see Rima again. So we captured some of my people...some Vulpera...i\nI couldn´t look into there eyes but i also couldn´t resist the whispers. \nThe ritual was ready and  i was eager to see my love again. We satrted the sacrefice...one after another i murdered them while m<y love was manifesting herself with everey soul i sacreficed. Then i heard her voice, but not as i remembered. It was a strange distant Echo. The moment i saw her was the moment i realized what i did. The shame of that shall never go away. The troll and i parted ways and was searching for a cause again.\n",
						["BK"] = 14,
						["IC"] = "achievement_boss_trollgore",
					}, -- [3]
					{
						["TX"] = "{h1}A new purpose{/h1}\nSo lost again i planned to end it all. Now i didn´t only lost everything, now i also did horrible things to my own people. I travelled to the desert shores in the west but before i could do anything heard drums behind the dunes. My eyes wherent the best, even then, but as i walked up the dunes i saw sails at the horizon...blue ones with a golden lion as their flag. On the other side a saw riders gathering, many many riders. A horde, you could say....\nAs soon as the ships had make it to shore a battle began. I listened to the warcrys and watched the chaos unfulding befor me. \nIt didnt´t take long and a creature from the ships ran directly at me. Shouting something i cuoldn´t understand. I try to ran but my legs wherent the best anymore even back then. So it caught up to me and the only thing i remember was waking up in an camp while a green creature tendet to my wounds. It was an Orc and after i saw all the suffering arround me, all those who where wounded by the battle, i helped him. With that i had cause again and the Orc taugh me how to heal the wounded. After the war was over i heard that some of my kind where joining the Orcs and their allys. So joined them and i on this new Continent locking for a cause again. Helping those in need...maybe on one of my last days i can find a family again...",
						["BK"] = 13,
						["IC"] = "inv_hordewareffort",
					}, -- [4]
