			["about"] = {
				["v"] = 60,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "(Very Rough Work in Progress, there's probably going to be typo's somewhere but will fix with editing)\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-67:64:64}\n{icon:inv_elemental_mote_fire01:25}{icon:spell_fire_rune:25}\n\n\n{h1}{col:ff0300}~Contents~{/h1}{/col}\n{h1}{col:ff0300}-------------------{/h1}{/col}\n\n{col:910200}{icon:inv_misc_firedancer_01:25}About - Quick overview of Telora's personality.\n\n{icon:inv_inscription_scroll:25}History - {col:494949}(Current Work in Progress){/col}\n\n{col:910200}{icon:achievement_guildperk_everybodysfriend:25}Personality Traits - Good, Bad, Hobbies etc.\n\n{icon:ui_chat:25}Plot Devices - Ideas for Walk-ups!{col:494949}(Current Work in Progress){/col}\n\n{icon:70_inscription_deck_hellfire:25}{col:910200}Additional information - Misc info about her character\n\n{icon:vas_guildnamechange:25}OOC Info.{/col}\n\n{icon:inv_elemental_mote_fire01:25}{icon:spell_fire_rune:25}\n\n________________________________________________________________________\n{img:Interface\\Pictures\\artifactbook-mage-cover:256:256}\n{h1:c}About{/h1}\n\n{col:ffffff}Before you is a lady who is, quite literally, a walking-talking bag of irony. One may wonder why; for instance, she is quite outgoing but remains reserved. Once talking, she probably won't stop, but she will remain silent with a group of people unless spoken to or if she wants to respectfully voice her own opinions on a certain subject matter.\n\nTelora is far more noble than her younger sister, Kalidoria Duskfury (who infused herself with the Void, and has since died yet came back as a Death Knight -- they still remain close), and will stay to protect those around her even if it means sacrificing herself in return. She will fight for what is right, and remains lawful in almost every scenario -- unless if she can set fire to something.\n\nThat's right, you have met a pyromaniac. Though quite the emotional little bean, she finds great pleasure in setting things alight and will argue that Fire is the best element in almost every scenario -- even if it isn't. But Telora does still carry both Arcane and Frost with high regard, even if she doesn't like the cold. In fact, it is evident that she has somewhat a skill in Frost magic too, though she rarely uses it as it could come with potential risks since she hasn't exactly honed her knowledge in that school of magic.\n\nShe's mature, level-headed, and quite the classy flirt. She will hold a door open for someone and is probably overly polite, having a LOT of manners. She is quite the open book and will speak freely about her past, and she holds no angst towards the Horde -- being quite neutral on the matter and would rather just travel and stay out of any conflict if she can.\n\nDespite her primary element being Fire, Telora is unusually cold to the touch. She can radiate heat when she wants too, but her skin itself will feel quite chilly if touched even if she herself doesn't feel cold. As stated at the start, a walking contradiction. She has a lot of patience and will probably laugh off any comments made at her at first, often finding humour in even the smallest of things, but if she does get irritated then it's best to either watch out or steer clear from her for the time being.{/col}\n\n{col:ff0300}(Note: I'm using Felo'melorn's appearance for her weapon as a guideline, she DOESN'T wield the actual artifact weapon IC){/col}\n________________________________________________________________________\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-Arakkoa:512:256}\n{h1:c}History{/h1}\n{p:c}{col:ff0000}(Spoilers){/col}{/p}\n\n{col:ffffff}\n{/col}\n\n\n________________________________________________________________________\n{img:Interface\\ARCHEOLOGY\\ArchRare-StaffofAmmunrae:512:256}\n{h2:c}Personality Traits{/h2}\n\n{icon:ability_paladin_holyavenger:25}{col:ffffff}Good:\n\n- Absolute gentle-lady and softy -- that is until you either get to know her or irritate her\n- Not easily irritated, will most likely laugh at any jabs given to her\n- Hosts a brilliant barbecue, though will most likely burn everything\n- Giving, doesn't expect much in return\n- Mannerly\n- Polite\n- Charming\n- Level-headed\n- Bold\n- Somewhat careless\n- Open book\n- Can crack a joke, but will apologise sincerely if she's offended anyone\n\n{icon:ability_warlock_demonicpower:25}Bad:\n\n- Will sleep for days - she is the definition of lazy (a lazy adventurer, huh?)\n- Probably might take a joke a little too far\n- Doesn't really trust people all that easily despite being an open book, she will probably be friendly to your face regardless but it may take a while for her to consider someone a 'friend'\n- A walking contradiction\n- Stubborn, once you get in a debate with her if she's passionate about something she will not drop it\n- Quiet, unusually so at times\n- Can be overly confident, much like her sister\n- Can be scary if she gets angry\n- She definitely has her dumb moments, you'll know them when you see them\n\n{col:ffffff}\n{icon:thumbsup:25}Likes:\n\n- Fires\n- Starting fires\n- Roasting marshmallows on the fires she's started\n- Getting her hands dirty, especially if she's digging for artifacts\n\n{icon:thumbsdown:25}Dislikes:\n\n- The rain or anything close to water, despite being an exceptional swimmer\n- Lack of style both in looks and personality, even if she doesn't really care what she looks like \n- Partypoopers\n- The cold and/or feeling cold\n- Alcohol -- she doesn't deal well with flammable liquids\n\n{icon:inv_misc_book_10:25}Hobbies:\n\n- Sleeping\n- Singing and dancing\n- Archaeology\n\n{icon:spell_magic_polymorphrabbit:25}Quirks:\n\n- She doesn't like to handle things without wearing her gloves\n- She's very emotional and will probably cry at the simplest of things\n-\n\n{icon:spell_holy_silence:25}Secrets:\n\n- She's terrified of holding objects, especially those susceptible to breaking and/or cracking. If you try to give her something fragile, she will probably freak out\n- She once burned Kalidoria's hair so badly they had to shave it off, she still feels bad\n- She has used her powers to cook food, but is actually a very VERY terrible chef\n- She loves animals but is terrified of dogs\n-????\n-????\n\n{col:ff0300}(Befriend her to see her other secrets!){/col}\n\n{col:ffffff}\n||Appearance||\n\nShe is presented as you see her in game, she has no set attire.\n\n||Character Art||\n\n\n||Language||\n\nThalassian -- Native language\nOrcish -- Very literate and well-spoken, she speaks with high class.\n\n\n||Gait||\n\nIf standing still, she'll most likely have her hands in her pockets.{/col}\n\n___________________________________________________________________________\n{img:Interface\\Pictures\\artifactbook-warrior-scaleoftheearthwarder:512:256}\n{h1:c}{col:4c83e5}Plot Devices{/col}{/h1}\n{p:c}(For Walk-Ups){/p}\n\n{col:ff7f00}-\n-\n-{/col}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n{col:ffff00}(Shoot me a /W to discuss any other plot devices if you would like to RP; am very approachable!){/col}\n\n___________________________________________________________________________\n{img:Interface\\QuestionFrame\\answer-MageFire:256:128}\n{h2:c}Additional Information{/h2}\n\n{col:ffffff}- If she hasn't set fire to something lately, she will begin to get a little antsy. It's almost as if she NEEDS to set things on fire to feel sane.\n-\n-\n{/col}\n\n{col:ff00ff}Voice Ref:{/col}\n\n{img:Interface\\TALENTFRAME\\bg-mage-fire:512:512}\n\n___________________________________________________________________________\n\nOOC Info:\n\n- I've been roleplaying in general for 6 years now (I'm a writer), so if you're interested in roleplaying outside of WoW I'll happily give my Discord \n- I'm open-minded, but I will NOT ERP\n- Am new to Belf/High Elf lore so feel free to call me out if something is wrong <.< would rather know than look like a fool :D\n\n\n\n",
				},
