					["PH"] = {
						["TX"] = "Betti seems to be quite an average Goblin, being middle aged her hair has begun to grey slightly and it shows when she's not dying it in various wild colours. She often does it up in various styles and cuts, and in recent times she's stopped wearing make up and only occasionally puts a bit of it on. You could say her face looks slightly feminine but at the same time a strange mix of cunning and brutish, though her appearance is often dominated by an imposing pair of goggles which conceal any emotion which her eyes could possibly show.\n\nHer body is quite average, a bit bruiserish and bulky. She was once a model, but it's evident that those times were so three wars ago.",
						["BK"] = 1,
					},
					["PS"] = {
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "What's the word on the street?\n\n- Betti started off on Kezan and went into modelling in her early career.\n- At one point her modelling career mysteriously fizzled out and she went into PR.\n- She worked for the Kajaro Trading Company in Public Relations until Mount Kajaro Erupted.\n- She was on the Lost Isles.\n- She enlisted with the Bilgewater Battalion once the Bilgewater Goblins reached Azshara.\n- She worked under her husband Mondo in PR after she married.\n- Her husbands supposed death at the hands of Legion cultists was used as evidence at the trial of Fuse Flarespark.\n- Her husband later re-emerged having been found on the Broken Isles.\n- After his company fell through again, she re-enlisted with the Bilgewater Battalion and was swiftly promoted to the rank of Captain.",
						["BK"] = 1,
					},
				},
