				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Shout, Brother, Look",
						["IC"] = "INV_Archaeology_Orcclans_Jareye",
						["TX"] = "Heartfelt, easily distracted and a slur when he gets too excited. But there are still many ways to communicate.\n\nHis eyes are big and curious like an octopus.\n\nHis voice is thick and slurring with a tongue that is too big for his mouth. This however is growing less and less noticable as he is trying to articulate more.\n\n",
					},
					["3"] = {
						["IC"] = "70_inscription_vantus_rune_tomb",
						["TI"] = "It's a Sin To Tell a Thing",
						["TX"] = "He speaks slowly and rarely change the volume. Practice makes perfection.\n\n",
						["AC"] = true,
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Whispering Fingers",
						["TX"] = "A gesture here, a gesture there. Shoes extra way to communicate which seem to pop up at random. Like a habit.\n\nSometimes Shoe speaks in sign-language. If you know it, let me know!\n\n",
						["IC"] = "ability_paladin_handoflight",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Into Each Life Some Plants Must Come",
						["TX"] = "A toxic Nightfurnance named Boris. His thorns have paralyzing venom.\n\nDo not worry. It is home.\n\n",
						["IC"] = "INV_Misc_Herb_AddersTounge_Stem",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Don't Get Around Much More",
						["IC"] = "INV_Misc_Bag_31",
						["TX"] = "The guy seem to carry his job around.\n\nPouch of Tools: Among the tools are measuring tape, a foldable clipboard and a set of pens, aswell vials. There is also a radio that looks new.\n\nDotted Reading: A booklets. Should anyone look inside the papers, then all they will see are dots.\n\nThe Bracer: A bracer with a small hourglass, a green gem and a compass attached to it. All three are warm to touch.\n",
					},
				},
				["v"] = 30,
			},
			["time"] = 1614627040,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["v"] = 6,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\LFGIcon-BrokenIsles:156:156}\n\n{h3:r}*Holds his left hand flat and palm down infront of him while the right hand circle under it, pointing forward with the index finger while the rest are clenched.*{/h3}\n{link*https://i.imgur.com/aINvQZX.png*A bit of a maniac}\n{link*https://i.imgur.com/pkeBdQY.jpg*Portrait of the gobbo!}\n\n{icon:INV_MISC_HearthstoneCard_Common:50}\n{col:e2d8c8}[Apparance]\n\nShoe is a scrawny and outlandish goblin that smells faintly of plains and dirt, suggesting a very outdoor nature of life. His fingernails are scraped and uneven and stained by grass. His stance looks like the kind of adventurer that only want to crawl up by a warm hearth with an old tome and possibly mixing vials until the tavern roof gloriously explode.\n\nHis face is freckled but bare no visable scars. Doesn't spend a lot of times in hospitals, probably. The ears are large and stiff and rarely move. His eyes are purple, for all that matter.{/col}\n\n\n{p:r}{col:e2d8c8}{icon:INV_Boot_Cloth_PVPMageGladiator_O_01:50}\n[Clothes]\n\nThe clothes he prefeer are warm or wellpadded robes in simple patterns along with a sharp dagger. His cloth is made of thick material, which incline either freezing or hiding. Perhaps he need to cover his bare feet more?\n\nA booklet and pens are never too far away and often tucked under the left arm or in the pouch.{/col}\n{/p}\n\n{icon:Inv_misc_trinket6oOG_Handeye3:50}\n{col:e2d8c8}[Quirks]\n\nWhen socializing his head turn automatically from side to side with the sluggish ears following, apparently keen on looking on who he is talking with.\n\nHe doesn't seem comfortable around dogs. Infact if they come near he'll let you know.\n\nHe have very vivid gestures while telling a story, rather acting it out then speaking.{/col}\n",
				},
			},
