				["CO"] = "Voice reference: Before I leave this World - Iván Torrent\nhttps://www.youtube.com/watch?v=1zlIPDbpX0I\n\nSTR: 12\nCON: 18\nDEX: 10\nINT: 10\nWIS: 24\nCHA: 19\n",
