			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Quite short in stature for a Taunka female. She exhudes femininity. A clear, hourglass figure and she appears soft and physically weak, yet her eyes shows an inner strength you cannot quite describe. Her fur resembles the colour of the purest alabaster. Even her long, elaborately decorated and embroidered hair is pearly white which reminds you of freshly fallen snow. Delicately woven into her braids are numerous jewels, gemstones and pearls tastefully placed at irregular intervals. Her face seems soft and highly expressive, while a Taunka, you can easily tell that she is a female by the more delicate features.  Her almond shaped eyes are quite a prominent feature to her face. Her irises are a bright, emerald green. A quite stark contrast to her snowy white fur.\nHer elegantly backswept horns that also are a bright white that have been engraved with primitive runes that you cannot decipher. The runes are delicate and curved as they swirl around the horns like a river would bend around a forest.\n\nHer shoulders slim and narrow and her arms and hands even appear soft and small. Her bosom being quite ample. A quite flat stomach covered with more of her downy, feathery soft white fur. Followed by hips that would definetly speak of a feminine fertility symbol.\nHair tail is unusually long, swaying down at her ankles and at the end of said tail is a majestic brush of hair. Her entire tail seems to be carrying numerous rings, yet she does not seem encumbered or hindered by this fact.\n\nEven her hooves appear a bright white, as if carved from ivory. Even these she has not left unattended. Engraved with runes and near the fetlocks on her hooves she seems to have inset gemstones. These are blue sapphires.",
						["BK"] = 3,
					},
					["PS"] = {
						["TX"] = "Sweet and kind, this Taunka is quite an oddity among her people. Overly caring and protective of those she loves and holds close. Her disposition is friendly and often very sunny yet often quite lost in thought. Her voice is luscious and very mellifluous sounding. At times she's very much the idiom \"heart on her sleeve\". not being afraid to show every emotion there is. Even intimate and strong emotions in an honest and open manner. She very much likes jewelry and gemstones, another oddity for a Taunka. While she loves all creatures there is one type she is absolutely mortified even seeing or being spoken of: the arachnid sort. Any spider causes her intense discomfort and and fear.\nWhile she often appears calm and controlled she is also considerably chaotic and wild, enjoying music and dance. Her singing is said to even cause the most cold-hearted stop in their tracks.",
						["BK"] = 3,
