			["link"] = {
				["Velindria-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{link*https://i.imgur.com/5IxYeu3.jpg*Art commission}\n\nBrief Description: \n\nVelindria is a prime example of Elven features, with her body being rather feminine and elegant in nature, though still kept to a high standard of health with a noticeable toning of muscles to it. She quite clearly cares for her appearance, occasionally wearing nail polish or paint and very often has her raven-black hair in a long braid. Her equipment and attires are always colour coordinated and unmistakably Elven in their style.\nA few piercings are spotted on her body, some in her ears and one in her navel, a gold ring with an azure blue gem in it.\n\nExtended Description:\n\nVelindria is a taller than average Sin'dorei with long and raven-black hair, often put into a lengthy braid hanging from the back of her head, usually slung over her shoulder and cascading down her front. Most of the time she has a neutral or curious expression on her features.\n\nThe womans face is very typically Elven, with soft edges, smooth and rounded cheeks and chin. Her nose extending out into a small yet elegant point, and her eyes being slanted slightly in the usual fashion. Her lips usually carrying a light layer of lipstick in a red colour.\n\nHer hair is surprisingly smooth and silky to touch, a lot of attention seeming to be put into it. It spends most of its time braided, but at times one might find her with it let loose, letting it fall on her shoulders and down her back, roughly reaching the middle of it.\n\nShe carries the natural shape of her kin, with a healthy hourglass figure adorning her body. This being showcased by her usually avoiding too loose clothes, preferring somewhat tighter tops or outfits.\n\nSomething that is rather obvious, especially in her most common attire, is that she likes to keep fit and stay in shape. Her stomach showing some subtle abs, only visible if one were to take a closer look. Her nails extend slightly past her fingertips, ending in a smooth curve at the tips of them.\n\nHer typical outfit consists of a long skirt, reaching down to just above her ankles. It being made out of thin and soft wool, almost feeling close to silk, though any knowledge about either fabric would make it more obvious. The upper portion being clothed by a strapless top in matching blue and yellow colours, made out of the same materials.\n\nIn comparison to her torso, she has rather long and sleek legs that seem regularly trained, something that may strike most as odd considering Velindria's appearance. Her toenails tending to have some kind of nail polish or nail paint on them, often in a blue colour.\n\nThe females arms are about average in size and not quite as toned as her legs are, though still slim and healthy with the expected feminine hands and fingers being found at the end of them, sometimes also with blue nail paint adorning them.\n\nAdorning her narrowly pointed ears are two golden rings, placed a bit above halfway up the length of the ears. The left ear carrying two earrings, with the right only having a single closer to the tip.\n\nLocated in her belly button is yet another piercing, one that often shows in her usual attires. It is also a golden ring, but at the apex of it, it has an azure blue gem embedded in it, one that matches the colour of her most common attire. It's not large, but big enough to notice it from a distance, as well.\n\nVelindria has nothing in the way of scars on her body, not somebody that seems to have experienced lots of strife or combat in her life, which is rather odd considering her age. It is suspiciously pristine.\n\nShe has the look of a woman well into adulthood, but her body has no wrinkles or noticeable signs of old age on it, having resisted the test of time surprisingly well, something she seems to take pride in.\n\nLocated around her waist, attached to her belt, are various sacks and satchels of alternating sizes. To anyone sensitive enough to magic, they might feel a noticeable degree of energies around the woman, though exactly where from is hard to discern. The containers being a prime location, however.\n\nVelindria also has a secondary attire, which merely consists of a very simple looking black leather and cloth outfit, a few decorations spotted here and there on it, if not only to make it look a bit more elven in origin, otherwise looking completely plain, perhaps too plain for an elf like her. It would often have a black woolen cloak, with some decoration around the edges of it, with it. It's used to shield her from the harsh elements, probably a travelling attire of hers.\n\nA hat in matching theme is often worn with this set, being used to give shadow for her eyes in bright and sunlit areas. The craftmanship of said headwear is surprisingly good, the materials used for it clearly of a very high quality.\n\nAlong with the rest of her supplies and equipment, she carries a long scabbard on her belt, connected on the left side of it. Depending on her attire, this is either a blue and gold leather sheath, or a black and gold one, both of similar design and clearly elven.\n\nOften held in her hand or hanging from her back through a simple system that locks it in place, is a staff. The item being constructed from a long metal rod with a large and bright yellow crystal spotted at the tip of it, and four smaller ones of similar design circling the main one.\n\nA larger container of sorts placed on the right side of her belt, also in matching colours to the current colour theme of what she's wearing at the moment. It has a very similar shape to that of a tome, Velindria's spellbook held inside. The book itself being matched to her outfit as well, and with golden ornaments in a very elven style across the surface and spine of it.\n\nA much rarer sight, especially when not residing on or near a battlefield, is a third attire, which happens to be much more combat oriented. It consists of some sort of metal tiara, with a sizeable purple gem embedded on the front of it, it obviously being enchanted. Two spikes protrude from the headwear in both the back and above the crystal, the ones in the rear much larger.\n\nA pair of thick leather shoulderguards, reinforced with bits of metal and a decorative array of luminescent feathers sticking out from below them, giving off a soft magical sensation when near the mage. Yet another gem of similar colour spotted on either shoulder, these most likely providing energy to the plumes. Attached to the shoulderpads is a long cloak, the colours specifically chosen to suit the outfit.\n\nCovering her form is a long robe, also made of durable leathers, dyed to suit the colour scheme. No energy having been spared on making the attire look as decorative and impressive as possible to onlookers. A pair of cloth gloves with bits of leather and thin strips of metal protecting her hands underneath the sleeves of her dress, as well as a pair of sturdy travelling boots.\n\nSpotted in a scabbard hanging from her waist is an unmistakably Elven blade, the pommel of it painted black. A faint, purple glow covering the sword, giving off a soft hum if listening closely. On her other side hangs a strange disklike object, many crystals sticking out from bits of metal. She seems to use it as an improvised buckler.",
				},
