					["TX"] = "{h2:c}{col:cfffff}Alenore Winterfall{/col}{/h2}\n\n{col:ffffff}\"Nobody is ever born into this world as a soldier.\"\n-Alenore Winterfall{/col}\n\n{icon:INV_Belt_Armor_BloodElf_D_01:25} {col:99ff69}- Personality{/col}\n{col:ffffff}Alenore is usually friendly. She is calm and reserved and aims to speak respectful to those around her. Though somtimes stubborn in some aspects, it shows that she doesn't simply let herself walked over by others.\n\nThis makes it pleasant for many people to be around her. She puts others before her and acts out of kindness to help others. It is not easy to anger this elf, but should push come to shove, she doesn't shy away to show her fangs. \n\nAlenore is a sweetooth and can easily be swayed with sweets and candy, much to her own dismay as she is worried she might get fat from too much consumptions. Overall, however, Alenore radiates positivity towards others. {/col}\n\n{icon:INV_Misc_Book_01:25} {col:99ff69}- Background{/col}\n{col:ffffff}Alenore was born in the prestigious family of high-elven rangers who made their home within Windrunner Village, shadowd by the impressive Windrunner spire, in the western parts of what is now called the Ghostlands. She is the second-born daughter of Turonal and Sele'mari Winterfall, and as such, the younger sister of Aru'naere.\n\nDispite archery being the legacy of her family, Alenore didn't have much interest in the profession and aspired to become a magister in the High Home. Showing affiliation with both the arcane as well as pyromancy, she was eventually send to the capital city to undergo professional training from the magisters.\n\nThough her sister never liked the fact that her younger sibling didn't become a farstrider like she did, the two were still very close and spent most of their times together outside their studies and training. Alenore has always looked up to her sister and aspired to become a strong individual as her someday. This would change, however, when Quel'Thalas fell to the Scourge. Her family was routed like many others, including her sister.\n\nThe heartbreaking news that her sister had become a Dark Ranger in service of Lady Windrunner was a dark time for Alenore. Dispite this, she had joined with the Horde and fought alongside her new allies for several years.\n\nShe recently decided to give up on being a mage and started her studies with archery. Coming from a prestigeous household known for their archery skills, she found that if she wished to restore her house, she had to continue their legacy. {/col}\n\n{icon:Achievement_Character_Bloodelf_Female:25} {col:99ff69}- Appearance{/col}\n{col:ffffff}With a new perfect symmetry to her facial features, which was common among the Elves of Quel'Thalas, Alenore can be described as an exceptionally beautiful individual.\n\nTo onlookers, she must be in the prime of her life, making it hard to discern her exact age. Her almond-shaped eyes, are rich in color with a distinct sea-cyan. Obsucring her marine iris by a little. Her long eyelashes neatly decorating her orbs of observation.\n\nAbove her eyes rests a neatly trimmed pair of long and slender eyebrows. Which shows that she still gives proper attention to her looks. Their dye is the same blonde as her sun-kissed hair. Her nose is small and slender and moves delicately to a curve upward at the tip, common among the elves of the High Home, which only further compliments her facial beauty. Alenore sports relatively high cheekbones, which gives an enticing detail to her visage, complimented nicely with her soft looking chin. Her lips are thin and don't appear to be wearing any lipstick at all times, still, they are colored with life and radiate a small pinkish hue from her otherwise pale skintone.\n\nOverall, these features give Alenore a warm and welcoming expression. Finishing off this look is her elegant long, blonde hair, curling playfully around her head at some places. It shows that this elf is making sure to keep her hair in presentable state. Her hair is sumptiously thick and sports a few tresses to the flanks of her face, reaching down to well passed her neck.\n\nThough she is not overly tall for an elf, standing at an average height, she gives the appearance of being a lot longer thanks to her long and sleder legs supporting her body. Though, this is often not seen thanks to the layers of clothing she prefers to wear. Her muscles aren't anything special. Though she doesn't appear like a stick, it is easy to see that she refrains from performing heavy bodily exercise. Perfoming just the neccesary to remain in a healthy condition.\n\nBelow her chest lies the expanse of her stomach, relatively slender and quite feminine. A slim and round bellybutton decorates her healthy abdomen unimstakingly feminine in appearance. Further down below, her firm waist flares into wide hips that doesn't appear to have ever carried any children in the past. All in all, it gives this elf an almost hourglass shaped figure.  {/col}\n\n{icon:Ability_Warrior_WeaponMastery:25} {col:99ff69}- Weapons{/col}\n{col:ffffff}When it comes to weapons, Alenore doesn't have many of them. She carries a long and slender bow with her of standard elven design.\n\nHaving been a mage prior to being a ranger, she is well-versed in the use of arcane and fire magic. Though she only uses magic in combat if the situation demands it. {/col}\n\n{icon:inv_misc_stormlordsfavor:25} {col:99ff69}- IC Bits{/col}\n{col:ffffff}Voice reference: Not yet determined{/col}\n\n{icon:Achievement_LegionPvP5Tier3:25} {col:99ff69}- OOC Bits{/col}\n{col:ffffff}± 10 Years of RP Experience.\nAlways approachable\nCan do /roll battle but prefer emotes.\nKind, knowledgeable about most lore, helpful, chance-giving, respectful, tolerating, direct. \nProfile created: 25/07/19{/col}",
				},
