			["about"] = {
				["T2"] = {
					{
						["TX"] = "Tall, with blue skin, silver eyes, and white hair, Adelais appears much like a typical Nightborne. She has a somewhat athletic build - certainly so for a studious mage, at least - and is mostly seen wearing wide, comfortable, but nevertheless elaborate and pricy looking robes or dresses. \n\n{link*https://cdn.discordapp.com/attachments/571636899786260480/772412328322269224/GCqfleeh.png*Link to art!}\n",
						["BK"] = 1,
						["IC"] = "inv_nightbornefemale",
					}, -- [1]
					{
						["TX"] = "Fascinated by the world outside the one of which she grew up, Adelais is a naturally curious and outgoing person, albeit with a slight haughty streak at time. Nevertheless kind and doing her best at acting respectful of others (although not always succesfully so) she is always eager to learn more - and as a result often finds herself getting distracted far too frequently. Although the arcane is her primary interest, she possesses a wide variety of interests that she'll always be eager to hear, or blather on, about.\n\n\n",
						["BK"] = 1,
						["IC"] = "spell_shadow_brainwash",
					}, -- [2]
					{
						["TX"] = "Originating from - like all of her kin - Suramar, Adelais was born after her people had separated themselves from the world already. One of many children of a family of some wealth, it did not come as a surprise that she started pursuing a variety of matters related to the arcane, studying for many, many years as she learned more about the magics she started to wield - both how to use them and the theory behind it all.\n\nWhen the Legion came and her people started to resist, Adelais would eventually vacate her home for the time being, hunkering down with the Nightfallen - and being lucky enough to not fall into a Withered state. \n\nSince the end of the Burning Legion's invasion, she's seen to travelling across parts of Azeroth, both out of interest and to further her own myriad of research topics - whichever it is that she fancies for the time being.",
						["BK"] = 1,
						["IC"] = "inv_misc_book_18",
