					{
						["TX"] = "{h2:c} {col:FFB200}Taztai{/col}{/h2}\n{h3:c}{col:69BEB0}The Dancing Monk{/col} {/h3}",
						["BK"] = 1,
						["IC"] = "inv_staff_2h_pandaraid_d_02",
					}, -- [1]
					{
						["TX"] = "{h3}{col:FFB200}Description{/col} {/h3}\n\n{col:69BEB0}A shock of bright yellow hair advertises this Darkspear troll's sunny disposition and zest for life, evident in his bouts of highly animated movement and bursting enthusiasm. Taztai's features are young and unblemished, only sharp around his nose and jawline, and seem naturally given to wide, cheerful smiles that light up in his tropical green-blue eyes - possessing of an occasional glint of true cunning in them, contrary to how he otherwise appears to wear his heart completely on his sleeve.\n\nA lean and wiry body is naturally given to finding rhythms and music within everything, his clear love of dance just as barely contained as his habit of tapping, drumming and humming to the tunes that spring to his mind. However, though his outward manner is jovial all-around, he is still built for speed and further clues all about his person suggest he isn't helpless nor as absent-minded as he lets on. Taztai's attire is light and loose with a preference for warm colours, allowing for ease of movement and his hands and feet, callussed in certain places from repeat impact, point to his focus on hand-to-hand combat./col}",
