			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-Drustvari:512:256}\n{p:c}Izzari \"Izzy\" Fusesparks was born into a family that was wrought by a fel addiction and due to the close connection to demonic magic, they grew up around many demons and fel energy. Their parents fanatically worshipped a Nathrezim, who in the tome Izzy still carries, was named Izzarin, which led to Izzy gaining their full name.  At a young age, Izzari was trained in the ways of the dark arts by their parents, this would lead to them being used as a conduit for demonic energy by the two, which led to their want to leave their family behind. They finally did this when they were seventeen, they stole many things from their parents' collection to help keep themself safe, including a fel codex and a skull possessed by a demonic being.\n\nAs they wandered around, they visited both Horde and Alliance settlements, learning many things from both, things like more magic and languages. A run-in with a \"strong opinioned\" Alliance soldier made them lean more heavily towards the Horde and eventually joining them fully.{/p}\n\n{img:Interface\\QuestionFrame\\answer-WarlockDemonology:256:128}\n\n{p:c}Appearance : Izzy on the surface seems to be quite a typical goblin, if not slightly more attractive. They have a toned frame and slender face, though some more demonic features stay shown, like fangs and sharp claws. Beneath their magical facade, Izzy appears much more demonic, small horns and fel cracked skin now show.\n\n\nPersonality : Izzy at first glance seems like one of the snarkiest, fun-loving and most daring goblins there is, but trust me, they can get deadly serious...emphasis on the \"deadly\" part, if you get on their bad side.{/p}\n",
