						["TI"] = "Appearance",
						["IC"] = "Ability_Rogue_StayofExecution",
						["TX"] = "Maxim'elora is still a young girl who is still blooming.\n\nHer white long hair lay over her shoulders. Her hair looks very well-groomed and combed.\n\nShe has a young face, with small freckles on her cheekbones. She has a soft and sweet voice. Her manner of speaking is like Cat from Sam&Cat.\n\nHer physique is not very big for a Blood elf. She is slightly smaller than an average female elf. She is muscliar and still training to become stronger.\n\nScars:\nNone",
