						["TI"] = "Weapons",
						["IC"] = "ability_rogue_fanofknives",
						["TX"] = "She is still in training.\n\nHer daggers are special handmade by her family.\n\nOne dagger is made for frost and the other one for fire, as she wield arcane. It has no use to steal them, they only react on Maxim'elora her touch of energy\n\nWeapon skills:\n- Sword (Single, master)\n- Daggers (Combo, master))\n- Archery (Progress 20%)\n- Close combat (Progress 60%)\n- Self defence (55%)\n- Shield (Progress 5%)",
					},
					["3"] = {
						["IC"] = "inv_misc_book_08",
