						["TX"] = "Maxim'elora always carries a small notebook on her belt. She occasionally writes in her notebook.\n\n  Try not to grab her notebook because she is very protective of her notebook.\n\nWhat does she register there and what kind of drawings does she make?",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Education",
						["IC"] = "inv_misc_book_11",
						["TX"] = "Maxim'elora is smart and learns things very quickly. Her favorite activity is reading. Learning and reading.\n\nShe has high marks at school and is in her senior year before graduating from high school. (Or fail, who knows what the future holds.)\n\nDespite the fact that she is very young, she is already quite far with her Arcane lessons.\n\nArcane basic:\n- Calls sigil (Shal'dorei)\n- Shield/barrier (Master)\n- Arcane Bolt (Master)\n- Transform objects with Arcane bolt (Starter)\n- Call Arcane without sigil.\n- Frost / fire ability on weapon (Medium)\n- Illusion (Progress 12%)\n\n~Cursebreaker education (5%)\n~Arts of shadow (30%)\n~Arts of arcane (70%)",
