			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Strolling down the street, a fifteen-year-old girl. With her long dark hair, covered in mud and filth, with green eyes. Deep green eyes, emerald green eyes. A girl named Maxim'elora Strongvein. Abandoned and left alone, she looks back to the point where she is now. Her life was anything but roses.\n\nIt started with her mother, Daendori Oddfeast. She hooked a royal guard. They saw each other regularly and this suited the two. The more they saw each other, the more contact there was. She eventually got pregnant by Tynvendon Strongvein, a royal guard from the Spire, of Silvermoon City. Before she could tell she is pregnant, he broke off contact with her. He was not allowed and did not want contact with a normal citizen. It was hard, very heavy. She had a child in her stomach, with no future. No plan for the future and she knew she had to do it alone but how? Her own family fought in the war or were killed or died of old age. Daendori stood defeated by the fountain, watching the man she was so deeply in love with walked away. To his group, to his team and every step further away from her.\n\nThe nine months pass quickly but whether Daendori can enjoy this is not so sure. She mainly blames the others. She can no longer do what she likes to do and that is gardening. Her beautiful garden at the house is overgrown, weathered, you can consider it lost. She couldn't help it anymore, if she couldn't bend over, move freely or spend hours. The unborn child got in her way, she couldn't do it anymore. Tynvendon was not even in the picture anymore. In nine months he is married to a woman, royal magister of the Spire. This news finally reached her. She felt nothing more than anger and horror, not only towards him. But also to the unborn child. After the moon was at its highest position, the contractions were induced. Her neighbors heard and called a doctor. This accompanied her with the birth of Max, which lasted a few hours in the end. For a first child, it was quite easy and before she knew it, Max was in her arms. Cleaned and cut loose from her umbilical cord and wrapped in a blanket, Max looked at her mother. She was silent after crying for a long time, calm with her green emerald eyes. Daendori didn't know what to feel. Joy of a birth, of a child. Hate by betrayal or what it's never meant to be. He is a royal guard and she is a citizen, a simple resident of Silvermoon. She was just a gardener, a cook.\n\nLittle Maxim’elora’s childhood was filled with conflict almost from the very start. Daendori, Maxim’s mother, but a mere 4 months into her pregnancy was abandoned by the one she loved, Maxim’s father… Tyvendon. Daendori, however, never blamed the child for the father walking out on her before receiving the news. Many months pass by and Max is brought into this world and upon one beautiful summer day in Silvermoon City, Daendori strolled along the streets, with baby Maxim’elora in a tiny baby carrier, tied to her chest.The little elf enjoyed Silvermoon, each floating green fel-crystal gleaming amongst the sunlight in the sky and the gentle hum of the city… it was calming. Much like all the other Sin’dorei, Maxim was given arcane to supplement her needs, as was the Sin’dorei curse. Though it saved the\nelves, Daendori disliked the power that addiction to mana and fel brought and poor baby Maxim was too adolescent to understand. The mother always told her daughter that Arcane can be just as bad as anything else, it could cause hatred and destruction. Maxim’s mother rounds a corner to spot a rather familiar face, Daendori’s former lover Tyvendon. Anger filled her, but it wasn’t something to spark a rage, no, it was a deep sadness that her little girl was unaware of. Many thoughts rushed through the Mother’s mind, “Should I tell him?”, “Is it better for him not to know?”. Daendori steeled her resolve, calmed\nher worry and took a breath as a stroke of courage filtered in. She patted herself down and raised her head high and proud and walks by, not even acknowledging the presence of the former lover.\n\nTime goes by and four years has passed, Maxim’elora was a fast learner. She managed to pick up walking and talking at a young age. The devious little girl had even learned to pick things up which drove her poor mother insane. Though the inquisitive little girl was confined to the house she lived in, no freedom, no exploration, it all became a bore after a while…\nHer mother, being protective, didn't allow her to try anything and the only people she spoke to was the odd visitor… every few weeks.\nThis wasn’t wholly Daendori’s fault however… She used to be a strong woman, one that worked as a gardener and supplied coin -AND- cooked for the family. But sadly Maxim’s mother fell into a depressive state after hearing that her family was practically cut in half in the war. Brothers, Sisters, Uncles and Aunts who all sacrificed their life to save azeroth from the threat at hand. This turns her bitter, almost a shell of her former self. She was growing\ndistant from her own daughter, perhaps the only one she had left. She simply didn’t understand Maxim either, why does she want to learn and not play? Raising a child was definitely more difficult than one had thought.\n\nTwo years passed and conflict remained in the house, at Maxim’s six birthday she received no cake, no celebration and not even the tiniest inkling of a gift. But oddly enough the girl was used to it by now. The living conditions for the pair were borderline squalid due to the Mother losing everything. The House, The luxurious garden. They had to move to a small room in the middle part of Silvermoon. The deprived area of the Elven city. And poor little Max was left with a rag doll, a gift that she had received from a sibling, and the clothes on\nher back. Which was the only thing she wore. Daendori, her condition getting worse over the years, cannot even fathom the idea of going outside the house and sends her daughter, Maxim’elora, to do her bidding… more and more each month. Maxim’elora gets to know a few people on the street, including slightly older children. They also wear dirty clothes, just like Maxim'elora. At first she was very shy, keeping her distance because she doesn't know how to communicate with others. An older girl notices this and takes her distance from Maxim'elora. For weeks the girl observes Maxim'elora and when she walks home, the girl addresses her. When she walks along, she tells who is where she lives and that she also cannot go to school. Maxim’elora gets to know her as Belnore Swiftrest. Belnore was only twelve years old and she too was the girl on the street. It takes a few months for Maxim'elora to dare to talk to her at all, and when she does, they are long stories. She finally comes out of her shell.\n\nYears go by until Maximelela has turned twelve years old. Not much has changed, other than herself. She's grown up, too mature for her age, but doesn't understand much about what she should be of her own age. She can take reasonable care of herself, such as taking care of food. She barely sees her mother, if at all. Maxim'elora was afraid of her. She didn't get answers to her questions, she had to do more and more around the house. Maxim’elora ran the entire household on her own, but learning became impossible. Maxim'elora still cannot read or write. What she used to feel for her mother is completely gone. No love, no affection. Only anger, hate and fear. Daendori was only concerned with herself. Man after man came by. Left Maximelora as filth, as if she didn't exist. A child who just enters your house, does your household and leaves again. She was deeply unhappy with her mother. One evening, Maxim'elora wanted to know who her father is so she could live there. Daendori was not served by this. She didn't answer, but she spanked Maxim'elora. Hit her hard until Maxim'elora found a way to flee the house. She didn't get it, how wrong she was. She does everything for her mother but nothing comes back, only hard words. Hate words, displeasure, anger. It wasn't Maximelela's fault that her father never wanted to contact her mother again. It was not her fault that her mother got pregnant. From then on, things only got worse. Dreandori takes the most impossible step a mother should never make. That day she walks the market looking for the wrong people. People you would rather not come near. Eventually she comes across a group, tells her that she has a worthless daughter and asks only twenty gold coins to take her over. The group agrees and Draendori runs home quickly, Maxim'elora says. She does not know what will happen to her, but she follows her mother, without any problems. Draendori arrives at the group and she pushes Maxim'elora towards the group. She looks around anxiously and the men start to judge her. Squeezing her arm, pricking her upper leg and pulling her hair for a reaction. Maxim'elora does not react strongly to it, just the opposite. She allowed it. She looked at her mother, filled in her eyes with disappointment, anger, fear, but especially hatred. How could her own mother do this to her. The group gives Draendori the money and Maxim'elora watches with her eyes wide open. They just gave money to her mother. Her mother suddenly sold her to total strangers. She couldn't believe it. Overwhelmed by her feelings, she runs to her mother, but just before she could grab her mother she was caught by the men. They held her no matter how loud she screamed for her mother, who slowly walks away. Proud that she can now buy some food and drinks. Without looking or blushing, Draendori walks on, the last moment Maxim'elora saw her mother. For weeks to months, she does not hear from her mother and has not seen her. Max, on the other hand, is starting to feel insecure. The group she was left with is a group of criminals. They force her to steal or be pathetic so that they can do their job.\n\nOne evening they go out again. They are going to try to rob a group of guards of their money. A few men take a knife and they approach Max. Max looks at them scared and she is being held. One of the leaders presses a knife against Max's cheek and slowly puts more pressure on her skin until a cut is made. No matter how hard Max thwarts, he keeps going until it's a reasonable wound. Max manages to gather courage and she kicks the man in his case. He gets furious because what man likes that. He looks at Max in silence and his eye color changes to black. The group around them are starting to get nervous. The leader approaches Max and places his hand on her head. He starts speaking a very old language, which is similar to void calling. Slowly Max starts to get a bad headache. She feels a lot of pain in her body, she is very uncomfortable. The man places his other hand on her stomach and sends a Shadow Orb in her stomach. All Max can remember is that she got a bad stomach ache and a huge headache. She wakes up again after a few days. She felt different. Completely different. She was no longer herself and there is a constant whisper in her head. Max slowly gets up and looks around her. Where was she? What happened? Why does she feel different? Where is everyone? When she starts walking, she sees that she is in the camp of the group, but no one is present at that her chance and she ran away. Very hard. She knows she is deep in the forest of Eversong Woods. She accepts no doubts and she keeps running. The whisper in her head forces her to stop and she can't think clearly when she runs towards Silvermoon. Before she's just over the hill, she is tackled by one of the gang members. Max screams for fear, pain, but most of all anger. She tries to break free but this fails. She is taken back to camp. The leader was not happy that she had run away. He paces along the campfire. What to do with her. He thought about it for a long time and snaps his fingers and she is grabbed by two men. The leader picks up his whip and they force her to her knees. “You are nothing but problems and that includes a punishment. You belong to me and you listen to me. And not only that. You do what I want without struggling. ” Max looks at him scared and she takes a deep breath. He lashes out over her back, legs, arms and shoulders. He wanted to enforce his leadership with this. After the punishment they release her. She starts to cry when she feels how much it hurts. She had no choice but to listen. She is then dragged to her tent, left as if she were nothing.\n\nShe follows the leader for months, does what is expected of her. For months she was often slapped in the face, punished. Max had to do something to get free, get away from the group. She goes and is allowed to go to Silvermoon more often and she does. She is fifteen years old and she walks down the street ……\n",
				},
