					["6"] = 2,
				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Makeup (On-Stage & Otherwise!)",
						["TX"] = "Easing up in recent months on his \"Makeup on at ALL time policy\", Maestral usually only wears his signature face paint when he is due to perform on stage nowadays. During such times, his visage is pasted a pure dazzling white, constrasted by burgungy colours that form a \"star\" around his right eye, a small heart beneath his left and his lips painted dramatically in the same colour. Oddly enough, such a colour scheme seems to make his emerald eyes burst with more colour imagineable, giving him quite a captivating and enticing gaze. This \"facepaint\" is very rarely seen with any flaws. Sweat, smudging or anything of the like seems to do very little to affect his look, possibly eluding to the fact the makeup is protected by a magical charm or incantation prior to performing.\n\nWhen taking some time off performing or relaxing, Maestral's makeup tones itself down rather significantly, on rare occassions he'll even wear nothing at all! More often than not thought, he chooses to completely forgo the stark white mask over his skin, opting for a natural base to flaunt previously concealed freckles across the bridge of his nose and cheeks as well as donning a simple burgundy eyeshadow and lip combination.",
						["IC"] = "INV_Inscription_Warpaint_Red",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Scent",
						["TX"] = "A lingering scent of incense clings to Maestral's being. A smoky, floral and musky scent all-in-one that captivates as well as his physical appearance does.\n\nHe is a clean individual, though given his profession and how active it can force him to be, he can often at times have the scent of fresh sweat intermingling with his everyday scent, especially immediately after a show that requires a lot of physical activity. He usually washes very soon after a show so the scent never develops into a -rancid- one...",
						["IC"] = "INV_Alchemy_CrystalVial",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Flamboyantly Strange Style",
						["TX"] = "Every bit the showman, right down to the way he presents himself, Maestral's appearance is very much one which he uses to his advantage to get noticed. With this man, there's no such thing as \"Casual Attire\".\n\nHis crimson hair is perfectly coifed at the front, his dainty painted face framed by deliberately styled curls. The rest of his hair that was once styled into an exotic dreadlock style has since been brushed out and let flow loosely over his shoulder in a long, wavy mane of scarlet down to his ribs.\n\nHis attire is just as striking with deep crimson clothing trimmed with white ruffles and layers of waistcoats, tailcoat jackets and shirts. Vertically striped trousers fit tightly against his long and slender legs tucked beneath well-shined black leather knee-high, heeled boots. A large \"teardrop\" shaped necklace of black opal gemstone set in dazzling platinum rests around his neck and atop his collarbones, a piece of jewellery that matches a heart shaped black opal ring set in platinum claws that don's his left index finger. Both pieces of jewllery are very dear and treasured gifts it seems and ones that he is -very- reluctant to ever remove. In addition, a beatifully intricate golden frog ring adorns his right ring finger, one encrusted with beautiful emeralds for the eyes. \n\nMaestral's ears don a respectable amount of golden piercings, large hoops, smaller loops and star shaped studs being the most notable of which. To finish his look off, his nails are grown out to around 3 inches in length and finely manicured into a slender square-tipped shape, laquered in burgundy polish to compliment his facial makeup.\n\nThere also appears to be a new addition on his left hand...a wedding band most stunning! Rose gold, platinum and with a teardrop cut Morganite gemstone taking the crowning centerpiece. A symbol and promise of eternal love from someone dearly beloved...",
						["IC"] = "Ability_IronMaidens_GrapeshotBlast",
					},
					["5"] = {
						["IC"] = "Ability_Priest_BindingPrayers",
						["TI"] = "Speech Mannerisms",
						["TX"] = "Fancying himself as a man of culture, Maestral's voice, softly spoken yet richly enticing, enough so to command crowds to his will, tends to adopt various foreign languages within his everyday flow of speech, most notably a distinctly Shalassian dialect, a reflection of his enamoration with the Shal'dorei people and their elegance. \n\n(OOC Note: I am using FRENCH terms of phrases to add a little flavour to Maestral's dialogue. He's not speaking French, this is my OOC interpretation of what the Shalassian language may sound like to those more used to hearing the Orcish/Thalassian dialect! I'm taking a few liberties given how few -actual- canon Shalassian words of endearment are known to us at this time. As all of our characters are techinally speaking a fantasy language that is translated into English for our OOC convenience, please do think of Maestral's French language quirks as an extension of that \"translative convenience\"! ^_^)",
						["AC"] = true,
					},
					["4"] = {
						["IC"] = "Ability_DemonHunter_VengefulRetreat2",
						["TI"] = "Body Shape",
						["TX"] = "Not a man of -towering- stature, but not short either in reality, Maestral's average height seems to be accentuated somewhat by the length of his lithe and slender limbs and body. Whilst he's incredibly svelte in shape, he's also surprisingly well toned and physically fit with muscle visible clearly in his arms, torso and legs especially, speaking volumes to the extent of his physical training and mastery over his own body.\n\nBeing a contortionist amongst other things such as an acrobat and also a keen rider, his body moves in -very- flexible ways and in manners that would look horrifically uncomfortable to the general populace! He takes it in his stride however, curling his legs over his shoulders being as natural and enjoyable to him as one would find folding their arms to be.",
						["AC"] = true,
					},
