			["about"] = {
				["v"] = 78,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h3:c}{link*https://imgur.com/a/mKBTVWf*Quick bust sketch of Maestral in full performance makeup and attire.}\n\n{link*https://imgur.com/a/awIif3d*Without makeup (A VERY rare occurrence!!)}\n\n{link*https://cdn.discordapp.com/attachments/605644404795113472/617747337443540992/image0.jpg*BEAUTIFUL artwork of \"Casual Maestral\" done by my VERY dear friend Raigarath Alem'daar! (Please check out his work!)}\n\n{link*https://www.deviantart.com/raigarath/art/Merry-Christmas-Raigarath-and-Lavarro-822183209*\"Together at Winter's Veil\" by Raigarath Alem'daar}\n\n{link*https://imgur.com/undefined*\"Stardancer & Moonsong; Maestral's Caravan Horses\" artwork by Raigarath Alem'daar!} \n\n{link*https://www.youtube.com/watch?v=4sAtqBrHA2I*Maestral's Theme: \"Imaginaerum\" by Nightwish}\n{/h3}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-93:64:64}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n{h3:c}{col:cca040}\"Life has presented me with two paths to take;\nBe a performing Hozen for the masses to gawk at.\nOr to live resplendantly at the tempo of my own tune.\n...And goodness...\nthe melody of this song is so exquisite....\"\n{/h3}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}{/col}\n\n{p:c}{col:ffb72a}\nAn uncannily familiar face...perhaps last seen during a play. A poetry recital. Or maybe even an acrobatic performance.\n\nIf it is even him at all, the mask concealing the true guise of Maestral has long since been hung up...\n\nThe time to live his truth has come.\n\nEmbracing his birth name of Lavarro and marriage in turn helping him to shed his shameful Dal'dier lineage, the masquerade of the enigmatic performer has been killed as efficiently as those at the mercy of his twin poison daggers.\n\nWith the confidence exuding and a self-assured air promising he is far more than the mere persona he donned to conceal himself with, Lavarro's wish to be unapollogetically himself spelled a new direction in his already twisted and spiralled life.\n\nDebonair, dandy and oozing eccentric style and sophistication, a new look serves as the poster child for his new ventures as a fashion designer catering towards the Illidari. Their demonic mutations and unique forms must be catered for accordingly after all, inspiration for such being taken from the very personal struggles in his married life.\n\nA perfectionist, a hopeless romantic at heart with an air of snobbery and dramatics, to say his personality marries well with his new profession would be no understatement. \n\nHe is as flamboyant as the garments he crafts...and one could unironically say he wears his personality on his sleeve...\n\n{/col}{/p}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-55:64:64}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n{h3:c}{col:ab0b28}\"When word spreads like wildfire that you kill for pay,\nthe association never truly leaves you.\nTry as I might to live a quiet and peaceful life...\n...This world will always want blood but rarely is it willing to dirty it's own hands.\n\"The Sanguine Harlequin\" never truly hangs up his daggers for good.\"\n{/h3}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n{p:c}{col:c72f33}Whispers in the dark underworld tell tales of a brazen assassin. \n\nA painted man known only as \"The Sanguine Harlequin\". \n\nKilling to him is an exact art. One which must be executed with precision and artistic integrity. He believes death to be a thing of beauty and that if a life is to be forcefully taken, it must be done so with the utmost respect for the target in question's dignity, granting a clean and graceful end to their lives...\n\n\"The Sanguine Harlequin\" is by no means an assassin to get into contact with if a client is looking for a simple, cheap and brutal murder, but he has gained renown amongst those able to spare the coin for a more...\"theatrical\" and symbolic approach to death.\n\nHis calling card once a target is extinguished?\nA garnet heart-shaped gemstone held between the target's front teeth...{/col}{/p}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-29:64:64}\n\n{h3:c}{col:cca040}Background:{/h3}{/col}\n{p:c}{col:c72f33}Not much is publically known of Lavarro's past besides the fact he was once one of the Darkmoon Faire's best crowdpleasing performers. \n\nWhat he only openly confesses as being a non-descript \"incident\" lead him to leave the faireground and start a life as a travelling performer and artist. He has travelled many cities to perform, Alliance and Horde occupied territories alike and has earned a modest living from such. \n\nAs he would say to anyone wishing to pursue the performing arts as a life career though, such a lifestyle must be subsided with another job on the sidelines to bring in a comfortable amount of money to live. In Lavarro's case, he chose assassination, an occupation he learned from an undisclosed source during quiet lulls in his performance schedules and to further make his training more lucrative, he has invested his talents for purely selfish and monetary gain. Or so he would have people believe. \n\nIt seems that Lavarro is not one to willingly open up about his past, prefering to hide behind his stage persona and have the world believe he is nothing more than a \"larger-than-life performer\". In due time, with trust, confidence and good reason, Lavarro may one day find it within himself to reveal more of the truth behind his past to someone beyond his close-knit family ties...{/col}{/p}\n\n\n{h3:c}{col:c72f33}Combat Capabilities:{/h3}{/col}\n{p:c}{col:cca040}As an assassin, and an exacting one at that, Lavarro prides himself in his ability to conceal himself out of sight and out of mind until his presense is needed, slinking off into the shadows until that time arises.\n\nPassionate about procuring rare and exotic poisons from around the world, he uses them, alongside his expertise with dagger combat and humanoid anatomy to kill with  precision, speed and with graceful flair and theatrical wonder, often using his own talents in contortion, poetry and acting to add a element of entertainment to his target's final moments.\n{/col}{/p}\n\n\n{h3:c}{col:cca040}Misc Facts:{/h3}{/col}\n{p:c}{col:c72f33}Lavarro has -many- years ago had a singular romance novel published that has since faded into the realms of obscurity, \"The Eve of Eversong Nights\" released under the psuedonym \"L.R.Darthorne\".\n\nHe has been known in the past to indulge  in magical \"cosmetic surgery\" to perfect his exterior appearance (His teeth being the most notably perfect feature. It is not an illusion, but a permanent physical change induced by magic). In recent months, he has reverted to a more \"natural\" representation of himself, removing some of the arcane incantations that once obscured his true visage.\n\nHe is vegetarian though not for any ethical or spiritual means, rather to preserve his fit and flexible physique. He -will- eat meat on rare occasions.\n\nAs an extension of his passion for collecting deadly poisons, Lavarro also keeps a small variety of poisonous Dart Frogs as pets and to harvest their toxins for use on his weapons. He thoroughly enjoys the theraputic side of keeping their terrariums well planted and natural looking, a tiny garden within his tiny travelling abode as it were, and even gives each frog it's own name. (Usually some rendition of \"Grenouille\"...meaning \"frog\" in Shalassian...)\n\nLavarro is multilingual in several languages, taking it upon himself to learn enough to translate most of his verbal shows into languages comprehensible to the audiences and places he travels to. He is by no means -fluent- in most of these languages but is knowledgable enough in them to get by. Notably, he is able to speak; Thalassian (Native tongue), Common, Orcish, Shalassian, Darnassian, Zandali and is currently learning Pandaren. \n{/col}{/p}\n",
				},
