					["2"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["TX"] = "Stellira is of average height, for a Vulpera at 3'11\", she has white fur with black stripes, a long, bushy white and black striped  tail and a short, pointed snout.\n\nHer ears are always perked up, listening to everything around her, ready for whatever might come, and keen to listen to any of the tales from those in her company.",
