			["time"] = 1614978924,
			["link"] = {
				["Stellira-ArgentDawn"] = 1,
			},
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Stellira is of average height, for a Vulpera at 3'11\", she has white fur with black stripes, a long, bushy white and black striped  tail and a short, pointed snout.\n\nHer ears are always perked up, listening to everything around her, ready for whatever might come, and keen to listen to any of the tales from those in her company.\n\nShe has a lot of muscle for such a tiny frame, likely due to her obsessive nature when it comes to hammers that she always has on her person and admires when seen in the hands of others.",
						["BK"] = 10,
					},
					["PS"] = {
						["TX"] = "Stellira believes in the law and the good it means for the people that follow it, though not all law is good and she will combat it if necessary.\n\nWhen asked a question, Stellira always answers as truthfully as possible, but has been known on occasion to lie, only for the sake of protecting another from harm.\n\nStellira would like to consider herself rational, if it weren't for the fact that she is constantly followed by a ghostly figure that strikes fear in her from time to time, she knows not where this \"creature\" came from, or why it follows her so.\n\nStellira loves to fight on the frontline and has no fear of battle, but when the odds are clearly less than favourable, she comes to her senses and prepares herself for retreat.\n\nStellira remains wary of her surroundings and the potential threats that might be hiding in the shadows, but when the battle comes to fruition, she leaps headlong into the thick of it, swinging her hammer with all her might.",
						["BK"] = 10,
					},
					["HI"] = {
						["TX"] = "Stellira began in the vast dunes of Vol'dun with her family and their travelling caravan, her father was a travelling smithy, going from camp to camp offering his service to those in need.\n\nStellira quickly picked up this trade and began to love the hammers she worked with all day and night long. Her love for hammers paid off when, on occasion, their caravan was assaulted by Sethrak Faithless seeking to enslave them. She fought them off valiantly with her smithy hammer and decided that now was the time to expand her knowledge on fighting, so she crafted herself a mighty hammer and armour to better defend herself and her caravan. \n\nWhen the caravan stationed at a camp, she would seek out the leading militia defending the camp and requested combat training, fixing their equipment in trade.\n\nShe trained day and night, learning to embrace her inner rage and channel it through her mighty hammer to crush those that would dare strike her family and their wandering caravan.\n\nHowever, no matter how much she trained, she was ill prepared for what was to come.\n\nThe might of the Faithless was growing day by day and the raiding parties were growing larger in number, one night while Stellira and her family were sleeping, a large Sethrak raiding party descended on their camp.\nShe quickly grabbed her trusty hammer she had crafted and rushed into the fray to defend herself and her family, but all was in vain, though she had managed to force the Faithless to retreat, her family was killed and her caravan was in ruin, burning hot and bright into the night sky.\n\nStellira was lost, she knew not what to do with herself, she stared into the starry night sky for hours, then she remembered tales at the campfire a few moons ago, tales of a group of travelling Vulpera who sought to explore the world and beyond, this idea rung true with her as she too wished to adventure and put her training to the test, she gathered up her equipment, any that had not been caught in the fires, and put it all in her bag and made ready for a long journey ahead.\n\nShe called out to her faithful Hyena companion \"Cheeky, come on girl, we're going to see the world\". Rustling could be heard from a nearby bush and out popped a large Hyena, still fightened from the events that happened a few hours ago.\n\nStellira scavenged the ruins of her camp and found a saddle and canopy which she fastened to Cheeky, climbed into the saddle and set off into the night.\n\nAfter travelling from night, through day and to dusk, she set up a small camp in an old Troll city, left to ruin. She was sleeping soundly when suddenly she was woken by heavy footsteps and voices, she quickly jumped up, grabbed her bag, and her trusty hammer, called for Cheeky to hide, and she too crept off to find somewhere to hide. The sounds of footsteps continued to get closer and she could see the light of a torch showing flickering shadows of the Faithless that were tracking her, she noticed a nearby tomb and quickly rushed inside, in the centre of this tomb was a half opened sarcophagus. She did not have time to think about the rights and wrong of desecrating the remains of the dead, her life was at stake, so she jumped inside and quietly pulled the lid over her, as she did she felt a sudden crunch between her footpaws.\n\nShe huddled within this sarcophagus for what felt like an eternity, until finally the footsteps and the voices faded into the distance.\n\nAfter waiting just a little while longer, she slid the sarcophagus back open, climbed out and returned to her camp, there were Sethrak tracks everywhere around her camp, she felt very fortunate indeed to have woken up just in time and glad that she travelled light for there was nothing in her possession for them to steal that was not in her bag.\n\nStellira set up camp again, hoping the Faithless would not return. As she began to tuck herself in, ready for sleep, a shadowy figure appeared before her, it did not speak, it did not act, it just stood there and stared at her with menacing eyes. Stellira did not sleep that night, for fear of what this being might do.\n\nThe following day, this weary eyed Vixen travelled once more, this time seeking shelter with the Horde, she was welcomed for her skills with both hammer and metal and made her way to a nearby inn in Orgrimmar.\n\nThat night, as tired as she was, she still could not sleep, the memories of that night in the dunes where her caravan was destroyed haunted her, she sat on her bed and stared into the fire, unblinking.\n\nOut of seemingly nowhere there came a sudden hum of magical energy as a fae creature appeared before her, seeking her aid in a realm beyond her imagination, Stellira believing this to just be a figment of her imagination, an illusion created from her exhaustion, declined this invitation. But it seems she had no choice in the matter, the hum of magic began again and she suddenly found herself in the middle of a strange and magical forest.\n\nAhead of her a battle was raging, the fae creature hovered to her side and pleaded with her to turn this tide of battle in their favour, promising enchantments to make Stellira's hammer brim with increased power and armour befitting a champion to their cause.\n\nStellira was bewildered, she could not understand why this fae had asked for her aid and asked the fae \"Why me? Why do you choose me among all others, I am not as strong as many others out there\". To which the fae responded \"True, you are not the strongest, but you have the potential to be stronger. Please, time is of the essence, will you aid us?\"\n\nStellira, still bewildered by this turn of events, agreed to aid them. She pulled out her hammer, donned her armour and leaped forth once again into battle against a new foe. The battle was long and hard, but eventually Stellira and her strange new allies overcame the odds and defeated these adversaries.\n\nStellira's exhaustion now reached its limit, seeing her enemy retreat before her she collapsed, the world went dark and she slipped out of consciousness.\n\nShe awoke the next day and found herself in familiar surroundings, a fire crackling nearby, a soft bed beneath her, she was back in the inn of Orgrimmar. On a table nearby sat an assortment of armour, tree bark-like in appearance, and rested against the wall was her trusty hammer, now shimmering with a strange enchantment. Beside the armour a letter had been left, Stellira picked up the letter and read it.\n\"Thank you for your aid in the battle, here is a token of our appreciation and we hope you will aid us again in the future.\"\n\nStellira still could not understand why she was chosen, but put it aside and remembered her original goal, to seek out the travelling caravan of Vulpera she had heard of. She asked around Orgrimmar, seemingly to no success, until she met another of her kin passing through, they sat and talked at length of their travels when mention of this group came into the conversation. This passing traveller told Stellira of rumours that this caravan was last seen travelling to Winterspring, a cold region north-west of Orgrimmar, high up in the mountains.\n\nShe did not hesitate, Stellira thanked this passing Vulpera and readied herself and Cheeky for another long journey.\n\nTime passes, Stellira sees many new sights and new faces along her travels, finally she reaches her destination, the cold, harsh mountainous region fo Winterspring, this does not dissuade her and she continues on, eyes peeled, looking for this mysterious band of adventurers.\n\nShe hears the crackling of a fire, voices, laughter, the language sounds familiar but still to distant to make out, so she creeps in closer. \n\nBefore her she sees the caravan she had been searching for. Nervous, but determined, but steps out into the open and introduces herself to these strangers. They welcome her and invite her to sit beside the fire with them, she sits there, quietly listening to their conversation and her ears perk up as she hears about a trial for one of their members. She offers her skills to assist in this trial, to hunt a wolf that has been wreaking havoc in the region.\n\nHer offer is accepted and they venture forth to track this beast down, time passes and word gets out that the beast has been discovered, battle commences once more, fortunately none were injured in the encounter and one of the Vulpera named Grachell, finishes off her quarry in a dazzling display of honed swordsmanship.\n\nWith the trial completed, they return to camp and regale tales of old, a re-enactment of Arthas, a name previously unknown to Stellira, and here our journey now begins anew.",
