				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-rogue-cover:256:256}\n\nVixxee is a reasonably young, and short goblin, even shorter than the average goblin with the height of 2Ft 8Inches. If not covered by her usual leather armor Vixxee would have a light green shade of skin which covers her mildly muscular body. Furthermore, reaching around her upper right arm is one of her two tattoos, reaching over the flesh from side to side, covering the vast majority of that section of skin to display herself flying towards a large centaur. The second tattoo of the two is a \"V\" shape on her side, designed to look like a harsh scar or wound. However, it is rare that the majority of the goblin's skin is visible.\n\nART! Thank you to all the artists who have provided art for this little goblin over the years!\n\n{link*https://www.deviantart.com/xewspaws/art/Vixxee-Fangslice-601833568*Vixxee Fangslice by Xewspaws!}\n\n{link*https://cdn.discordapp.com/attachments/296266830560100353/591020967095042051/Vixx.png*Vixxee Portrait number 2 by Xewspaws!}\n\n{link*https://www.deviantart.com/xewspaws/art/Drosera-and-Vixxee-sisters-in-spirit-613675625*Vixxee and Drosera, Spirit Sisters by Xewspaws!}\n\n{link*https://www.deviantart.com/kishera/art/MiniMe-Vixxe-727298955*Vixxee and Basty, companions for life! By Kishera!}\n\n{link*https://media.discordapp.net/attachments/270135787746492416/400677110253092895/Miss_Fangslice.jpg?width=505&height=469*Vixxee \"Sup?\" by Kilgun Oilchains!}{col:93a3bc}{/col}\n\n{link*https://imgur.com/a/zBVIpeu* IC painting done by Baldemar!}\n\n\n",
