			["msp"] = true,
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}{link*https://www.argentarchives.org/node/247144*Argent Tournament Event Page}{/h2}\n\n{h2:c}{link*https://twitter.com/donlawride/status/1367505172822384641*Crusader Gear - Donlawride@Twitter}{/h2}\n{h2:c}{link*https://media.discordapp.net/attachments/694118471268827268/816249347637379092/EvcGkFfXYAAgfGY.png?width=988&height=70*Vurch Entry - Donlawride@Twitter}{/h2}\n{h2:c}{link*https://twitter.com/donlawride/status/1296156984023093249*Updated Full Body Art - Donlawride@Twitter}{/h2}\n{h2:c}{link*https://pbs.twimg.com/media/EbX9oAFXgAcPLen?format=png&name=900x900*Uniform Art - Donlawride@Twitter}{/h2}\n{h2:c}{link*https://pbs.twimg.com/media/D4yqYSwWwAEaMLV?format=png&name=900x900*Younger Vale, Full-body Art}{/h2}\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-OldGodTrinket:512:256}\n\n{h1:c}STONETIDE OUTPOST{/h1}\n\nBorn to the secluded Stonetide Outpost in southern Vol'dun, Vale led a life of relative peace in the deserts - as much peace as scavenging as a means of survival could afford. This changed quickly for the young fox when Korthek's minions swept across all of Vol'dun, taking any Vulpera they could find as prisoner - dead or alive. Vale stood to defend the outpost, but fell in battle. Of the fight, he retained a dangerous memento: the Sethraki blade that had been thrust through his chest.\n\n{img:Interface\\Pictures\\artifactbook-paladin-cover:256:256}\n\n{h1:c}THE LION'S MERCY{/h1}\n\nHe recalled little from the time between the attack and the first time he was able to open his eyes since the sword was plunged into his chest. The blue flags that surrounded him told him plenty though: it was a camp controlled by soldiers of the Alliance. To his surprise, he wasn't bound by chains or behind the bars of a cage. His chest wound was covered by clean bandages, and beside him lay several similarly wounded soldiers. Humans, for the most part, but some dwarves, gnomes, and other kinds he was unable to recognize.\n\nA day, maybe two later, he found himself lying awake. A hooded man with the head of a wolf - a worgen, he'd heard - spoke to a human by the entrance to the tent, in a language he was unable to understand. They both pointed at him occasionally, and he could only wonder what grizzly fate awaited him.\n\nInstead, the human walked away, and the worgen drew closer, inspecting the wounds before following the human.\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\nHe didn't attempt an escape until he was able to stand up on his own again. His escape was foiled moments after it started; by the worgen no less. He stood ready to fight his way out, despite the obvious difference in size and bulk, but the worgen simply stood in his way, an amused grin spreading across his snout. He drew a dagger - big enough to be a small sword for the vulpera - and tossed it his way, before drawing a mace of his own.\n\nThe first swing was Vale's, striking the mace's handle, to be pushed away without a hint of effort from the worgen. The wolf swung with the broad side of the mace, which the vulpera just barely dodged. As they traded blows, the worgen seemed progressively more amused, until he finally grabbed the blade and yanked it right off of Vale's hand. Bruised and tired, the vulpera could do little more than protest. As (what Vale assumed to be) a token of good will, the worgen knelt, placing a hand on the largest gashes on the fox's body. The hand shone briefly... and the pain subsided. Once the hand moved away, there was no wound scarring the fur anymore. Unsure of what to make of this, the vulpera reevaluated his options. Suddenly, his bed in the medic tent seemed better than venturing out into the sands.\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\nMore spars took place over the next days. He was beginning to understand the language of the Alliance's forces a little better. He could recognize specific words. More vulpera came in, and not all of them left, their injuries too great. The humans looked weary from not just the desert, but also the war. There was more to this than he'd been led to believe by Horde couriers. He understood, above all else, that the sethrak offensive grew stronger by the day.\n\nFrom books borrowed by the soldiers, he learned (from the pictures, at least) about the \"righteous\" soldiers who embraced a power called \"the Light\". When he quizzed the few who visited his tent, even less were able to give him a proper answer. Its power still fascinated him.\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\nHe wasn't sure how long he'd stayed at this camp when he fell mysteriously ill. The mender at the settlement tried his best, but nothing seemed to make the vulpera's state improve. Finally, an unorthodox solution was found: he'd been given a blade, previously wrapped in thick cloth - the blade that had struck brought him to an inch of his life in the first place. Just like that, his health improved almost overnight.\n\nThe soldiers at the camp didn't seem to like that. He wasn't sure if it was the appearance of the jagged blade, or the fact that their captive had a weapon with him all the time now. His worgen 'mentor' saw past that, for reasons beyond his understanding. Over a few more days, when Vale's Common was developed enough, they had a proper conversation. He was told more about \"the Light\", and how it was the only way he would ever be able to survive wielding the weapon. When he queried him for hints on where to start searching, the worgen grew hesitant.\n\n\"Believe?\"\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\nHe left the camp during a moonless night, when the guards were much too tired to either notice or chase him. He carried new armor and a small satchel full of supplies for the journey through the sands. The trek was nothing new to him - but it would be no less painful.\n\n\n{h2:c}{icon:inv_inscription_81_contract_honorbound:50}{/h2}\n\nThe fresh breeze of the port of Dazar'alor greeted him after days of travel, trade and bargains.\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n{h2}OOC Note: The dagger is of void origin, and others capable of detecting such energy can detect it too. Vale -will- lose strength after too many days without it, such is the way it has become bound to his soul.{/h2}\n",
