			["about"] = {
				["T1"] = {
					["TX"] = "{h2:c}{col:ffffff}Hey there! Here you'll see the backstory of Rallena if you're interested in reading, which is not a must. But do be warned the story is quite long if you decide to read it!{/h2}\n\n{link*http://imgur.com/uN3JheX*Headshot by Teallinum}\n {link*https://imgur.com/BWdH2mf*Art by Zaggums}\n{link*https://imgur.com/a/izE5i9W*Art by myself}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n{h1:c}{col:b38345}The Dunes{/h1}\n\n{p:c}{col:8aff83}Life started off like any others. Rallena was born in the warm desert, Voldun, and lived her life just like any other little one. \nHer and her people travelled along the sands in their small caravans, collecting and trading with whomever they happened to pass on their way. \nMany years went by like this, and Rallena had grown bigger and reached the mature age. Her parents obviously weren't as young anymore, but they still kept their heads held high. That was until that one day, the Sethrak ambushed their caravans.{/p}\n\n{h1:c}{col:b8893e}The Sethrak and slavery{/h1}\n\n{p:c}{col:8aff83}Everything burned, their homes had been taken from them in just a split second. Many were slaughtered, including Rallena's parents, but a few was taken and brought to the Setrak's camps, Rallena with them.\nIt was mostly the younger Vulpera that were taken, they suited best for the upcoming slave trades in Voldun.\nRallena was sold to quite a wealthy Sethrak. Her job was mainly cleaning blood and bodyparts from her now former people. They were tortured before they lost their lifes in the most brutal way.\nRallena was determined to take her life back, she wouldn't let anyone control her as they pleased. But then the days got longer and more painful. She had been suffering from various punishments that had left her arm all cut up and bleeding horribly. The fur around her neck was permanetly gone due to the tight iron collar she had strapped on her. She was giving up living, the pain and suffering was too much for her to bear anymore, until..{/p}\n\n{h1:c}{col:b8893e}Freedom{/h1}\n\n{p:c}{col:8aff83}One night the Sethrak that held Rallena as slave, had accidently left a small iron tool near her where she was chained up by the collar. She pulled it towards her with her tail, and tried to pick the lock. After many attempts she managed to open the lock, and she felt a glint of hope inside her.\nThis was her time to escape, but how? The Sethrak was asleep in their chamber, so she had to be quiet. \nSilently approaching the exit she stopped and thought for a second- \"I can't let them get away with this...\" She found a Sethrak sword hanged on a wall nearby, and grabbed it before entering the Sethrak's chamber. To prevent alarming any others, she covered the Sethrak's mouth and slit it's throat, giving it a slow and painful death.\nRallena was free. She dropped the weapon she had used and looked down at her hands that was covered in blood. Shaking and feeling all the agony slip away, she shook her head and quickly ran for the exit of the chamber. \nFinally in the dunes again, free from chains, free from pain. She was free.{/p}\n\n{h1:c}{col:b8893e}What happens now{/h1}\n\n{p:c}{col:8aff83}Wandering for days in the dunes, Rallena came across a group of small Vulperas. They took her in and helped her recover from her wounds. The group was travelling to Kalimdor to settle down and help this so called \"Horde\". Rallena had no clue who this Horde was, but she decided to travel along with them.\nThey arrived at Orgrimmar the main city of the Horde. All these strange races that Rallena has never seen before, was suddenly everywhere to be seen. She had a strange feeling, but she was ready to accept whatever that were to come her way. After all she was free, no longer a slave but the scars she carries will always be a reminder of the past.\nShe decided to cover up the missing fur around her neck, with a black leather collar, and carried on her exploring in this new land.\n\nThe adventures go on!\n\nUpdate: Rallena was accepted into a new caravan family. Though she may still be a new snout around, she very quickly took a liking to these new people she had met. Some have already become dear friends to her, and one a warming flame to her life.{/p}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n{h1:c}{col:da0a0f}Quick personality check{/h1}\n\n{h3:c}{col:ff514c}Rallena will do anything to keep her friends/family save. If sacrifices were to be made, then so be it. She doesn't walk around with swords as a joke.\nAs a former scout, she knows her tricks and how to get rid of a threat easily\nDon't see her as an easy target.{/h3}",
				},
