					["TX"] = "{img:Interface\\PETBATTLES\\Weather-ToxicFumes:512:128}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-99:64:64}\n\n{h2:c}{col:3fff00}T{/col}{col:00e511}h{/col}{col:00cb0f}e{/col}{col:00ff20} {/col}{col:09bf00}A{/col}{col:00ad09}m{/col}{col:069b00}a{/col}{col:009f13}n{/col}{col:008d10}i{/col}{/h2}\n\n{col:5bff60}Aziboi{/col} Was part of the Amani Empire for years. He fought against the Alliance and the Elves for a long time. He had fanatic ideas that was given to him by the Amani Tribe though their propoganda that was about restoring their ancient Empire. Nevertheless After battle after battle they won they lost at the end. He departed from the Amani Empire and joined up with the new Tribe Called the Revantusk Tribe since restoring their ancient glory was never going to occur ever again\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-63:64:64}\n\n{h2:c}{col:ff695b}T{/col}{col:df6b61}h{/col}{col:cf6761}e{/col}{col:b35951} {/col}{col:c95c49}H{/col}{col:a75349}o{/col}{col:ab453a}r{/col}{col:79332f}d{/col}{col:5e2826}e{/col}{/h2}\nAziboi had lived with the Revantusk for awhile and after they joined the Horde officially he participated in their wars to come. He fought against Garrosh's Horde along side with Vol'jins rebellion and he fought along side with the Horde during the Legion invasion. The Final and recent war he joined the Horde with was the fourth war which he still has scars from. \n{link*https://www.youtube.com/watch?v=gxGLfkvwiSM*Theme}\n\n",
