						["TX"] = "Trixie is an attractive & curvaceous firecracker of a Goblin. This feisty lil' lady can be too hot to handle!\n\nTrixie's smooth apple green skin is heavily covered in Tattoos! Her rich violet eyes shine with passion & wonder. Her hair is a striking & vibrant shade of white.\n\nBeing a highly skilled professional Tattoo Artist, Trixie is covered in Tattoos & Piercings, all of her own work & design.\n\nTrixie uses a mix of magical skills & powerful enchantments to create her Inks & Tattoo Designs.\n\nThis unique combination causes her designs to almost come to life with spectacular results!\n\n*Trixie's Tattoo & Piercing List*\n\n*Naughty but Nice*\nTrixie has 13 piercings in total.\n*2 silver hoops in her left ear.\n*4 black studs, 2 in each ear.\n*2 blue studs, 1 in eaach ear.\n*1 purple tongue bar.\n*1 silver bar in her belly button.\n*3 are in very intimate parts of her body. (no ya' can't look!)\n\n*Phoenix Hawk Tattoo*\nSwoop is a full length back tattoo & Trixie's prized creation. A living Fire Hawk Tattoo that is able to psyically leave her body!\n\n*Flaming Dragon Maw Tattoo*\nA large flaming dragon skull covers most of Trixie's right shoulder & top half of her arm. Its eyes & maw drip & bleed with fire!\n\n*The Serpents Kiss*\nTwo large life like snakes are coiled & wrapped around Trixie's right wrist & forearm. They seemingly slither freely around Trixie's forearm.\n\nOne snake is a rich & vibrant mix of firey reds, oranges & yellows in colour. The other snake is a deep & shadowy mix of blues, greens & purples in colour. \n\n*Fire Heart Tattoo*\nA spiral shapped love heart tattoo covers the top half of Trixie's left arm. It flickers & glows like an open flame.\n\n\n*Divine Grace Tattoo*\nA beautiful & elegant tattoo that covers all of Trixie's left wrist & forearm.\n\nA tribal patterned rosed thorn bush covered in roses & butterflies. The vibrant red, pink & purple rose petals shimmer softly as they change colours. \n\nThe delicate butterflies are deep & vibrant shades of orange, yellow & blue their wings flutter as they softly open & close.",
