						["AC"] = false,
						["TX"] = "Donning a complete Full-plate armour set, complete with ring mail and leather beneath the thick plates of painted Truesilver.\n\nAll craftsmanship is of the highest quality, encrusted with high quality mithril around the edges, with native platinum around the studded aquamarines.\n\nThe complete set of armour feels to be fully enchanted, likely to improve mobility and increase the overall strength of the armour.",
					},
					["4"] = {
						["IC"] = "inv_mace_1h_draenorcrafted_d_01_b",
						["TI"] = "Ümkar, Hammer of Passions",
						["AC"] = false,
						["TX"] = "Her pride & accomplishment as an masterwork craftsman.\n\nÜmkar is a smithing hammer. All craftsmanship is of the highest quality. It is made of an unseen metal that shimmers rose, pink and violet against the light and a shining silver when it is not. \n\nDecorated with azerothian diamonds, truesilver rings along its shaft, and arcane crystals  inset precisely along its head to focus its abundance of magic energy to rival artifacts both old and new.\n\nThis item also bares and image of many individuals holding the hammer aloft on both sides of its head carves delicately into the metal.",
					},
				},
				["v"] = 42,
			},
			["time"] = 1615067247,
			["link"] = {
				["Shaelendra-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 7,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{p:c}{link*https://i.imgur.com/Vr4OPh6.png*Reference image}\n\nShae'lendra initially comes off as large and imposing for one of her kind; tall and built with powerful muscles that see a constant amount of use, she is as physically powerful as she is adroit, however lacks many manners - the cut and dry sort with a crude behaviour and caddish mannerisms.\n\nHer fiery red mane is to the point, cut short with the swift use of a blade than a barbers skill - meant to keep it out of her way when working and secured from her face with a heavy duty set of goggles cresting her forehead.\n\nIn spite of how she may come across however, Shae'lendra hides an attractive face once you've gotten past the grease, soot and grime. Flawlessly ageless like all elves are; short nose, striking ears and slim lips. She almost appears regal and elegant - yet makes no effort to show that pretty mug off.\n\nAnother accessory from her craft hangs around her toned neck muscles by way of a chemical mask typically worn by alchemists whom dabble in the experimental. Those keen with the forces of the arcane could even detect the use of abjuration magic.\n\nBeyond that, Shae'lendra is an iron fortress of lean muscle bound tight and taut beneath an - often dirty - strained sleeveless white shirt and a tough leather overall that looks thick enough to block heat and arrow point alike, stretching all the way down to her legs. Most of that is hidden behind of her blacksmithing apron however; stained with constant use, it too was made of a rough leather as though it was fresh off the tanning rack. It even has pocket on the front!\n\nWhile every sinew of her being has trailed through a complete workout day in, and day out for hundreds of years, this does result in a body not exactly lady like - not nearly as curvy or amatory as some of her kin. The only few hints that there was a woman beneath all the dirt was the curve of her chest.\n\nHer right arm is completely concealed beneath a huge padded smithing mitt from the shoulder down; fastened with metal bands all the way down, spaced out in precise increments and enchanted with more abjuration magic more commonly seen in wards. Its place on her arm seems tightly secured even further with a harness that reaches across to her left side. It wasn't going anywhere anytime soon. As such, her right arm appeared far larger by mere virtue of the mitt's size; yet all her fingers still moved appropriately inside of it, and the dexterity of which has not been compromised somehow.\n\nMeanwhile her left is far less interesting; scarred and marred with burns, cuts and bruises that reappear in different places each week, while her mitt came up just before her elbow - loose enough that her hand could slip out of it with ease.\n\nFinally was the craftswoman toolbelt (beneath her apron) which carried everything one would expect from a smith - tongs, chisels, clamps and measuring instruments all of varies sizes. Alongside other tools that appeared a little out of place - bottles and vials containing what looked to be oils and salts. And of course hiking nearly all the way up to her knees were a pair of heavy duty boots that did nothing to conceal her approach or departure the way the stamped and clanged around.{/p}",
				},
