				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1}On the Surface{/h1}\nAfter a brief encounter one might assume that Sothri'syn quite simple, with her vacant stares and propensity for silence. Even to those who know her she often talks of her distaste for academia and scholarly pursuits. The more astute would suggest that her quiet nature is a result of her upbringing, that she was taught never to unmask and bring shame to herself or her family name.\n\n{h1}Behind the Mask{/h1}\nIf you manage to catch her alone she is a lot more open to conversation, although she does tend to avoid talking about herself unless prompted to. Usually she likes to disclose that her quietness is not out of a lack of interest or comprehension, rather that she is particular about her choice of words, or lack thereof.\n\n{h1}History{/h1}\nVery rarely does Sothri'syn bring up her history, even when asked she will become deliberately evaisive unless caught in a vulnerable moment. Usually she just mentions having similar stories to most of her kind, a cruel awakening of the horrors of life at the hands of the scourge.\n\n{h1}On the Battlefield{/h1}\nThose who fight alongside her would likely be quick to notice that she seems to have an unorthodox and at time undisciplined fighting style. She is often quick to let her guard down and usually suffers for this. Her strikes are not done with the seasoned finesse of a honed Blood Knight, they are forceful and passionate but ultimately sloppy and unrefined.\n",
