			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["IC"] = "Achievement_Character_Bloodelf_Female",
						["TX"] = "Feynaeli's appearance is immaculate. Her curled hair perfectly styled without a single strand out of place. Freckles can be seen across her cheeks and nose. The robes she wears are finely tailored, crafted by her own hands. \n\nWhen getting close to her it is possible to smell the scent of roses from the perfume she chooses to wear. ",
					},
					["3"] = {
						["AC"] = false,
						["TI"] = "Dorah: Battle-Caster Staff",
						["TX"] = "A staff with the appearance similare to that of battle-casters usual choice, a lightweight from craft enabling it to be wielded with ease in one hand which is what its crafted for.\n\nIt is reinforced making it a strong durable craft even able to be used in melee range.\n\nThe crystal foci is green and it glows and flickers with saturated arcane. \n\nAlong the shaft, arcane runes are spiraled downwards and shimmer in red and orange, they will light up as spells channel through, enhancing and focusing the arcane energies wielded by the caster. \n\nThe shaft's midsection is covered in a comfortable yet durable leather grip, itself decorated also with motives of flame and feather.\n\nAlong the top section of the shaft, lengthwise, is a single word in Thalassian: \"Dorah\" translated to \"Valor\"\n\n- A gift from Narindiel Windblaze",
						["IC"] = "INV_Staff_14",
					},
					["2"] = {
