			["time"] = 1614642844,
			["link"] = {
				["Feynaeli-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}Lady Feynaeli Phoenixheart{/h1}\n\n{link*https://www.deviantart.com/hunter-roka/art/Feynaeli-by-Nidarosisart-826077804*Art}\n\n{h3:c}Appearance{/h3}\n\nFeynaeli's long, thick poppy red hair reaches down to the small of her back when left loose. Her chosen style is to have her hair loosely curled and set to appear as though not a strand of it was out of place. Like the majority of her kin, she takes great pride in her appearance and makes an effort to look her best at all times. \n\nHer face looks relatively young and remains unscarred. Her teal eyes seem somewhat brighter as they contrast the colour of her hair and her lightly tanned skin. Her cheeks and the bridge of her nose are heavily freckled.  Her resting expression is a small and welcoming smile, a reflection of her personality. \n\nHer posture reflects her pride in herself, always formal and making herself look elegant. Feynaeli's tone of voice is soft and calming when she speaks. \n\n{h3:c}Clothing and Jewellery{/h3}\n\nAround her neck is a necklace with a pendant attached to it, the pendant itself would be an orange crystal. In certain lighting it might be noted that the crystal changes colour ever so slightly making it appear to have flame-like colours. \n\nTowards the tips of her ears are three pairs piercings on each side. In the middle of two small diamond earrings is a slightly larger piercing featuring an emerald. \n\nOn her left ring finger is a golden wedding ring, small and elegant in design. \n\nFeynaeli’s robes are beautifully tailored and appear to be in very good condition. Her robes crafted by her own hands. It should be noted that embroided on the sleeves of her robes is the sigil of her House. Two phoenix's with their beaks touching, their wings spread behind them with flames coming from them. \n\n{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}",
