						["TX"] = "Wearing Fine and strong Black Saronite Bone armour.\n\nOn her back are skeletal wings that cover her backpack. The item is currently powerless, merely small fragments of necrotic power within.\n\nShe dons a surcoat oft worn by the Unholy knights of the Ebon. \nA fierce skull emblem. (Design in her Art.)",
