					["4"] = {
						["AC"] = true,
						["TI"] = "Taken",
						["TX"] = "On her finger is a gorgous green emerald ring, that she holds onto dearly. To her, it was what bound her to another in life.\n\nThe human saying: \"till death do us apart.\" is unfortuantely not known to her, making her ever so hopeful on meeting her lost love again.",
