			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://64.media.tumblr.com/b368486b7f2d5b742c124bf2b9745f19/dab3df2b31cceca5-a4/s2048x3072/5d516b4e54795923c209b82372b5f3114bc4eef4.png*Happi Goober, Drawn by silvertonguedaggermaw.tumblr.com}\n{img:Interface\\ARCHEOLOGY\\ArchRare-RingoftheBoyEmperor:512:256}\n{h1:c}{col:30962a}The eyes...somber, hollow and unforgiving, staring out with intense hatred. A glint of light..it faded, blurred images of a battlefield stained her eyes. In her view lay corpses as far as her vision allowed her to see, the sand below stained red as it soaked up the combatants blood. Broken, frightened, strong. Their expressions varied greatly, not every one of them ready to face what lay beyond the veil. In her mind she fumed, cursing just about everything she could for being so weak, to not be able to stand up again and continue the fight. To save whoever she could from these killers that set upon her caravan without a second's thought. Her right fist clenched tight as she felt the warm sand envelop it, every ounce of strength that remained was used to drive the hand deep into the sand, to hide what mattered most from these barbarians. The image in her eye begun to fade as smoke rose from the burning pyres that littered the battlefield, darkening the pink twilight sky and in turn taking light from the horrid visual that remained. Her comrades and enemies slowly disappearing from the world as their remains sunk into the sand, engulfed by the very land she called home.\nShe cursed and flailed as she could, helpless at the end of her journey. A final breath and the image in her eyes disappeared, everything turned black.\n\nA end for her mortal coil, everything was removed from her as the spirit begun its final journey, taking with itself the experience it had gained. Memories of friends, of love, of joy and sadness. Behind, it left but a body, a shell whose last thoughts had been that of strength, of hatred and of loss. Bleak and negative emotions had seeped into her very being, with one exception...Hope.\n\nSoftly, her eyes opened again as she looked up into a darkened room, a hall, filled with blurred figures of tall humanoid creatures. Her anger, her disgust and thirst for revenge engulfed her as she pounced upward at her assailants... {/col}{/h1}",
