			},
			["about"] = {
				["read"] = false,
				["BK"] = 5,
				["TE"] = 3,
				["T3"] = {
					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "{h3:c}Art and music{/h3}\n\n[Off-duty with whiskey and smoke]( https://tinyimg.io/i/ZuzcwE4.png )\n\n[If Roifa was a tarot card? The devil..]( https://tinyimg.io/i/rFjJfLB.png )\n\n['Chilling'..]( https://tinyimg.io/i/Fv3mcMA.png )\n\n[All Roifa needs to be content is his smokes, a tapered cup of coffee and being able to lift some heavy weights. Otherwise, you end up with this...]( https://tinyimg.io/i/hF3AAaL.JPG )\n\n[ Some bangin' music to listen to as you read this profile...The Cello perfectly captures Roifa's swagger)]( https://www.youtube.com/watch?v=rkpfWuSP2GE )\n\n[Roifa's signature theme. If I didn't voice the character myself... then this is pretty much what he'd sound like and what he'd sing about... Gotta love that honey-smoked texture to his accent, savvy?]( https://www.youtube.com/watch?v=yXycqEwEB6U )\n\n{h3:c}Physical description{/h3}\n\nWalking with a timelessly well-worn swagger and clocking in idle regard, this unliving human is well formed with musculature, is of tall height and harbours an immediate presence which often speaks for itself given the time he spends observing those around him, studying with an impassive mask of relaxed disinterest. \n\nHis armourments carry the classic tell-tale signs of countless fights and marks yet still appear to be well-maintained, featuring supple lambskin lining and cashmere accents- Perhaps an inkling to his finer and more cultured tastes.\n\nThe most striking aspect of his angular visage would be his single-eye, frigid in it's cold blue hue but also subtly faint, giving him a piercing, almost human-like stare that too often hints at an intelligence he would never admit to. This is also deeply contrasted by the skinless-jawline of his lower face, that which reveals itself as his association to the unliving.\n\nAbove all else, he is often found wearing an expression of vague amusement, never quite taking anything or anyone too seriously..",
