						["AC"] = true,
						["TI"] = "Hair",
						["TX"] = "Putrid green locks are barely tamed into an elaborate looking pouf atop her head. The do spans upwards from her skull, adding a good fourty centimetres or so to her height. Within this dome of hair is a mass of backcombing and teasing, which is hidden beneath the combover of smoother strands to the outer edges of her hairline.\nFew sections of the lengths may often be brought into uniform pincurls here and there.",
