			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "A slightly taller than average Sin'dorei, somewhat rougher around the edges than typical of his skin. While lacking in the social graces of a Sin'dorei he does not lack for their physical grace, with an agile, albeit solidly build frame, he is by no means weedy.  His shoulders and upper arms especially seem better trained and developed than the rest of his sleek and lithe shape, an educated guess would suggest the bow he carries on his back responsible for this.\n\nHis weapon appears a typical elven design, artisan and gilded but no less practical to use. Rich magics flow through the supple wood it was carved from.\nThe rest of his attire would suggest something along the lines of a ranger or scout, leather and light chain - at times scuffed or torn by wear and tear outdoors but still well presented, casual and humble in style. On his belt he carries a manner of assorted outdoorsman tools and a knife.\n\nHis age seems difficult to place, while by no means showing the gravity of time passing on his features, an oft-held gaze of weariness may suggest more than just overt cynicism. By no means a picture of exceptional aesthetics, quite the opposite, a rather rustic and comely look to him, accentuated with his tidy beard.\n\nNevertheless he still has lustre in his hair and skin, his eyes a gentle, almost subdued green to them. He is marked with a few old wounds, but nothing fresh. The most recent being a particularly deep gash on his forehead. Atop his head his short hair is let to grow largely in any undirected fashion, girdled only by a headband to stop it overtaking his vision.\n\nHe has a dry voice, strung through forced elocution over many years. Fluent in both Thalassian and Orcish, although his accent in the latter is somewhat off.",
