			["characteristics"] = {
				["CL"] = " ",
				["RA"] = "Pandaren",
				["MI"] = {
					{
						["IC"] = "inv_misc_kingsring1",
						["NA"] = "House name",
						["VA"] = "of The Windblade Family.",
