						["VA"] = "Ish, Ember",
					}, -- [2]
				},
				["FN"] = "Ishii \"The Mute Ember\" Windblade",
				["EC"] = "Olive Green",
				["FT"] = "The Mute Ember, The Silent Blade, Master Illusionist & Pyromancer.",
				["HE"] = "Average",
				["WE"] = "Curvy",
			},
			["mspver"] = {
				["AH"] = 2021981832,
				["AE"] = 964453151,
				["DE"] = 107793770,
				["AW"] = 3485504331,
			},
			["msp"] = true,
			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "(OOC; as a mute please ignore any vocal in game emote sounds when they are used)\n\nIshii is an attractive young Pandaren, she has the traditional plump & bouncy female Pandaren figure.\n\nSoft, golden caramel well kept fur covers most of Ishii's body. The rest of her fur is milky white in colour with little tints of caramel brown flexed into it.\n\nIshii's eyes are a deep shade of Jade green. Her hair is a rich shade of caramel brown with two long streaks of bright vibrant pink hair running through it.\n\nThe pink locks of hair are worn in loving honour & respect of her twin sister Nimosa who now lives among the Races of the Alliance.\n\nThe fur around Ishii's neck clearly stands out from the rest of her soft well kept fur. It is heavily matted & scurffy looking.\n\nHaving suffered a near fatal injury as a Cub the skin under her fur around her neck is heavily scarred & burnt. Although Ishii survived the attack the injury has left her Mute.\n\nIshii is a Master Illusionist & Pyromancer. Ishii has come up with a unique way of communication. Ishii uses her magical talents to create visions & images to hopefully get her point or feelings across to those she meets.\n\nIshii is also highly skilled & fluent in communicating via Sign Language. A skill that she has taught to several of her friends, family & loved ones.\n\nIshii's left ear can often be seen twitching & wiggling softly by itself when she is clearly in a good mood or feeling happy. This behaviour changes to her right ear when she is feeling down, frightened or sad.\n\nIf being in extreme hot or cold temperatures or conditions bothers Ishii it would not show. As she always seems comfortable & composed in both.\n\nIshii's tail is very rarely still for very long, It can normally be seen wiggling happily behind her especially at the sight, mention or thought of Spot or her Family.\n\n*Out Like a Light!*\nIshii has a very unconventional & rather odd way of sleeping. When sleepy or in need of a nap Ishii will pick a spot & curl up like  a cat or dog would possibly do.\n\nIshii often uses her thick busy tail to shield her eyes and face while she sleeps. Ishii will literally sleep through almost anyhting!\n\nIshii is a skilled Blade Mistress, she favours the use of a single blade weapon in combat. Ishii's Shakatani Warblade is honed to a keen & deadly finish.\n\nWhat Ishii may lack in physical strength in combat compaired to some of her opponents she more than makes up for in speed & skill.\n\nIn combat Ishii relise on the speed, skill, agility & ferocity of her deadly lightning fast attacks to overcome her opponents. Her movments are swift & graceful as she performs her deadly dance.\n\n*The Whispers Edge*\nWhen drawn the magnificent blade humm's softly with a deep latent power embedded in the heart of its steel. The blade of Whispers Edge is envelloped in a powerful Arcane Aura that keeps the blade eternally keen & razor sharp allowing a well placed strike to cut deep through flesh & armour alike.\n\nIn combat Ishii will often magically ignite the blade of Whispers Edge fully enhancing its already deadly & destructive capablities.\n\n*Flame Heart Tattoo*\nIshii has a Magical Tattoo on her left wrist, it is clearly visable  at all times through her fur. The tattoo is a purple flaming heart, it glows softly.\n\nThe twined tattoo to this one sits on the wrist of Ishii's twin sister Nimosa.",
