		["1103173021Hmvi1"] = {
			["character"] = {
				["v"] = 7,
				["CO"] = "IMPORTANT! Nomu is awlays in brute form the ritual just makes his power grows and he becomes even bigger.\nHello there! I'm not native english speaker so I might have small problems. (PL)",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "Not DK and not DK's eyes\nChceck out At First Glance!\nNomu is good worker\nAlways up for good fight!\nHey! You yes you! Nomu look for new members for  gearfist!",
			},
			["time"] = 1614632181,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}{icon:ability_warrior_strengthofarms:25} Physical description {icon:ability_warrior_strengthofarms:25}{/h1}\n{p:c}\nNomu is a huge, muscular Orc. His entire body is tattooed with white marks.\nHis eyes glow the color of blood. \nThe body is covered with many wounds that are slowly healing{/p}\n\n{h3:c}{icon:ability_mage_studentofthemind:25} Mental description {icon:ability_mage_studentofthemind:25}{/h3}\n{p:c}\nNomu is not a wise Orc, he doesn't know Orcish well. He is very loyal. He is easily offended. Nomu loves to fight brutally and without mercy.{/p}\n\n{h2:c}{icon:ability_mage_timewarp:25} History {icon:ability_mage_timewarp:25}{/h2}\n{p:r}Nomu was a child when his village on Draenor was killed and burned down. Nomu himself was kidnapped by Orc mercenaries to the old Orc, he was a blood mage. For many years, Nomu was tortured by Ork and imprisoned. The orc also used Nomu as its blood magic test subject. He performed many rituals on Nomu, many were not pleasant, but they made Nomu a special Orc.\nWhen the Horde arrived on Draenor in one of the battles, a huge iron horde cannon fired hitting Nomu's cell. Taking the opportunity, Nomu escaped. He met the Horde and managed to get to Azeroth, there he spent a few years trying to get acquainted with the other world, even though he remembers the previous one only from behind bars. After many travels he came to Orgrimmar and lived there, fought many fights in the Arena and was employed at Gearfist IBS.{/p}",
