						["TX"] = "Has small magical runes and symbols tattooed on her hands and arms. Usually most of them are hidden under her sleeves.",
					},
					["4"] = {
						["IC"] = "spell_mage_overpowered",
						["TI"] = "Appearance",
						["AC"] = true,
						["TX"] = "She has clearly put some effort into her looks. Her hair is neatly combed, and she is wearing dark eye makeup.",
					},
