			["time"] = 1615491446,
			["link"] = {
				["Velyndra-ArgentDawn"] = 1,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "\n{h2:c}Velyndra Nightveil{/h2}",
						["BK"] = 1,
						["IC"] = "ability_rogue_feint",
					}, -- [1]
					{
						["TX"] = "\n{col:e6e6e6}Velyndra is on the short side of average, with a slim figure and raven black hair combed neatly around her face. It’s evident that she puts in effort to look presentable, and she carries herself in a way befitting a woman of high social status.\n{/col}",
						["BK"] = 1,
						["IC"] = "spell_shadow_twistedfaith",
					}, -- [2]
					{
						["TX"] = "\n{col:e6e6e6}Her posture is straight and her face is often set in a neutral expression, with her lips pressed together in a thin line. She wears dark eye makeup, and she has prominent cheekbones and a pointed chin.\n{/col}",
						["BK"] = 1,
						["IC"] = "spell_holy_rapture",
					}, -- [3]
					{
						["TX"] = "\n{col:e6e6e6}Velyndra is trained in arcane magic, and specializes in matters related to portals and teleportation. She is always looking to learn more and to better her understanding of magic. {/col}",
						["BK"] = 1,
						["IC"] = "spell_arcane_arcane01",
					}, -- [4]
					{
						["TX"] = "\n{col:e6e6e6}In years past, Velyndra Nightveil was a known figure in the elite circles of Quel’Thalas. In her youth, she inherited a small fortune, including a large estate in Tranquillen. {/col}",
						["BK"] = 1,
						["IC"] = "achievement_zone_isleofqueldanas",
					}, -- [5]
					{
						["TX"] = "\n{col:e6e6e6}However, her facade of a bored, wealthy heiress did not exactly tell the full story. Some rumors claim that behind the scenes Velyndra was a skilled infiltrator and thief, but nothing has ever been proven.{/col}",
						["BK"] = 1,
						["IC"] = "ability_racial_preturnaturalcalm",
					}, -- [6]
					{
						["TX"] = "\n{col:e6e6e6}OOC: If you want your character to know Velyndra from the past, send me a pm and we can work something out!{/col}",
						["BK"] = 1,
						["IC"] = "inv_misc_questionmark",
					}, -- [7]
