			["about"] = {
				["v"] = 32,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\DRESSUPFRAME\\DressUpBackground-NightElf1:256:256}\n\nA sleepy looking vulpera. Despite their expression, they're suprisingly fearsome with the two small blades they carry at the hip.\n\n{h1:c}{col:920293}~~~~~~~~~~~~~~~{/col}{/h1}\n\nBorn of two Vulpera runaways who sought a better life amongst the Bilge Rat crew, Tikwid had a rough upbringing. Forced into servitude on the high seas, they bode their time, using their natural stealth and guile to evade the wrath of their  captors as much as possible. \n\nAfter 9 years, Tikwid finally managed to escape the crew once their ship reached the port of Boralus. Tikwid fled to the slums of the city, scavenging to survive. They often found their  life in danger by both those in the slums and those in the city, and sought escape once more.\n\nAs a way of coping with their  situation, Tikwid found escape in drawing. Whatever scrap of parchment they could seize, it was their  window to the people around them. It kept Tikwid curious of the world outside their small, squalid existence. \n{h1:c}{col:920293}~~~~~~~~~~~~~~~{/col}{/h1}\nAfter the Horde's invasion of Boralus, Tikwid oppotunistically snuck into the Horde's ranks and gained passage to the city of Orgrimmar. From there they began a semi-nomadic life, travelling across Azeroth sketching the flora and fauna which live there.\nA nature lover, Tikwid enjoys studying these subjects. \n",
				},
