		["[MSP]Yukiske-ArgentDawn"] = {
			["character"] = {
				["CU"] = "HP: 27/27\nInyoni HP: 14/14\nSTR: 8 / DEX: 17 / CON: 17 / INT: 10 / WIS: 12 / CHA: 20",
				["CO"] = "Voice Ref - Temari (Naruto Dub)\nLGBTQ+ Friendly <3",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["v"] = 79,
			},
			["misc"] = {
				["ST"] = {
					["1"] = 2,
					["3"] = 2,
					["2"] = 1,
					["5"] = 0,
					["4"] = 1,
					["6"] = 1,
				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Weaponry",
						["TX"] = "Slung neatly across her back is an exquisite Zandalari longbow, carved from the most ancient tree of the Warbeast Kraul, and lined with gilded gold. It sports feathers from her beloved ravasaur companion, and the bowstring is supposedly taken from a spawn of Shadra.\n\nOn her back is a tempered Zandalari Exsanguinator, a longmace with several barbs on each side of the macehead, designed for inflicting grievous smashing blows and drawing blood with ease. The sigil of Gonk adorns the centre of the macehead on each face.\n\nKept on her left right is a weighted Zandalari cleaver, enchanted with a portion of the power of Lei Shen, designed for effective tossing at medium range, as well as close-quarters use when things get hairy.\n\nSheathed on her left hip is a tempered Zandalari steel broadsword, imbued with a tiny fraction of the thunder king's power. The crossguard bears the iconic Zandalari skull, and the eyes give off a dull blue glow when the blade's enhancement is called upon.",
						["IC"] = "inv_bow_1h_zandalari_c_01",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["TX"] = "Sitting atop two broad shoulders is an average sized skull, bearing a rough face, ridden with battle-scars and rugged with age. Interestingly, her skin seems quite pale for your usual Zandalari, slightly resembling the sandy-coloured complexion of a Farraki.\nDraped down the back of her head down to the middle of her back is long, braided pink hair. Most noticeable about her face are several tribalistic markings with a sickly black hue.",
						["IC"] = "inv_zandalarifemalehead",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Armour",
						["TX"] = "The experienced shadow hunter is clad from head to toe in extravagant Zandalari scale-mail armour, lined with gilded gold. Several sigils deidcated to Gonk line the pauldrons and chestplate, and her chest bears ritualistic markings and raptor feathers. Her left gauntlet bears two long blades crafted from raptor talons adorning the knuckles, acting as a fist-weapon.\n\nAdorning her skull is often a trollish Rush'kah mask, typically used for defense, but sometimes, in the case of rituals, used to commune with, and in rare cases directly channel the sacred Loa the shadow hunter is devoted to. If not worn, it is attached to her waistplate.\n\nOn her waistplate can be seen the tusk of a slain drakkari chieftain, fashioned into a knife.",
						["IC"] = "inv__faction_zandalariempire",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Wounds",
						["IC"] = "70_inscription_vantus_rune_nightmare",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Supplies",
						["IC"] = "inv_misc_potionsetf",
						["TX"] = "Health Vial - x3\nRoll of Bandage - x5\nVial of Anti-Venom - x3\nVial of Cobra Venom - x5\nWaterskin - 10x",
					},
				},
				["v"] = 49,
			},
			["time"] = 1615231957,
			["link"] = {
				["Yukiske-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-Zandalari:512:256}\n\n{h1:c}\"In de loa's name, I preseve de natural orda'. In de name of de wild, I speak fo' de beasts.\"{/h1}\n\nInnately enamoured by wildlife from a young age, and believed from birth to be inherently drawn to a connection with Gonk, Yu'kiske spent much of her early teen years, and young adulthood in constant training with blade, bow, and mastery of the beast. Aspiring to join the ranks of the well reknowned Raptari, her dedication would be met with respect and approval by her soon to be superiors. Earning nation-wide fame for her deeds in the Pandarian Invasion, Yu'kiske would return to an empire in decline, and thus, found herself lacking in purpose. \n\nMuch communion with her beloved loa, and a long passage of time spent surviving with reliance on no one but herself would bring the Raptari huntress to a life-changing decision that would test her resolve to its utmost - beseeching her loa, and aspiring to become that which few could hope to achieve. Shadow Hunter. Seeking nothing more than her loa's guidance and approval, she was granted her trial - to resign herself to the embrace of the wildnerness of Zuldazar, and to live amongst the beasts, to survive on the hunt for many years to come.\n\nThe years passed, and it would not be until the Horde's arrival to her homeland, and the rallying of the Raptari to war once again, that the veteran huntress would finally return from her long recluse in the wilds, and be summoned by her loa to be granted that which she spent her life dreaming to achieve - Shadow Hunter of Gonk.\n\n-----------------------------------------------------------------------------------------------------\n{img:Interface\\ARCHEOLOGY\\Arch-Race-TrollBIG:256:512}\n\nYu'Kiske, despite being a devoted warrior of Gonk, also acts as a devotee, warrior, and disciple of other loa of natures, typically those of life, death, and beasts, those being;\n\n\nBwonsamdi - Loa of Graves\nLegba - Loa of Speed\nLukou - Loa of Healing and Respite\nGrimath - Loa of Taming\nEraka no Kimbul - Tiger of the Sands",
				},
				["MU"] = 2146258,
				["BK"] = 2,
				["v"] = 12,
			},
			["mspver"] = {
			},
			["msp"] = true,
