		["0225222112GrRPZ"] = {
			["character"] = {
				["v"] = 43,
				["CO"] = "Gender Nonconforming\n\nHe/Him\n\nThe bratty Blood Knight",
				["RP"] = 2,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "Carries his axe over his shoulder\n\n",
			},
			["time"] = 1615156549,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}\nRaised as the third son in a patriarchal lower noble house, Sio'ren was told from an early age that he must be a strong and faithful man. Even though he was taught to never stop training and to be manly, he developed a feminity that would make high-class concubines jealous. Still, despite his prefered presentation, he would never forsake his inner manliness.\n\nWith no chance of inheritence, he joined a Sunreaver unit under the leadership of Magistrix Assina Sunhawk. In that elite unit of 7 led by the Magistrix, the group was successful throughout many missions and raids.\n\nAfter the new rise of House Sunhawk, he pledged his life and loyalty fully to Lady Sunhawk and became a member of the Six Embers, the elite Guardians of the Sunhawk House.",
				},
				["BK"] = 1,
				["TE"] = 1,
				["v"] = 12,
			},
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Looks",
						["IC"] = "achievement_character_bloodelf_female",
						["TX"] = "Despite his appearance, Sio'ren is a biologically male Blood Elf. His short and feminine figure is in stark contrast with the heavy armor he is wearing. He has a slightly tanned skin tone, which makes his freckles often hard to see. The dark hair, that are often hiding a good chunk of his feminine face, are cut into a neat bob.",
					},
					["3"] = {
						["IC"] = "inv_axe_1h_blacksmithing_03",
						["TI"] = "Light's Flame Executioner",
						["AC"] = true,
						["TX"] = "Sio'ren's Axe. He carries this massive axe over his shoulder most of the time. People skilled in magic can detect that the weapon is enchanted with Holy and Fire elements.\n",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Armor",
						["IC"] = "ability_mage_moltenarmor",
						["TX"] = "He wears rather eye-catching plate armor, adorned with many seals, flames and engravings that truly befit a Paladin. His items are enchanted to protect the wearer from dark magic and strengthen the holy flames he wields.",
					},
