					["TX"] = "Az'zaka is a lanky and sunbaked troll, his skin lacking the usual fur found on most trolls. Instead his skin is bare, suntorched and burnt from years of dwelling under an unforgving sun, in blistering heat.\n\nLike most Trolls, he towers over many other races, if only he stood up straight. Despite the deceptivly lanky apperance, the Trolls lean frame is one of pure, wirey muscle, toned from years of hardships in wild environments. Llike many of Trollkind, he has suprising amount of strength that could rival or even surpass the average Orc.\n\nHis features are typically concealed behind a crude wooden Voodoo mask, save for his protruding tusks and his brown mane of hair. Though beneath the mask are the typical sharp and rigid features of a troll, with saphire blue eyes typical of his kind.\n\nAz'zaka wears little in the form of protection, if anything at all, his skin bare to the elements, typical of his savage upbringing. He relies on his physical strength, agility and general Troll hardiness to keep him from physical harm. What he does concern him self with, is foul magics and bad Ju Ju. Along with his wooden Voodoo mask to ward off evil spirits, he wears a leather harness adorned in various creatures teeth, tusks claws and skulls. Aswell as ritualistic carvings on his tusk and paint across his sunburnt hide.\n\n\n((Work in progress, wrote in 5 mins. Will change))\n",
