					{
						["TX"] = "To my most fervent admirer...\n\nHi there Grizzik!\n\nI do appreciate you taking the time out of your busy schedule to come check up on me. It warms my heart that you would decide to follow me through Ashenvale, Felwood and even to -Winterspring-, when I'm all alone. \n\nI do hope you realize that your actions are noticed. So much so, in fact, that there's pictures of you lurking on me in Stealth. Generously provided by my Illidari friends.\n\nI do suggest you cease though. You won't benefit from your behaviour.\n\nOh, and in case you're not Grizzik. \n\nhttps://imgur.com/a/sXqv0fj",
