		["0115204613ygH0k"] = {
			["about"] = {
				["v"] = 8,
				["BK"] = 2,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}General{/h2}\nGrimtotem in name but not entirely in nature. \n\nWith Jevan Grimtotem's secession from the Grimtotem to join with the Horde, those among him of the Grimtotem came to the Horde with some degree of friction. Sabelon was no stranger to this,  and it took him proper time to adjust correctly to the ways of the Horde full and proper. By old Grimtotem standards, he's considered a soft touch, which is pretty telling.\n\nA Sunwalker, not the first under Aponi but in the first numbers that emerged.\n\n{h2:c}Appearance and Personality{/h2}\nSabelon is, very obviously, a Tauren. There's little difference between him and the standard Tauren outline you'd get. He's very tall, broad and strong. The bulk in his frame allows him to wear almost cumbersomely heavy armour with relative ease, and his weapons are usually large enough to be as tall as those of other races. When not using a brutally hefty Warmaul, he'll use a nasty axe and a shield as large as he is. Traditionally, his armour is in darker colours, of coppers and bronzes, reds and black and leather straps. With Sunwalkers lacking a true set of armour to call their own, he sticks with more Tauren/Horde styles of equipment.\n\nHis mount, Groundshatter, is a heavily armoured warbeast of a kodo, built and trained for battle more than anything. Tenacious, loyal and almost unstoppable on the charge, traits he sometimes wished he had more of, himself.\n\nPositive traits include a sense of honour at a base level, and a Grimtotem sense of agency in that one should act when opportunity arises instead of laying passive. Whilst his attitude (and sense of humour) can be dry, he's fairly no-nonsense and will state things as he feels without skirting or dressing up topics to avoid them. He respects the men that fight with him and his enemies, and holds himself with integrity: he refuses insults of those in his tribe and will stand up for subordinates without hesitation. Sabelon respects the Earthmother to a degree and honours tradition, as well as things honoured in ancient times. He's willing to work with enemies against a common threat, and has an open distaste for backstabbing and deception\n\nNegative traits include being somewhat abrasive and stubborn in his worst moments. Grimtotem ruthlesness creeps into him when he'll quicky take to less savoury and \"honourable\" tactics, such as striking downed enemies or even bombing them from a distance. Whilst he understands mercy, he doesn't often have it. He's openly racist against Dwarves and High Elves. He's not above browbeating or using his authority to get what he wants, though generally speaking that's never normally something actively harmful to his allies.\n\n{h2:c}Miscellaneous{/h2}\nHates littering. Keeps clean, bathes twice daily usually.\n\nExercises/works out as a hobby and a way to unwind.\n\nSometimes stares off into space without realising.",
				},
			},
