		["0710132324M3h9K"] = {
			["misc"] = {
				["ST"] = {
					["1"] = 1,
					["3"] = 3,
					["2"] = 1,
					["5"] = 3,
					["4"] = 1,
					["6"] = 1,
				},
				["PE"] = {
					["1"] = {
						["IC"] = "inv_belt_cloth_raidpriestmythic_s_01",
						["TI"] = "Appearance & Clothes",
						["TX"] = "Haru’s quite feminine body is adorned with a long, groomed and snow-white colored fur due to the infusement with his Light magic. One could notice an inconspicuous yellow shining at the edges of each hair. The edges of his rather small, but fluffy ears have a light purple tint. He seems to take care of his paws, since they are unusual clean for a vulpera and also his nails are clipped. \n\nHis cheeks are covered in a longer fur than the rest of his body whereas he has ocean blue eyes.\n\nHe normally wears a yellow and white colored robe, shoulder pads which resembles little wings and a sweet circlet on his head.\n\nHis circlet is now enchanted with a lesser Shadow Ward.\n",
						["AC"] = true,
					},
					["3"] = {
						["IC"] = "inv_jewelcrafting_gem_42",
						["TI"] = "Crystal & Mount",
						["AC"] = true,
						["TX"] = "The vulpera carries a blue crystal which radiates a blue light when rubbed. It seems like it is a way to call his violet pandaren phoenix.\n\nShiro is the name of his violet pandaren phoenix. She fell as a hatchling out of her nest and her parents did not want to re-adopt her. Haru found her once on one of his travelling ways to sell the monastery’s ale to the local cities on the ground and raised her lovely in the monastery. He got the knowledge in one of the many books of the monastery’s library.\n",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Student of Light & Medic",
						["TX"] = "Due to formative events, Haru chose to devote his life to the studies of the Light. The vulpera mostly keeps his knowledge for himself but is open minded to talk with others about it if they ask. His highest commandment is to help people no matter what they did or which faction they are part of.\n\nThanks to the Light, Haru is capable of well advanced healing skills and can take care of light to life threatening injuries. He also always carries a small medical box with essential things to cure most injuries.\n\nA side effect of his mending expresses itself in his changing fur color dependent on the complexity and intensity. However, his fur will change back whenever he has time to recover.",
						["IC"] = "spell_holy_surgeoflight",
					},
					["5"] = {
						["IC"] = "inv_misc_bag_33",
						["TI"] = "Bag",
						["TX"] = "He carries a cream colored bag with the following items:\n- medical box\n- a blue crystal\n- Vol'dun map\n- pumpkin, fox, turtle, wear it yourself-worgen (Winter's Veil, Marsuul) plushy, Alpaca plushy\n- piercing box\n- ring\n- coin necklace\n- some coins (0gold 9silver 57copper)\n",
						["AC"] = true,
					},
					["4"] = {
						["AC"] = false,
						["TI"] = "Behavior",
						["IC"] = "inv_pet_redpanda_brown",
						["TX"] = "Haru often walks around with a warm smile and is always open for a good talk. He mostly likes to listen to people and can be a trustful, friendly and caring friend for them. His voice is really soft for a male vulpera. He tends to be rather shy around females, but learned to be more self-confident in that case.",
					},
				},
				["v"] = 33,
			},
			["time"] = 1614802424,
			["link"] = {
				["Harume-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{link*https://pbs.twimg.com/media/Eu1jeABWYAM2hYy?format=png&name=900x900*Haru by SnytchellDome}\n{link*https://pbs.twimg.com/media/EtE0L_hXMAYKrw7?format=jpg&name=4096x4096*Haru by M0chizu}\n\n{h2:c}{icon:inv_belt_armor_waistoftime_d_01:25} Backstory {icon:inv_belt_armor_waistoftime_d_01:25}{/h2}\nHaru, son of Bilge Rats was exposed by his father in front of the Tian Monastery barely 21 years ago as they docked their ship in the east of the Jade Forest for restock purposes. He was adopted and raised by High Elder Cloudfall, the head of the monastery, but his time in the monastery as the only vulpera was rough. Peers didn’t take him seriously and the elders just ogled him which made him the vulpera he is now. Rather shy, inconspicuous and lacking courage. However, it didn’t stop him from helping those in need, listening to those who need an open ear or obeying his father for monastery needs. The little vulperas interests were simple, finding a way to get better in those things, by challenging himself and learning first aid. \n\nDays past, Haru learned, obeyed and got disciplined in the way the monastery educates their orphans, but the peace got interrupted as the Burning Legion attacked the Peak of Serenity. Haru, someone with now greater knowledge in first aid was called to work in the field hospitals close to the invasion. Those endless days of pain, suffering and exhaustion changed him and his believes as one pandaren girl died in his paws in the middle of the treatment. It was his first encounter with death, an endless state with no return. Guilt embraced the little fox and he promised himself to get better, to find a way that this won’t happen again. He devoted his life to the Light.\n\nThrough books, wandering priests and believer of the Light, Haru managed to feel and use the Light for his purposes.\n\nAs a friar of the monastery, Haru leads tours, guides the travelers around and takes care of getting ingredients for monastery purposes as well as the brewery. Besides his work in the monastery, he travels to gain new knowledge, meet new friends, help those in need and make important experiences in life.\n\n\n{h2:c}{icon:inv_misc_book_13:25} Spells {icon:inv_misc_book_13:25}{/h2}\n\n{icon:paladin_holy:25}Light's Blessing\n(your character feels a pleasant warmth for the duration of one hour)\n\n{icon:spell_nature_slow:25}Chains of Faith\n(shakles your character, high chance to miss, short duration, long preparation time, your character can attempt to break it)\n\n{icon:spell_holy_heal:25}Minor and Major Healing\n(can heal minor injuries or support the healing process of more threatening injuries)\n\n\n{h2:c}{icon:inv_first_aid_70_medicalkit:25} Medical Box {icon:inv_first_aid_70_medicalkit:25}{/h2}\n{icon:ability_mage_conjurefoodrank12:25}Disinfectant crystal water (1/2 left)\n{icon:inv_misc_bandage_18:25}Bandages\n{icon:inv_firstaid_healingsalve2:25}Pain relieving ointment (1/2 left)\n{icon:inv_misc_herb_liferoot_stem:25}One branch of Liferoot in a draenic pouch",
				},
