			["about"] = {
				["v"] = 42,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Luther Uhlmer{/h1}\n\n{col:c1cfff}Luther's origins are unclear, but he suspects he has always been an unscrupulous type. He faintly remembers crankily arguing with two Forsaken after being risen in a decrepit dungeon in the Hillsbrad Foothills.\n\nLuther was later sent into the Invasion of Gilneas as a blade hired to track down worgen guerilla fighters in Silverpine Forest. He has many fond memories from this time, although he was forced to dispose of his treasured souvenir necklace of worgen ears because it kept attracting flies. \n\nLuther has since freelanced everywhere from Pandaria, to Draenor, to Stormheim to Kul Tiras. Along the way, a chance encounter with an imp led him to expand his knowledge of occult magics.\n\nHe was killed and risen as a Death Knight by the Ebon Blade around the time the skies over Icecrown were shattered. (This proceeded a confrontation between Luther and some Knights about the 'ghoul ranch' he was trying to start in Durator.)\n\nOutside his service to the Ebon Blade, Luther spends his unending days developing his combat prowess, collecting novel trinkets, recruiting ghouls, and continuing his contract work with the Red Venturers.{/col}",
				},
