			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Aaillish stands a shorter then the normal Nighborne elf, which makes her slightly self concious. Her skin appears to be littered in scars and burns of varying sizes, her face and neck appear to be mostly clear of the scars with the exception of a large scar on the left side of her neck and a new, dark purple scar above and below her left eye, barely avoiding the eye itself.   She is slightly on the lanky side, being quite skinny, almost unhealthy looking in some ways yet retains some muscle definition in her upper arms. She can usually be found in her uniform, choosing to keep her unformal clothing for her time at home. Aaillish has short white hair that has small braids in it, threaded with purple ribbons, black feathers and silver beads. Most of the time they are tucked away. These braid are usually kept in the best condition and are redone as her hair grows or get cut, they are tighted quite tightly with a blue string so they do not fall out but at times can come loose. ",
						["BK"] = 1,
					},
					["PS"] = {
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Aaillish is the twin daughter of the house of Solaris, with her older twin brother Valerick to become the Head of Household she was to be married off to another noble house to create connections and higher her status. Her mother was once a priestess of elune so it was only natural that she woul try to make her daughter one, she trained Aaillish every day until her death when Aaillish was only 499 years of age. After her mothers death she stopped training for quite a while only continuing it when the bubble was dropped around Suramar.   After a year outside Suramar, Aaillish decided to change her ways and swap her magic for two swords to become a trainee monk. Her style of fighting seems to be a mix of several different styles but she trains when she has time at the Jade Serpant temple. She knows few healing spells but she enjoys this role more then she did being a healer.",
