		["1123000141QoFFB"] = {
			["character"] = {
				["CU"] = "Mood: Cheerful.\n\nHas a bite mark on his neck",
				["CO"] = "The Ashen Phoenix is a secret organization and its existence is only known to its members. Please do not meta game.",
				["RP"] = 2,
