						["IC"] = "ABILITY_HUNTER_HUNTERVSWILD",
						["TX"] = "Still exploring the knowledge of the world and its wonders. Expression of curiosity is something that can always be spotted on her face when something new is to be learned. Though by now, very few things are new to her.",
