					},
					["5"] = {
						["IC"] = "ability_malkorok_blightofyshaarj_yellow",
						["TI"] = "Other Info.",
						["TX"] = "Current Mood: Decent.\n\nCurrent Aura: None.\n\nWithering: Slight pale shade.\n\nLeclia can detect life through hemomancy, death due to necromancy and shadow/void magic due to her proficiency with it. So she can detect your stealth.\n\nQuite strong character, if you cant cope with it, you have been warned.\n",
						["AC"] = true,
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Alive",
						["IC"] = "spell_holy_fanaticism",
						["TX"] = "Even though she is quite proficient and works a lot with necromancy, Leclia is not claimed by death yet. As necromancy rots and withers the user, turning them to undead, yet her hemomancy fights that back, for she has great control over her body. Her normal needs, sences, skin color and scent remain the same.",
