				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Blood of the Fallen{/h1}\n\nLiving as a priest of the Light before the third war, Belorius traveled the Human lands, learning their religion and abiding by it. There he called on the Light to aid the injured and the misforunate.\n\nAll of this came to a close during the Rise of the Scourge. Serving his priestly duties in Lordaeron, he witnessed first hand the Humans' foolishness as they squabbled amongst as the Scourge was growing in strength and number.\n\nFinally resolved to help and prepare his people from the coming threat as he saw the Humans falter, Belorius went back to his homeland in Quel'thalas where he was aiding from the backlines, calling to the Light to aid his people.\n\nAs the Scourge overran Silvermoon however, Belorius' faith and resolution wavered, the Light, corresponding to that, stopped responding to his pleas as elves were dying in front of him.\n\nSurviving the invasion by the skin of his teeth, Belorius joined the emerging Blood Knight Order introduced by his beloved Prince, believing that the Human way of prostrating in front of the Light was wrong all along and that his people had a rite to control the Light as much as they had the right to control the Arcane. There he served, commited to his beliefs even after the Sunwell was restored..\n\nBy order from Magister Auralius, Belorius was commanded to join the proven Highblood Myrmidons to serve as their Prefect for the time being.",
