			["about"] = {
				["T1"] = {
					["TX"] = "art - {link*https://i.imgur.com/hEMSdgn.jpg*Sketch1}\n       {link*https://www.furaffinity.net/view/36804651/*Resting}\n       {link*https://www.furaffinity.net/view/38080332/*It goes BOOM!}\n       {link*https://www.furaffinity.net/view/40279527/*Terry and Aric NEW UwU}\n{col:ff3000}Terry{/col}: What up! The names Terry!\nYou'll see me looking pretty avarge for a vulpera when my gun isn't with me. I would wear some warm armor and a sharp as hell sword. Some times I may dress more formally, if I'm with my gun that is. Not to brag but I have got quite a lot of bruises though you cannot see them because they are under my clothing. And no I will not get nude only so you can see the bruises. Maybe if you ask nicely *winks* I could give a little peek. (bruises include claw marks on his back and stab-like wounds on his butt cheek(stabbed by stingers of huge wasps and scorpions))\n\nIm normally a good guy, but get on my bad side, and you'll be seeing hell. I normally dont like being in crowded places (might hurt someone, who knows)\nm pretty friendly, sometimes I can get cocky, and I would rarely back down a drink.\n\n.....Wait? I got to say a bit about my past?\n{col:ffffff}Interviewer{/col}: Yeah they asked me to write something, interesting about you.\n\n{col:ff3000}Terry{/col}: Hmm... Well, just as most Vulpera I come from Vol' Dun. I came with Kiro's Caravan but I decided to leave them in the middle of the road, because I thought I saw something interesting. Turned out to be a dragon's lair. A dragon chased me for soo long, I got lost in a swamp and had to find my way to Orgrimmar alone. But while on the way I stumbled on a goblin outpost. They were pretty cool people. They thought me a few things about engineering (mostly explosives) but then they pointed me the way to Orgrimmar. And you are like why didnt they attacked me or something since I was new to the horde and they might not know?\n\n{col:ffffff}Interviewer{/col}: Yeah, how actually didnt they have any suspisions of you?\n\n{col:ff3000}Terry{/col}: Well apperantly I was lost for quite some time and they have already met with some Vulpera. We had our goodbyes and I went on my way. Eventually I got to Orgrimmar. And wadda ya know, Kiro actually didnt forgot about me. He waited at the front of the gates! Boy I was soo happy to see a familliar face. He showed me around a bit, I got settled in, and had a really long nap. The End.\n\n{col:ffffff}Interviewer{/col}: Well Thank you, Terry thats all we needed.\n{col:ff3000}Terry{/col}: Yo welcome!",
