					},
					["3"] = {
						["AC"] = true,
						["TX"] = "A orgrimmar tabard is decoarting Shogura's chestpiece. Unlike the armour she wears, it is new and definitely has not seen combat.\n\nShe regularlly preferred replacing the decorative colours after usage due to the symbolic value of it and depending which regiment she served under. Markings of her legionnaire rank can also be found on it.",
						["IC"] = "inv_banner_tolbarad_horde",
					},
					["2"] = {
						["AC"] = true,
						["TX"] = "Shogura is currently donning a well-used and battleworn centurion armour. Upon first glance one can easily notice how the steel had began to lose its colouring and was dented due to receiving heavy hits on multiple areas. It has without question seen a lot of usage in combat.\n\nThe set however still served its purpose, spikes which decorated most of the plate still sharpened and layer upon layer of defense to the weilder.\n\n",
						["IC"] = "inv_plate_chest_warfrontshorde_d_01",
					},
				},
				["v"] = 17,
			},
			["time"] = 1615152406,
			["link"] = {
				["Shogura-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 12,
				["BK"] = 5,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-DraenorOrc:512:256}\n\n\n{p:c}-Appearance-{/p}\nShogura is your typical orc, broad frame, muscular and well-trained after a lifetime of smashing gits on the battlefield. She possessed strong, wide shoulders, oak-strong and firm thighs to carry her weight, a flat and ripped stomach sporting abs.\n\nApart from all her muscles, Shogura did not have a kind face. Perhaps once having been considered naturally pretty for an orc, war had left her scarred. Her once quite lush lips had been cracked numerous times, leaving them dried, torn. A large noticeable, jagged scar took much of her face's attention, it ran down from her right eye until ending at the tip of her nose, most likely caused by something incredibly sharp. Most of the old scars which littered the warrior's body had healed by this point. Mixed between the damaged tissue were also tattoos, marking her soot black skin with traditional orcish clan markings and colourful horde symbols in bright red.\n\nHer often glaring eyes spoke the most of her face, always offering a watchful, piercing look in their flaming depth. Like most of her clan, Shogura had a tone of fire to the depth of her eyes, bright and glowing like the magma found in the mountain she once called home.\n\nThe hair that adorned her head was of a natural, night black colour, darker than her grey skin. It was thick, wild and most of the time unwashed. Little care was given to it in terms of hygine or health, but she loved decorating it with trophies from her kills and jewelry made of bone. Whenever Shogura decided to allow her hair to grow to its full length, she kept it in thick dreads, often tied together into one large braid in order to more easily access to her helmet.\n\n",
				},
