				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-46:64:64}\n{h2:c}{col:2c2c2c} -- {/col} {col:288728}Sareal 'Bug' Cara'den{/col} {col:2c2c2c} -- {/col} {/h2}\n{p:c}{col:666666}Hungry Hearts Will Eat Lies.{/col}{/p}\n{img:Interface\\LFGFRAME\\LFGICON-HELLFIRECITADELRAID:512:3}\n\n{col:a4a4a4}Bug is exactly what you’d expect from someone in his situation. Fairly average height for his age, his frame is underfed and wire thin. His clothes are exactly the same day-to-day, and they are showing the wear and filth of being worn day and night for however long he’d had them. Threadbare in places, outright torn and fraying in others. Covered in a myriad of uncounted-for stains. His boots are worn, his gloves are cut off at the fingers. And over it all a travelling cloak with a deep hooded cowl, under which he wears a mask of cloth over his nose and mouth. Just in case. \n\nIt’s rare that anyone sees the face that lies under the hood, but not impossible. Dark curls are messy and caked in grime, falling around a pale-skinned face. He has his father's rich emerald eyes, set brow, and angular jaw. He might have been handsome one day if years of rough living, rough company and rough habits had not ruined his features. And his attitude. \n\nA once pleasant and mannerly young man time has tested him and the results have fallen short of his former glory. Sarcasm and spite steer the course now and his habits and unstable mood leaves you never entirely sure if he’s going to be friend or foe on any given day.{/col}\n\n\n{img:Interface\\LFGFRAME\\LFGICON-HELLFIRECITADELRAID:512:3}\n{h3:c}{col:288728}Rattle His Bones Over The Stones.\nIt's Only A Pauper Who Nobody Owns.{/col}{/h3}\n{img:Interface\\LFGFRAME\\LFGICON-HELLFIRECITADELRAID:512:3}\n\n{h3:c}{col:2c2c2c} -- {/col} {col:ffffff}Links{/col} {col:2c2c2c} -- {/col} {/h3}\n{p:c}{link*https://www.pinterest.co.uk/katieadb/my-oc-sareal-bug-caraden/*Thematic Pinterest}\n{link*https://www.argentarchives.org/node/137466*Argent Archives}  \n{link*https://imgur.com/a/uiuzisj*Artwork}\n{link*https://oathofsilver.enjin.com/*Oath of Silver}{/p}",
