				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:b1fff1}A Vulpera who has honed his skills of survival in the deserts of Voldun, a scavenger through and through.\n\nAn agile frame covered in well toned muscles and a scruffy layer of red fur. \nTwo large pointed ears serve as a better form of expression since his face is rather blank most of the time.\n\nUnsightly burn marks can be seen on his neck that seem to travel down to his chest, the extent of these injuries are hidden under clothing, but they appear to be healed up, although still enough to cause discomfort.\n\nWell guarded with his feelings and his social demeanour, Skiff's voice is rarely raised.\n{/col}\n{img:Interface\\PETBATTLES\\Weather-StaticField:512:128}\n{col:ffff87}An interest in engineering has been fostered by this Vulpera. From humble beginings of constructing simple pricklevine needle contraptions and explosives, Skiff has slowly worked up to more complex schematics through plenty of trial and error.\n\nSkiff is comfortable with technology and a quick learner. Intensely fascinated with any form of robotics or mechanics.{/col}\n\n{link*https://imgur.com/a/ecG6hy2*Various Skiffs}\n",
