			["about"] = {
				["v"] = 34,
				["BK"] = 6,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1}Phojan Storn{/h1}\n{col:ffffff}The campfire served as a faint beacon in the night. Phojan Storn sat alone next to the lit firewood endorsing the silence amidst mutilated corpses that ably dressed the grass red. The scent of charred wood, cleaved grass and disturbed dirt overwhelmed the sense of smell and diluted the odour of blood. Each and every of the lifeless carcasses had one thing in common; a white tabard dressed with one red emblem on its center.\n\nHe glared into the fire as if in a trance. His mind drifted off to fragmented memories of a former life — their unclear meaning haunted him. He saw a house ablaze, cries of panicked cattle and pillaging bandits fleeing the scene. Caught within the inferno a woman reduced to a black husk. The remembrance played on repeat rapidly flashing his mind by over and over again until a roaring spark from the campfire brought him back to reality.\n\nA grunt came from the tied zealot near Phojan. “Took your time. Slept well?” The woman struggled to get on her feet until she realized she could not.\n“What do you want? Please, let me go!” she pleaded realizing the fate of her comrades. Phojan bluntly tossed more firewood into the fire. “The three households your lot unjustified captured implored for their release too. Yet you butchered them without second thought.”\n\nThe zealot protested with a snarl. “This land belongs to us! They were in the wrong for not b—!” Phojan sharply disrupted her as he rose from his seat and drew his sword. “For not being human? How ironic it is that you forgot your humanity.” \nThe zealot predicted her fate and entered a state of panic. “If you were to kill me then why didn’t you do it earlier!?” He lifted his weapon for the imminent execution.{/col}\n\n{col:cb0015}“I wanted you to see it.”{/col}\n\n{col:ffffff}Who you are looking at is Phojan Storn; a dead man with a high sense of justice. Little does he recall of the man he once was in his earlier life but vague memories, values and a great resentment towards misdemeanour. Whence risen from eternal sleep he declined the offer to serve the Dark Lady and took it upon himself to make his purpose a path of his own. Staying true to what fragments he has left of himself he dedicates his afterlife to uphold the purposes of order where the long arm of justice would reach thin.{/col}\n",
