			["about"] = {
				["v"] = 36,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{p:c}\"She's a pleasant enough creature, if slightly mentally deficient.\" - Ymerawdwr Winterwake{/p}\n\nWhile her height is approximately average, Lissera's appearance does not act as a reminder of the quintessential Blood Elf. Sun-kissed skin is toned by well-trained musculature, and decorated with a vast representation of Vrykul culture through her blackened tattoos which cover the majority of her upper body; skin-turned-canvas.\n\nHer reddish brown hair is cut and tied with precision into a thick braid which runs from the top of her head and down the middle of her back. Her eyes have shed their former Fel corruption and instead glitter warmly like gemstones. Her nose has been graced by freckles, as well as some passing underneath her eyes.\n\nA notable blemish, none which the Blood Elf seems to care much about, she has a short scar at her upper lip on the right side.\n\nCarved out of bone and painted black, Lissera wears a pair of spiral earrings in her lobes. She is also adorned with silver earrings; one in the helix of her right ear, two in the left.\n\nUncaring about her impression, Lissera tends to wear worn cloth and leathers that, unsurprisingly gives her the look of a delinquent. Comfort beats style. Usually this means she wears a black crop top with whatever else she deigns appropriate.\n\n\n{p:c}\"She's responsible for our Rumsey stock taking a dip. Sensible woman.\" - Chiel Nightfall{/p}\n\nHer common choice of weapons are a pair of handguns made out of stainless steel, modified to have their barrels extended from the usual 4'9'' to 5.9'' each, and are threaded to be able to accept muzzle breaks, suppressors, compensators and so on. Her armaments are smoky black in colouration. She carries them in a double draw tactical shoulder holster, with spare magazines.\n\n",
				},
			},
