				["T1"] = {
					["TX"] = "Oraoth was born into the Warsong Clan of Draenor, like most other Mag'har and came to Orgrimmar when the Horde champions called on the debt owed by the Clans from the alternate timeline. She was quick to adapt to her new home and easily settled down, already out and forming a pack from various wolves around Azeroth.\n\nThough she is very capable in close combat, Oraoth prefers battle from afar, raining arrows upon her foes, earning her name as Cruelfire for her rather sadistic methods of combating her foes, coating her arrows in fire and watching with glee as her enemies are both pierced by her arrows and set aflame, stumbling about the battlefield with their cries like music to her ears. If one is considered fortunate enough to be out of her range of fire or too close for her to shoot, do not consider yourself safe, for if her reach cannot touch you, her wolves certainly will, starved before battle and hungry for a meal.\n\nOnly animals are safe from such methods, their hides more valuable when intact. When asked why she would follow a rather dishonourable form of combat, she is quick to remind those around her that honour in combat is reserved for those who prove themselves honourable and worth a good death.",
