				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://twitter.com/ythania_art/status/1303337108405444609*Character art by @ythania_art}\n\nSylvare comes across as an average elf when seen, slightly taller and bulkier then the \naverage citizen, hard work as both a Blacksmith and a Blood Knight/Paladin for over a decade having helped to strengthen his body and add to it's size. He has alabaster skin with fel green eyes and has short blonde hair, his facial expression often neutral. Despite this, his demeanor can be carefree and youthfull outside of the field of danger.\n\nAs a blacksmith, he maintains most of his own armour but crafts little from scratch. The only piece of armour he possesses that he has crafted himself is a replica of the Blood Knight armour, forged from Dark Iron to add a resistance to fire, no longer being active as a Blood Knight however, he is rarely seen in this. As a blood elf there is some inherent pride in him which manifests in upkeeping his armour, sometimes seemingly obsessed by quickly repairing any blemishes to the armor, even those that do not threaten the integrity of it. Upon entering most battles, his armor is spotless and looks as if it was freshly forged.\n\nA pouch is rested on his waist, mostly filled with alchemic concoctions, trinkets and potions. Having forsaken his mining carreer to persue the alchemic arts after discovering the usefullness of the properties of alchemic potions. He often carries some revitalizing potions on him, rather it be for health or mana. \n\nHaving been active outside of Quel'thalas since the opening of the dark portal into Outland, he has seen many battles and has fought for many factions, this has acquired him many sets of armour everywhere between light agile armour to heavy duty plate. Often wearing the colours of those factions depending on the set of armour he is wearing.",
