						["TI"] = "Attire",
						["AC"] = true,
						["TX"] = "Seemingly, Sienus’ taste in garb is the embodiment of the stereotype associated with her kin. Donning all black, with accessories ranging from ripped fishnet gloves to lethal metal spikes, it’s certain the elf has a preference for gothic aesthetics. \nWhile her clothing is changed on the daily, the presence of large, pointed shoulder pads and heavy, leather boots is unwavering. ",
