						["AC"] = true,
						["TI"] = "Jewellery",
						["IC"] = "inv_jewelcrafting_70_maxlvlring_purple",
						["TX"] = "With her rather dark appearance, she avoids wearing any accessories too bright, and often sticks to gunmetal or silver finishes. Though avoiding anything colourful, she certainly doesn’t shy away from anything gaudy. Large, bat shaped pendants, rings embellished with spikes, leather cuffs and chains draped over her torso - all these and other such pieces are common wear for her.",
					},
					["2"] = {
						["IC"] = "spell_priest_voidtendrils",
						["TI"] = "Hair",
						["AC"] = true,
						["TX"] = "Befitting her all black garb, her hair is also dyed with the same colour, which contrasts heavily against her stark white skin. The hair itself is backcombed and teased to present incredible volume, which causes the lengths to form a uniform dome around her haid. This mass of hair reaches her shoulders, though solid bangs have been cut just above her brow. ",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Whispers ",
						["IC"] = "inv_nzothfish_void",
						["TX"] = "Whilst not uncommon for Void Elves to be tormented by whispers, the voices following Sienus reach further than just her own head. \nOn occasion, whispers of a deep, unknown voice may sound from her. Not from her mouth, though certainly from somewhere on her person. The vocals can be heard by all those around her, as though an unseen being were latched onto her. ",
					},
