						["TI"] = "Makeup ",
						["AC"] = true,
						["TX"] = "With skin as white as a sheet, her complexion is ghostly, perhaps frighteningly so. Yet, it seems she prefers to emphasise this sickly visage by taking a harsh black contour to her already gaunt cheekbones. To pair with this, she coats her lids in black eyeshadow and liner, which extends down to her lower lashline. Her lips are also matte black.",
