						["IC"] = "ability_racial_vulperasurvivalkit",
						["TX"] = "Trinkets, vials, gems, beads, shells and who knows what else are stashed away on her person. If you can imagine it, she's probably picked it up. Whether it's a collector's habit or simply items pilfered from someone else is anyone's guess.",
