						["TI"] = "Instruments For Success",
						["AC"] = true,
						["TX"] = "She carries a few instruments with her, the most notable being a lute strapped onto her backpack. Other instruments include a wooden flute, a twin pair of small drums and a tamborine, carried by her mount.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Full-On Adventure",
						["IC"] = "ability_racial_rummageyourbag",
						["TX"] = "A bulging rucksack with a bedroll attached to the bottom rests on her shoulders, full of tools and supplies for her travels. Short blades are sheathed on her belt and even a bow and small quiver on her hip can be seen sometimes.",
					},
					["4"] = {
						["IC"] = "ability_racial_nosefortrouble",
						["TI"] = "Keen-Eared Fox",
						["AC"] = true,
						["TX"] = "Always watching and listening, she's got her nose primed for a special scent or her ears tilted for that subtle sound. She's as sharp as sense as she is of wit and she doesn't miss a beat.",
