			["time"] = 1614992680,
			["link"] = {
				["Jerru-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h3}Description{/h3}\nSmall in stature and unassuming, this young vulpera could possibly be overlooked or missed in a crowd. Whilst this is sometimes preferred, she more than makes up for it with her bold, vivacious personality.\n\nHer wiry frame is covered in a pelt of short, sandy fur broken up by sleeves and socks of dark brown. Spots of the same colour can be seen over her shoulders, ears, back and tail, perhaps reminding one of markings similar to that of a hyena. Short, dark claws upon her paws are kept sharp and her long muzzle is usually set in that of a cheeky smirk or toothy grin.\n\nNoticeable facial features are dark, stripe-like markings on either side of her snout, small spots gathered in a group at the base of her nose and a mark underneath her left eye.\n\nEyes of amber are large and bright, taking in every detail they possibly can and enhancing her desert-born appearance. They are full of intelligence and almost disarmingly intense. Her tufted ears are tall and wide, front-facing and always in an instinctual state of alertness.\n\nThe way that she carries herself, her adventurous personality, confidence and love for jokes, story-telling and music hints of a great passion for performing arts. She lacks airs and graces, yet speaks in a smart and practiced silver-tongued manner. Underneath that jovial exterior, however, there are often hints that she can be just as fiesty and vicious should she want to be.\n\nFull of life and almost boundless energy, she is definitely no introvert. Whilst not intentionally grating, she may be difficult to handle for some, even if she does genuinely mean well.\n\n{h3}Equipment & Inventory{/h3}\n[WIP]\n\n{h3}Background{/h3}\nWith the recent joining of the Horde, the Vulpera have ventured to lands unknown. Jerru, taking the opportunity to explore the world beyond the sands of Vol'dun, now revels in the bounty of discoveries awaiting her in her new home. Hoping to make a name - and coin - for herself, she embarks on her own adventure, relying on her wit, guile and cleverness to survive.\n\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-Islands:256:128}",
