		["[MSP]Lockjaaw-ArgentDawn"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Stiff Jaw",
						["TX"] = "Varric has a very stiff lower jaw.\n\nFrom the way it is angled and the clicking noises when he speaks, he probably got it from something hitting him in the face.",
						["IC"] = "ability_mage_frostjaw",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Golden Vambraces",
						["TX"] = "These rather ornate and beautifully designed gauntlets stand out quite obviously.\n\nIt is the only thing Varric has that is well kept and maintained, for some reason.\n\nOn each gauntlet, blue magical energy swirl and shimmer across his fingers and knuckles.",
						["IC"] = "inv_gauntlets_69",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Recently Dead",
						["TX"] = "Despite his undeath, Varric's body is still very well preserved and fresh.\n\nThere are very little sighs of rot and decay, though the smell of undeath is quite obvious.",
						["IC"] = "inv_skinning_80_tempesthide",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Puglilist's Garb",
						["TX"] = "Varrics clothing is made from beaten leather and tough cloth.\n\nOver the years and after his death, it has become worn and rough.\n\nDespite that, it still provides Varric both protection with no loss of mobility.",
						["IC"] = "inv_robe_mail_nzothraidmythic_d_01",
					},
					["4"] = {
