			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}History{/h1}\nCason was born in ThuderTotem His mother and Father where glad to have him as he grow he came to find that he had a great bound with Nature As did his Father who thogut he would make a great Druid while his mother thogut he would make a better Shaman, So they gave him the choice, in the end he Chose Druid and at the age of 16 (a year before the 3rd legeon invasion happend) he was sent to The Druid elders for his trining he soon returened to Thuder totem after being called Upon by Mayla Highmoutain...\n\nCasion is a young Kind soul who wishes to help others anyway he can as all Druids do, he has not hate to the Allince and is not in any political parties and belives to be neutral, still as a member of the horde he will Battle the allince if he is needed to, he has resntly show hate to others but wishes Redemption and to apolgise for his acsions. he is reborn no longer haunted by the old gods\n\nDispite his last name he is not a balance Druid\nHe does not refare to the Tauren (nomale and Highmountain) as shu'halo\n\nHe also enjoys his Cat form to the point where i like to be a cat and act in the was of such it's knowen if he does this for fun or if his wild side took over him.\n\n{h2:c}Family info{/h2}\nCasons Family is rich with meany grate Druids (from his father side) dating as far back as 4000 years ago his mother side is mostly filled with farmers that have keeped Highmountain fed for genrasions. It's unknow what tribe his family is from since he has black fur, Cason himself says he was born in thunder totem so he thinks it is the Highmountain Tribe but one one can truly tell.\n\nHis mother and father got ever ill one day Cason hope them the best but saddly his mother passed away....\n\n{h2:c}Travails{/h2}\n\nAfter joining the ranks of over Highmountain tauren who was recuted by the horde under the Horde Council Cason wanted to learn more about The Taurens of Kalimdor so he went to Mulgore where the place Taurens call home there he learned alot about the Tauren and was amazade to discover that The Turens of Mulgore are much like the Highmountain tauren. also He traviled to Thunder bluff and meet with Baine also he notices some Highmountain taurens where there. {icon:achievement_character_tauren_male:25}\n\nAfter some time Cason headed north to Borean Tundra at first he aidded the Horde in keeping hold of there keep and laurened about the Taunka another type of tauren he trivaled to  Taunka'le Village to aid them in anyway he can as well as laurening about them. {icon:inv_archaeology_70_tauren_drum:25}\n\nSoon after he went to Dragonblight to help out the Taunka more as well as the dragonflights whuile there he heard the tale of Battle of Angrathar the Wrathgate, Cason seemed more the happy to help out the Green dragonflight.\n Cason also encounterd the kraken godsess Oacha'noa {icon:inv_misc_head_dragon_green:25}\n\nNot long after this he traviled back to Val'sharah to finsh his training as a Druid \n\nAfter his bravery and corige was showen to the Zandalari Cason was given word to retune To Thunder Totem to reseve the Heritage of Highmountain which now Cason wears with pride {icon:inv_tabard_a_95highmauntaintauren:25}\n\nCason like meny others has opted to help the Argent Crusade in Ice crown {icon:achievement_reputation_argentchampion:25}\nHe was there to take down Heraid Dalora with the help of horde, allince and the Argent Crusade.\n\nCason joined the Tauwaha tribe and when thogue the test of loyaty and became a member swearing his outh to the tribe\n\nWhen his mother and father where sick Cason called out to the old gods to save seem but at a coust of him being rude to others after relising what he had became he went agesnt the old gods orders after his mother died the old gods bagin to made him suffer with help from his friends and Chieft the old gods was lefted from his body\n\nNot long after this Cason left the Tribe after an incident and set on a new path not for love or for power but to find himself hoping that he will return to the open arms of the Tribe......",
