				["T3"] = {
					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "{img:Interface\\QuestionFrame\\answer-VindicaarCrystal-FelHeartofArgus:256:128}\n|cff0fff00Rowynwen Hawkwing is a Sin'dorei who's subtle mannerisms paint a picture of a woman that does not fit amongst the high white walls of the fabled city Silvermoon. As she walks amongst the white-faced Sin'dorei with their rose coloured cheeks and academic books held to their chests, she does not blend in as one would expect her to.\n\nNo, certainly as you watch her movements, you notice that she walks with the gait of a wind-up toy, as though expecting at any moment for the sky to fall from the heavens or for the ground to open up beneath her feet. Each step gently, purposefully placed with swift transitions to get from each point hastily, she gives the impression of a puzzle piece that doesn't fit the mould.\n\nCuriously when standing still, Rowynwen with her back pressed to solid walls, wears the expression of a caged bird, looking around for a place she can take flight. Small in height and with skin like a freshly bloomed peacebloom, it is easy to be led to feel as though she is a fragile song bird that would be happier seen in the world outside of the confines of society. \n\nHer eyes as bright as christmas lights, glitter a fresh green hue like an uncut emerald stone, framed by thick deep orange lashes. They move with the transition of someones focus sweeping back and forth like a pendulum over the surrounding area, in-taking the world and its details slowly. \n\nBeneath her almost almond shaped eyes, following the softest of curves that make up a petite nose and sat above a soft jaw is painted red lips. Often seen nestled into a nervous almost shy line that wavers from a polite, friendly smile to a deepened pout, she gives off a rather friendly portait in features.\n\nSoft, diluted ginger tones sprout from the crown of her head in the form of silken spun hair, tied glossily into a high pony-tail. Her fringe is kept free form, shorter than the rest of her hair, falling just above her freckle dusted cheeks and often swept to one side over her left eye. \n\nHer voice sounds soft with careful pronunciations in Orcish that can quite easily be perceived as text-book taught, finding the language harsher to cope with. The harder vowels and tones coming away dulled and gentle. In her native tongue she sounds more sure of herself with a wary tone. \n\nHer armour always seems to be too outlandish to be from her homeland and she rarely can be seen wearing reds and golds, favouring browns and greens that blend her into forests and grassland. On her left arm she wears an armlet composed of reddish brown strands of metal that coil around themselves in a vine-like pattern. Several metallic leaves rest against her skin - covering a certain grey blemish - and become accentuated by the slightest hint of tiny pear-shaped gemstones bearing a dull mixture of green and blue hues. It is a usual assumption after clocking eyes on Rowynwen, that she is indeed, not a usual Sin'dorei.\n\nRowyn most recently has acquired a mercy blade made from damascus steel in a dull grey colour with a bronze hilt of a Dragonhawk - the hilt specifically being a tail. It is sharp and well cared for in an ebon hilt with a silver chain keeping it lodged to her belt at all times.|r\n\n{img:Interface\\DRESSUPFRAME\\DressingRoomDruid:512:512}",
