						["AC"] = true,
						["TI"] = " ",
						["TX"] = "Valarmar puts effort into his appearance, his hair braided on the side of his good eye, so that it doesn't get into his face during battle.\n\nHis demeanor would also indicate that this Sin'dorei was raised well, perhaps even a part of a prestigious household, despite appearing quite down to earth.\n \n",
