			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h3:c}A Brief Summary{/h3}\n\nValarmar might strike you as somebody who is free from the worries of his kind, but nothing could be more untrue. Much like many other blood elves, he struggles to hold on - having lost so much on this dark and winding road they have all been on. \n\nHowever he does pride himself on his ability to stay light hearted through it all. He has a strong set of morals and believes that by excelling in whatever he puts his mind to will be what would allow him to endure.\n",
						["BK"] = 3,
						["IC"] = "achievement_zone_isleofqueldanas",
					}, -- [1]
					{
						["TX"] = "{h3:c}Appearance{/h3}\n\nHe is a fairy handsome elf that spends time maintaining his appearance. His hair is well groomed - lush and a vibrant natural blonde. It currently sits in a braid at the side of his head - so that it does not get in the way of his good eye in battle.\n\nThere is a certain kind of softness to his eyes due to lines that would suggest that the man had seen strife and pain in his lifetime. He has short pointed ears, which almost always have some hair brushed behind them.\n",
