			["time"] = 1614806521,
			["link"] = {
				["Braindrinker-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h1}{col:ff9900}Doctor Braindrinker{/col}{/h1}{h3}{col:ffd100}'Trustworthy' Medical 'Professional'{/col}{/h3} \n{link*https://imgur.com/a/wpwYy45*All of the art for Braindrinker can be found here!}\n\n{link*https://i.imgur.com/5W2Rs3U.mp4*Doc After Dark! Gif created by @East_Owl_}\n\n{link*https://i.imgur.com/zfXH0rJ.jpg*The Doctor Is In! Created by Leandroyepyep}\n\n{link*https://www.youtube.com/watch?v=-C-HytsGYg0*Character Theme: Epitaph - King Crimson}\n\n\n{col:ffffff}Braindrinker was perhaps not your typical picture of a friendly, professional or even vaguely trustworthy Doctor. That was because her methods of healing were often downright barbaric. Though functional. Primarily utilizing first aid and alchemy in her own special way - she was actually a rather competent healer, if one can bare the pain of having her treat you. She did not grasp the concept of painkillers.\n\nThe first thing you'd likely notice about Braindrinker was her mask. Marking herself as one of the Laughing Skull Clan. A twisted skull mask forever grinning - masking this woman's visage behind the amused smirk. This skull wasn't as well decorated as others might be. There were a few bones and teeth hanging from holes she had drilled, but it lacked gold which was so often added into these masks.\n\nTopped with black feathers and fur - the mask blended well into her own dark hair, almost being difficult to distinguish, granting the mask a faintly haunting reality to it, as if it really was the face she was born with. Though within the dark pits of her mask, the dull brown of Brain's own lips was visible, that too, often curled into laughter. Her eyes were bright, eccentric, but a looming red which could be seen as intimidating to those easily shaken.\n\nPhysically, Braindrinker was your average Orc. Perhaps somewhat on the shorter end in terms of height - but regarding muscle, she was packing. Meaning that her threats always carried the weight of brawn behind them. That was not to say she was a brute though. Far from it. While she was like any Orc - prone to her outbursts of bloodlust, despite her apparant insanity - she was  exceptionally cunning and tactical. Often leading foes to underestimate her intelligence. \n\nThe clothes she chose to wear made her stand out among even the Laughing Skulls. She didn't wear the average scantily clad leathers and would often be found in full-fledged clothing, elegantly made and either Elven or Human looking in its design, protective and well-fitting, clearly especially made. She almost appeared to look like a Pirate.\n\nRegarding personality, Braindrinker was... Odd. That was saying the least. While most Laughing Skull were nothing but entirely insane savages, Braindrinker was... Different. That was not to say she was socially acceptable. She had no problem engaging in barbaric acts, but when she wanted to reveal her cards, she displayed surprising elegance in vocabulary and great education regarding the world as a whole. But, that didn't change her clan - and she still carried much of their values. \n\nDespite not looking the part, Braindrinker was actually a healer. She was skilled enough to patch wounds, mend flesh in the heat of battle, treat soldiers and nurse them back to health after the fact. Primarily using first aid and alchemy to gather ingredients from her surroundings and convert them into healing substances. She was fully literate, and often read various medical books. She did have a PHD... However, it was one she had stolen from a corpse, and written her name over the original recipients in their blood, presumably.\n\n {/col}\n\n{link*https://www.youtube.com/watch?v=bwhtCgR_oQU*Click me.}",
