						["TI"] = "Big Brain!",
						["TX"] = "Braindrinker was actually very intelligence for an Orc. Especially compared to fellow Laughing Skull orcs she was exceptionally well spoken and even well mannered... When she wanted to be.\n\nThis Orc was under the belief that consuming the brains of her allies and enemies will grant her increased intelligence. \n\nBraindrinker is by no means stupid though, capable of reading and writing, complex thought. She was a skilled Doctor in her own right, even if her methods could often be seen as barbaric.",
