					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Dressed To Impress",
						["TX"] = "Braindrinker actually took pride in how she was dressed. Often found in seemingly rather expensive leathers and metals, rather than tattered rags that the Laughing Skull Orcs typically wore.\n\nSurprisingly, her attire was often rather clean, other than occasionall patches of blood. Any rips and tears, she would sew back together, leaving it a bit patchy in places.\n\nBizarrely enough, her attire looked like it had been stolen from a seafaring pirate. But for an Orc..? She dressed well!\n\nHer boots were capped with steel toes! Protecting her precious feet and empowering her kicks!\n\nBeneath her clothing, there was a padded vest, designed to stop bullets from striking her skin! It seemed Gnomish in Origin!\n\nShe had a necklace made of Worgen's ears draped around her neck!\n\nWears a whistle around her neck that is designed to call Faceflayer's Gronnling",
						["IC"] = "INV_Shirt_Red_01",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Multifaceted",
						["TX"] = "Braindrinker was an Orc of many talents. The most obvious being murder. Like most Laughing Skull Orcs, she was VERY good at that.\n\nAside from fighting, she 'excelled' outside of combat as well. Her years upon Draenor she accomplished everything from working as a field medic, specializing in amputation, to  working among the Blackrock Engineers - picking up much from them in regards to working firearms and explosives.\n\nAdditionally, she can read and write Common and Orcish, and is learning Thalassian.",
						["IC"] = "Ability_Rogue_TricksOftheTrade",
