					["5"] = {
						["AC"] = true,
						["TI"] = "OOC Information",
						["TX"] = "I have a horrible tendency to click keys unintentionally, accidentally going stealth or popping CDs, etc... Sorry!\n\nHer mask is strapped tightly to her face. It wouldn't come undone easily, or forcefully.\n\nThe TRP is a bit of a meme in places, but that doesn't mean it isn't serious in others\n\nRandom acts and crazy behavior is entirely IC. I will never speak OOCly in /s\n\nTRP is an ever evolving WIP\n\nKeep IC IC and OOC, OOC. As much as is possible, at least.\n\nI am IC even when in the open world! (Unless on a flying mount)\n\nConstructive criticism is always welcomed.\n\nApproachable!\n\nRPG lore is accepted.",
						["IC"] = "TEMP",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Weapons!",
						["TX"] = "Braindrinker primarily relied on fist-weapons. Various claws she could grip and use to rip and tear with puncturing punches. However, upon either hip there was a flintlock pistol and a bag of ammunition, meaning that if she needed to - she could take two shots at a time.\n\nAcross her chest is a bandoiler, where one might expect to see easy to grab bullets, there were actually several scalpels! Designed for throwing or slashing in a quick pinch. She'd also carry a bonesaw upon her belt.",
