				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{link*https://imgur.com/a/UE8zYz1*Art}{/h1}\n{h1:c}Please don't steal art.{/h1}\n\n{img:Interface\\QuestionFrame\\answer-AlliedRace-Nightborne:256:128}\n{h1:c}Outward Appearance{/h1}\n\n{h1:c}{icon:INV_NightborneFemale:25}{/h1}\n\n{col:81aaff}Lady Alairyn carries a very soft and noble appearance, that being she has a very soft noble complexion.  Her hair and eyebrows are a very bright white snow in color.  Around her violet glowing eyes are two separate bright arcane tattoos.{/col}\n\n{h1:c}{icon:ICON_7FX_NIGHTBORN_ASTROMANCER_BLUE:25}{/h1}\n\n{col:81aaff}Two like stripes of arcane tattoos go down along both her eyes and end with a small swirl.  Her eyes are a violet color, the light of the sun and moon can make them glow perfectly.  She bears with long eyelashes and her lips are clearly defined and depicted as being rather full.  Though rather slender, Alairyn has a rather slight muscular build that can give off a clear regality of a lady.{/col}\n\n{h1:c}{icon:Spell_Arcane_MassDispel:25}{/h1}\n\n{col:81aaff}Dawning across her center parts of her body more arcane tattoos, like an upside-down crescent moon shape with lines crossing past it and around her mid-section and shoulders the tattoos run all along her body.  They often brighten up whenever her arcane source of magic is being used making a beautiful display.{/col}\n\n{h1:c}{icon:Achievement_AlliedRace_Nightborne:25}{/h1}\n\n{col:81aaff}She has long white hair, however, she keeps it tied up into a ponytail along, sitting on the top of her head is a pure silver made twin headband with the dusk lily sitting in the middle of it.  On both, her ears are two separated light clamped earrings that cover the top half of her long slender ears.  Though they do look heavy they are considerably light.{/col}",
