				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PVPFrame\\Icons\\prestige-icon-2-3:128:128}\n\nThe purity of this one's blood is undeniable.\n\nArrogance, signature of the Sin'dorei, rolls off of every facet of Plutarch Cinderguard. He stands at an even 200cm which is emphasized by the way his frame wears his body: shoulders tightly back, cleft chin forward and up, his chest\nhigh. Two shining eyes polished by fel-fire establish dominance over his face, laying beneath a thick brow ridge and two impressive black brows. A latern-jaw weighs everything down. His face is latticed by a collection of scars which vary between skinny and sleek to jagged and raised. His countenance is justified to an aquiline nose with a bridge that has been clearly broken and reset many times.\n \nHis body, tangled between thick pieces of matte plate and brass-buckled leather straps, is packed with hard muscle. His bulk seems to fill anything that tries to restrict him: the top lacing of riding boots, thin coats, tightly-wound bandages. His wrists are thick and sturdy, his legs are tear-dropped by muscle bred from marching, and his hands are guarded by thick calluses. His chest is bannered by ironed tabards of Silvermoon or its sister-factions. Hanging from his waist are leather sheathes which case damascus shortswords and onyx spearheads. A black riding crop knocks against the side of his leg as he walks, commanding and sleek.\n\nSpeaking in a grizzled tenor, his physical presence is well-bolstered by his words, nearly all of which are spoken in Thalassian. His Orcish, grudgingly given up, is strained through gritting teeth and a heavy accent.\n\nNotes of cardamom, pink pepper and amberwood wrap his body neatly, topping off such a ruthlessly proud and hawkish man with a soft dollop of inherited elegance.\n\nA true Sin'dorei if there ever was one.\n",
				},
			},
