		["0630152308Cvlc0"] = {
			["misc"] = {
				["ST"] = {
					["1"] = 2,
					["3"] = 2,
					["2"] = 3,
					["5"] = 0,
					["4"] = 0,
					["6"] = 0,
				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["IC"] = "Sha_Ability_Rogue_BloodyEye_nightmare",
						["TX"] = "The most notable things upon glancing at him, he has vividly bright crimson eyes that blaze piercingly at people, his skin is very ashen - very light grey - contrasting to his sable hair.\n\nHis ears are heavily scarred at the top, suggesting they were cut raggedly and that they were once longer than they are now.\n\n(Check about for more details.)",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Incognito",
						["IC"] = "INV_Letter_09",
						["TX"] = "It is notable that he never wears anything that marks him as any group or organisation, he doesn't sport a tabard or a pin that is distinctive.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Monstrous",
						["IC"] = "INV_Misc_BearClaw_Black",
						["TX"] = "Whenever he grins, it can be noted that his teeth have been filed into fangs.. a scare tactic perhaps.\n\nHis nails are a touch longer than the norm of a human, they're blackened in colour and claw-shaped but don't seem to get in the way.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Satchel",
						["IC"] = "INV_Misc_Bag_CoreFelclothBag",
						["TX"] = "He has a satchel slung about his body, it is quite large in size and seems to be mostly be partially full half the time.\n\nIt sounds like it may have parchment within, the slight clinking of vials and metal also emits sometimes.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Aura",
						["IC"] = "Warlock_Curse_Shadow_Aura",
						["TX"] = "He has a rather disturbing aura to anyone who can sense such, it seems a tad corrupted.\n\nThose with the affinity would notice that he is attuned closer to the shadow and void.",
					},
				},
				["v"] = 34,
			},
			["time"] = 1615068302,
			["zone"] = "Silvermoon City - The Royal Exchange",
			["about"] = {
				["v"] = 14,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:FFFFFF}Sable straight, lustrous hair has been slicked down against his skull, accentuating his oval-shaped head which is vastly contrasting against his distinct ashen skin, somewhat translucent showing partial inky veins - it is notable that he has extremely mutilated ears that are scarred, they look as though they were cut jaggedly with a blunt blade and appear as though they were once longer than they are now - he has rather exquisitve features with a strong brow-line sporting steeped sable arched brows over almond, average sized eyes, they are an unsual shade of crimson that pierces through anyone he looks at, lighting up his deathly visage with a red hue and casting shadows across his high cheekbones, cracks in the skin start from his eyelids outwards to his cheeks in varying lengths and angles. Moving down his face he has a narrow bridge heading to a sharply pointed nose sometimes flaring his nostrils when he speaks, his thin but darkened lips twisting into smirks showing his fanged teeth, the skin here is also cracked like near his eyes, these cracks are distinctly marking his skin with inky sable discolouring, they stretch until they fade not reaching his angular chin.\n\nHis neck is long and elegant, leading down to his compact shoulders that are held straight and upright so that his collar-bone is jutting out, the bones sitting under the ashen skin - his torso is long but slender and remains preserved like all of his body, in fact it is impossible to find a bone that has torn through his flesh, not even along his long, spidery arms - his hands are large and spindly, infact his fingers seem unnaturally long with strange enlongated blackened claw-like nails still sprouted from them, it is notable that his palms have the same likeness of cracked skin akin to his face, some even extends along his right-hand's wrist. He has incredibly long and lean legs, reminiscent of elven heritage as he stands on agile, narrow feet that allow him to walk almost airlessly from place to place. The thing that doesn't make sense is that he seems to hold only the faint smell of ash to his skin, like burnt out wood.\n\nHis attire is rather interesting, the colours are a contrasting shade of deep purple and dark grey, along with a dark metallic thick filigree that match the accents of his armor, the robe sports a high collar he pulls against his neck, it is notable that he seems to wear various small-boned necklaces tucked under his robe but visible, the latest addition to his necklaces is what appears to be a mixture of silver, onyx and amthyst coloured beads, decorated with a unholy tentacle wrapped eye - the shoulderguards are strapped down to the robes, decorated with spikes and chiseled out holes that emit a faint void-like essence from within them, the belt matching in design and keeping his robe hinched tight so that it doesn't slack, the robe has two upper spiked legguards fused to the sides, protecting his upper legs.\n\nThe staff he sports looks as though it was made from a gnarled branch, thorns and bits of dying leafs sprouting from within the wood which has started to turn grey - there is some deep purple cloth wrapped around the upper part of the stave then twisting up to the top, tying down a large skull that wedges the scythe head into the wood, the metal looks as though it is sharpened regularly though has a small chip in it - the skull's eyesockets are glowing faintly.\n\nWhen speaking, he has a rather deep and husky voice - he sounds quite cold and calculating most of the time, often trapsing into full on stone-cold when he is angered.{/col}",
