			},
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "[Ritual garb]",
						["IC"] = "INV_Chest_Cloth_KulTirasQuest_B_01",
						["TX"] = "Draped around her form is a set of dark, sealogged robes often worn by the Tidesages of old. Her attire signals the woman out as a tidesage. A hempen belt sits around her waist. Her visage is concealed underneath a hood, which is adorned with an anchor in the center of the hood. \n\nNestled upon her shoulders is a wavecaller's mantle. Six scrolls are nestled in place, each scroll containing ancient text each of them housing incantations utilized in both ritual practice, as well as other duties she is bound to. \n\nShe is seldom seen without the cloak that draped over her shoulders, the fabric itself is tethered to her wavecaller's mantle. The cloak bares a sentimental value to the prideful Tidesage. ",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "[Ritual equipment]",
						["IC"] = "INV_Staff_2H_BattleDungeon_C_02",
						["TX"] = "Ritual wand: Carried with her at all times is an ornate wand. This is her go to weapon when she utilizes her magic for both shielding and offensive purposes. \n\nAbyssal beacon: Nestled at her hip is a distinctive lantern, the handle bares a curved shape. The Doctor utilizes this in order to ward off the mists and to serve her as a beacon of light to guide her.\n\nWavecaller's staff: The Doctor carries with her at all times a wavecaller's staff. She utilizes this as a conduit and thus, allowing her to perform major healing prayers. \n\nDead-ringer: A silver bell resides at her hip. She utilizes this when performing funeral rites as the bell is capable of storing souls of the dead inside in order to release them at the shrine. ",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "[Tidemother's Blessings]",
						["IC"] = "Spell_Shaman_HighTide",
						["TX"] = "Those with capabilities of detecting magical presences may detect the presence of the tides lingering around her. Her aura is calm like the tranquil waters of the tide. The Tidemother's blessing is present around this forsaken, as well as her attunement to the waves. \n\nConcealed underneath careful wardings is a darker presence, that of which, is associated with the darkest reaches of the ocean. Underneath that calming aura is an underlying presence of shadow. Even the tides bares a shadow underneath the surface.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "[Like the tide[",
						["IC"] = "INV_Faction_ProudmooreAdmiralty",
						["TX"] = "An antique pendant hangs from the Doctor's neck, the jewel piece is shaped like an anchor. She keeps this in perfect condition, such comes with a sense of pride carried with tis item. A fleeting reminder of a home she no longer bares. When in prayer she is often seen holding it in the same fashion one would carry rosary beads whenever a blessing is performed. To her this signifies reverence, while to others it is seen as strange. Not even undeath can shatter a Kul'tiran's pride. ",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "[Medical kit]",
						["IC"] = "INV_FIRST_AID_70_MedicalKit",
						["TX"] = "Nestled upon the side of her belt is a compact medical kit, containing standard first aid tools, herbs and supplies. She carries this with her at all times, a physician is never unprepared. \n\nWrapped around her upper arm is strip of white fabric inscribed with a red cross, both this piece of fabric and her bag bare this insignia, thus signalling her out as a medic. ",
					},
