			["about"] = {
				["T1"] = {
					["TX"] = "\n{h1:c}{icon:spell_frost_summonwaterelemental:25} Lilry the Wavespeaker {icon:spell_frost_summonwaterelemental:25}{/h1}\n\nA wiry, hard-muscled example of her species, Lilry has vividly red fur marked with darker stripes, and eyes of oceanic blue. Her tufted ears are a little ragged, and here and there, faint tracks of slightly disturbed fur betray scars beneath. When she grins, which is often, a gold tooth glints among her sharply carnivorous fangs. \n\nShe seems at ease amongst taller races, with less of the wide-eyed gawking that some of her less travelled brethren exhibit, though it doesn't stop her feigning cute innocence when it suits her. She's rarely without a rather nasty axe, chipped to hell and back but still decently sharp, and her accent betrays strong traces of the polyglot trading language of merchants and pirates. She faces the world with the casual cynicism of one that's seen a lot of bad things, and participated in most of them.\n\nThose that are sensitive to such things might well sense a density of elemental energy about her, tuned heavily towards water and electricity. \n",
