						["TX"] = "She grew up in the thick of the horde. Her parents had her within Silvermoon. They later moved at a young age to Mulgore to assist the tauren with training the Sunwalkers...\n\nIn Mulgore she followed a lot of the traditional ways of the Tauren. \nShe undertook the coming of age and hunted down a harpie, and undertook the ritual for coming of age. Later she earned her nose ring in helping the small village in Mulgore, her deeds were helping build a house and collect and hunt for food. Assisted with looking after younglings and trained and tutored  with the youthful sunwalkers. \n\nEventually her parents were called to action and passed defending Undercity. \nThe bodies of her parents were never recovered due to the green plague that ate at everything in the area. Her extended family have faded or renounced the name of Dawnflora for stronger names. Before her father left to fight the Alliance, she was knighted.\n\nShe is the last of her family name.\n\n",
