			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Was born in Kezan and under the name Waste 46 was raised a slave to the Bilgewater Cartel. While she was still a child, Deathwing attacked Kezan forcing the population to flee. Taking advantage of the chaos Trade Prince Gallywix has the rest of the population enslaved nd any wealth they had stolen when they arrive on the Lost Isles. There while forced to mine Kaja'mite Wulu starting hearing things. Fearing she was going mad she kept quiet about these voices. Luckily she didnt have to wait long, as Thrall and his Horde aided the freed goblins to save the others. There she was finally freed and sent to the Orgrimmar orphanage where she stayed for a few months haunted by the voices.\n\nOne day she wandered from the orphanage to deal with the voices only to find herself going mad starting repeat the words she heard. Before things got out of hand a Troll warlock sensing a summoning in progress outside safe circles comes to her aide. With a fast cast of subjugate demon he caught the imp that tormented her and seeing potential he took her under his wing to learn control over the demons. She was his student for only a month before he lost his life to a twilight cult invasion attempt.\n\nWhile still very young and in a state grief she sought to leave orgrimmar and sneaks on an emissary ship. She sneaks on with little trouble being smaller than a gnome at the time. Upon arriving she flees the boat when its attacked by some zandalari that at the time were working on invasion plans to pandaria. Lost in zuldazar streets she wandered the streets and surrounding foliage picking plants that looked even the slightest bit valuable developing a talent for identifing high quality herbs. A zandalari troll alchemist took notice of this talent and officially adopted her though, she'd call him mentor instead of father something he encouraged since it would keep them both safe for the time. From then on she was raised as a zandalari was taught about the loa and alchemy so to have a trade of her own.\n \nOne time while fishing she caught a fish that was too big and it pulled her into the water where she was swallowed whole. In the belly of the serpent like fish Bwonsamdi appeared in a fit of laughter at her ironic death though due to good laugh was willing to let her live since the fish was guilty of eating a former priest of his. Inspired and terrified Wulu bargained with bwonsambi when she nearly met her death again at the hands of a blood troll defiling Bwonsamdi's temple and becoming a new priestess, the first zandalari goblin priestess of graves. From then on shes protected and cared for the temple only leaving to collect souls or potion ingredients. A few years after reaching adulthood orgrimmar makes contact again making peace this time, from there she visits orgrimmar making friends with races that werent there before and with that her old fears began to dwindle.\n",
