						["TX"] = "{h2}Early Life{/h2}\nLike all Nightborne, Tei was born in Suramar, approximately 500 years a go. She was born to parents who were both servants to a wealthy noble, so her early life was kind and easy for her.\nHer mother passed away in an accident involving the Master's menagerie of exotic beasts. The resulting trauma drove her father to drink and he passed a few weeks later, falling into the canals around Suramar.\n\nOrphaned and not being in good stead with her parents' master, she was passed on to her godparents, a couple who had once been friends of the family. They ran an arcwine distributory on the front and an illegal fighting ring behind it. \n\n{h2}Young Life{/h2}\nThere isn't much one could do in Suramar before the barrier was dropped. You either studied, laboured or lived in luxury. For Tei, it was maddening. Grieving for her parents and having seen most of the city in her few decades as a child, she took the first oppurtunity she could to patrol the Arcway with the Duskwatch. \n\nThe training and fighting helped keep her discplined for a while and it brought more money into her adopted parents' business. Eventually, not even a century into service, she was dishonourbaly discharged for an alleged affair with her commanding officer. Which of course, never happened. \n\nThe fact she was low-class and was moving like a rising star through the ranks made her the target of embittered nobles who wanted to be the shining stars. The rest, is history.\n\n{h2}Post-Duskwatch{/h2}\nAfter being fired from the army, Tei went to join her adoptive parents' fighting ring, excelling at fights and picking up bits and bobs of using weapons, small amounts of magic and hand-to-hand combat. All this experience was cultivated across three centuries, during which time she aided those she could.\n\n{h2}The coming of the Legion{/h2}\nWhen the barrier fell, Tei, like many, were incensed at the decision to bow before the Legion. She joined with the Dusk-Lilly rebellion and aided in the fall of Suramar's elite. Despite herself and her kind-hearted nature, she slew the Master who had been responsible for her Mother's death. She had been ordered to capture him, but her thirst for vengance and the oppurtunity proved too much.\n\nWhen Suramar fell and rose from its own ashes, Tei was lost. Her adoptive parents and their home had been destroyed in the final days of Suramar's civil war, many of her friends and family butchered by the Legion's Demons purging out those dens thought to be sided with the Dusk-lilly.\n\nShe was lost and alone.\n\n{h2}After the Legion{/h2}\nTeinithra stayed in Suramar for a few months, eventually getting the chance to eat the fruit of the Arcan'Dor, freeing herself of her addiction to the Nightwell. She busied herself with labour and work, but each night sleeping alone in a tent with other displaced Shal'Dorei slowly drove her away.\nOne night, she used her savings to take a boat going anywhere and slipped away into the night, watching until the jewel of ancient empires slipped over the horizon.\n\n{h2}Pandaria{/h2}\nThe Shal'Dorei was in awe when she got off the boat in the Jade Forest. She had never seen so much green! Nor felt so much heat... \nThe next year she spent wandering around Pandaria, infected by a wanderlust she did not know she had.\nShe eventually entered the tutelage of Tian Monastery and began learning how to manipulate mana and chi to create the mists of the Jade Serpent. Combined with her centuries as a street-builder, Tei finally started to put aside the demons of her past.\n\n{h2}Now{/h2}\nWith her training advanced enough that she can call herself a 'Mistweaver', the Shal'Dorei continues to wander the world, experiencing something her great-great-grandparents could only have dreamt of.\nOh and a good scrap. And good drink. Anything to enjoy this new and bright world.",
					},
