						["TX"] = "She holds a simple, yet sturdy bo staff on her back. The staff is made out of ironwood, wrapped in linen cloth and decorated with a red ribbon at the lower end of it and a couple black rings. \n\nFor other monks, it seems infused with potent Chi energy, or at least soothing magic for others.",
					},
					["2"] = {
