						["TI"] = "Tiger paws",
						["IC"] = "INV_Leather_RaidMonk_R_01_Glove",
						["TX"] = "Sometimes her forearms and hands are protected by an odd enquipement which includes a metal protection and a sharp weapon to fight with in hand-to-hand combat. If they aren't used, she rests them at the back of her belt.\n\nThe equipement is attached with two leather straps, and linen bandages underneath.\n\nAnyone familiar with enchantment can tell they are infused with arcane energy.",
