					["4"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["IC"] = "INV_Ember",
						["TX"] = "Wild and abundant, Kyle's flaming hair is tied in a short ponytail at the top of her head, the remaining hair cascading behind her ears and past her shoulders.\n\nOne scar marks her left cheek, not as visible from a large distance, still.\n\nHer forearms are always covered in a linen cloth.",
