			["about"] = {
				["v"] = 27,
				["BK"] = 19,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:75ff00}Huntress{/col}{/h1}\n\n{img:Interface\\LFGFRAME\\LFGICON-HYJALPAST:256:256}\n\n{h1:c}{col:75ff00}Appearance{/col}{/h1}\n\n{h3:c}Before you stands a grumpy, mostly serious looking orc. Her gaze inspects strangers with a hint of distrust, although the simplest attempt at communication may cause her to blink and appear somewhat confused.\n\nMoriga is a tall orc with a muscular frame, her overly agile physique having been mostly replaced by a strong, firm build. The hints of past agility still linger in her body, however. Her legs are long and thick, making her steps slow and steady, while in action her footing appears to be well-thought beforehand, letting the orc be capable of somewhat agile maneuver.\n\nShe has a bulky mane, it taking a wide range over her scalp to its use. The material is rough, causing the very edges of some of the strands of hairs to curl up. Her front braids reach over her chest, while the back hair usually reach just above her bum.\n\nRight side of her face is adorned by three, seemingly old, scars. They start from her ear and go down her chin, most likely caused by some kind of beast. Half of her right ear is missing, as if having been melt off. Whenever her back is exposed, a long burn-mark follows the left side of her back.\n\nHer clothing consists of self-made leather and fur armour. Her belt sports a collection of bags and both a skinning knife and a proper dagger.{/h3}\n\n\n\n\n",
