			["about"] = {
				["T1"] = {
					["TX"] = "A Vulpera  who loves to brawl and fight, training to his utmost limit to the point he can even overpower a male tauren, using just his arm. His desire to get stronger knows no bounds, training harder and harder to the point He can shatter rocks with just his fists, uprooting trees with just his grip. He is friendly to others and loves eating and drinking. He also loves arm wrestling and showing off his strength, and aiming to get even stronger.\n\n- Face -\nDespite his hulking body that can put a tauren to shame, his face looks that of a young male vulpera, though his facial may make him look fragile and the place to aim when fighting him, but his skull can split a rock in two without him sustaining any trauma. He often allows His opponent to hit his head with their greathammers first, shattering them, laughing at their faces.\n\n- Body -\nHis body has been trained to the point not even armor can be of any use to it, He only wears  armor for dress code decency. His arms can literally uproot or crush any tree he can grab hold on, even crushing rocks in his bearhugs. His legs strong enough to even pull heavy loads that elekks or livestock cannot handle. His chest, back and abs dense and big enough to be  his armor, able to take hits and cuts far more than any plate armor he was willing to try on, saving him  a lot on repair bills. If any weapons actually do cut, bruise or even spells damage him, his metabolism can heal him wounds fast without a healer's help, enabling him to actually fight without being accompanied by any healers",
