			["about"] = {
				["BK"] = 12,
				["T3"] = {
					["PH"] = {
						["TX"] = "Tegolwyn stands at average height and is well built considering. As she is a Demon Hunter who survived the rites at the Black Temple, there are mutations. Her skin has turned a scarlet colour and developed scales around her limbs and a pair of spiring ebony horns adorn her crown. Scars are visible all over, as she has seen a lot of battles and endured so many hardships.\n\nShe is mostly seen wearing armour that befits the agile fighting style of a Demon Hunter, mostly made of demon leathers, horns and the occasional plate of metal. She also wields a pair of specialised swords, made with metals of a demonic origin.",
						["BK"] = 6,
					},
					["PS"] = {
						["TX"] = "Tegolwyn shows to be highly alert, and disciplined at all times thanks to years of preparation and training.. However, the Demon soul she paired with is an Inquisitor and shares tell-tale qualities found in the Demon; to accrue knowledge by any means necessary and can show to be cruel on a rare occasion.\n\nOn a personal level, Tegolwyn is quiet and calculating, and shows to have a somber yet cynical persuasion due to past events, yet despite all that she does try to be as open to others as possible.",
						["BK"] = 6,
					},
					["HI"] = {
						["TX"] = "One of the followers of Kael'thas in his pilgrimage and followed him until after entering the Outland, she settled for a few years until demons from the Legion inevitably attacked the settlement.\n\nShe hid to only find everything put to the torch.\nThose she had befriended, impaled.\nAnd those who she worked with, executed.\nEven those she hated were fed to the Felhounds.\n\nAfter the smouldering ruins of her home extinguished, she wandered aimlessly among them. Beset by grief, and an anger that she never felt before.\nShe set out to seek the Illidari, having nothing left besides the home she made in Silvermoon. A journey too great and risky to make.\nTegolwyn demanded to avenge those she witnessed perish. Nay. Begged, and begged until her hands were bloody and her knees were sore. After all, she really had nothing left and understood the sacrifices necessary.\n\n-Best to ask Tegolwyn personally of her past, although she will be hesitant at first.",
						["BK"] = 6,
					},
