			["time"] = 1614723678,
			["link"] = {
				["Teejo-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}{col:c800ff}T{/col}{col:e868ff}E{/col}{col:f3bdff}E{/col}{col:e868ff}J{/col}{col:c800ff}O{/col}{/h1}\n{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\n\nArt by me:\n\n{link*https://i.imgur.com/s0pAKrz.png*Wizard of Vol'dun}\n\n{link*https://i.imgur.com/AlKUFUl.png*Smart Fellow}\n\n\n{h2:c}{col:c800ff}APPEARANCE{/col}{/h2}\n\n{col:ffffff}Teejo is a fairly average-looking vulpera with a few quirks. A vulpera of average height and a lean build, he appears more agile than muscular. Orange fur with blond patches and darker brown stripes dominate his fur coat and he has a pair of bright, orange eyes that almost always are wide and awake. He does have a pair of rather large ears with dark, fuzzy tips. His right ear is pierced with three silver rings of a Zandalari make.{/col}\n\n{h2:c}{col:c800ff}ATTIRE{/col}{/h2}\n\n{col:ffffff}Teejo's style of clothing is not too far from that of his kin. As a wizard on the move, he dresses lightly in his Vulpera vest, the string of small metal discs having been decorated with arcane runes, but they appear purely decorative. Like a proper Vulpera, Teejo's waistline is plastered with items that fit onto his belt. Bags, waterskins, pouches. Magical or mundane, he keeps lots of items handy. The crowning achievement of Teejo's outfit, however, is his wizard hat which he carries with great pride. Strange magic surrounds it and it is very well maintained for being so old.{/col}\n\n{img:Interface\\Pictures\\artifactbook-mage-cover:256:256}\n\nAdditional Information:\n\n{link*https://www.argentarchives.org/node/236575*Argent Archives Page}\n{link*https://youtu.be/5V0O0QQV9Ac*Theme}\n\n\n\n\n\n",
				},
