				["TE"] = 1,
				["T1"] = {
					["TX"] = "A orcish warrior there came thoughe the dark portal when it turned red, now he is fighting for the horde, he serves it and will die for it. Nothing will stand between him his friends or his family. His past was not the most kind, he lost his mate and newly born child, it has taken it's hold on him so he will do all he can do keep those he cares for safe. He finally learned more about his clan and now he wants to follow it. the nature of him is that he follows strong leadership from a code of honor he made to keep him self in line. he is a brute and restless doing combat and dose not care for anything  beside winning and would end do dishonrble moves just to save those he fights with. He was the captain of fourteen orcish warriors doing the iron horde's time where he lead raids and attacks on dreanei towns and patorls.\n\n\nBODY:\nLarge scares runs from his neck and down to his lower back, it's clearly a old and deep scare while there would be a few thine ones around his chest and the newest is one right over his right eye. He also got a large tattoo covering most of the scares around his body it's a large wolf with it's maw open and ready to bite.\n\nFace:\nLarge scare over his right eye, long thick beard flows freely down from his chin, neeck and cheeks while there is a few large iron rings in the large black beard.\n\n\nEyes:\nThe redish hellish eyes is a trait there have gone though his family for ages.\n\nArmor:\nThe armor of the Ironbreaker was passed down to him though many generations of his family before him and one each shoulderpad hangs a banner of the oathbound hounds.\n\nRange weapons:\nHeavy rifle. called the Hound's bane a large caliber rifle there is made to punch though cover and armor\nThe hound's roar: a weapon made by a goblin enginer with a mix of orcish and goblin design and shoots slow but hits like a bull, made to punch though metal covers and reinforced walls.\n\n\n\nART: {link*https://cdn.discordapp.com/attachments/34817817940