						["AC"] = true,
						["TI"] = "An Inked Canvas",
						["TX"] = "The lines and curves of Hali's back are creamy pale, inked from the top of her neck to the bottom of her spine with intricate vines and flowers.\n\nBelow her breasts lies a tattoo which spans the width of her upper stomach, swirling clouds and ribbons of chi melting and merging with leaves and petals.\n\nHer left arm is adorned with inked sprays of blooms and leaves. Clusters at her shoulder, elbow and wrist with vines dancing between to connect them.\n",
						["IC"] = "inv_archaeology_70_highborne_noblemansletteropener",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Medical Belt",
						["TX"] = "Chunky and sturdy, a medical belt rests about the soft curves of her hips. Many buckled pouches are attached, filled with gauze, cotton, banages and more. Two looped straps of leather hang from the belt Hali's outer thighs. The left is strung with surgical instruments, the right with glass vials of surgical spirit.",
						["IC"] = "inv_belt_mail_revendrethraid_d_01",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Graceful",
						["TX"] = "It can be easily noted that Halidae moves with grace and speed, each step gentle and precise.",
						["IC"] = "ability_rogue_shadowdance",
					},
					["5"] = {
						["IC"] = "inv_misc_necklace_shell08",
						["TI"] = "Sea Shell",
						["TX"] = "Haliae's jewelry all seems to follow a similar theme, hanging upon the silver chain about her neck is a sea shell. Creamy on the outer egde with a glossy pink inner, the shell falls to just below the fine lines of her collar bones. \n\nA handful of smaller shells hang from a charm bracelet strung around a slim wrist whilst another delicate necklace holds a tiny silver dolphin with sapphire eyes.\n\nAn addition charm bracelet has recently been strung alongside the sea shells, shimmering silver with charms adoring it. A fish, a mug and two letters, K and H with a heart between dangle from the bracelet.\n\nAn engagement ring rests upon her wedding finger. Twists and whirls of glittering platinum, inlaid with two emeralds.",
						["AC"] = false,
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Sea Foam",
						["TX"] = "The large eyes which sit below her ebony brows are quite dazzling! Twin pools of sea foam green, swirled through with frothy creams and blues. The effect is a sight to behold, framed with velvet lashes and an artfully applied flick of black liner which flares up at each corner in a pretty cats eye.",
