			["about"] = {
				["v"] = 16,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-ThunderPinnacle:256:128}\n{h3:c}{col:515874}--Artwork--{/col}{/h3}\n{p:c}{link*https://cdn.discordapp.com/attachments/733715166906286114/813613726376001557/Halie.png*-New- Hali Half Body Piece}{/p}\n{p:c}{link*https://cdn.discordapp.com/attachments/792375857733566494/809886180795351060/2.1.png*Dreamy Hali}{/p}\n{p:c}{link*https://cdn.discordapp.com/attachments/775902043436482602/780100722095292416/fin_render2-1.jpg*Half Body Piece}{/p}\n{p:c}{link*https://cdn.discordapp.com/attachments/775902043436482602/780521873007706112/fn_render5.jpg*Coy Hali Piece}{/p}\n\n{img:Interface\\PETBATTLES\\Weather-Rain:512:2}\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-9:64:64}\n{h3:c}{col:515874}--Meeting Hali--{/col}{/h3}\n{col:8f5983}To say that Hali was sure of herself would be akin to calling the sea a little damp. Graceful steps have carried the raven topped Mist Weaver through many trials and tribulations during her short life, though she keeps her past close to her chest. Like an oysters shell Hali's heart is hard to pry open, yet to endeavour is to reap the glistening bounty of a perfect pearl.\n\nShe turns her attention to you then, a silken brow raised in silent question. Her face is heart shaped and as beautiful as the rest of her kin though slightly rounder than most, missing the angular cheekbones. A softly bowed pair of lips bloom into a confident smile, though her gaze is guarded. When they part a voice as sweet and smooth as honey butter meets your ears, her tongue very often running away from her and opinions rarely reserved. \n\nWith a shrug she moves a slender hand to reajust the fabric of her tunic, a habitual motion which draws your attention to her graceful curves though that is not her intent. Her waist is slender, small enough for hands to wrap around entirely. In contrast hips and bust are more shapely than she would like, the hourglass of her figure not something particularly common in Elven females and certainly something she longs to be rid of but can never seem to change.\nHer free hand moves to sweep the loose curls and waves of her hair away from sea foam eyes, the tresses falling to her shoulders like pitch water. That gaze is dazzling and inquisitive, the only makeup discernable being a sweep of mascara which draws your attention inevitabley to the velvet fan of her lashes. A few moments more and she makes her excuses, turning to leave the way she came in a lingering cloud of coconut shampoo which seems to veil the faint scent of salt water.{/col}\n\n{h3:c}{col:515874}--Tattoos--{/col}{/h3}\n{p:c}{link*https://cdn.discordapp.com/attachments/775902043436482602/779019604453490708/20201119_162019.jpg*Left Arm}{/p} {p:c}{link*https://cdn.discordapp.com/attachments/775902043436482602/779022789973114950/20201119_163406.jpg*Spine}{/p} {p:c}{link*https://cdn.discordapp.com/attachments/733715166906286114/779022947016245308/20201119_162003.jpg*Below Breasts}{/p}\n\n{img:Interface\\PETBATTLES\\Weather-Rain:512:2}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-9:64:64}\n{h3:c}{col:515874}--The Water Baby--{/col}{/h3}\n{col:8f5983}Toes wriggle in the sand, then dash away from the playful wave which seeks to lap at them. Laughter chimes across the beach, as sweet and smooth as honey butter as she flops back to sit just shy of the pursuing tide. \nEbony curls catch the setting suns rays, kissing her shoulders like inky glass. \n\nShe has always loved the sea, chasing it's waves since she was a young child and taking any oppertunity to swim in its cool embrace. Today is no different and she rises to her feet in a fluid movement, gracefully slipping out of her clothing and allowing it to pool upon the sand at her feet. In a mere moment she dives beneath the waves, swimming in long, strong strokes until her slender arms ache. Only then does she burst forth from below the surface to inhale a salty breath of air. As sun sets she leaves the beach, her heart as always lingering in the waters.{/col}\n\n\n{h3:c}{col:515874}--Guild--{/col}{/h3}\n{p:c}{link*https://www.argentarchives.org/node/250160?*Crazy Eight's AA Page}{/p}\n{p:c}{link*https://www.argentarchives.org/node/250152*Hali's AA Page}{/p}\n\n{img:Interface\\PETBATTLES\\Weather-Rain:512:2}\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-9:64:64}\n\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-ThunderPinnacle:256:128}",
