			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Leadrel Dawnstar is a very young Sin'dorei, barely over her teenage years in elven age. Having grown up with Blood Knights, she has been through brutal physical and mental training, which can be observed on her body. \n\nShe is usually dressed in comfortable, civilian clothes made of Blood Elven silk, although she does possess a few heirlooms from her family: a plated set of armour and her shield. Also, she usually carries a harp with which she performs.\n\nTouched by spirits, both her hair and her eyes are a lot lighter tinted than the typical Sin'dorei.",
						["BK"] = 5,
					},
					["PS"] = {
						["IC"] = "achievement_character_bloodelf_female",
						["BK"] = 6,
						["TX"] = "To the shock of her parents, Leadrel was born a special child. She possesses a connection with the spiritual world, being able to see and talk to ghosts of the past.\n\nDue to her young age, she is quite impulsive and it is difficult to anticipate her next movement. Having a naive personality, typically she tries to help people around her. Lea is very energetic and eager.\n\nThe dark side of her personality is due to her connection to the spirits. Leadrel can become quite unstable because of them. Her connection to the Light is sometimes severed by the strength of certain spirits, which can exploit her young age and manipulate her.\n\nTravelling across Azeroth, she loves to sing with her lute and her voice to the delight of the public. Lea has also written a series of books, most of them are short stories and collection of poems. Right now, she is working on her next masterpiece!\n\nList of published works:\n\n-\"Ancient Poems of Quel'Thalas - A Collection I and II\"\n\n-\"A Spirit's Demise\" - short stories about spirits she's seen\n\n-\"The Horde and The Alliance\" - satyrical poems and stories about the never ending conflicts\n\n-\"Under the Light\" - propaganda she was paid by the Blood Knights to write.",
					},
					["HI"] = {
						["TX"] = "The Dawnstar family is a proud, old and once respected family of Quel'thalas and Silvermoon City. However, the price of their ambition proved to be to high: in an attempt to elevate their status, the Dawnstars entered in a conflict with other noble houses, that have decided and succeded to eradicate our family from the face of Azeroth. Therefore, most of the members are either dead, missing or have fled to Outland. Even the house matron, Nathlaeril, has fallen in the fight against the Lich King and turned into a San'layn.\n\nBorn along with her twin brother, Xalerian, Elysia shared in the education he did, which means a lot of training in the magical arts. Both of the children have sacrificed their youth in order to become deadly weapons of their people. Besides magic, Xalerian was educated in the arts of diplomacy and money-making so he may one day become the head of the Dawnstar family, Elysia was trained in the arts of shadow, subterfuge and assassination, so that she may carefully remove and enemies of her family and her people.\n\nRight before the assassinations started against our family, Elysia has taken her newly-born daughter ( Still searching for an IC father. ), Leadrel and given her to the Blood Knights for training and security, so that she may escape the killers. The young member of the family shares the magic talents of her parents, combined with the training of the Blood Knights and a passion for the arts.\n\nWhere we stand now: Nathlaeril has broken from the chains of the Lich King and is now free-wiiled, Xalerian has remained in the public domain, attempting to restore the glory of his house, while Elysia went off the grid in a fit of rage and desire for vengeance, finding all sorts of activities to keep her occupied: from painting and travelling to being a hired killer. Laedrel is travelling across Azeroth, writing, singing, trying to help people and speaking to the ghosts of the past.\n\nIn their own ways, the members of the Dawnstar family are working towards the same goal, albeit in very different approaches: restoring their family ( which, if you are interested, welcomes your Sin'dorei character! ) to their rightful place.",
