			["about"] = {
				["T2"] = {
					{
						["TX"] = "{link*https://imgur.com/a/4AfAdec*Art Gallery(partial nudity warning)}\n{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\n{h3}{col:181dff}Suryan is tall and heavily-made, almost a throwback to a Kaldorei in scale. Wide shoulders, broad chest, strong-boned frame with well-defined muscles. Yet he still moves with grace and deliberation - although he seems slow in his actions he covers the ground swiftly enough. He 'occupies' any area he is in, seeming to fill space around him with the assured awareness of a top predator.\n\nHis hair is a thick, fine, creamy blonde with white highlights, if unbound it falls in heavy locks down beyond his mid-back.  It contrasts against the tan of his weathered skin.  He has light stubble beard along his strong jawbone converging into a trimmed goatee on his chiselled chin. His ears are somewhat thicker than the normal for his kind, folding backwards, more reminiscent of Kaldorei ones.\n\nThe eyes are ocean blue, their irises dark in cloudy weather and vivid in light. The deep-set eyes gleam with live fire and the lines of a grin are cut deeply into his face so that the merest twitch of a smile sets them darkening. They look out with a stern expression: this is an old-style man, macho and disciplined, sombre and self-contained.\n\nWith the ease of longevity that all elves have this one still looks like he has been around a very long time.{/h3}\n\n{h3}{col:181dff}Clashing with his serious demeanour and appearance he wears some less conservative jewellery, such as a flat golden ring in his bottom lip, a silver stud through the middle of his tongue and two small rings in his left brow. In his ears he has two industrials crossing each other.\n\nSuryan has a masterwork of a tattoo, a pair of red-inked wings on his broad shoulders with the realistically detailed feathers ending at his elbow.{/col}{/h3}{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}",
