		["1024192523PVUco"] = {
			["character"] = {
				["v"] = 20,
				["CO"] = "Fatigue 0/20",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "Has a noticable Limp.\nSkin is pale and almost translucent.\nDark circles around his eyes.\nFaint green looking scars across his chest and left arm.\n",
			},
			["time"] = 1615069177,
			["zone"] = "Silvermoon City - Farstriders' Square",
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "He may once have been described a handsome man, with a strong, masculine jaw, chiselled cheeks and Sea Green eyes. However it’s difficult to see a face as attractive when it bears dangerously deep scars and wears an eternal mask of thinly veiled contempt. And it’s tough to admire eyes of deep jade when the left is a sickly deep red color like old blood.\n\nThe thick, heavy plating of his armour is immaculate. He is never seen out of it and appears unhindered by its considerable weight, as it if formed an integral part of his heavy frame.\n\nHooked in his wide, heavy belts are a score of trophy hooks, a few of them always sporting a freshly claimed extremity, be it a hand, ear, scalp or similar.\n\nHis right arm is completely replaced by an arcane mechanical construction. The limb itself has been crafted in a dark grey metal, it is sleek, streamline and incredibly well made. \n\nScattered along key parts there are fel stones surrounding a larger blue stone that glows brightly with the arcane energies. These are positioned around the top of the biceps and also a set above the wrist. Around the index finger, a chunky gold ring with fel stones embedded within has been perfectly merged with the digit as if it is both wearing it and yet it is clearly fused with the metal.\n\n The hand itself is eerily lifelike, holding a liquid grace to the craftmanship, the fingers themselves look as if they could be real if they were not tipped with subtle claws.\n\n The shoulder is capped with smooth metal that spans partially onto the chest and armpit to lock it in place, the skin around the prosthetics attachment point is raw and scarred from where the skin has been pinned over the metal to allow further security.\n\n The arm looks perfectly lifelike until you see the two ball points at the top of the arm where it locks into ball sockets in the shoulder. \n\nWhen attached, the sheets of metal cover these ball sockets and joints to leave a perfectly smooth expanse of metal in a series of segments that look almost like armour. \n\nThe limb itself seems to show muscle definition, these areas even flex of move like real muscles when the arm moves or fingers flex.\n\n It looks almost like someone has simply painted metallic grey over the mans arm it is so realistic if not for the segments and sheets of metal merging together to allow flexability.\n\nShould one attempt to find something nice to say about him, it might be that he appears well-groomed, especially when it comes to his long, white hair which would easily brush along the ground, should he ever bow. \n\nA keen observer would notice that he appears corrupted on a deeper, more sinister level. Black veins can be seen on his visible skin, yet has not yet reached his neck or face.\n\nIn the event that someone saw him in a state of undress, they would him completely covered in a thick layer of scar tissue, both fresh and old. Although many scars are of a warlike origin, it would be impossible to conceal that most of them, especially on his back are stemming from a hand exceptionally skilled in the use of whips and blades.\n\n Even so, one can see within the remains of his ruined back, a tattoo which seems to shift, to writhe and breathe as the magics within it still function. It used to be in the image of a city of almost alien origin. Yet the destruction of his skin has rendered it nearly impossible for anyone to tell, save those who might once have seen it in its full nature.\n\nA large black tattoo is covering his left arm and shoulder, the design tribal and seemingly of an arcane nature.\n\nDemonic and Fel runes cover almost ever inch of his torso and arms, seeming carved, tattooed and branded into his flesh, crossing over scars. If anyone takes the time to look at them closely, there are thousands of them, the reasons for them unknown. ",
