						["TX"] = "Around each of her lower thighs she has what appears to be leather belt that are strapped around with a small flat pouch of each, these contains each five small thorwing daggers. On her upper- thighs she has two black holsters strapped around her thighs that each contains a dagger, this does that the handle of the dagger is pointed upwards. In her gloves she has a simple metal piece built in underneath the surface which bends after her hand, preventing her to straighten her hand completely.\n",
