						["TI"] = "Shadow cloak",
						["AC"] = true,
						["TX"] = "Nemyt wears a rather big cloak which would cover her whole. Even drags it behind as it reached the ground. Rather dark and old looking. But that wouldn't be the only thing about this cloak, there seems to be a dark smoke coming out of it every now and then. Nemyt uses this cloak to perfectly hide herself in shadows or even protect herself in battle by it, only if focused enough.\n",
