			["link"] = {
				["Nêmyt-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-Drustvari:512:256}\n{h1:c}{col:a8343b}Nemyt Stormlight{/col}{/h1}\n{link*https://imgur.com/OU12ZsE*Newest reference of Nemyt}\n{link*https://imgur.com/X8XwX3c*Nemyt}\n{link*https://imgur.com/1ypG8hs*Her scars}\n{link*https://imgur.com/fSTaqvb*Nemyt and Kilin}\n{link*https://imgur.com/4jzhTsh*After a battle}\n{p:c}{col:692428}Thin figure, adorned in a dark leather armor is covered with many weapons on her, whole body. Mostly hidden. Around each of her lower thighs she has what appears to be a leather belt that is strapped around with a small flat pouch on each, these contains each five small thorwing-daggers. On her upper thighs she has two black holsters strapped around her thighs that each contains a dagger, this does that the handle of the dagger is pointed upwards. In her gloves she has a simple metal piece built in underneath the surface which bends after her hand, preventing her to straighten her hand completely.\n\nNemyt's waistline goes in, making her have a natural hour-glass shaped silhouette that compliments her feminine looks, this however looking more hour-glass shaped due to the fact that she has quite the broad hips, and a flat stomach which may make her hip bones and her rib cage stick slightly out. Her breasts are seen pretty much within the avarage size of any typical Sin'dorei and leads down to get flat and slender stomach, clearly taking care of keeping her weight. Nemyt has  scars everywhere on her body. Her whole back is covered by long scars made by a whip and quite small scars on her arms made by blades which hit her in many battles.\n\nHer face is of a thin posture, while her chin ends up in a slight point. Her nose bridge is small as her nose tip is pointing forward. Nemyt's eyes emit a shadow violet color due to her class, however not so strong and rather pale. She has completely white hair, straight and loose hair that leads down to her chest. Her lips are small, but slightly thick. Nemyt has a long slender neck that would make her collar- bones show easily, and thus also having somewhat small and fragile shoulders.{/col}{/p}\n\n{h1:c}{col:a8343b}Personality and Traits{/col}{/h1}\n\n{p:c}{col:692428}Bubbly, energetic and charming. Nemyt often hides her demented mind behind a childish exterior, which she can combine with the flirtatious demeanor of a woman who is aware of her good looks and will use them to get what she wants. She is also much more intelligent than she lets on, often causing friend or foe alike to underestimate her. In addition to being a skilled manipulator, she's prone to explosive fits of rage and has a violent streak. Most of Nemyt's incarnations do possess a softer side and are capable of genuinely caring about others, however. Nemyt can also be very loyal to people she cares about, but at the same time she struggles with an innate selfishness and a sense of dependence on others.{/col}{/p}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n{h1:c}{col:a8343b}History{/col}{/h1}\n\n{p:c}{col:692428}Nemyt Stormlight, born in Dalaran by two loving parents and with her older brother. Her parents died when she was just 12, which is considered a child among the Blood Elves. After that she and her brother moved to Eversong Woods, closer to the more populated places in the Sin'dorei community. Her brother raised her for a big part of her light, but she was never taught how to defend herself or how to use any sort of magic, which made her an easy target for different assassins, bandits, thugs, rogues, and so on... And after 8 years she finally fell prey  to Amani Troll, during the Second War. He wasn't planning to kill her straight away, he tortured her, used violence and injured her in all different ways, until someone broke into the den of this troll and killed him with quite a fight. The rogue revealed his face, and it was not Kaledon - Nemyt's brother... It was an unknown person she barely could see, her vision was blurry and she ended up by just closing her eyes and falling asleep. She woke up in a house, definitely cozier than the troll's hiding place. That rogue taught her his ways - How to apply poison, how to fight, the ways of stealth and immediate liquidation of one's foes... \nUnfortunately\nfor one rogue, there is another one. Her savior was brutally murdered by another rogue that right after, ran away, leaving enough traces for her to be able to find him shortly after, in the desire for vengeance, in range and in fury...\nWhen she arrived there, she saw who that murderer was - her own brother .She wasn't able to kill or even hurt him. Although he was capable of things, even worse than what the troll did. He slashed her skin with burning blades, knocked her out... Until one day, she used her skills to break free, and in a one on one duel she had beaten him. She killed him, stabbing right through his chest, through his heart. She would not have a better reason to kill him than the truth he has revealed, the painful truth - He was the one that killed her family... \nAfter that she stayed in Silvermoon city for some years until the Scourge attacked the city and killed most of the population. Nemyt luckily survived but it was a rough battle. Since then, she never stayed too long at one same place, she lived basing on stealing, robbing and selling. During the Third War she hid in Stranglethorn. She had quite the reputation on the Gurubashi arena and after a while she left, traveling on her own across the world. Nemyt has faced many threats, but with each one she became more experienced and destroyed each threat with her battle-scarred daggers and her unbelievable agility...{/col}{/p}\n\n",
