					["TX"] = "{img:Interface\\LFGFRAME\\LFGICON-ZULAMAN:256:256}\n\n{h1:c}Early Life{/h1}\n\nZhu was born in the ShadowTooth tribe in Ashenvale, in her early life she followed in the footsteps of her father the tribe witch doctor learning the tribes rituals and practices, when she reached adulthood she was facinated by the local satyrs and their demonic worship deciding to study the tribes history with demonic energy it is there she found an old ritual practiced by the Zandalari of old the art of harnassing demonic power\n\n{h1:c}Demoniac{/h1}\nAt the age of 25 Zhu'jin summoned her first demon an imp which she let possess her in order to trap him and consume his energy, after this she would often capture newer and stronger demons consuming their power\n\n{h2:c}Joining the Horde{/h2}\nWhile she supported her tribe during one of the more difficult rituals she lost conntact with them, only finding the ruins of her tribe after a twilight hand attack on it, having no other place to turn too she joined the darkspear who accepted her as they be needing all the help they could get to stage their revolt against Garrosh Hellscream\n\n\n\n\n",
