		["0226162523cxuKJ"] = {
			["character"] = {
				["CU"] = "Mood: Angry\n\nObservant.\n",
				["CO"] = "Approachable, i use Tongues.\n\nGlances are really important.\nMount = IC\n\n\n\n ",
