			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Alensha Mistwhisper is a shy Kaldorei that devoted her life to nature.\n\nIt's not easy to get to know a shy person like Alensha, but you will find out that she's a friendly, and calm.\n\nShe's polite, and generous. She lived happily until the Cataclysm, it destroyed much of what she calls home. She went to Shadowglen shortly after, to train. She learned much there, studying how to use nature to mend wounds. The Cataclysm changed her, and she left for the wilds with no idea where to go or who to trust. She now lives in the Twilight Grove, filled with doubt and fear from the past. \n\nHer personality is very quiet. She is kind, caring, and has a very calming aura about her. Her favorite color is purple, and enjoys tending the groves and gardens across Azeroth.\n\nShe's often haunted by nervousness and fear.\n\nShe hid from the other races within the Twilight Grove or Duskwood, but she chose a different path. Alensha doesn't seem to care about the Alliance anymore. The world is plagued by war and death, and she wants nothing to do with it. She will travel the world, hopefully finding peace within herself. \n \n\n",
				},
