					},
					["3"] = {
						["IC"] = "inv_misc_herb_starflower",
						["TI"] = "Decorations",
						["TX"] = "She decorated her hair and neck with flowers, vines and orange leafs. Around her neck hangs an amulet with a moon, glowing at night. \n\nThe amulet is intertwined with even more vines, making it barely visible during the day. White cloth is tightly wrapped around Alensha's chest and both arms, no one knows why...",
						["AC"] = true,
