						["AC"] = true,
						["TI"] = "Aura",
						["TX"] = "Alensha has a calming aura around her, she's like the calm before the storm. All the negative energy goes away around her and you feel more at ease.\n\nShe has the pleasant scent of flowers and wildlife.",
