		["0103131348o0AWi"] = {
			["character"] = {
				["v"] = 33,
				["CO"] = "Prince Tanny~\n",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "",
			},
			["time"] = 1615068790,
			["zone"] = "Silvermoon City - Murder Row",
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}{icon:inv_misc_tournaments_banner_bloodelf:25}{col:5b8f32}Tannen Brightsong{/col}{icon:inv_misc_tournaments_banner_bloodelf:25}{/h1}\n\n{h1:c}{link*https://imgur.com/a/11wcZf6*Artwork of Tans}{/h1}\n\n{h2:c}A tall, blond-haired, green-eyed Sin'dorei. High cheekbones, a sharp jaw and pale flesh are likely best used to describe his face. Often sporting a lazy, half-lidded gaze and a sly smirk, Tannen could be described as smug, though he'd much rather be referred to as confident.\n\nHe maintains excellent physical form, trained and well-toned; though still distinctly elven. As such, Tannen carries himself with the grace and soft mannerisms expected of his kin. \n\nHe keeps his hair and pretty boy features as well kept as possible, often grumbling away to himself when the former becomes messy.{/h2}\n\n\n{h1:c}{icon:spell_arcane_blast:25}{col:b373ff}The Spellblade{/col}{icon:spell_arcane_blast:25}{/h1}\n\n{h3:c}Tannen is well versed in both swordplay and magical arts and, as such, combines the two when the need arises. His arcane aura is likely easily felt by those who are attuned to such things making it no secret he dabbles in arcane crafts.{/h3}\n\n{h1:c}{icon:inv_misc_curiouscoin:25}{col:FFBB3A}The Keeper{icon:inv_misc_curiouscoin:25}{/h1}{/col}\n\n{h3:c}As Keeper, or Dinoriel, of The Thalassian Exchange; Tannen runs numerous trading routes around Azeroth, mostly dealing in luxury items and bulk supplies. Because of this, some people may know his name, or that of the Exchange.{/h3}\n\n{h1:c}{icon:inv_sword_11:25}{col:93ecff}The Mentor{/col}{icon:inv_sword_11:25}{/h1}\n\n{h3:c}Trained in swordplay from a young age, and more advanced magic later on, Tannen now tutors aspiring spellblades. If an elf has a grasp of the basics and a willingness to learn, they need only reach out for further teaching.{/h3}\n\n{h1:c}{icon:inv_belt_armor_bloodelf_d_01:25}{col:ffb536}The Lord{/col}{icon:inv_belt_armor_bloodelf_d_01:25}{/h1}\n\n{h3:c}As the eligible heir of House Brightsong, lordship fell to Tannen after the death of his parents and the disappearance of his older brother. The destruction of the Brightsong Estate during the Scourge invasion of Quel'thalas is one that left a dark mark on Tannen's history. A mark he has recently made efforts to scrub clear, with the acquisition of new lands.{/h3}",
				},
