			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "The first thing one might notice about Vylariah is her unusually tall height for an elf like herself. She is built slimmer than average, with little curves and long, willowy limbs. Her features are sharp and defined, with high cheekbones and a pointy chin and jawline, much like the daggers she carries on her hips. Her hair is jet black and falls long and pin-straight down her back, set in a slightly off-centre parting. Her cunning, fox-like eyes flicker with an amber glow, contrasted by a small, pointy nose. Her bottom lip bares a small yet barely noticable scar; one wouldn't be able to tell unless they were up-close. She has porcelain-like skin dusted with a few light freckles across her nose and cheeks.\n\n{link*https://imgur.com/a/Cs84y7H*Appearance Artwork}",
						["BK"] = 1,
						["IC"] = "achievement_character_bloodelf_female",
