					["PS"] = {
						["TX"] = "Although she has followed an arguably unhonorable lifestyle as a rogue, V can be fiercely loyal to those who show her respect and care. She has an intuitive distain for the undead, due to the nature of the death of her parents and the chaos in her life. Although she is good at heart, V has a tendency to be deceitful and difficult with a lot of people as a means of protecting herself.",
						["BK"] = 1,
						["IC"] = "inv_misc_book_09",
					},
					["HI"] = {
						["TX"] = "Vylariah grew up as the child of a tailor and his wife in a settlement in Eversong Woods. She lost her parents during the scourge attack of the third war, and was found and rescued by a lone assassin and poison-master named Orin. He took her in and taught her the ways of his profession, making V well-versed in combat and poisons. His work recently led to his death, and V has now resorted to travelling alone with Orin's lifelong earnings in her pocket, looking for work and purpose. ",
						["BK"] = 1,
						["IC"] = "inv_scroll_03",
					},
