						["TI"] = "First noteable features",
						["TX"] = "At a first glance your eyes would be drawn to the figures hair. A thick head of hair sprouts wildly from his scalp and cascades down over his shoulders and lower back.\n\nAs the light catches the strands the vivid hues hidden there would be quite stunning. Bright ruby reds, ambers and honey yellows flow like a river.",
