					["3"] = {
						["AC"] = true,
						["TI"] = "Acrid Scent",
						["TX"] = "The elf carries an acrid scent about him of gunpowder and explosives. Sometimes he just smells of burnt things entirely!",
						["IC"] = "inv_eng_bombfire",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Feeling of an Aura of Light",
						["TX"] = "It is a subtle thing hidden in the very core of the elf. A spark of the light, raw and unused. Although he is no Blood Knight or paladin in the making, it is clear he has the light within him.",
						["IC"] = "spell_holy_aspiration",
