					["5"] = {
						["AC"] = true,
						["TI"] = "Dragonhawk Trainer",
						["TX"] = "About his person is a few varying objects that show he is a Dragonhawk trainer. Such items include a large ring of bone and wooden whistles carved into Dragonhawks, spare reins and riding crops. His neck also has the feint tattoos of red flames come up from beneath his collar bones - part of a larger tattoo.",
