					["4"] = {
						["AC"] = true,
						["TI"] = "Body build & physical notorieties",
						["TX"] = "Much like his race, De'vontae is heavily built up. Though he is in top physical form, what with being so young and serving in the military, he does not look like his age. His face is lined and his eyes hold a great wisdom. Upon his ring finger is a tattoo of two twin Dragonhawks entwined in a circle.",
