			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}\n\n|cfffff67fOccupational titles.\n- King Ace of the Skies\n- Skymaster to southern Quel'thalas.\n- Captain of the Thalassian Skyguard - 'Romulo'.\n- Battle Brother to Skylark the Gilded Crimson Dragonhawk.\n- Proud pseudo-adopted father of Lae'rulynn Firestar [Now Deceased]\n- As of recent 'Merciless De'vontae', 'Hero of Torga's Rest', 'Charmer of Warmothers', 'Lover of spiky clubs.'\n- Owner of Meyren Sevalar's Banana\n- Captain Flyboy Number One\n\nCurrent military Medals: \n- Tear of Elrendar for the campaign of True Blood.\n- Phoenix banner in Bronze for the Campaign in Northrend and Feralas.\n- Rectrice in Bronze for service in the Skyguard.\n- Bronze Horde Banner for service in the Ashen Bulwarks Blades edge Campaign.\n- Bronze Fist and sword for service in the Dead Rise Campaign.\n\nCurrent load out:\n2 x Firestarter bombs\n5/5 x Hamstringers\n\n\nHave you ever seen autumn leaves in the sun? Reds as deep and vibrant as succulent rubies, oranges like the taste of pumpkin and cinnamon, sweetened only by the saturated yellow of the purest honey. It is these colours that make up the mane of the man standing with you. There is something about these vibrant strands when cast in the light of the sun. You don't always notice it at first, but when you do, you realise the vague terms we use to describe hair colour, no longer fit them. They turn into rays of morning sunlight before our eyes, swimming with a warmth and energy that projects the world with a wild light - leaves of autumn shining in the lining of deep untampered honey. If you have never seen such hair before, then you will surely notice this amongst all other things of the character De'vontae. To be lost in the flames of hair is a sweet yet energizing experience, but should you find your eyes wondering, you will begin to notice the smaller details of Firecloud.\n\nSupple ivory skin lines his chiselled countenance with silver scars and lacerations across his torso retaining a strange beauty to his physique as well as a morbid history. De'vontae has an appealingly handsome face made with a strong jawline, high set, sharp cheekbones and defined lips that curve up into a smouldering smirk. His eyes hold a mixture of holy energies from the ever present sunwell as well as the thick sickly green fel shroud that had tainted his race. Beneath this glow, you'd find an intelligence in earnest eyes that seek to understand everything around them, picking up on hidden details, seeking true meaning about what things are and not what they are meant to be. But at times a deep rooted sadness can still be found on more melancholy moments, a sadness that weighs down the elf in his stature as well as his mannerisms that give away he has been through much in his short life.\n\nIn terms of physique, De'vontae stands tall for his kin, but not overbearing with a muscular athletic body that, has twisted ropes of muscles shown along his arms and across his back and down to his stomach. This is often hidden in chainmail armour or shown off in tight leathers and cloth that set a less militant and more casual set up for the elf. \n\nBeneath the clothing is a set of stylized flame tattoos that ignite at his wrists and flow up his arms, along his shoulders and down his back, creeping along his sides and beneath his trouser line. If you were to follow them further still, you'd find a Dragonhawk spread in full flight forming the flames at his left pelvis. The reason behind these tattoos is to hide the scars of his past and the most recent scar of an eye upon his left sternum. On his left ring finger the elf has a tattoo of one autumnal Dragonhawk wrapped with its head on the tail of another more orange tinged Dragonhawk with a more male featured face. The first has wings like blood and the second has wings of fresh oranges, each touch in a circle mouth to tail creating an intricate circle and ring. This for those astutely aware is the males wedding band.\n\nPerhaps, now you have seen all you can make out at close inspection, you will move onto uncovering the person inside of all we have covered. Let us just hope you find him as charming a man as he is intended to be. Some have called him a sad living form of the brutality the elves have faced, others refer to him as a unique and wonderful character, many comment of his new found faith in the light and view of the world. What will you find in De'vontae Firecloud?|r\n\n{img:Interface\\QuestionFrame\\answer-VindicaarCrystal-LightsJudgment:256:128}",
					},
					["HI"] = {
						["IC"] = "INV_Misc_Book_17",
						["BK"] = 1,
						["TX"] = "{img:Interface\\PETBATTLES\\Weather-Blizzard:512:128}\n|cff8f8f8f\"My name is De’vontae, son of a spineless sperm donor and a human loving egg dispenser. Not the introduction you were expecting to start with? Yeah, well I guess you could say that my life hasn’t turned out to be what you’d expect to have been dealt upon ‘entering a contract with mother nature.’ Think I’m being excessive? Then ruminate whilst I shed some light upon those worn out leather boots of my life you are judging prior to trying.\"\n\n\"As you may have gathered, my outlook on my parent situation is, for lack of a less colourful term, about as favoured as an abomination farting in a compacted Undercity elevator. I’m sure Esteler and Theodluin Autumnvale didn’t start off with the intention of ending in the way they did, I’d go as far as to say, they probably thought things were going to be great. But in truth, as soon as Esteler announced her pregnancy, Theodluin - my biological father, became about as useful as a knife made out of butter. He was always a coward of a man that managed to get to where he did with his lot in life by being a ‘good listener’, and that’s about as far as his talents stretched. He was the kind of guy that would inspect his shoes intently during any conversation and likely hold an explosive that was about to detonate as long as it stopped you yelling at him.\"\n\n\"My mother Esteler fell for Theodluin after a messy breakup with the local Spellbreaker’s apprentice, following a discussion about what was more important, training or her. I think we all pretty much can guess what the answer was to that question. So, done with burly lovers, Esteler fell for the docile and rather useless Theodluin - the guy who will always be the ‘safe choice’. To cut a long story short, in the run up to my graceful entrance to the world, Esteler fell for a domineering human by the name of ‘That fucking wife stealing bastard’ she met one night ‘on the road’. It took her all but the length of time it took me to pop out and wave a howdy for her to jump ship into the arms of her new human lover and run off.\"\n\n\"Theodluin as we’ve established, was about as useful in situations of distress as a spoon is in combat, but add heartbreak and fatherhood into the mix and Theodluin decided he had been called away on a spiritual quest to see the world. So, a human loving mother and a father that was more in touch with his Kal’dorei self than he was with the fruit of his loins, we’re hitting the ground running with this story aren’t we?\"\n\n\"I grew up with my father’s loyal friend Skymaster Baesh who had taken me in as his stable hand. Life with Baesh was like living with your best friend from your days at the academy, all fun and games and there for you when you needed a buddy to beat up those little pricks that went about like they had the testosterone of an Orc. But, he was never a father, and I couldn’t really expect him to have to be… I suppose the best way to describe it would be, your parents provide you with the rules of life, whereas Baesh provided the guideline.\"\n\n\"Transitioning past my voice breaking, hair growing where hair had not grown before and a large shift in the balance between which kid shits on who’s doorstep - ..purely figurative, I was at my coming of age and a budding Dragonhawk rider, still part time stable hand. Baesh had taken me on a journey out towards Kalimdor by boat to exchange a Dragonhawk egg for a substantial amount of silver. We were on our way home when our ship was redirected towards the Hinterlands following an obscure warning about there being unrest in the High Kingdom.\"\n\n\"Baesh became unsettled by this news and the fact the ship would not be returning upon its designated route for ‘some time’. It was then that he took his own Dragonhawk and we rode into the skies to head out along the coastline towards home - but just as we passed over the mountain into the region of Ghostlands, that was when we saw what had stopped our ship. A black jagged, ugly scar was being torn across our homeland, littered with flames and staggering bodies that I assumed were the ambling survivors of our race. Baesh turned us back towards the mountains nestled in the south with the intention to free room on the Hawk for any wounded he could rescue. I waited six days, foraging more than hunting, gathering as much as I could for as many as I thought he could bring with him. Naively optimistic, my stubborn youth was rewarded with the sighting of Baesh’s Dragonhawk on the sixth night, swooping and twisting back in a careful descent to the grass.\" \n\n\"I had never seen Baesh look so old as I did that night, ghostly pale and withdrawn. In a sense, my friend never came back on that Dragonhawk, the man who did was fuelled by a sorrow I couldn’t understand or even begin to console. Since this time, I have read many books, seen much scars of that battle, but I’ll never claim to share the sorrow that other’s have known. The sorrow of seeing the extermination of Anasterian and the High Elven race.\"\n\n\"Two years passed since that night, we had spent that time helping to rebuild our homeland, our minds and find a way forwards. Propaganda had begun to spread like wildfire across the survivors, telling tales of the Sunwell that we had all felt be ripped from us, like a maelstrom had opened up inside of our stomachs. But it went on to speak of horrors of what would happen to us now we could not feed upon the Sunwell’s riches. How we will become twisted forms of ourselves, history will repeat itselves and soon, we will face our future evolution, as the Kal’dorei once did to the High elves. Many jerked off this as a cruel and sickened joke from those too mad and broken to look for hope in this bleak world. Baesh was one such elf. ‘What a load of Tauren bollocks’, he used to fume as we took turns tending to whatever job we had been given that day. You see, since then, we had joined a colony of survivors, led by the remnants of some Farstriders and city Guards, making a small camp and pushing forwards blindly to survive.\" \n\n\"I wondered, why would these people be spreading such rumours and tales in such a time  as this? I ridiculed these proclaimed mad elves with many others, taunting them and throwing stones as they tried to use turned up crates as podiums. Life went on like this until news had come through the camp that Prince Kael’thas had returned from Dalaran and is seeking any able bodied to come with him to find an alternative to the destruction of the Sunwell. Promises of a new bright future spun like golden strands of the sun towards us and brought us together, binding us under our new title ‘Blood Elves’. Sin’dorei. The word still burns a fire in my heart.\"\n\n\"I caught Baesh packing shortly after the news had reached our camp, he turned to me like he had been caught cheating on his lover. His face ashamed and eyes sad and apologetic as they had become to always be since the attack. He would be heading out with the Prince and many other elves in the hopes of finding something new out there for us, as a way of making amends for what he couldn’t stop. He explained to me how I was too young to go, and I suspect if I was old enough he still would not have wanted me to. I felt the ground tumbling away from me, rooted only by the sense of reliability he had to me not to lose it. ‘Besides, they’re going to need a kid to step up and take over from an old Skymaster’.\"\n\n\"Green under the collar, I knew better than anyone I wasn’t ready to be a Skymaster, but I couldn’t say no. I couldn’t break out into that cliché scene of screaming and crying like a good boy I was meant to be, I just accepted it because I knew that was what Baesh needed. And so, Prince Kael’thas, his men and my Baesh left to what would later be, Outlands.\"|r\n\n\n|cff8f8f8f\"During this time, I moved into a turned out ruined building with a girl called Lorilae, a few years my elder, an innate ability to kick my ass in everything and stunning eyes, I was unable to really say no. It was my first interest in the opposite sex and I had no idea how to handle this strange world. I’d like to say, but don’t worry, Lorilae was a great teacher, but we went through this earlier. This isn’t exactly what you’d expect to happen. Our make shift home was made more homely by some pelts and recovered cloths from wreckage hauls, I had made a nest for a Dragonhawk egg and kept Baesh’s Dragonhawk out in the back courtyard. Lorilae and I shared bed mats often, for she suffered night terrors from the attack and I consoled her with an awkward pat and terribly misplaced thoughts about what is a bra and how does one smoothly handle the prospect of untying it.\"\n\n\"I didn’t notice the hunger and thirst for magic as many others did so dearly as it was more a background noise to me than anything larger, and I suppose being away from it at the time made matters less difficult. But Lorilae had been aspiring to join the ranks of a Magister, she was closer to the Sunwell than I’d ever be and she felt the pain like it was a physical burn on her throat. Always there, I suppose like the dead scar is to Eversong. We had all started to become thinner and more withdrawn in appearance, and Lorilae had since stopped coming to my bed mat as her hair had started to fall out in clumps. I tried to console her one night that it was simply due to malnutrition and stress, but I wasn’t trained in the world of women and didn’t know how rude it was to say ‘Hey, look, I was never fussed about your hair before, you’ll be more eye catching without it.’ Lorilae left the house and did not come back.\"\n\n\"One night, when I was on my own, I was awoken by a faint scratching sound at the door, similar to a mouse but more frantic. Picking up the leg of a broken table, I edged my way around the door and towards the shutters of the nearest window. In the light of the moon, I gently pushed open the shutter by a crack, nimbly pressing an eye to the side. Now, I never really bought into this whole mock the Kal’dorei’s Elune, until Elune decided to take a giant steaming crap on my innocence by showing me what I saw that night. So. Before I continue. Fuck you Elune.\"\n\n\"Lorilae - or something that looked much like her, stood at the door with blue bulging eyes. Her thin hunched body turned towards the window showing the hunch to be a growth of her skin upon her back which glowed a strange blue. Walking over clumps of fallen hair, she started to amble her way closer. So next time you ever want a version of a cold shower from thinking about a hot girl, well yep, that did it for me.\"\n\n\"I picked up the Dragonhawk and fled, my heart pounding as I tried to reason with my fight or flight instinct and the rationality of if this was a bad dream from hearing too many propaganda speeches. I ran out the back door towards Baesh’s Dragonhawk and looking into it’s consoling eyes, I came to some sort of realisation. It was as if this attack on the High Kingdom was the end and the part I’d been living was some cruel twist of a joke. Like letting a fish off a hook only to have it swim into a net. If I couldn’t find freedom, then Baesh’s hawk deserved to. Untethering the leather strap that held it into place I commanded it to flee - it sensed my fear and took to the skies. Thanks a lot ancestors for your decision to opt for opposable thumbs over wings.\"\n\n\"It’s safe to say I’ve not had such a bad night since then - Really? You fell for it again?\"\n\n\"News came through from month to a few months at a time from Outlands followed by the appearance of green floaty orbs in gilded chains dotted around the rebuilt city of Silvermoon, but none came back from Baesh himself. I became detached from the prospect he was still alive and instead I put my mind onto something else. Become an Outrunner. You see, our civilization may have been destroyed, but life had gone on and I needed a job and at my age at the time, I needed anything I could get. There had been a noticeboard placed up near the camp advertising for Outrunners to carry messages through the ruins of the city and even possibly down past the Dead scar - that black line that tore along our homeland I spoke about earlier. This wasn’t a very sought after job as it kind of took your life expectancy down from triple digits to two. But as such they weren’t picky about how old you were as long as you could run and follow simple orders, yes sir no sir, you tell me how many bags you want full sir.\"\n\n\"For this, I needed to move down to Falconwing Square.\"\n\n\"My interview consisted of running around a disused fountain and being forgotten about by the drunk ranger who was currently in charge of the post because he became distracted by his empty bottle. Four hours later and I was still running, he came back and laughed for another thirty minutes in hysterics but I kept running. If you ever need to work off a lot of pent up aggression and distress, do some running, unless you can have sex, both are relaxing, running is the beggars sex.\"\n\n\"My first job ended up being my only job as an Outrunner. I was given a large parcel and told that my destination was Sunstrider Isle, my point of beginning, Falconwing Square. This meant I had to run across the very long stretch of Dawning Lane that divided the ruins of Silvermoon - the place where elves like Lorilae were being disposed into, elves that had fallen victim to their own addiction. They had become to be known as ‘the winnowed’. Sometimes you’d catch elves on their last legs jumping fences to get into the ruins to join ‘tapping parties’, where the attendees had captured Mana Wyrms and started to tap into them and their blood like a drug.\"\n\n\"This, I will point out, wasn’t approved of, but usually if you had fallen so low as to forget yourself and actually begin this tapping process, you had already sealed yourself into becoming a winnowed. It was breaking into the early rays of the morning when I set off down the path, I figured they’d be less likely to lurk on the path that the Guards would be regularly seen upon during the daytime, when patrols were more often. And it was going well until I reached the first gate. Slumped over the dead body of an Outrunner stood a winnowed, hands deep in the ribcage of the body. Seeing it in the actual light of the day, I was certain they had become worse… for this creature - this thing that had once been the other side of the same coin to me, had transformed into something that makes Worgen seem like a Fey tale. It had green bulging eyes, a black rot-like mouth with what looked like black drool coming from it mixed with blood, a balding head and these pulsating green growths… It’s feet and hands were like claws, ripping and slicing up it’s meal with wiry like fur growing out in patches across its’ arms. Parts of the growths seemed to have popped for there were small holes where they should have been. It’s chest no longer followed the structure of a ribcage, instead it sucked inwards. It turned itself from its’ meal, likely sensing the prospects of what little magic I had flowing through me as a nice desert. It was then i noticed the markings near the eyes, like small slits - it just wasn’t elven anymore. I ask you now, how can we be born the same and yet ended up so different?\"|r\n\n\n|cff8f8f8f\"Fear contained the bile that had risen like a churning sea in my throat, that could be me if we didn’t find a cure. I dropped the package and fled just as I heard the screech of the wretched thing ‘So.. hungry!’ followed by the clicking of its’ claw like feet hitting the slabs of the pavement. I screamed out in turn, and I felt as fast as I could back towards the square, hearing more and more clicks of claws upon the ground. Just as I saw the barricades into the square, I was gripped by more fear, for the rangers were pushing the barricades as though to keep me out. I waved my hands in the air and yelled that I was Sin’dorei, to open up and help. And just as I thought I was forced into a corner, a bright flaming arrow blitzed across the sky and landed behind me into the body of the pursuing monster. I heard the thud of the fallen body and turned to see the gone creatures descend on the fallen to gorge upon them. Collapsing backwards, I was dragged back behind the barricade followed by shouting orders.\"\n\n\"I was relieved from my job as an Outrunner having failed my duty to take the package to the Isle and was given a few copper to go wash away the pain at the local tavern. I was still so shocked, I did just that. Throwing my copper at the barkeep, I ordered my first flagon of ale and I suppose covered in dirt and mud, the elf was beyond cracking down on things like ‘are you old enough for this?’. As I simpered into my third ale, a woman burst through the door and into the murky smoke filled tavern where many had come to swallow down the horrors that had become our lives. Tears streamed down her face and in her hands she held the remains of a shirt. ‘They’ve become wretched! They’ve all become wretched! We’re poisoned! Kael’thas has abandoned us and taken our children and left us to die!’ Punters rolled their eyes and began to yell at her to jog on, shut her trap and go put it to better use in the brothel.\"\n\n\"I’ll stress, I was very drunk at this point and young, and after what I had just seen, I wasn’t all that willing to join in the shouts anymore. Because I knew different. I pushed back by bar stool and waved my arm about the room shouting, ‘And what the fuck do you think we’re guarding ourselves from now? Where do you think people are disappearing to? You’re all blind and ignorant and remaining that way because it’s easier than admitting that we will end up like them! You’ve all felt the hunger and seen the changes on us!’ I received a club around the ear and numerous half eaten pieces of food thrown at me, at least the woman wouldn’t be ridiculed anymore. It was the first beating I had taken since I was ten and I no doubt deserved it, being thrown out into the streets in my own vomit and someone else's piss. ‘And what are you going to do about it kid?’ - And that was when I met Alaris.\"\n\n\"Alaris was a ranger who worked along the front lines of the Dead Scar and that night had taken to the tavern to sate his addiction - i’m talking a more primal addiction that starts in the loins and finishes in a glass of milk. If you don’t know what I’m talking about then this story is going to get a lot less child friendly. It was actually his own bought consort he was supposed to be with that was crying her eyes out and ran into the tavern, becoming wet in all the wrong places, primarily her eyes. So in a sense, we both had had a pretty shit night. Alaris explained to me that if I wanted to see change happen, then I would have to start learning how to make a difference, and that started with learning to fight.\"\n\n\"The next part is pretty dull, I learned to fight, I learned humility and I also became a father - figuratively, to my Dragonhawk. I did get word from Baesh in time, but this happened after the Prince Kael’thas had publically become known as a traitor and Lor’themar stepped up as Regent Lord. A soldier that served out there actually gave the letter to me and explained it would have been sent off a lot sooner, but it came from Northrend. It turned out Baesh was in the suicidal fight against Arthas in the North, the one where the Sin’dorei tried to find vengeance but only found more death. So it was confirmed, Baesh had died.\"\n\n\n\"The Sin’dorei were as a race re-building and finding a new standing point, we had been guided to joining the Horde and as I said. Death happens, but life doesn’t stop to say ‘Oh dear, poor thing’. It keeps going and so must we. But what got me moving was the re-appearance of an old friend. That Dragonhawk I had let go, that’s right, Baesh’s, returned to Eversong - and we stumbled to each other upon the hilltops near the ocean. It took me a while to realise why this Dragonhawk was acting so strangely, but it was unmistakably his. I ran home - or to what had become home, a small collective group of houses that had been rebuilt on the trolls old land and become inhabited by Alaris and some other friends we’d made together.\"|r",
					},
				},
