					["TX"] = "Lillys is a fast  hunter! \nShe´s a Dune Hunter of her caravan and is proud of what she dose best..hunting!\nWhen she first came to Ogrimmar, she was tired and lonley but happy she got away from Vol´Dun. \nBut she now lives a meaningful life with her caravan that she met in Ogrimmar, and finally feels like she found a home again.\n\n\nPersonality :\n\nLillys is a very happy little fox, always smiling. She has a low tolerance for others bullshit and cant stand grown people whining.\nHer favorite things to do, besides hunting and taking care of her animals, is dancing and partying. \nShe dose not worry much and will always help when she´s able to.\nThat also means helping the Horde...after all, they helped us (vulperan).\n\n\n\nOBS (working on my TPR still) \n\n",
