				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Arsenal",
						["TX"] = "- A warm aura radiates from her robe.\n\n- One can easily sense a strong aura of abjuration and arcane due to Narestra's eight runes, obvious green gems. No Fel.\n\n- An overwhelming aura of Light is easily sensed radiating from her one-handed sword. Yet something more sinister might be there! For the mages.\n\n-At times, Narestra sports a steel shield, quite durable and less enchanted than the rest of her arsenal.\n\n-Only a few books can be seen hanging from her belt. What would they be?\n",
						["IC"] = "inv_helm_suncrown_d_01",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Belt",
						["TX"] = "Narestra's belt is used as a place to hang books and pouches from. Currently, there can be seen two books, thin ones and four pouches.\n\nA perception check can easily determine that the thin books concern matters of faith, willpower and their relation to the Holy Light as a force of purging.",
						["IC"] = "inv_armor_belt_lightforgeddraenei_d_01",
					},
					["3"] = {
						["IC"] = "ability_malkorok_blightofyshaarj_yellow",
						["TI"] = "Aura",
						["TX"] = "- Primarly, an aura of Holy Light radiates from this individual. An aura of warmth and welcoming. Undead might dislike this.\n\n- Secondary, an aura of order emits from Narestra. An arcane aura, yet not as powerful as the Light.",
						["AC"] = true,
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Jewerly",
						["TX"] = "- Two eagle-wings can be seen adorning each earlobe. Symbolic earrings.\n\n- A rising eagle neck piece that hugs gently around her neck. It carries no aura.\n\n- A golden ring hangs from her neck thanks to a thin, steel chain. It has the following words carved in Thalassian: \"Thor, Shal, Ashal, Na, Owyn\"\n\n",
						["IC"] = "inv_jewelry_necklace_75",
					},
				},
				["v"] = 22,
			},
			["time"] = 1615041619,
			["link"] = {
				["Narestrra-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 20,
				["BK"] = 4,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}\n\n{h2}{col:d29037}Apperarance & Arsenal{/col}{/h2}\n\n{h3}{col:d29037}{icon:achievement_character_bloodelf_female:25} White with a few red strands, shoulder length hair slightly reveals a craggy, yet resting face. Small eyes that emit a bright orange color, set thightly within their sockets, watch blankly those that approach her.\n\nThe characteristic pale skin could only be seen due to her neck and face, otherwise most of it is covered by armor.\n\nAn otherwise lithe frame, not too tall but not short either. Despite that, a slight athletic sense is at hand, a sign that this one exercises regularly.\n\nThere's something different about her, perhaps it's her eyes or the general blank expression, an expression of the fearless, but also of the lifeless, as if her spirit wasn't quite within her body. Nonetheless, she seems to be talkative, somewhat approachable. What thoughts flood her mind during a conversation though is another story.\nOne could only guess her age, by the looks of it, Narestra seems venerable, obvious wrinkles beneath her eyes give it up.{/col}{/h3}\n\n\n{h3}{col:d29037}{icon:inv_chest_armor_bloodelf_d_01:25} Narestra sports an old, yet otherwise powerful arsenal. A robe, adorning the obvious colors of black, red and gold covers everything, from up her neck to her boots. Enchanced silk cloth with the purpose to keep her warm during cold nights and cold during warm days.\n\nCloth isn't the only thing she sports though. The obvious shoulderpads that cover her shoulders and even below, her biceps, are made of hard reinforced steel, pretty much durable than the common shoulders. Its secret for the durability was the triple quenching of the incandescent item, afterwards dipping it in oil, which made them more durable and gave the steel pieces a better shape. Obvious, feather-like shapes, along with what appeared to be the face of an eagle on either shoulderpad. A symbolic figure of the house Bloodcrest.\n\nThe same applies to the obvious chest-plate in front, which extends from Narestra's upper chest area to the middle of her abdomen. This thick piece is kept together with another thinner piece that protects the Sin'dorei's back with neatly tied leather straps painted red.\n\nConcluding, her gaunlets, the front part of her belt and her heavy boots are made in the same way. Heavy, which would inevitably decrease her speed, but durable enough to protect her numerous times from equally heavy attacks. Both magical and melee. Specifically, her gaunlets have sharp-nail parts. Making her able to claw in melee distances.{/col}{/h3}\n\n{h3}{col:d29037}Apart from the armor, Narestra's arsenal sports eight specific and obvious gems. Enchanced gems that act for defense and retaliation.{/col}{/h3}\n\n{h3}{col:d29037}At times, Narestra carries a burning sword in the obvious Light energies and a shield. The sword can be sensed to have a strong Light aura, same with her shield. Pretty uncommon objects, hardly destroyed.{/col}{/h3}\n\n\n\n------------------------------------------------------------\n\n\n\n{h2}{col:d29037}Abilities{/col}{/h2}\n\n{h3}{col:d29037}{icon:spell_arcane_rune:25} -Through the passage of time, Narestra has acquired knowledge and means to use spellbreaking abilities. Able to toy with a mage's focus and flow of thought, directly assaulting the mind, overwhelming it with means necessary to make one forget spells temporarily, thus rendering them useless. Narestra uses her sword as a conduit of such terrible anti-power. Apart from the strong Light aura, mages will sense a menacing, chaotic enchantment. Bearing resemblance to a Fel enchantment, though that doesn't seem to be the case due to the Light. It is a strong, spell-stealing enchantment.\n\n{icon:achievment_raid_houroftwilight:25} -Apart from the anti-magic techniques, Narestra radiates a warm, major aura of Holy Light. An antithesis if one gets to know her, as Narestra isn't the typical paladin, that seeks to use the Light for the greater good. There is something far more selfish, chaotic situation to that. Yet, the Light is summoned, pointing out Narestra's unbreakable willpower. Willpower for her own goals. \n\n{icon:inv_ember_fel:25} -Narestra has a sort of an adept knowledge about Fel. Inevitably, she had to cross paths with its energies for survival, yet she refused to practice it more other than just survival. No spells, demons, soul-stealing can happen. Yet, she is keen on detecting demonic auras that associate with Fel.{/col}{/h3}\n\n\n\n------------------------------------------------------------\n\n\n{h2}{col:d29037}Story and House{/col}{/h2}\n\n{h3}{col:d29037}A long one. Only a few can reach that deep. There are stories, songs, legends, traditions. Yes, there are - however Narestra doesn't seem willing to reveal any of them.\n\n{icon:inv_misc_book_10:25} Despite that, Narestra has a keen eye for ones that can serve her house as mercenaries, ones that are searching for contacts, acquaintances, mages and paladins alike.{/col}{/h3}\n\n\n------------------------------------------------------------\n\n{h2}{col:d29037}OOC stuff!{/col}{/h2}\n\n{h3}{col:d29037}-OP? Just enough for a venerable Sin'dorei. Yes, they exist too.\n\n-Belore? YES.{/col}{/h3}\n\n\n\n",
				},
			},
