						["TI"] = "Armour",
						["TX"] = "Silyse often wears a purple and ornate slik battlemage's robe with armour, made from a Saronite and Leystone alloy, fashioned in a mixture of traditional Suramarian style and Scourge armour.\nIf not that, then she'll wear a hooded black robe, adorned with pieces of metal.",
						["IC"] = "inv_chest_plate_raiddeathknight_l_01",
					},
					["4"] = {
						["IC"] = "inv_sword_1h_pvpdraenors2_d_02",
						["TI"] = "Weapons",
						["AC"] = true,
						["TX"] = "Traditional Spellblade's Swords - Forged from Lumenstone, used by Silyse in life during her time in the Duskwatch. They have since been reinforced with Saronite, now including skulls at the hilts, and are charged with frost runes.",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 1,
					["5"] = 3,
					["4"] = 2,
					["6"] = 2,
				},
				["v"] = 59,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:00fff7}Silyse{/col}{/h1}\n{h3:c}{icon:ability_ardenweald_paladin_winter:35}{col:e27dff}The Chill of Night{icon:ability_ardenweald_paladin_winter:35}{/col}{/h3}\n{h3:c}{link*https://imgur.com/a/AJk2DN3*Art}{/h3}\n\n{p:c}{col:ffffff}Like most Nightborne, Silyse's skin is patterned with runic symbols. However, the Death Knight's tattoos are more crude, and glow a bright, light blue as opposted to your typical Shal'dorei. Most noticably, on the right side of her face, a rune shaped like an 's' wraps around her eye socket and runs down here cheek. The same rune can be found, mirrored, on the left side. Her skin is also noticably paler than is normal of her race, on account of her undeath.\n\nShe is thin, very thin. Her bones practically poke through her skin, and her muscles appear severely underdeveloped. She appears almost like a Nightfallen, but it is clear that she has eaten of the Arcan'dor, as she is not withering. It almost appears as if she died of malnutrition.\n\nSilyse's hair is a snowy white, which falls to just below her shoulders and it parted close to the middle, just off to the left. Small crystals of ice can be found tangled in between her thick locks, which gives her hair a blue tinge when viewed from a distance.\n\nAs with most Death Knights, Silyse's eyes are a haunting, chilly blue. Wisps of magic can be found trailing from the corner of her sockets. The typical, sneering squint of the Nightborne can be found on her face.{/col}{/p}\n\n{p:c}{col:ffffff}An adept fighter and master of Cryomancy, now risen into undeath in service of the Lich King.{/col}{/p}\n\n{p:c}{col:ffffff}Silyse does not particularly enjoy recounting the events of her death. However, to somebody close to her, she will share her tale if asked. She does not remember her raising, and will get annoyed at people who push her to try to remember.\nOtherwise, she is very open, and enjoys talking about her old life in Suramar.{/col}{/p}\n\n{col:00fff7}{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-74:150:150}{/col}\n",
				},
