			["time"] = 1614723361,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\Calendar\\Holidays\\Calendar_HordeWarCampaign:128:128}\n\n{col:542710}General: \nAn average sized tauren, with a trained physique. Strong like any tauren should be. Kemala stands tall and proud. With shaggy brown fur and thick, crude, plate armor.\n\nPhysique: \nThe tauren. Tall, hulking, noble creatures. They tower over the other races of the Horde. And Kemala is no different. Built like a literal bulldozer, this furry mostrosity of dense bone and powerful muscle will charge clean through any barricade and knock aside anyone standing in her way.\nDue to being mostly muscular with little fat, her chest and hips are not as defined. They are clearly feminin. But, not THICC.\n\nKemala has shaggy fur. Brown with beige spots and belly. Although, clean and well tended. The fur will remain coarse and shaggy. Her hooves are adorned with hoof irons on the bottom. Hammered in with iron nails.\n\nHer fur is painted in tribal warpaint.\n\nFacial features: \nKemala's golden eyes are set in a frown. Just the shape of her face really. Her snout is long, with large nostrils. Her teeth clean and white.\nHer sharpened, black horns frame her features well.. Often used to gore those who don't get out of her way fast enough.\nShe has warpaint on her snout.\n\nHer brown mane is shaggy and ruffled. It is decorated with eagle feathers and blue beads. Likely trinkets dangle from her horns, ears, forehead, and around her neck.\n\nEquipment:\nPlain, thick iron armor, decorated with Thunderlizard horns, thunderlizard hide and mountain cougar hide.\nMaintained often enough, it does show signs of battle. With scratches and broken off spikes.  \nShe carries with her a large axe. The oakwood handle resembling a staff, with the stone axehead emblazoned with earth runes!\nOn her back, she carries a Kalimdor oakwood totem. The totem itself imbued with the power of Earth!\n\nOn her hip she has what humans consider a large backpack. A pouch to Kemala. The fur, leathery satchel, decorated with feathers, is filled with equipment for travel. Rope, food, a waterskin, a skinning knife, a leather tent.\n\nArt:\n{link*https://imgur.com/OGLJYgT*Art1}\n{/col}{img:Interface\\ARCHEOLOGY\\ArchRare-TrollDrum:512:256}",
