						["IC"] = "ability_racial_jackofalltrades",
						["TX"] = "Spear\nThe spear that Vobak brings to battle looks fansy but in truth it is as common as the next spear. The spear was made to make thousends of small lighting fast stabs on raptor back yet is still viable on foot for combat. The reson for it looking so fansy is becuse it was made to intimidate dose it ever work? no..\n\nSword\nThe sword is Vobaks pereferd choise on foot. unlike Vobaks spear  this one is not made to look fansy but just focused on practicality and made to chop like an axe yet cut like a sword.\n\nShield \nOften seen with his sword and spear. ones again decorated to intimidate his foes but dose that ever work? but despite this decoration it dose not neglect practicalty with a large buckle in the middle to controll a foes weapon aswell as thorns on the saids to deliver that exstra puntch.\n\nDagger\nThe last deffance! the last of the last! dose not see alot of combat! mostly seen whean cuting food or enything like that or in offerings to his loa\n\nGreatsword\nThe greatsword is Vobaks preferd weapon if he plans on going in on foot but its rather avrage as swords go. The sword is wrapet halfway up the blade to allow for halfswording.\n\nAnd ofcourse meny meny more! one handed maces, axes and two handed axes and maces! and other things! helberds! got a collection",
