						["AC"] = true,
						["TI"] = "Warrior's Physique",
						["TX"] = "This Elf stands a full head taller than her kin, her body carved in heavy muscle. Dark twilight skin is covered by glowing Orcish Military Tattoos and Shalassian Leylines, her arms and fingers thrumming the same shade as her azure eyes. Three claw-like scars cover her right eye.",
