						["AC"] = true,
						["TI"] = "Crow Blades",
						["TX"] = "A mighty Warblade is holstered to her back, beside her banner, standing taller than the towering elf. It's far too large to be swung, and the steel seems unlike anything you've encountered before.\n\nFrom her hip hangs a curved longsword in a crow-feathered sheathe, the scabbard's side painted with the Orcish symbol for 'Fire.' Blessed magic radiates from the steel, even through its sheathe. A leather corden hangs from the grip of this sword, bearing a host of trinkets and war-medallions.",
						["IC"] = "inv_icon_wingbroken05c",
					},
				},
				["v"] = 97,
			},
			["time"] = 1614644247,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h2:c}{col:af24ff}Appearance{/col}{/h2}\n\n{link*https://www.argentarchives.org/node/245379*Velravyn Lunaire}  is a powerful young woman of the Horde. Honed over several years of ferocious conflict, she stands tall, proud, and strong in the face of adversity. Like those she fights with on the frontlines her body is covered in rugged, powerful muscle and heavy scarring. Her eyes are potently charged with mana, Shalassian and Orcish Military tattoos radiating arcane fury and rarely extinguishing. Together they crackle potent azure magic at her fingertips with a mere moment's notice. It is a sharp disparity to her dark skin, coloured so that you could lose her in the shadows of twilight.\n\nWhile lighter on her blush than many of her fellow Suramarians, Velravyn always keeps herself made up with mascara and foundation. Her clothing has become far more practical than her homeland; when not in her armour, she can often be seen in high-neck shirts, thick cloth pants and calf-length leather riding boots. This exposes her incredible collection of scars, from face to feet, including a trio of wicked marks over her right eye and a stark circular ring about her left forearm. Her back is by far the worst, a horrific torturer's canvas of white and black lines twisted into stiff valleys of scars.\n\nHer hair is kept clean and bound in a cloth-wrapped ponytail and braids, the loose ends either tucked beneath a rugged old hat or a bandanna to ensconce her ears, both of which are missing their upper halves. Like her hair, her nails are often kept just so; manicured and lacquered when on vacation and just barely kept in the thick of combat.\n",
						["BK"] = 6,
						["IC"] = "sha_spell_warlock_demonsoul_nightborne",
					}, -- [1]
					{
						["TX"] = "{h2:c}{col:af24ff}Personality{/col}{/h2}\n\nReforged in the crucible of war and revenge, Velravyn is an elf many outside of her circle would refer to as, 'Callous and Composed.' While she frequents usual pleasantries with light smiles and a keen eye, often she keeps her inner thoughts restrained with a placid masque-like face. Her voice, {link*https://youtu.be/WomoIywubm4?t=349*worn hoarse through the din of battle, is a low and appeasing contralto} clearly crafted in its cadence for the polticial battlefied of the Court of Stars.\n\nHer sharp eyes belay a keen cunning and intelligence, transmitted often through creative sarcasm or warm humour. She has a natural Suramarian confidence to her attitude and body, though seems for the most part to keep her pride in check. She often affixes her sentences with polite titelage, using, 'My dear,' to those within her circle and addressing others by rank or last name.\n\nTo those who know her well she is a friendly, warm face who will give all she can. To her enemies, however, she is known as a terrible and brutal opponent, a cruel imagination sparking behind those ever-thinking eyes.",
						["BK"] = 3,
						["IC"] = "ability_demonhunter_vengefulretreat",
					}, -- [2]
					{
						["TX"] = "{h2:c}{col:af24ff}Equipment and Blades{/col}{/h2}\n\nVelravyn’s armour suggests a preference for skirmish tactics, being light and smooth to dive in and out of battle as a Blademaster should. Here and there, her armour is accented with elements of Suramarian military flaire.\n\nBuilding her own armour piece by piece, the Nightborne wears a light Orcish warharness over her stark blue tattoos. During campaigns, a strong plate neckguard is added to her ensemble for a little extra protection. Standing out amidst her sleeker is a heavy pauldron bearing the skull of a felled Proto Drake. Mounted upon her back is her Sashimono – {link*https://www.argentarchives.org/node/232649*a warbanner bearing the sigil of the Crowblade.} The sigil depicts a bird poised for combat with the recognisable Burning Blade held in its beak. A delicate shal’dorei transmutation rune encircles the bird and its weapon. Atop the ironwood banner, bound with red cloth, sits a trio of dark trophies. A gilded Demonic Inquisitor's skull is nestled into the apex, a crudely carved Imp-skull hanging just below it by a similar sash while a third rests below of a much larger, similarily horned creature. All have arcane permanance runes engraved into their brows, preventing them from returning to the Nether.\n\nThe rest of her armour is comprised of light, layered drake-plates. Borne over one shoulder is the skull of a felled Proto-Drake, it's plates matching those of her taloned boot-guards and the ornate taloned gauntlet strapped over an arm. Her legs are armoured with a dragonscale kilt hanging from a bulky warbelt. The unearthly white shimmer across the dead ebony scales indicate they once belonged to an Infinite Dragon. Shimmering arcane feathers poke out from underneath their leather thighguards, giving the high-sitting leg armour more of a flared, slimming effect. These scales are held up by a sturdy belt that is bedecked with pouches and a handy first aid kit. \n\nOn her hip, bound by a blue Shalassian Silk sash, {link*https://www.argentarchives.org/node/246413*the ancient Elunite steel blade, “Anaris,” sits within a crow-feather sheath.} The Orcish symbol for 'Fire,' is painted over the metal finishing connecting the feathers to the mouth of the scabbard, an ornate rope sword-frog holding the sheath to the sash. Draped over the metal mouth is a rope tassle, bearing a twilight blue bead, a perfect pearl, and a third gem of the two melded together in a perfect eclipsing moon. A jade bead hangs from the tassle itself, the maker's mark supporting the rest of the blade. Any familiar with Azshara’s Expansion Wars against the Troll Empire would recognise it and its elven details such as the crescent moon pommel, and the Qiraji Obsidian eclipsing guard. Those with a keen eye would recognise its forging origins as both ancient Mogu and Pandaren, the latter clear in the blade's form and the Cloud-serpent styled metal collar just below the guard.\nTo the Zandalari Empire and Trolls of old, it is a wretched blade rumoured to sever a troll’s connection to their Loa.",
						["BK"] = 6,
						["IC"] = "inv_sword_1h_wrathguardweapon_b_01",
					}, -- [3]
					{
						["TX"] = "{h2:c}{col:af24ff}History{/col}{/h2}\n\n*Are publicly known events, feel free to recognize her!}\n\n- Born in the Waning Crescent to Lieutenant Syrienna Lunaire of the Duskwatch Saberguard.*\n- {link*https://www.argentarchives.org/node/224350*Studied at Suramar University and graduated to an apprenticeship}. Departed public eye after Mother's banishment.*\n{col:ff003f}- Took up the pen-name {link*https://www.argentarchives.org/node/222784*'Alryette Duskquill'} and authored many romantic fantasy books, catering to the upper nobility.{/col} Later participated in the Suramarian Rebellion as a Smuggler and Informant.*\n{col:ff003f}- Held and tortured by the Inquisition of the Black Flame until the Rebellion's end.{/col}\n- On her escape notably killed Lieutenant Lerethold Geroux in a public Tal'ashar at the Nighthold despite near-Withering and crippling injuries.*\n{col:ff003f}- Recruited into Horde Intelligence during the start of the Fourth War, taking the Blood Oath. Participated in multiple black-operations under the Shattered Hand's \"Warforged\" division. Division later disbanded and members released or reassigned.{/col}\n- Taken in by the Sisterhood of the Serpent, and further developed her skillsets incorporating magic, alchemy and blades in her work.*\n- Vanished during the height of the Fourth War.\n- Returned to Azeroth and became a student of Kar'goz Clearstrike and the ways of the Burning Blade. {col:ff003f}Notably broke off from the Sisterhood after violent falling out.{/col}\n- Joined the Frozen Paw Clan, rising to the rank of Mystic Overseer at the Rebellion's end.* {col:ff003f}Personally oversaw attacks on agents of Ny'alotha and N'zoth up until the end of the Fourth War.{/col} Joined the Voice of Azeroth.*\n- Skirmished frequently with Alliance Forces over Black Moon Incursions throughout Kalimdor, including the cursed 'Desolace Campaign,' up to the Shattering of the Sky.*\n- Raised to the Rank of Champion, becoming the First Blade of Rogmasha Thundercaller.*\n- Engaged both Scourge and Mawsworn forces in hotspots throughout Northrend and Kalimdor.* {col:ff003f}Recieved a relic of the Realm Beyond the Rift, and began work on fighting forces of the Maw beyond the veil.{/col}",
						["BK"] = 3,
						["IC"] = "achievement_garrison_monument_horde_raid",
					}, -- [4]
					{
						["TX"] = "{h2:c}{col:0092ff}Carcanet of the Wolf{/col}{/h2}\n\nWrapped around the hilt of Anaris is her Carcanet of the Wolf. A relic of the Old Clans of Draenor, to the Frozen Paw it is a physical indicator of her time spent in the clan; a leather corden bearing trinkets and beads made in her time there. It bears the following:\n\n- {col:ffdf78}Golden 'Champion' Bead{/col}\n- {col:0092ff}Blue Member's Bead{/col}\n- {col:cecece}Iron Training Bead{/col}\n- {col:ffffff}White Egg Bead{/col}\n- 'Voice of Azeroth' Allegiance Pin\n- \"The End of Days\" Campaign Medal\n- \"Argent Crusader's Medal of Valour\" (Dead Rise in the Plaguelands Campaign)\n- {link*https://cdn.discordapp.com/attachments/603154017920745482/769644918980739102/ShadowlandsCapaignMedal.png*\"Dragonbone Medal of Honour\"} ('March of the Damned' Barrens Pre-Patch Campaign)\n- \"Medal of the Huntmistress\" (Shattered Sky Campaign)\n- \"War-God's Bond\" (Yellow-and-Black Friendship Bracelet)\n- {col:cecece}Silver Vinework Elunite Pendant{/col}",
						["BK"] = 6,
						["IC"] = "inv_jewelry_frostwolftrinket_01",
					}, -- [5]
