		["1015114902qOTwx"] = {
			["character"] = {
				["v"] = 61,
				["CO"] = "May bite.\n\n\n",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "Event stats:\nHP:25½/25½.  MP:250/250\nTraits:\nUnbreakable will \nChampion (+20 def +20 ap)\n",
			},
			["time"] = 1614992564,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T1"] = {
					["TX"] = "Writen description: \n\n<<Note: 2h-weapons he has displayed are always carried rested against his shoulder. or held in hand, plain and simple..no-one in their right mind would keep things they mean to use, on back. ever. >>\n\nWhile looking upon Thagr, will viewer be greeted by either of the two sights: \n\n1)\nThat of an orc, massive in size, easily towering over most members of the horde atleast a full head taller, his skin holding colour of greyish shade of green, minor signs of very minor corruption once upon time easily visible, with webbing of scars covering most of it. Of the marks on his hide, one in particular stands out from the rest: A pale patch of skin as if it was still coldburned, in middle of his chest. The orcs tusks are sturdy in appearance and in some ways seem as if they were being used often. Tips of his fingers all end to a bony claws, rather than usual nails.\nFor an orc he's pretty hairy too.\nUsualy clad in an ancient suit of reinforced scalemail, totemic runes carved on the reinforcing plates, plates, those also in many places like rest of the armor, show signs of repairs and damage in battle, bringing the armor a rugged, time toughened appearance matching to its wearer.\nThe orc stands with straight back. Hunching is for peons and warsongs ( And 'orks'.)\n\nArmor effects: In addition of doing what armor does: which is keeping cuts from getting through. \n\nthere also are enchanted sigils projecting defences against certain types of magical attacks. \n4x sigils of necromancer's bane : greatly diminish effects of unholy and otherwise necrotic sources of damage. (2 added during initial campaing in plaguelands. 2 more added during war against the lich king in northrend. )\n4x sigils of demon's bane: Greatly diminish effects of fel-based incoming spelldamage. (added during expedition to outlands. )\n\nNever is the shaman seen without his wolfmask. Mane of the mask descends down to his back and shoulders as a short cape. While the eyes are covered by lenses, with bright fiery light glowing through them. Some have claimed this to give him something of an intimidating appearance of some half-wolven creature.\nAt times the wolf mask can be seen equiped with an armoured plating over it, matching with rest of the orcs armor.\n\nMask Effect: Shielded eyes = Immune to blinding powders, gasses and bright flashes..and sand naturaly doesnt get in them either. \n\nSometimes uses a scarf to cover his lower face aswell. \n\nOver the armor normaly is worn a badly torn, many times repaired old tabard of by now dull  colour, its markings barely noticeable by now.\n\nTo complete the kit, he normaly has an utility belt of some description also worn, along with equipment harness, with compact backpack secured on its backside, pouches on front side orderly filled with different items of possible use.\nOh and there is row of grenades too. (Applies only when chest armour is worn )\n\nOn his back can at all times seen chained his iconic, spiky maul, serving purpose of both weapon and totem at the same time, and having served the orc through countless of battlefields.\nUsualy seen with shield strapped on the backpack too.\nAged knife can be seen hanging by backside of his belt too. \nRight next to an ornamental pistol of some form. \n\nIf carrying an great axe, it is usualy held in right hand and rested against shoulderguard on the same side. \n\nOther items of notice: \n-Armored tome hangs normaly on his left side. \n-Reinforced satchel usualy seen hanging on his right side.\n-bag with odd hook holstered on its side, chain leading inside the back usualy somewhere on his belt.\n-Remains of his old Northrend era Kor'kron guard tabard hang on the left side of his belt.\n-Badge of Mok'lohn command marauder Blood Guard is usually clipped somewhere on his belt..it is worthless, really. Just like the kor'kron tabard remains and badge of 41.st legion blood guard. But a memory of old days anyway. \n-Pair of reinforced flasks hang by his belt. other one is colour of red, and other of blue. both dented and scratched..but still intact.\nTrophies! : small items attached there and there on his pouches. Trophies taken from most memorable battlefields on his career, ranging as far back as to days before Frostwolves broke through dark portal for the first time.\n\n\nA raven can at times be spotted sitting on the orcs shoulderguard.\n\nUnlike most of the common grunts and less experienced orcs usually: He washes fairly often and in general maintains personal cleanlines. \n\n2)\nThat of a massive wolf, its fur either light grey or pitch black. Occasionaly red-ish. \n\non rare occasion makes use of spectral wolf's form, instead of going through full physical transformation.\n\n\n\n\n                                        Commonly known history:\n\nThe orc is known to have been around during first war, during which he claimed lives if humans and orcs in equal measure, for what he claims to have been a common flaw among them: Weakness of will.\nWasnt seen since then until third war when he joined the other orcs for the exodus to Kalimdor.\n\nThe most recent career of the orcish veteran can be tracked to warfronts such as:\n-Battle for Mt.Hyjal\n-Opening of gates of Ahn'Qiraj\n-Wrathgate\n-Wintergrasp\n-Battles against rampaging elementals during beginning of cataclysm\n-Tol barad\n-Isle of thunder offensive\n-Ashran\n-Broken shore\n-Various smaller warfronts around Azeroth, including kul tiras and zuldazar..and the rest of so called 'fourth war'. \n-Transfered to unknown duties /position for the Duration of the 'peace' that arrived post 4.th war. \n\n..Oh yeah. From time to time he teaches new shamans to their trade too.\n\n((Say no to growth potions. Learn to write and read descriptions. ))\n\n\n\n122-370,8",
				},
