			["about"] = {
				["v"] = 10,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-HighmountainTauren:512:256}\n\nThe woman named Nawotara was visibly a Grimtotem.\nShe carries with her the traditions of a tribe that lost their heart to Magatha, and lost their limbs to the other tauren tribes and the Horde. \n\nAs a traditional Grimtotem warrior should, she fights to win. Every fight she's had bolstered her body into a mass of unpronounced but very well-placed muscle, giving her the shape of a strong athlete. Entirely necessary to survive, considering the many scars that litter her skin and the irregular fur on her arms, legs and torso that show it. She still has that pure black fur, though stained it with the marks of the Grimtotem and other tauren tribes to show her allegiance. They include Bloodhoof, Skychaser and Runetotem markings.\n\nHer mane is a striking feature. It is big, fluffy and hangs over her shoulders, but even more along her back. The hair droops down over her eyes to conceal them, giving her a very unkempt and shy look. The two braids that dangle down her front are more expressive. They are incredibly lengthy, nearly reaching the ground and sway with every step she makes. Her tail descends along with them, reaching the ground too and often swinging along with her moves.\n\nHer figure leaves nothing to be desired. A highly feminine bend of her spine nudges her torso slightly forwards and pronounces her heavy chest. Her massive thighs break all the world records. She must put very serious effort into maintaining her endurance, and the long legs she carries forward on powerful hooves make her look like a kodo about to stampede. Her black horns leave the exact same impression because they point directly forwards like those of a rampaging bull. Their length is great, allowing her to impale her enemies. In a fight she will topple most foes with a lengthy charge while running at a speed that is very high above the average. Frighteningly, she maintains that speed in plate armour.\n\nShe regularly carries around trophies of battles she has survived, and sometimes she brings along a scroll case for improvised rune-scribing. Whenever she has her weapons around they tend to be quite bulky, but the runes she put on them give them the power she needs to use them well.\n\nOverall she is a Grimtotem that should rightfully be feared when she stands against you.\n\n",
				},
