			["msp"] = true,
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1:c}† Devotion †{/h1}\n\n{col:ffffff}{col:ffc000}Holy light • {/col}Being a deep follower of the Holy light Raikenia has spent her entire childhood, youth and adultscene to the light and saving people. She has been baptized enough times to count on several hands. This has caused her aura to become very pure, and is growing for every single day.\n\nTemple of Holy Radiance • Like the Holy light Raikenia devoted herself to the light but also her Temple. As much as they taught about the balance between the Light and the Shadow she rarely ever picked up the arts of Shadow magic. However every teaching she recieved at the Temple became a strong foundation to who Raikenia grew to become as her age increased with the fleeting of time. To this very day she carries their Insignia.{/col}\n",
						["BK"] = 7,
						["IC"] = "spell_priest_chakra",
					}, -- [1]
					{
						["TX"] = "{h2:c}{col:ffd100}† Equipment †{/col}{/h2}\n\n{col:ffffff}Holy Radiance Outfit • Every now and then Raikenia can be seen wearing her most symbolic outfit. It has been imbued, and woven with the Holy light, the light color of the fabric very soft but durable it has red strings holding it tightly on Raikenia's body.\n\nIt also has red pauldrons with gentle holy light radiating from the two golden crystals embedded into them. They provide her with some form of protection but also a symbolic meaning that she gained from her Temple. They valued her deeply and began to see her as the Mother Priestess of the Temple.\n\nThe belt she wears is quite big made with simple reinforced steel with some minor designed spikes, and a large holy Crystal it has several effects another gift she was given for her service for the Temple. It is elegant looking Outfit and also her favorite one\n\nDark Holy Maiden Outfit • WIP\n\nCrimson Priestess Outfit • Wearing her Crimson Red Priestess outfit often comes with being her day to day wear. It is red with Golden embroderies, and heavy looking shoulder made of hardened metal. It is not only made for protecting her against heavy hits, but also to harness the very light that Raikenia imbues into it. Each of the sculpted faces carries a red blindfold. Not only is it representing her Sin'dorei heritage but also partially of her former Temple.{/col}\n",
						["BK"] = 7,
						["IC"] = "ability_priest_wordsofmeaning",
					}, -- [2]
					{
						["TX"] = "{h2:c}† Holy Radiance Temple †{/h2}\n\n{col:ffffff}Holy Radiance Temple bases themselves on a few principles. These principles\n\n• All lives matters no matter what faction, race, profession you choose. Whoever is in need of aid shall be given aid. Social status has no meaning either. Making Holy Radiance Temple very neutral and different then many temples.\n\n• Everyone who joins Holy Radiance temple either at a young age or later on will get tutored equally. Those with higher aptitude or wishes to serve a higher goal can get special lessons.\n\n• Being the different Temple they are. The ones in Holy Radiance Temple unfitting their own name, has also chosen to study into Shadow Magic and Void magic. Not many practioneers took upon this offer feeling a dreadful feeling towards the darker arts. \n\nPoint of View • They took upon this uncommon practice simply because by their own ideology no power is truly evil. The one who uses the magic makes it either evil or good. This was very frowned upon by the fellow Temples. Making Holy Radiance temple exempted, and looked down upon. There has been regulated control to ensure that the darker Practioneers never strayed far from their path.\n\n• One of the paths very few choice was combine Light and Shadow into their respective fields. Many if not all chose to use both for the purpose of healing {/col}",
						["BK"] = 7,
						["IC"] = "ability_priest_savinggrace",
					}, -- [3]
					{
						["TX"] = "{h3:c}Dor'Shorel{/h3}\n\n{col:ffffff}Relic of Holy Radiance Temple Crystal. Raikenia being gifted within her temple and seen as the Head Priestess was allowed to use the Crystal of the Light to make her staff. Using the Crystal as a catalyst brought light into her staff. {/col}\n\n{col:ffffff}The fellow Priests, and Priestess said several Holy Prayers during an assembly to bless Dor'Shorel causing the staff to hum whenever wielded, small amount of light particles pop out of the staff, releasing it's holy aura upon those around Raikenia. With the usage of her staff Raikenia is able to sooth the minds of people nearby, and the effect strenghtens if Raikenia also says a prayer. With the boost from the prayer the staff is able to mass heal the people around. It is not the strongest but the spell does it's job{/col}",
						["BK"] = 7,
						["IC"] = "inv_staff_2h_artifacttome_d_01",
					}, -- [4]
					{
						["TX"] = "{h2:c}{col:ffd700}Holy Spell List{/col}{/h2}\n\n{col:ffffff}{col:fff300}Holy Triangular Shield †{/col} † Channeling the very Light within her body. She is capable of guiding and shaping the light into a Triangular shape that she can cast infront of her allies, and the people she save. This requires a holy incantation to be activated.\n\n{col:ffb300}Holy Pillars strike †{/col} † Being one of the few offensive spells that Raikenia has under her control is the Holy Pillars. With this ability she transforms the light into several different Pillars that she can slam down from the air onto her foes. {/col}\n\nHoly Ray Particles † {col:ffffff}Second area Healing spell. Whenever she casts this spell she makes a semi large domain. Causing everywhere around her a tiny star like light that flutters in the air. Everyone within this domain will be healed by all the particles that flies in the air{/col}\n\nDivine Feather Prayer † {col:ffffff} With this special Divine Prayer that Raikenia learned she is able to enhance the speed of a small group of People. Allowing them to either escape from Danger, or use the Opportunity to make the enemies struggle. {/col}\n\nZither play † {col:ffffff}Changing the light into a zither Raikenia is able to play a song while singing that causes enemies to become pacified and relaxed. This only works as long as she is not interupted.{/col}\n\nBlinding Light † {col:ffffff}Like the name says. This spell is a distractional spell blinding her foes, and possibly allies if they are within the reach to look at the light{/col}\n\nDivine Barrier † {col:ffffff} Within the Divine Barrier everyone who resides within it is protected from any oncoming attacks being either magical or non magical in essence. The Divine barrier is built upon layers of prismatic Shields that morphed together to form a round large barrier{/col}\n\nReflective Shield † {col:ffffff}With the Reflective Shield she is able to make an angular Shield that reflects attacks and sends them back or away depending on how the shield is put up. However the one infront of the barrier is unable to use spells, arrows and the like through the shield{/col}\n\nRadiating Spark play † {col:ffffff}Radiating being her second offensive Spell. She unleashes several tiny sparks of Holy light that Explodes when enemies come nearby. The explosions arent massive, but being so numerous if you get hit by too many, the danger of dying is high.{/col}",
						["BK"] = 7,
						["IC"] = "spell_priest_pontifex",
					}, -- [5]
