				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["IC"] = "inv_herbalism_70_foxflower",
						["TX"] = "Her crimson and sand colored fur seems to be taken care of pretty nicely. Her fur shines and looks (and feels) nice n' fluffy as well. \n\nHer eyes have a wonderful sky blue color, the dark ouline around her eyes helping to notice them much better.\nShe has a bit of a short snout. Her ears are also a bit short, but this does not mean she doesn't hear bad... well, maybe she does.\n\nHer body type seems to be pretty average, and slightly curvy. Pretty flexable she is too.\n__________\n\nVoice ref: Meerah (Slightly higher pitched)",
					},
					["3"] = {
						["IC"] = "inv_chest_armor_vulpera_d_01",
						["TI"] = "Armor",
						["AC"] = true,
						["TX"] = "Rihi is seen wearing protective armor most of the time. Most of it is made out of thick Direhorn leather and some simple plating.\nSome of the gear she has seems to originate from the Honorbound, but doesn't have the Horde logo on it.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Calming Aura",
						["IC"] = "ability_monk_renewingmists",
						["TX"] = "Rihi carries an... interesting aura with her. When near her for a long period of time, you might feel more relaxed and calm.\n\nThis mainly works on animals, but sometimes on people too.",
					},
					["5"] = {
						["IC"] = "ability_racial_rummageyourbag",
						["TI"] = "Equipment & Stuff",
						["AC"] = true,
						["TX"] = "Rihi carries several items with her, most of the time.\n\nShe wears what seems to be a large but thin collar on her waist just above her belt, with a nametag saying \"Dunai\".\n\nShe has a rucksack and several pouches around her belt:\nShe has one for money, one for dried meat for her companions and... one for cookies. She also seems to have one pouch with a magical rune on it... Interesing.\n\nOn the rucksack you can find an average sized Troll-ish totem attached to it.\n\nA small notebook and a small bottle is found too, which is mainly filled with water.",
					},
					["4"] = {
						["IC"] = "inv_polearm_2h_snakeman_c_01",
						["TI"] = "Weapon",
						["TX"] = "Rihi seems to wield a rather large Sethrak polearm most of the time, which she can take apart to form two seperate blades.\n\nShe has a staff as well, also Sethrak design, seemingly enchanted with powerful Elemental energies. Lightning being the main one, but having a bit of everything.\n\nRihi also seems to be having a foldable bow, also attached on her bag.\n\nThese weapons are found attached on her rucksack... Or just on her back when she doesn't have the rucksack on.",
						["AC"] = true,
					},
				},
				["v"] = 77,
			},
			["time"] = 1615231973,
			["link"] = {
				["Rihi-ArgentDawn"] = 1,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1:c}Appearance{/h1}\n\nHer crimson and sand colored fur seems to be taken care of pretty nicely. Her fur shines and looks (and feels) nice n' fluffy as well. You may also notice some fluff sticking out on her head!\n\nHer eyes have a wonderful sky blue color, the dark ouline around her eyes helping to notice them much better.\nShe has a bit of a short snout. Her ears are also a bit short, but this does not mean she doesn't hear bad... well, maybe she does.\n\nHer body type seems to be pretty average, and slightly curvy. Pretty flexible she is too.\n\nVoice Ref: Meerah (Slightly higher pitched)\n\n{link*https://cdn.discordapp.com/attachments/813384154661388289/813384848349200414/RIHI_JEWELRY.png*Rihi's Jewelry, from Additional Information tab!}\n",
						["BK"] = 3,
						["IC"] = "inv_babyfox_red",
					}, -- [1]
					{
						["TX"] = "{h1:c}Personality{/h1}\n\nRihi is a rather... no, a VERY kind Vulpera. She likes to help people whenever someone needs her, depending on the situation of course.\nBut she always wanting to help is not always the case, since she enjoys being a bit lazy as well.\n\nEven though she like helping, she doesn't always approach to offer help, since she can be quite shy sometimes. This doesn't mean she has never approached people, she just find it more comfortabe when she gets approached by others.\n\n{link*https://www.youtube.com/watch?v=X6GaYWJTQ3s*Rihi's Theme: Aurin Theme from Wildstar}\n",
						["BK"] = 3,
						["IC"] = "ability_monk_renewingmists",
					}, -- [2]
					{
						["TX"] = "{h1:c}Background{/h1}\n\nSand, lots and lots of sand.\n\nAnd hunting, that too.\n\nIn her past, when Rihi was much younger, she didn't have much adventurous events happening in her life.\n\nRihi and her family had their own small caravan and lived quite happily even though they lived in the dangerous desert known as Vol'dun.\n\nOne day, her father went out to look for supplies... but never returned. She, along with her brother and mother, went on a search throughout the desert to find him, but with no success...\n\nFew days in the search they started to give up and returned to their travels, thinking he left them, or worse. That same day they stumbled upon another traveling caravan, and they were welcomed to join them, which they eventually did.\n\nMuch stuff happened since then. Good, but sadly also bad things… very bad things.\n\nRihi has now found a new Caravan to be with, with other, great people she can call family.\n\n{img:Interface\\QuestionFrame\\answer-warboard-bfa-Voldun:256:128}\n",
						["BK"] = 3,
						["IC"] = "inv_tourofdutyvoldun",
					}, -- [3]
					{
						["TX"] = "{h1:c}OOC & Art{/h1}\n\n-Any speedboosts I use are IC! Rihi is a fast vixen... fox... Vulpera... creature...!\n\n-Rihi wears a Mood Ring (See Characteristics), here is a template I use for it: {link*https://cdn.discordapp.com/attachments/599192476489744395/813388420016767006/Mood_Ring_Chart_-_Imgur.gif*Mood Ring Template}, the information of it being visible will be put in the Currently tab when necessary!\n\n{h3:c}Commissioned Art{/h3}\n{h3:c}{link*https://pbs.twimg.com/media/EvO45y0XEAUAsNV?format=jpg&name=medium*Feli & Rihi art by @glowcrow on Twitter}{/h3}\n{h3:c}{link*https://pbs.twimg.com/media/EtZ2Ff-U0AAiPDG?format=jpg&name=large*Rihi & Guenn art by @KilJaded on Twitter (Commissioned by a friend)}{/h3}\n\n{h3:c}Free art{/h3}\n{h3:c}{link*https://cdn.discordapp.com/attachments/728342036503068774/813300284154707998/tbrender003.png*Rihi & Hoppie, Rihi's Baby Alpaca Companion by @Kimei_Vulpera\n on Twitter}{/h3}\n{h3:c}{link*https://cdn.discordapp.com/attachments/813384154661388289/813384933233524766/rihi_tusk.png*Rihi & Tusk, Rihi's Large Ravasaur Companion, by a Guildie}{/h3}\n\n{h3:c}Self-Made Art{/h3}\n{h3:c}{link*https://imgur.com/a/VJ3wrew*All the art I made with Rihi!!}{/h3}",
						["BK"] = 3,
						["IC"] = "achievement_doublerainbow",
					}, -- [4]
