				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}Over the top verbose description{/h2}\nAt first glance, you are captivated by her caring and gentle motherly-like gaze that beams as the warmth of sunlight would tickle your cheeks invoking true feelings of complete safety and inspired hope.\nThe commanding presence hits you a moment later as the warmth grows familiar like the rhythm of a beautiful symphony.\nAdala commands this presence both through her stature and empathic smiles of deep understanding and reasoning.\nLight flows, bends and shifts around directly and indirectly her like wisps would swirl around and rejuvenate entire forests in a gentle and calm aura. \nThis essence and feeling shines, echoes and resonates inspiring everlasting awe all at the same time and seems to continue to shine forever, without limit and beyond. \n\n{h3:c}TL/DR{/h3}\nUnknown history. \nPart of Shattrath's Paladin groups such as the Sha'tar and the Shattered Sun Offensive.\nHas a kind look on her face, and seems like a generally good and understanding person.\nIs helpful and kind, neutral towards the Alliance and Horde conflict.\nFocuses on fighting external threats, such as the Legion, Old Gods etc. \nIs served by Commander Tolus, a Draenei under her command. \nSince the Outland conflicts calmed down, she is a rare encounter.\nSometimes aids the Arcatraz in capturing dangerous beings.\n\n{h2:c}Details{/h2}\n\n\n{h3:c}Armour{/h3}\nWith Guild Tabard(Lightforge): Personal Armor. Heavy Armor, said to have once belonged to a Dragonsworn Knight and was adjusted to fit her.\n\nNo-Tabard(Judgment): Ceremonial Assault Armor. Blessed with Draenic Oils.\n\nShattered Sun Tabard: Heavy Armor, heaviest of Wards and blessings, very defensive. The glowing Shoulders are the wards.\n\n\nGreen Armor: When not on readiness, light armor.\n\n{h3:c}Armament{/h3}\n\nPolearm: Heavy Weapon\n\nOne-Handed Sword: Defensive, Blessed and sheathed in light\n\nTwo Handed Sword: Sha'serrar, the Light Blade. \nA name chosen to symbolize Shattrath's Unity. \n\"Sha\" from Draenei \"sha\", \"light\", \"serrar\", from Thalassian \"blade\".\nSomewhat known as her blade, it is said to contain a Naaru's blessing.\nAnything Unholy should rightfully fear this weapon.\nHowever, it is by no means as powerful as the Ashbringer.\n\n\n{h3:c}Optional Trivia and miscellaneous{/h3}\n\nFor characters with mind reading abilities or other traits allowing them to gain more information than a normal character.\nHer mind seems open, yet only the surface of it, the rest seems inaccessible for anyone but the most skilled mind readers.\nDemon Hunters with spectral vision may find her too bright to look at (optional).\n",
