					["TX"] = "{img:Interface\\QuestionFrame\\answer-warboard-wod-FrostfireRidge:512:256}\nPhysical Appearance\nAge: 35 \nBirthplace: Outlands\nHome: Wherever the clan is\nHeight: 5’9”, Weight:\n\nHistory\nKora is the only daughter of Gharok Wolfhowl and Kalde Shadowmane. After the First war, she was left behind on Outland with her Mother and taught in the ways of hunting and survival. Kora and her mother would constantly be on the move, despite the growing presence of the Ogre population in the areas. Eventually, they were forced to travel across the borders and moved into Nagrand where they took refuge in the small village of Garadaar. \nKora would later complete her Om’riggor by killing a Garn wolf, a difficult beast to slay for one orc on their own.\nShe would later venture out to Azeroth when the portal reopened, travelling in search of her Father and eventually met her half-brothers. Kora would then travel back to Outland and living back out in areas of Nagrand and Blade’s Edge Mountains. In this time she would get a mentor under a Blademaster, earning a very special trick known as windwalking, where the user becomes so adept and agile that they can move so quickly that they appear to be invisible to the naked eye.\nYears later, her mother would die from a sickness in her sleep, leaving Kora to find her only living relative and joining the Terrorhymn Clan.\n",
				},
