			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n{h2:c}{link*https://cdn.discordapp.com/attachments/597872461564084237/733396488108900446/vulpera_studying4_by_kam_fox_de1fpzb-pre.png*Art by Kamfox}{/h2}\n\n\n{h2:c}Description{/h2}\n\n\nBarely entering her twenties, her black and white fur was lustrous indicating great care of it and making the black Hyena spots noticeable on her shoulders and tail. Her long pointy snout curved upward giving her an uppity look that was tempered by her Lime Green eyes reflecting her inquisitive nature. Her build was on the slender side, she formely sported a skinnier body in the past, the richer life beyond the dunes allowed her to fill up harmoniously. Her clothing varies depending on her needs, however the more constant here are the scrolls she carries alongside her on journeys, their origins as well were from various corners of the world.\n\n\n{h2:c}Background{/h2}\n\n\nOrphaned by the harsh dunes as she barely reached the age of consciousness, lived with her older brother in the Northen burrows of Vol'dun until the Sethrak Empire attacked. Lived among the Vulpera of the Dustpaw Caravan all the way beyond the dunes to Horde lands.\n\n\n{h2:r}OOC{/h2}\n\n\nKeep IC matters IC, OOC has to stay polite and civil. Other than that I'm friendly and open to encounters whether friendly or unfriendly.\n",
