					["3"] = {
						["AC"] = true,
						["TI"] = "Alterations",
						["TX"] = "Her nails are blackened and hardened, resembling claws more than anything else. Rich, green veins pop out around the corners of her eyes.\n",
						["IC"] = "ability_demonhunter_metamorphasisdps",
					},
					["2"] = {
						["IC"] = "spell_fire_felflamering",
						["TI"] = "Instability",
						["TX"] = "Gwylathiel's auras are mostly cloaked from the usual means of magical detection. However, a skilled divinist might find bursts of fel energy barely supressed by a cloaking enchantment, threatening to burst through. (DH's can /w for more details about that).",
						["AC"] = true,
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Weapons and Scrolls",
						["TX"] = "Her sword was forged with mastery equal to the most proficient orcish smiths, and emits a strong aura of fel magic to anyone able to discern such. It is kept safe within a solid scabbard, with two scrollcases built into it. ",
						["IC"] = "inv_sword_2h_titanconstruct_d_01",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Jewellry",
						["TX"] = "On the index finger of her right hand, an elaborate ring made out of dark metal can be seen. The band has rich amber inlaid into it, with three jade stones embedded and surrounded with rich filigree, in contrast with the shaded silver.\n\nA solid gold necklace with inlaid emeralds rests on her neck.\n\nTo a magically trained eye, every piece of jewellry on her is enchanted in a way.",
						["IC"] = "inv_70_quest_ring3d",
					},
				},
				["v"] = 33,
			},
			["time"] = 1615070811,
			["link"] = {
				["Gwylathiel-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{link*https://i.imgur.com/kZHBBPXh.jpg*Art by KeyIllustrations!}\n{link*https://imgur.com/a/PigOWww*Art by Kylerane!}\n{link*https://imgur.com/a/wFsTo1C*Art by Devoante!}\n{link*https://imgur.com/a/TGVx93K*Meme by Kylerane}\n\n{p:c}{img:Interface\\Pictures\\artifactbook-warlock-cover:256:256}{/p}\n\nGwylathiel is a rather fragile and skinny elf. Whatever remains of her muscle is well shaped, but even with that, her posture leaves much to be desired. She's usually straightened out, nearly every gesture overflowing with inner pride and certainty.\n\nHer eyes betray the obvious, strong influence of the fel exerted upon her. The shmmer is almost overflowing at times. Her nails are long, curved and blackened, very much alike to sharp, demonic claws. A set of demonic runes has been engraved into the front of her teeth, displayed whenever she's grinning.\n\nGwylathiel's mood and behavior are constantly influenced by the chaotic magic she so fondly practices. They change quickly, sometimes without a warning, effectivelly shattering the illusion of calm she tries to cloak herself with.\n\nCorruption:\n- Claws\n- Faintly glowing veins of greens sprouting from the corners of her eyes\n- Two fel scars visible beneath her right eye\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n{link*https://www.youtube.com/watch?v=-vJ0NMOH2vA*You found the secret theme song}",
